niej 3 kawałki zaśpiewane przez: Karolinę Kozak (MTV Selekt), Magdę Polańską (ex-prezenterka Viva Polska) i St-Martin (Modfunk). Styl swoich utworów Red porównuje do brzmienia takich producentów amerykańskich jak: Timbaland, Neptunes, JD. W promocję albumu zaangażowana jest MTV. Zrealizowane zostały 2 promujące płytę klipy. \"Al.-Hub\" to nowa jakość w polskim hiphopie, płyta, która ma szansę wejść do kanonu tego gatunku.',13,'www_hhbd_pl_red-al-hub_(2002-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1810),(50,'...Się Przyjeło',1,0,'2004-10-28 16:56:37','0000-00-00 00:00:00',0,NULL,366,'2000-00-00','',1,'www_hhbd_pl_1000-___sie_przyjelo_(2000-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,435),(51,'Po prostu echo...',1,1,'2004-10-28 17:12:37','2004-10-28 17:16:16',0,NULL,313,'2001-01-00','',6,'www_hhbd_pl_echo-po_prostu_echo____(2001-01-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','BLENDREC08','',NULL,510),(52,'Rapterapia',1,0,'2004-10-28 18:03:39','0000-00-00 00:00:00',0,NULL,318,'2002-11-00','',27,'www_hhbd_pl_prezes-rapterapia_(2002-11-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,931),(53,'Alchemia',1,0,'2004-10-28 19:24:22','0000-00-00 00:00:00',0,NULL,166,'2002-00-00','',24,'www_hhbd_pl_igor-alchemia_(2002-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1158),(54,'Apogeum',3,3,'2004-10-29 23:40:23','2004-10-29 23:56:40',0,NULL,401,'2003-03-17','',12,'www_hhbd_pl_ascetoholix-apogeum_(2003-03-17).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1042),(55,'Wideoteka',3,0,'2004-10-29 23:55:43','0000-00-00 00:00:00',0,NULL,405,'2003-11-26','',12,'www_hhbd_pl_jeden_osiem_l-wideoteka_(2003-11-26).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,990),(56,'Wbrew Regułom',3,0,'2004-10-30 13:06:32','0000-00-00 00:00:00',0,NULL,407,'2004-00-00','',28,'www_hhbd_pl_chlopaki_z_szarego_tlumu-wbrew_regulom_(2004-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','10185','',NULL,724),(57,'JuNouMi vol.1',1,1,'2004-10-30 21:53:47','2004-10-30 23:53:24',0,NULL,190,'2002-02-20','',19,'www_hhbd_pl_v_a-junoumi_vol_1_(2002-02-20).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,981),(58,'JuNouMi vol.2',1,0,'2004-10-30 23:58:45','0000-00-00 00:00:00',0,NULL,190,'2002-11-20','',19,'www_hhbd_pl_v_a-junoumi_vol_2_(2002-11-20).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1593),(59,'Deobedena.com',3,3,'2004-10-31 20:32:19','2006-02-23 14:17:24',0,NULL,558,'2004-08-23','',12,'www_hhbd_pl_deobe_dena-deobedena_com_(2004-08-23).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','UMC 019','',NULL,728),(60,'Nic dziwnego',3,1,'2004-10-31 21:57:20','2005-03-13 18:25:22',0,NULL,358,'2004-05-20','Po blisko półtorarocznej pracy w studio, ukazuje się wreszcie długo oczekiwany, drugi album Łony (rewelacyjnie przyjęty debiut \"Koniec żartów\" ukazał się pod koniec 2001 roku). Styl Łony pozostał ten sam - piekelnie inteligentne, satyryczne obserwacje na temat tego co dzieje się w Polsce i na scenie hiphopowej. Wszystko okraszone fabularnym storytellingowym talentem o skali rzadko spotykanej na polskiej scenie i podane w towarzystwie produkcji Webbera (DobrzeWiesz Studio). Gramofony: DJ Twister. Mix i mastering: Noon dla 33 Obroty Studio.',5,'www_hhbd_pl_lona-nic_dziwnego_(2004-05-20).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C40','',NULL,1061),(61,'A miało być tak pięknie...',1,7,'2004-10-31 22:41:49','2005-05-12 20:13:27',0,NULL,426,'2004-06-07','Pierwszy projekt w ramach nowopowstałego sublabelu Asfaltu - Tabasko Nagrania (pod patronatem O.S.T.R.). To tak naprawdę drugi album Afrontu (pierwszy nie ukazał się rok temu z przyczyn niezależnych od zespołu). Płyta nawiązuje klimatem do hiphopu z początku lat 90\', szczególnie do nowojorskich klasyków, garściami czerpie z czarnej muzyki lat 60\' i 70\' jak i z polskiego jazzu. Wyróżnia się ciekawymi eksperymentami z brzmieniem i nowatorskim podejściem. Album tekstowo prezentuje szerokie spektrum tematów: od klasycznych dla hiphopu motywów przedstawionych jednak w świeży sposób, poprzez bragga, po teksty bardzo osobiste. Produkcja: O.S.T.R. z drobnymi wyjątkami na rzecz DJ Funksion i Janka. Skrecze: DJ Funksion. Nagranie, mix, mastering: Marek Dulewicz. Patronat: Dosdedos, www.hip-hop.pl',5,'www_hhbd_pl_afront-a_mialo_byc_tak_pieknie____(2004-06-07).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C41','',NULL,2086),(62,'Bez Ciśnień',4,1,'2004-11-01 21:40:17','2005-04-29 16:45:53',0,NULL,84,'2003-00-00','Na singlu znalazły się dwa utwory i zwiastun całego albumu (fragmenty wszystkich utworów z płyty). W tytułowym \"Bez ciśnień\" gościnnie występują: Dragon Davy (Soundkail Francja), oraz Toma (Francja). Muzykę skomponowali: Waco i Pono. Na singlu znajdują się remiksy: Korzenia, Pioora, oraz Hohoła i Pono. Producentami singla są: Waco, Piooro, Korzeń, Pono, Hohoł i Doniu. W nowych tekstach Zipery daje się wyczuć dojrzalsze i głębsze tematy. Opowiadają o prawdzie ulicy z subiektywnego punktu widzenia młodego, zbuntowanego człowieka oraz dają przestrogę dla młodego pokolenia. Materiał utrzymany jest w hardcorowym klimacie, co jest nieodłącznym elementem zip stylu.',2,'www_hhbd_pl_zipera-bez_cisnien_(2003-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1072),(63,'Esencja Czysta',3,3,'2004-11-02 22:48:46','2005-07-31 12:53:51',0,NULL,430,'2004-00-00','',3,'www_hhbd_pl_analogia-esencja_czysta_(2004-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','WJ05 518867 2','',NULL,1471),(64,'Koniec Żartów',3,1,'2004-11-03 10:02:55','2005-03-13 18:31:29',0,NULL,358,'2001-12-03','Kolejna zaskakująca i interesująca płyta z Asfalt Records. Debiutancki, solowy album szczecińskiego rapera Łony znanego wcześniej między innnymi z grupy Wiele CT. Jego teksty pełne są optymizmu, dystansu do problemów dnia codziennego oraz inteligentnych obserwacji podawanych zawsze z dużym poczuciem humoru, w połączeniu z doskonałymi bitami Webbera, realizacją i masteringem samego Noona, gwarantują tłusty album, dostępny także w jednopłytowej wersji winylowej.',5,'www_hhbd_pl_lona-koniec_zartow_(2001-12-03).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C25','',NULL,1013),(65,'Hiphop Non Stop/Nie słuchać przed 2050 r.',3,1,'2004-11-03 11:08:51','2005-03-13 18:29:07',0,NULL,358,'2002-11-04','Na singlu znajduje się nowy rewelacyjny utwór \"Nie słuchać przed 2050 r.\", niepublikowany wcześniej na CD/MC. \"Hiphop Non Stop\" to kawałek z albumu \"Koniec żartów\" (drugi singiel). Dodatkowo - tylko na singlu - dwa remixy tego utworu (L.A. (White House), Raadradd) oraz trzy remixy \"Hiphop Nonstop\" (Webber, Rolo, Cybul) a także teledyski do obu kawałków.',5,'www_hhbd_pl_lona-hiphop_non_stop_nie_sluchac_przed_2050_r__(2002-11-04)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C29','',NULL,537),(66,'Wspólne Zadanie',3,0,'2004-11-03 23:15:02','0000-00-00 00:00:00',0,NULL,439,'2003-00-00','',13,'www_hhbd_pl_ski_sklad-wspolne_zadanie_(2003-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1162),(67,'Temat zakazany',1,0,'2004-11-05 13:45:56','0000-00-00 00:00:00',0,NULL,45,'2002-00-00','',2,'www_hhbd_pl_pono-temat_zakazany_(2002-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,817),(68,'Efekt',3,1,'2004-11-05 18:26:44','2004-11-05 19:00:38',0,NULL,40,'2001-00-00','',6,'www_hhbd_pl_fenomen-efekt_(2001-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','010CD, Blend 2001','',NULL,826),(69,'Nie Ma Miejsca Jak Dom',3,1,'2004-11-05 18:51:04','2004-12-09 16:29:31',0,NULL,55,'2002-00-00','',24,'www_hhbd_pl_pih-nie_ma_miejsca_jak_dom_(2002-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,681),(70,'Do Trzech Razy Sztuka',3,0,'2004-11-05 19:01:11','0000-00-00 00:00:00',0,NULL,157,'2004-00-00','',26,'www_hhbd_pl_v_e_t_o_-do_trzech_razy_sztuka_(2004-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1010),(72,'Asfalt Wiosna 99 EP',4,4,'2004-11-06 19:30:13','2004-11-20 00:53:54',0,NULL,190,'1999-04-23','',5,'','image/jp