 usłyszeć całkiem nowe brzmienie w polskim rapie. Produkcją zajął się m.in. Szyha (odpowiedzialny za większość muzyki na &#8222;O Nas, Dla Was&#8221;), Jajonasz, Teka i Magiera. Oprócz głosu Piha na płycie można usłyszeć same gwiazdy polskiego rapu, tzn. Mesa, Pezeta, Tedego, Fenomen, MyNieMy, HST, Pyskatego Sk......, oraz Oddział Zamknięty. Nic dodać nic ująć trzeba tę płytę koniecznie mieć i przesłuchać!!! Utwór pt. &#8222;Hawajskie Koszule 2&#8221; jest przeróbką znanego z mediów hitu składu który śpiewał o tym &#8222;Jak zapomnieć...&#8221;. W rozgłośniach radiowych już można usłyszeć jego pierwszy singiel pt. &#8222;Nigdy już nie wróci&#8221;, a co nie wróci ?? Dowiesz się po przesłuchaniu tego albumu.',17,'www_hhbd_pl_pih-krew__pot_i_lzy_(2004-11-08).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','C149','',NULL,1131),(114,'Przez $ jak...',1,0,'2004-11-22 19:44:08','0000-00-00 00:00:00',0,NULL,11,'2004-11-08','',17,'www_hhbd_pl_o$ka-przez_$_jak____(2004-11-08).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','C-','',NULL,774),(115,'Dobra częstotliwość',3,1,'2004-11-22 22:33:55','2004-11-23 00:24:59',0,NULL,178,'2004-11-04','',14,'www_hhbd_pl_praktik-dobra_czestotliwosc_(2004-11-04).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','EMB005','',NULL,578),(116,'Kochana Polsko',3,1,'2004-11-22 23:53:04','2005-03-10 15:46:44',0,NULL,4,'2002-06-10','',5,'www_hhbd_pl_o_s_t_r_-kochana_polsko_(2002-06-10)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C28','',NULL,617),(117,'Nibylandia',1,0,'2004-11-23 02:35:31','0000-00-00 00:00:00',0,NULL,480,'2001-10-04','',21,'www_hhbd_pl_ego-nibylandia_(2001-10-04).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','0161034','',NULL,469),(118,'A',3,0,'2004-11-23 21:58:40','0000-00-00 00:00:00',0,NULL,401,'2001-00-00','',17,'www_hhbd_pl_ascetoholix-a_(2001-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1171),(119,'Rap daje mi siłę',3,0,'2004-11-23 22:33:00','0000-00-00 00:00:00',0,NULL,42,'2004-11-06','',17,'www_hhbd_pl_borixo