2-10-10).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1142),(126,'Każdy szczegół',1,0,'2004-11-25 15:25:04','0000-00-00 00:00:00',0,NULL,560,'2002-00-00','',31,'','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,584),(127,'Stara szkoła rapu',3,0,'2004-11-25 20:45:21','0000-00-00 00:00:00',0,NULL,156,'2002-00-00','',24,'www_hhbd_pl_wzgorze_ya-pa_3-stara_szkola_rapu_(2002-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,776),(128,'Made in Poland',3,7,'2004-11-25 22:19:01','2005-10-14 16:31:51',0,NULL,399,'2002-00-00','',6,'www_hhbd_pl_mcf-made_in_poland_(2002-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','BLEND19CD','',NULL,425),(129,'Poszło w biznes',3,3,'2004-11-26 23:43:30','2005-10-18 16:48:00',0,NULL,242,'2001-00-00','',13,'www_hhbd_pl_elemer-poszlo_w_biznes_(2001-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','T1 CD 005','',NULL,1035),(130,'Tajemnica',4,0,'2004-11-27 13:28:24','0000-00-00 00:00:00',0,NULL,165,'2001-08-27','',5,'www_hhbd_pl_fisz-tajemnica_(2001-08-27)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C18','',NULL,473),(131,'Gry studyjne',1,0,'2004-11-27 16:19:55','0000-00-00 00:00:00',0,NULL,191,'2003-06-23','',9,'www_hhbd_pl_noon-gry_studyjne_(2003-06-23).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','tee07c','',NULL,661),(132,'Morwa drzewo',3,0,'2004-11-28 14:43:13','0000-00-00 00:00:00',0,NULL,38,'2002-10-26','',7,'www_hhbd_pl_mor_w_a_-morwa_drzewo_(2002-10-26).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5435072','',NULL,1024),(133,'Nic co ludzkie',1,1,'2004-11-28 23:26:16','2004-11-28 23:26:28',0,NULL,81,'2004-09-15','Postać, która w rodzimym hiphopie siedzi już spory kawałek czasu, ale mimo tego na swoim koncie nie miała do tej pory debiutu w postaci legalnej płyty. Były epizody na producenckich składankach, było sporo \"fiuczerów\". Dlatego spodziewałem się wyrazistego wydawnictwa, wspartego przecież wcale nie małym obyciem. I choć bez dwóch zdań .Nic co ludzkie. nie będzie okupować list przebojów, bo chyba nikt nie będzie tego oczekiwał od rdzennie ulicznego rapu, to ta płyta urzeknie nie jednego. Brakowało wam ulicznego, osadzonego mocno w realiach hiphopu? A to są właśnie takie nagrywki, ze specyficznym klimatem, przy których refleksji nie zabraknie, przy których przypominają się niepowtarzalne sesje ze składanek Volta. Niektórzy zarzucą pewnie, że zbyt wiele jest moralizatorstwa na tym albumie. Ale cóż, takie właśnie jest .Nic co ludzkie.. Poznamy to po tekstach z mocnym życiowym przekazem, poznamy to po refleksyjnych produkcjach (brawa dla duetu WhiteHouse za naprawdę trafne remixy). W takich klimatach 1z2 odnajduje się doskonale. Może nie jest cały czas na wyżynach i tak jak w kawałku .Wpływ. jego flow pozostawia wiele do życzenia. Z kolei w niektórych sytuacjach nie ma pomysłu co z nim zrobić . bo wystarczy tylko, że bit ma troszkę szybsze tempo i 1z2 momentalnie zaczyna się gubić, w efekcie w .Brak poklasków. chwilami decyduje się na zabawę głosem, by następnie powracać do nużącego, jednostajnego stylu. Ale są też takie numery jak .Fenomen., czy .Nie wszystko. i już wiemy, że ten legal to nie pomyłka. Za muzykę odpowiadają profesjonaliści (600V, Szyha, wspomniani L.A. oraz Magiera, a także trochę mniej doświadczony Bartosz z Endefisu). Wszyscy oni swoimi produkcjami świetnie dopasowują się do tematyki obranej przez 1z2. Całość jest dopieszczona przez miłe damskie wokale i światowej klasy skrecze (szczególnie autorstwa Kostka), bez których ta płyta straciła by naprawdę bardzo wiele. Generalnie imprezy takim rapem nie rozkręcisz, ale w poszukiwaniu przemyśleń sięgnij po .Nic co ludzkie.. Myślę, że nie pożałujesz.',32,'www_hhbd_pl_1z2-nic_co_ludzkie_(2004-09-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,882),(134,'Vision',1,1,'2004-11-29 00:43:55','2004-11-29 01:01:09',0,NULL,584,'2002-04-29','',9,'www_hhbd_pl_noon_dj_twister-vision_(2002-04-29)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','tee05c','',NULL,774),(135,'Ludzieprzeciwkolud