i Deszcz i DJ Dobry Chłopak (znany także jako DJ Brzydal).',2,'www_hhbd_pl_hemp_gru-klucz_(2004-12-06).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,3316),(152,'D.I.S. (Domysły i spekulacje)',3,0,'2004-12-14 00:17:22','0000-00-00 00:00:00',0,NULL,6,'2002-00-00','',3,'www_hhbd_pl_tede-d_i_s__(domysly_i_spekulacje)_(2002-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1053),(153,'Bleak Output',1,0,'2004-12-14 12:44:08','2004-12-14 13:01:23',0,NULL,191,'2001-02-23','świat tej płyty to melancholijne sample oparte na ambientowej przestrzeni i oszczędnej hiphopowej rytmice. Płyta refleksyjna, introspektywna, marzycielska i sentymentalna przywołująca twórczość DJ SHADOWA i BRIANA ENO. Choć NOON jest artystą polskim, płyta ta wydawana jest na licencji dDrecords (Holandia).',9,'www_hhbd_pl_noon-bleak_output_(2001-02-23).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','tee01C','',NULL,670),(154,'Bleak Output - [Special Edition]',1,0,'2004-12-14 13:12:46','0000-00-00 00:00:00',0,NULL,191,'2004-10-21','',9,'www_hhbd_pl_noon-bleak_output_-_[special_edition]_(2004-10-21).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,621),(155,'Masy ludu. Na językach.',1,1,'2004-12-14 19:31:39','2004-12-14 19:34:36',0,NULL,221,'2002-10-28','Płyta HST to pierwsza wspólna produkcja Jajonasza i Igora. W ciągu ostatniego roku został zarejestrowany materiał w postaci pilotów, obecnie trwają prace nad aranżacjami i zgrywaniem całości. Większość utworów jest nagrywana na nowo. Znaczną część podkładów na płytę wyprodukował Jajonasz. Igor zajął się nagraniami, mixem i masteringiem.\n',33,'www_hhbd_pl_hst-masy_ludu__na_jezykach__(2002-10-28).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1443),(156,'Masy ludu. Na językach.',1,0,'2004-12-14 20:15:27','0000-00-00 00:00:00',0,NULL,221,'2002-00-00','',33,'','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,487),(157,'Wielki sen',3,0,'2004-12-14 21:36:27','0000-00-00 00:00:00',0,NULL,34,'2001-12-00','',17,'www_hhbd_pl_7_lez-wielki_sen_(2001-12-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,914),(158,'Chleb powszedni',3,0,'2004-12-14 23:22:26','0000-00-00 00:00:00',0,NULL,48,'1999-09-00','',24,'www_hhbd_pl_zip_sklad-chleb_powszedni_(1999-09-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1502),(159,'Za wcześnie',3,0,'2004-12-15 00:17:05','0000-00-00 00:00:00',0,NULL,349,'2002-01-09','',1,'www_hhbd_pl_spinache-za_wczesnie_(2002-01-09).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,632),(160,'Jazz W Wolnych Chwilach',4,0,'2004-12-17 15:13:06','0000-00-00 00:00:00',0,NULL,4,'2003-12-05','',5,'www_hhbd_pl_o_s_t_r_-jazz_w_wolnych_chwilach_(2003-12-05).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C36','',NULL,1304),(162,'F3',4,0,'2004-12-18 19:18:38','0000-00-00 00:00:00',0,NULL,168,'2002-12-09','',5,'www_hhbd_pl_tworzywo_sztuczne-f3_(2002-12-09).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C31','',NULL,828),(163,'Radio Ewenement 5 G FM',3,0,'2004-12-18 20:58:18','0000-00-00 00:00:00',0,NULL,124,'2001-11-10','',7,'imgs/albums/www_hhbd_pl_molesta_ewenement-radio_ewenement_5_g_fm_(2001-11-10).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5361092','',NULL,763),(164,'Autentyk',3,7,'2004-12-18 21:26:04','2005-07-19 13:54:01',0,NULL,647,'2002-08-31','Płyta zrealizowana w studiu SCHRON, składa się z części hip-hopowej i instrumentalnego bonusu.<br />\r\nDo wykonania międzynarodowych skitów duet zaprosił znajomych z różnych krajów.<br />\r\nWśród gości: Lui, Pono, DeLux, Tomek Lipiński (Tilt, Brygada Krysyz).<br />\r\nMuzycznie wspierali ich: Fox, Rei Caballo, Korzeń, Majki, Dj Seb (Easy Band Allstars).<br />\r\nPłytę promowały klipy Nokaut techniczny i Prawdziwy Rap.<br />\r\nZostała również wydana w wersji winylowej.',7,'www_hhbd_pl_vienio_&_pele-autentyk_(2002-08-31).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5419832','',NULL,750),(165,'Autentyk II',3,7,'2004-12-18 21:43:13','2005-07-19 13:59:45',0,NULL,647,'2003-10-18','Płyta zrealizowana w studiu SCHRON, przy współpracy z Majkim i Korzeniem.<br />\r\nOprócz gości ze świata HH takich jak: Włodi, Wigor, Lui, Mehdi Mesrine (Paryż) pojawili się również Andrzej Smolik i Novika.<br />\r\nSinglem promującym płytę był utwór pt. \"To dla moich ludzi\" z gościnnym udziałem Lui\'ego oraz Gutka.<br />\r\nPozostałe single to: \"Zawistne serce\" (ft. Włodi) oraz \"Tak od 7 lat\".',7,'www_hhbd_pl_vienio_&_pele-autentyk_ii_(2003-10-18).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5942242','',NULL,877),(166,'Wyrwani Ze Snu',3,0,'2004-12-29 22:42:30','0000-00-00 00:00:00',0,NULL,73,'2004-02-23','',13,'www_hhbd_pl_tewu-wyrwani_ze_snu_(2004-02-23).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,915),(168,'Znaki Zapytania',3,0,'2004-12-31 14:29:20','0000-00-00 00:00:00',0,NULL,229,'2004-00-00','',24,'www_hhbd_pl_proceente-znaki_zapytania_(2004-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,602),(169,'W siną dal',3,1,'2005-01-01 21:11:32','2005-09-02 22:45:07',0,NULL,658,'2002-10-00','Produkcją muzyczną debiutanckiej płyty obdarzonego charakterystycznym głosem MC w większości zajął się wrocławski mistrz - Magiera ( współautor muzyki do Blokersów, płyty KASTA Skład, Tymona i Peji - Slums Attack). \"Siny to straż przednia hiphopu. Lojalnie ostrzegam że Siny dysponuje głosem wysokim. Tak wysokim, że z miejsca poprawiłby Peji humor. Myślicie, że wiecie jak wysokim? Nie, nie wiecie. Zrobi z waszymi uszami to, co ponętna blondynka zrobiła z regałem pełnym szkła zabawiając się z Adasiem Miauczyńskim w Nic śmiesznego. Głos Sinego potrafi szarpać nerwy, raper ma skłonność do szarży i ekwilibrystyki wokalnej, to prawda. Pierdolony kastrat - powie tradycyjny odbiorca. To ścisła czołówka jeśli chodzi o flow. Siny robi z beatem co chce\" - oto fragment jednej z wielu entuzjastycznych recenzji płyty W Siną Dal. Ten album to nie tylko zbiór utworów, rymów i słów. Jest to apel o tolerancję, pełen niechęci wobec chamstwa i ograniczonego odbioru rapu i jego twórców. Z drugiej strony to błaganie o spontaniczność i radość tworzenia.',6,'www_hhbd_pl_siny-w_sina_dal_(2002-10-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','blend15cd','',NULL,1033),(170,'W 63 minuty dookoła świata',3,0,'2005-01-03 16:15:45','0000-00-00 00:00:00',0,NULL,59,'1998-00-00','',4,'www_hhbd_pl_kaliber_44-w_63_minuty_dookola_swiata_(1998-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','SP 44/98','',NULL,1256),(171,'A.M.O.K.',3,1,'2005-01-03 16:50:58','2005-04-29 18:30:09',0,NULL,354,'2001-11-26','',5,'www_hhbd_pl_koma-a_m_o_k__(2001-11-26).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C23','',NULL,631),(172,'Samuraj',3,1,'2005-01-04 18:29:20','2005-01-08 22:20:39',0,NULL,143,'2002-00-00','',7,'www_hhbd_pl_grz-samuraj_(2002-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1230),(173,'W pogoni za lepszej jakości życiem',1,0,'2005-01-08 22:13:59','0000-00-00 00:00:00',0,NULL,662,'2005-01-06','',2,'www_hhbd_pl_malolat&ajron-w_pogoni_za_lepszej_jakosci_zyciem_(2005-01-06).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1053),(174,'Być albo nie być',1,0,'2005-01-11 12:11:29','0000-00-00 00:00:00',0,NULL,302,'2005-01-30','Druga płyta zespołu Endefis powstała w poszerzonym składzie już na początku 2004 roku (Bartosz, Miexon + JedenZdwóch). Zarówno muzycznie i tekstowo jest zdecydowanie bardziej zróżnicowana od pierwszej płyty (od kawałków spokojnych, poprzez żywe i dynamiczne, do hardkorowych).<BR>Produkcją muzyczną zajęli się zarówno producenci z wyrobioną już renomą np. Mazsa z zespołu Fenomen oraz Kociołek, jak i młodzi i mniej znani, ale bardzo utalentowani (np. WDK, DNA). Mimo tych różnorodności płyta muzycznie jest spójna. Gościnnie występują nie tylko wykonawcy z najwyższej półki O.S.T.R., Fenomen, ale i mało znani szerszemu gronu, choć reprezentujący wysoki poziom (np. SZTYKU, STEFCZI, RDS). Na krążku nie zabrakło oczywiście skreczy, którymi zajął się jeden z trzech najlepszych polskich dj-ów &#8211; DJ Kostek.Singiel radiowy oraz teledysk promujacy płytę ukaże sie pod koniec stycznia i będzie to refleksyjny kawałek pt.: &#8220;Nie chce być sam&#8221;.',12,'www_hhbd_pl_endefis-byc_albo_nie_byc_(2005-01-30).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1300),(175,'Kodex',1,0,'2005-01-11 22:37:27','0000-00-00 00:00:00',0,NULL,53,'2002-11-23','',13,'www_hhbd_pl_white_house-kodex_(2002-11-23).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5902619100247','',NULL,1326),(176,'Muzyka klasyczna',1,1,'2005-01-11 23:06:47','2005-01-11 23:32:23',0,NULL,670,'2002-04-08','',13,'www_hhbd_pl_pezet-noon-muzyka_klasyczna_(2002-04-08).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','T1 CD 010','',NULL,994),(177,'Autentyk III',1,7,'2005-01-12 14:39:41','2005-10-14 15:26:49',0,NULL,647,'2005-02-05','Już na początku lipca trafi do sklepów najnowszy album Vienia i Pelego - dwójki raperów z legendarnej Molesty Ewenement.<BR><br />\r\nPłyta nosić będzie tytuł \"Autentyk III\" i stanowić będzie zwieńczenie trylogii \"Autentyk\".<BR><br />\r\n<br />\r\nNa krążku znajdzie się 12 utworów, w tym 4 nowe wersje znanych już wszystkim fanom utworów - \"Jedno z takich miejsc\", \"Iść swoją drogą\", \"Tak od siedmiu lat\", \"To dla moich ludzi\". Nie będą to zwykłe remiksy utworów, ale całowice nowe wersje - nagrane z udziałem \"żywego\" zespołu.<BR><br />\r\n<br />\r\nPierwszym singlem, który promował będzie to wydawnictwo będzie utwór \"To jest mój hardkor\", który trafi do rozgłośni radiowych i stacji telewizyjnych pod koniec stycznia.',7,'www_hhbd_pl_vienio_&_pele-autentyk_iii_(2005-02-05).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5637692','',NULL,937),(178,'Wyjście z bloków',1,3,'2005-01-12 21:49:58','2005-02-12 12:19:16',0,NULL,672,'2005-02-28','Niemal 2 lata fani musieli czekać na nową produkcję rapera Mezo, którego poprzednia płyta \'Mezokracja\' sprzedała się w ponad 20 tyś. egzemplarzy i zdobyła niezwykłą popularność takimi utworami jak \'Żeby Nie Było\', \'Aniele\' czy \'Mezokracja\'. Tym razem całą płytę wyprodukował Mezowi poznański producent Tabb (znany ostatnio m.in. ze współpracy z Peją - singiel pt. \'Kurewskie Życie\' czy donGuralesko - singiel pt. \'Drewnianej Małpy Rock\'). Owocem ich pracy jest niemal 70 minutowy album, na którym znajdziecie 18 hiphopowych utworów. Od refleksyjnych, spokojnych numerów, poprzez zaangażowane społecznie kawałki, po klasyczne, techniczne hiphopowe \'bangery.\' Na płycie gościnnie pojawiają się inni znani raperzy: Owal/Emcedwa, Pan Duże Pe, Liber, a także Aro i Orzech. Całą płytę oskreczował Dj Spox, a w kilku utworach zaśpiewały bardzo utalentowane wokalistki: Kasia Wilk i Ania Karwan. Pierwszym singlem promującym płytę jest utwór pt. \'Nie Ma Nic\' - spokojny, bardzo klimatyczny numer o tematyce \'motywacyjnej\' jak mówi sam autor. \'To tekst o tym, że wszelkie trudności jakie napotykam ja czy ktokolwiek inny, nie powinny zabijać w nas motywacji, chęci działania, miłości do życia. A wszystkie porażki jakie odnosimy powinny budować nasze przyszłe zwycięstwo. Kawałek jest w sumie bardzo pozytywny w treści, ma jednak w sobie pewną gorycz\' - mówi Mezo.<BR>\r\nInfo: <a href=\"http://www.umc.pl\" target=\"_blank\">http://www.umc.pl</a>',12,'www_hhbd_pl_mezo_tabb-wyjscie_z_blokow_(2005-02-28).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1149),(179,'Muzyka Poważna',1,1,'2005-01-13 12:52:22','2005-04-29 18:12:42',0,NULL,670,'2004-04-20','\"Muzyka Poważna\" jest kontynuacją \"muzyki\" duetu Pezet Noon, która stała się dla wielu słuchaczy tego gatunku, wyznacznikiem poziomu jakości. Względem pierwszego krążka, płyta jest bardziej refleksyjna i poważna, jest tutaj dużo retrospekcji, osobistych tekstów i opisów nie zawsze kolorowej rzeczywistości. Muzyka Noona doskonale podkreśla charakter tekstów, jest bardzo spójna i utrzymana w klimacie. Słuchając płyty można śmiało stwierdzić, że mamy do czynienia z kolejnym klasykiem, tym razem o wiele bardziej ciężkim i poważnym, ale za to bardzo osobistym i prawdziwym.<BR><BR>Jeżeli lubisz coś więcej niż tylko bujające rytmy, cenisz klimat i osobiste refleksje, koniecznie zapoznaj się z Muzyką Poważną.',14,'www_hhbd_pl_pezet-noon-muzyka_klasyczna_(2004-04-20).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','EMB002','',NULL,899),(181,'Produkcja HIP-HOP',3,0,'2005-01-15 15:28:49','0000-00-00 00:00:00',0,NULL,24,'1998-00-00','',24,'www_hhbd_pl_dj_600v-produkcja_hip-hop_(1998-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,2156),(185,'3',1,1,'2005-01-18 17:54:56','2005-04-28 16:18:44',0,NULL,238,'2005-02-17','17 lutego 2005 ukaże się długo oczekiwany, duży studyjny album grupy Grammatik, zatytułowany \"3\". Po olbrzymim sukcesie maxi płyt: \"EP+\", \"światła miata\" oraz singla \"Reaktywacja\". Grammatik \"3\" jest zdecydowanie jedną z najbardziej oczekiwanych pozycji 2005 roku!<BR><BR> Maxi singiel Grammatik \"Reaktyywacja\" odniósł sukces, sprzedając się w nakładzie ponad 10 000 sztuk. Obecnie zakończyły się prace nad pełnym studyjnym albumem, Grammatik \"3\", który zostanie wydany nakładem miejskiej oficyny wydawniczej EMBARGO NAGRANIA. Pierwszym singlem promującym to wydawnictwo jest utwór zatytułowany \"Dedykowanie...\".',14,'www_hhbd_pl_grammatik-3_(2005-02-17).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','EMB007','',NULL,1094),(186,'Kolejna część',3,0,'2005-01-21 23:18:45','0000-00-00 00:00:00',0,NULL,42,'2001-00-00','',24,'www_hhbd_pl_borixon-kolejna_czesc_(2001-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1060),(187,'Kastatomy',3,7,'2005-01-21 23:46:06','2005-10-14 16:30:53',0,NULL,37,'2003-00-00','',6,'www_hhbd_pl_kasta-kastatomy_(2003-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5904259351645-2','',NULL,740),(188,'Tabasko',3,1,'2005-01-22 00:24:31','2005-03-10 15:42:52',0,NULL,4,'2002-06-24','',5,'www_hhbd_pl_o_s_t_r_-tabasko_(2002-06-24).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C30','',NULL,1089),(189,'30 minut z życia',3,0,'2005-01-22 11:20:05','0000-00-00 00:00:00',0,NULL,4,'2002-02-08','',5,'www_hhbd_pl_o_s_t_r_-30_minut_z_zycia_(2002-02-08).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C27','',NULL,621),(190,'Wszystko Co Mogę Mieć',3,3,'2005-01-22 11:35:56','2005-09-30 22:23:40',0,NULL,697,'2003-03-03','',31,'www_hhbd_pl_onar_i_o$ka-wszystko_co_moge_miec_(2002-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1006),(191,'Masz to jak w banku',3,0,'2005-01-22 14:16:21','0000-00-00 00:00:00',0,NULL,4,'2001-10-08','',5,'www_hhbd_pl_o_s_t_r_-masz_to_jak_w_banku_(2001-10-08).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C22','',NULL,1007),(192,'Ile jestem w stanie dać',3,1,'2005-01-22 14:38:19','2005-04-29 18:27:30',0,NULL,4,'2001-09-10','',5,'www_hhbd_pl_o_s_t_r_-ile_jestem_w_stanie_dac_(2001-09-10).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C20','',NULL,850),(193,'Drewnianej Małpy Rock',1,1,'2005-01-24 00:55:58','2005-03-24 16:11:28',0,NULL,97,'2005-02-05','...teraz nadszedł czas na drugą solową produkcję. Materiał składający się na płytę \"Drewnianej Małpy Rock\" to 19 utworów o niespotykanej w Polsce jakości i brzmieniu, zrealizowanych i wyprodukowanych na europejskim poziomie. Płyta ta będzie jednym z największych i najbardziej oczekiwanych wydarzeń Hip-Hopowych na polskim rynku muzycznym. Może także mocno zaistnieć na rynku Niemieckim, dzięki singlowemu utworowi \"Te Typy\", w którym u boku poznańskiego rapera wystąpił Sido. Jest on jednym z najlepszych i najbardziej popularnych artystów w Niemczech jak i innych krajach niemieckojęzycznych. W zeszłym roku odnotował jedną z najwyższych sprzedaży jego płyt na rynku niemieckim. Jego teledyski i singlowe utwory były najczęściej granymi przez stacje radiowe i telewizyjne. Ponadto jest laureatem wielu nagród za najlepszą płytę roku 2004 na rynku niemieckim.',3,'www_hhbd_pl_gural-drewnianej_malpy_rock_(2005-02-05).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','WJ06 519742 2','',NULL,1922),(194,'Najlepszą obroną jest atak',1,0,'2005-01-24 12:16:17','0000-00-00 00:00:00',0,NULL,704,'2005-02-07','',26,'www_hhbd_pl_slums_attack-najlepsza_obrona_jest_atak_(2005-02-07).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,910),(195,'Ã„â€šÃ‚â€œsmy Marca',3,3,'2005-02-12 12:24:10','2006-02-23 14:16:01',0,NULL,709,'2005-03-08','Debiutancka płyta Verby ukazuje zupełnie nowy styl muzyczny. Atmosfera płyty odbiega od dotychczas wydawanych płyt hip-hop. Warto zauważyć fakt, że Bartek z Verby od najmłodszych lat gra na instrumentach klawiszowych, stąd wykorzystanie jego dotychczasowych pomysłów i kompozycji na płycie \"Ã„â€šÃ‚â€œsmy Marca\". Cała płyta powstała bez użycia sampli, pętli, zapożyczeń z utworów innych wykonawców. Komputer umożliwił skomponowanie wszystkich melodii nuta po nucie. Singiel \"Nic więcej\" jest tylko zapowiedzią tego, czego można się spodziewać na \"krążku\". Płyta przepojona jest dużą ilością brzmień fortepianów, skrzypiec, gitar akustycznych i instrumentów dętych. Różnorodność melodii i brzmień sprawia, że płyty słucha się od początku do końca z przyjemnością. Tematy zawarte na płycie \"Ã„â€šÃ‚â€œsmy marca\" poruszają sprawy codziennego życia, uczuć, spostrzeżeń związanych z przeżyciami autorów. Przekaz płyty charakteryzuje szczerość, otwartość i realizm. Jak mówią sami autorzy: \"W założeniu cała płyta miała być prawdziwa i życiowa, więc zrobiliśmy wszystko, aby ostatecznie nie utracić wartości przekazu...\".',12,'www_hhbd_pl_verba-Osmy_marca_(2005-03-08).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','UMC 026','',NULL,809),(196,'Kastaniety',3,0,'2005-02-13 11:09:46','0000-00-00 00:00:00',0,NULL,37,'2002-00-00','',6,'www_hhbd_pl_kasta-kastaniety_(2002-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,760),(197,'Na Trzy Sposoby',3,3,'2005-02-13 12:16:08','2005-02-14 13:56:23',0,NULL,712,'2004-05-08','',16,'www_hhbd_pl_dialektyka-na_trzy_sposoby_(2004-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,538),(198,'Nokaut',3,0,'2005-02-15 17:38:55','0000-00-00 00:00:00',0,NULL,718,'2001-00-00','',6,'www_hhbd_pl_killaz_group-nokaut_(2001-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,986),(199,'Zjednoczone Emiraty Poznańskie',3,0,'2005-02-15 18:04:26','0000-00-00 00:00:00',0,NULL,718,'2001-00-00','',6,'www_hhbd_pl_killaz_group-zjednoczone_emiraty_poznanskie_(2001-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,680),(200,'A Póki Co',3,0,'2005-02-15 18:27:28','0000-00-00 00:00:00',0,NULL,41,'2004-00-00','',32,'www_hhbd_pl_zurom-a_poki_co_(2004-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','MLCD102-2','',NULL,709),(201,'O nas dla was',3,3,'2005-02-15 19:13:06','2005-02-15 20:13:24',0,NULL,722,'2003-00-00','',32,'www_hhbd_pl_chada_i_pih-o_nas_dla_was_(2003-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1035),(202,'Fru!',3,3,'2005-02-17 12:01:38','2005-04-16 23:00:42',0,NULL,724,'2005-04-25','Album jest owocem wspólnych sesji nagraniowych Fisza (wokal, rap) i DJ\'eja Envee (produkcja) z kolektywu Niewinni Czarodzieje. \"Fru!\" jest realizacją nowych i starych pomysłów Fisza, z których wiele długo czekało na ujrzenie światła dziennego. Na niezwykle różnorodnej i w sumie kompilacyjnej płycie znaleźć można zarówno down-tempo, nu-jazz, klasyczny hip-hop (gdzie w kilku kawałkach Fisz wraca do rapu!) jak i utwory nie podlegające jakiemukolwiek zaszufladkowaniu - między innymi singlowy \"Kryminalny Bluez\", utwór który jest świetnym przykładem na wszechobecne na płycie: spontaniczność, humor i przymróżenie oka.',5,'www_hhbd_pl_fisz_envee-fru!_(2005-04-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C46','',NULL,1475),(203,'Kryminalny Bluez',3,0,'2005-02-17 12:06:12','0000-00-00 00:00:00',0,NULL,724,'2005-03-10','Handlowy singiel zapowiadający album \"Fru!\". Na singlu utwory \"Kryminalny Bluez\" i \"Tłusty bit\" plus dwa gościnne remixy Emade i O.S.T.R. Digipack. 4 marca, premiera singla została przesunięta z 4 marca na 10 marca.',5,'www_hhbd_pl_fisz_envee-kryminalny_bluez_(2005-03-04)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C44','',NULL,885),(204,'Kameleon',3,7,'2005-02-17 13:32:56','2005-10-14 15:26:22',0,NULL,726,'2005-03-26','',7,'www_hhbd_pl_olsenfu-kameleon_(2005-03-26).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','8609922','',NULL,626),(205,'I nie zmienia się nic',3,1,'2005-02-18 16:08:37','2005-08-30 01:31:40',0,NULL,704,'2000-05-22','',17,'www_hhbd_pl_slums_attack-i_nie_zmienia_sie_nic_(0000-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,723),(206,'Na legalu?',3,0,'2005-02-18 18:18:10','0000-00-00 00:00:00',0,NULL,704,'2001-00-00','',13,'www_hhbd_pl_slums_attack-na_legalu__(2001-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1215),(207,'P-ń VI',3,0,'2005-02-18 23:04:46','0000-00-00 00:00:00',0,NULL,292,'2003-09-14','',12,'www_hhbd_pl_52_debiec-p-n_vi_(2003-09-14).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,718),(208,'Alboom',3,7,'2005-02-22 20:22:54','2005-10-14 16:29:23',0,NULL,589,'1995-09-30','',8,'www_hhbd_pl_liroy-alboom_(1995-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','74321306632','',NULL,993),(209,'L',3,0,'2005-02-22 21:01:51','0000-00-00 00:00:00',0,NULL,589,'1997-06-15','',8,'www_hhbd_pl_liroy-l_(1997-06-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','74321498662','',NULL,829),(211,'Dzień Szaka-L\'a - Bafangoo cz.2',3,0,'2005-02-24 16:09:17','0000-00-00 00:00:00',0,NULL,589,'1999-00-00','',27,'www_hhbd_pl_liroy-dzien_szaka-l_a_-_bafangoo_cz_2_(1999-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,733),(212,'Płyta Pilśniowa',4,1,'2005-02-26 02:11:30','2005-10-01 22:21:10',0,NULL,750,'2001-12-08','Płyta trwa 76 minut, z czego prawie dwadzieścia przypada na \"Kopalnię niespodzianek\" zawierającą między innymi fragment naszej sesji wolnostylowej, fragment próby na której przesłuchiwaliśmy nową wokalistkę, fragment house\'owego remiksu \"Dopsz bujam\" i fragmenty zremasterowanych starych utworów. Trzy kawałki z \"Negatywnych Wibracji\" znalazły się na \"Płycie Pilśniowej\" w całkowicie nowych, od zera nagranych wersjach. ',13,'www_hhbd_pl_afro_kolektyw-plyta_pilsniowa_(2001-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','T1 CD 007','',NULL,1141),(213,'Perz',4,0,'2005-02-26 03:03:52','0000-00-00 00:00:00',0,NULL,751,'2001-09-03','',9,'www_hhbd_pl_bunio-perz_(2001-09-03).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','Tee02c','',NULL,726),(214,'Powrót do przeszłości',1,1,'2005-02-26 14:46:05','2005-09-05 10:48:41',0,NULL,752,'2005-04-01','<p>Pracę nad debiutanckim albumem trwały od 15 grudnia 2003 kiedy to Stylowa Spółka Społem w osobach Deca (rap) i Domela (produkcja, gramofony) weszła na trzy dni do Suchybrut Studio Emada. Mimo powagi chwili, pierwsze nagrania Spółki dla Asfalt Records przebiegły w szampańskich humorach. Likwidacja Suchybrut Studio w połowie roku spowodowała prawie roczne przedłużenie się prac nad albumem, ale w ocenie samego duetu tak długa praca nad pierwszą płytą wyszła wszystkim na dobre. Po dokonaniu licznych dograń i poprawek wokali, w grudniu 2004 Emade dokonał ostatecznego mixu i relalizacji materiału. Na pierwszy singiel z albumu grupa wybrała utwór \"Zespół wzmacniaczny\".</p><p>Będąca efektem 2 letniej pracy debiutancka płyta zróżnicowana jest zarówno pod względem muzycznym jak i tekstowym. Ekipa produkuje się sama, muzycznie korzysta szeroko z funkowego i soulowego dorobku lat 70 (DJ Domel nie marnował długiego czasu spędzonego w Stanach). Ich charakterystycznym znakiem firmowym są stosunkowo szybkie bity. \"Wesoło i z jajem\" - to motto przyświecało Spółce w trakcie całej pracy nad albumem, stąd wzięły się spontaniczne skity a teksty \"z przekazem\" oparły się na sugestiach a nie moralitetach. Ważnym elementem całości są gramofony DJ Domela, Spółka starała się znaleźć miejsce na scratche w większości utworów. Swym stylem grupa przypomina old-schoolowe konwencje pielęgnowane współcześnie przez takie zespoły jak np. J5 czy Ugly Duckling.</P>',5,'www_hhbd_pl_sss-powrot_do_przeszlosci_(2005-04-01).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C45','',NULL,696),(215,'Szum rodzi hałas',1,7,'2005-02-26 14:48:45','2005-08-26 11:45:47',0,NULL,753,'2005-05-24','POE to wspólny projekt Ostrego i Emade &#8211; najbardziej oczekiwanego duetu producent/raper na rynku. Produkując album POE, Emade chciał pogodzić esencję brzmienia ze złotego okresu rapu z tym co najbardziej interesuje go we współczesnej muzyce europejskiej. Starał się kontynuować to co rozpoczął solowym &#8222;Albumem producenckim&#8221; przekładając dotychczasowy styl na nowszy język. Jest to dla niego nowy etap w rozwoju muzycznej produkcji, ale jednocześnie dalszy ciąg podróży przez świat samplerów i analogowych brzmień, podróży która na pewno kontynuowana będzie na swój sposób w przyszłości. Dla Ostrego, który uważany jest przez wielu za najlepszego polskiego rapera, była to przede wszystkim pierwsza w karierze próba sprawdzenia się na cudzych bitach. Próba, z której Ostry jak zwykle wyszedł zwycięsko.<br />\r\nPatronaty: Polskie Radio Bis, VIVA, ślizg, www.cgm.pl ',5,'www_hhbd_pl_p_o_e_-szum_rodzi_halas_(2005-04-28).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C47','2005-05-24',NULL,1540),(216,'Muzykoterapia',1,3,'2005-02-26 14:51:31','2006-03-07 15:46:38',0,NULL,754,'2006-04-28','Debiutancki album',5,'www_hhbd_pl_muzykoterapia-muzykoterapia_(2006-04-28).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-','',NULL,1019),(217,'Numer jeden',1,3,'2005-02-26 14:55:31','2006-06-20 20:16:56',0,NULL,755,'2006-06-23','Pełny studyjny album superkolektywu: Bunio (smp), Emade (smp), Fisz (voc), Wojtek Mazolewski (bas), Macio Moretti (dr), Mikołaj Trzaska (sax). Produkcja: Bunio, Emade, Moretti.',5,'www_hhbd_pl_bassisters_orchestra-numer_jeden_(2006-06-23).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C2','',NULL,791),(218,'Dread Za Dreadem',1,3,'2005-02-26 15:28:29','2005-10-29 22:36:51',0,NULL,759,'2005-10-27','Obecnie Dreadsquad pracuje w Studio Wielkie Joł nad producencka płyta, na której znajdzie się wielu gosci z klimatu Reggae & Hip-Hop. Na pewno możemy spodziewać się na niej Ri!Codeh\'a, Sidneya Polaka, Banda Tre (w składzie Pan Duże Pe i Mista Pita) oraz Fu i Natural Dread Killaz, a także artystów związanych z Wielkie Joł - Reggaeratora i Pablopavo (z formacji Vavamuffin) i innych.<br /><br /><br />\r\nGorące brzmienia i ciekawi goście to mocne strony tej nieprzeciętnej i bezprecedensowej produkcji. Będzie się można już o tym przekonać w pierwszym kwartale 2005 roku.',3,'www_hhbd_pl_dreadsquad_sound_system-dread_za_dreadem_(2005-09-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1526),(219,'Viza',1,0,'2005-02-28 15:09:33','0000-00-00 00:00:00',0,NULL,190,'2005-02-28','Projekt &#8222;VIZA&#8221; to pomysł polsko-francuskiego albumu muzycznego o charakterze komercyjnym, osadzonego w stylistyce hip-hopowej. Przenikanie tradycyjnej stylistyki hip-hopowej elementami innych nurtów muzycznych jest aktualnym trendem zarówno na polskim jak i światowym rynku muzycznym. Ogromna popularność muzyki francuskiej w Polsce pozwala rokować dobrą koniunkturę dla tego projektu. Universal Music Polska ma już na swoim koncie sukcesy płyt z muzyką francuską. Są to m.in. składanki : &#8222;LA VIE EST UNE CHANSON&#8221;, &#8222;MONAMORE&#8221;, płyty artystów takich jak ALIZEE, ADAMO, JULIETTE GRECO, JENIFER , MYLENE FARMER, INGRID, KATE RYAN i wiele innych. Do tej pory łączenie hip-hopu polskiego z franuskim na naszym rynku muzycznym miało charakter incydentalny, dlatego sądzimy, iż pomysł hip-hopowei fuzji pozwala estymować dużą popularność dla tej nieeksploatowanej jeszcze koncepcji artystycznej. Zawartość płyty stanowią piosenki w wykonaniu znanych i popularnych artystów polskich jak i francuskich. Na oryginalność muzyczną wydawnictwa składają się: mieszanka elementów muzyki etnicznej, różnorodność kreacji występujących artystów, oraz stricte hip-hopowa nowoczesna produkcja muzyczna autorstwa znanego francuskiego producenta Mohameda Kanzallah. ',21,'www_hhbd_pl_v_a-viza_(2005-02-28).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','9870806','',NULL,708),(220,'7 rano',1,7,'2005-02-28 15:22:28','2005-10-14 16:23:45',0,NULL,767,'2005-05-09','',21,'www_hhbd_pl_red_&_spinache-7_rano_(2005-05-09).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','9871293','',NULL,1093),(221,'Nie ma takiego drugiego',1,3,'2005-02-28 15:45:19','2005-07-01 18:32:10',0,NULL,480,'2005-06-25','Rok 2003 przyniósł wiele zmian, niby nic już nie było, a jednak czuło się tego obecność. Zaczyna się praca nad nową płytą. Coraz rzadziej można zobaczyć i usłyszeć jednocześnie skład, który całkowicie pochłonęła praca w studio. Dziś wiadomo już że te osiemnaście miesięcy potrzebne było aby wpuścić w każdy poszczególny dźwięk odrobinę powietrza - tak by powstało coś na kształt \"bańki mydlanej\". Niebawem ukaże się kolejny wytwór wyobraźni - drugie EGO \"Nie ma takiego drugiego\".',1,'www_hhbd_pl_ego-nie_ma_takiego_drugiego_(2005-12-31).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,988),(222,'Zanim minie czas',1,3,'2005-02-28 15:47:55','2006-02-16 15:03:55',0,NULL,214,'2005-07-31','Spodziwamy się po nierównej walce z polskimi realiami nagrody dla wytrwałych w postaci niepowtarzalności albumu pt. \"ZANIM MINIE CZAS..\"i jako że czas jeszcze nie minął do usłyszenia wkrótce.',1,'www_hhbd_pl_godziny_szczytu-zanim_minie_czas_(2005-12-31).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','wakacje 2005',NULL,802),(223,'Mędrcy z kosmosu',1,0,'2005-02-28 15:59:05','0000-00-00 00:00:00',0,NULL,69,'2003-00-00','Singiel zapowiadający drugą solową płytę Eldo - \"Eternia\".',6,'www_hhbd_pl_eldo-medrcy_z_kosmosu_(2003-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','blendsin06','',NULL,780),(224,'Live At Wrzeszcz',1,0,'2005-03-01 18:14:01','0000-00-00 00:00:00',0,NULL,755,'2004-02-02','Dwukawałkowy maxi-singiel (25 minut) zawierający fragment zapisu pierwszego publicznego jamu w składzie: Bunio (smp), Emade (smp), Fisz (voc), Wojtek Mazolewski (bas), Macio Moretti (dr), Mikołaj Trzaska (sax).',5,'www_hhbd_pl_bassisters_orchestra-live_at_wrzeszcz_(2004-02-02)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C37','',NULL,528),(225,'Warszafka',3,1,'2005-03-01 23:29:45','2005-03-10 15:41:34',0,NULL,168,'2003-06-09','',5,'www_hhbd_pl_tworzywo_sztuczne-warszafka_(2003-06-09)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C32','',NULL,331),(226,'Funk - dla smaku',1,1,'2005-03-02 14:46:36','2005-04-28 16:18:08',0,NULL,193,'2005-04-28','',14,'www_hhbd_pl_2cztery7-funk_-_dla_smaku_(2005-12-31).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','EMB008','',NULL,1273),(227,'Jest tak',1,1,'2005-03-03 19:36:35','2005-05-23 23:20:18',0,NULL,405,'2005-05-09','Jest to pierwszy singiel promujący nowy album, który będzie miał swoją premierę w maju bieżącego roku.',21,'www_hhbd_pl_jeden_osiem_l-jest_tak_(2005-05-09)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,644),(228,'Rap eskadra 2',1,1,'2005-03-03 19:44:37','2005-03-08 15:03:50',0,NULL,190,'2005-03-14','',12,'www_hhbd_pl_v_a-rap_eskadra_2_(2005-03-14).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,518),(229,'Jest nas wielu',1,3,'2005-03-03 19:45:42','2006-02-23 14:15:19',0,NULL,190,'2005-03-11','Płyta powstała na fali ukraińskiej pomarańczowej rewolucji jako gest poparcia dla ideałów demokracji i wolności. Można by rzec, tam gdzie kończy się pomarańczowa rewolucja i ukraińskie &#8222;razom nas bahato&#8221;, zaczyna się polskie &#8222;Jest nas wielu&#8221;. <br />\r\n<br />\r\n\'Powstał utwór bardzo gorzki, wręcz mroczny, stojący po stronie wolności, z nadzieją, ale też przestrogą przed naiwnością, refleksją nad dalszym losem rewolucji i uzasadnioną nieufnością do świata polityki. Ukraina jako przykład, pretekst do rozważań, utwór uniwersalny i ponadczasowy\' - mówi Robert Leszczyński o polskim nagraniu. <br />\r\n<br />\r\nNa płycie oprócz tytułowego nagrania &#8222;Jest nas wielu&#8221;, dodatkowo znajdą się utwory Ascetoholix, Cisza & Spokój, Owal/Emcedwa, Mezo, Pięć Dwa Dębiec, a także remixy nagrania &#8222;Jest nas wielu&#8221; w aranżacji Tabba, DJ Spox i DJ Story. <br />\r\n<br />\r\nNa płycie nie zabraknie oryginalnego hymnu pomarańczowej rewolucji &#8222;Razom nas bahato\' w wykonaniu zespołu Greenjolly, który będzie reprezentował Ukrainę na tegorocznym 50 Konkursie Eurowizji, organizowanym w Kijowie. <br />\r\n<br />\r\nAutorami oryginalnej, ukraińskiej wersji jest duet Greenjolly, czyli Roman Kostiuk i Roman Kalin pochodzący z Iwanofrankowska. Młodzi Ukraińcy muzyką zajmowali się po amatorsku, a piosenkę nagrali, bo jak sami mówią &#8222;dość już mieli słuchania przemówień na wiecach&#8221;. Utwór szybko stał się nieoficjalnym hymnem zwolenników Wiktora Juszczenki, zgromadzonych w grudniu na placu Niepodległości w Kijowie. <br />\r\n<br />\r\nProsty tekst i zaraźliwy refren uczyniły z utworu przebój, który dzięki internetowi trafił w świat - w ciągu kilku dniu ściągnięto go ponad 1,5 miliona razy! <br />\r\n<br />\r\nInicjatywa nagrania polskiej wersji \'Razom nas bahato\' powstała na Ukrainie. Robert Leszczyński, znany przede wszystkim jako juror programu \'Idol\', podczas wyjazdu na Ukrainę stał się nieoficjalnym łącznikiem między stroną Polską i Ukraińską. Skontaktował się z wytwórnią UMC, z propozycją nagrania polskiego &#8222;razom nas bahato&#8221;. <br />\r\n<br />\r\nSprawy potoczyły się bardzo szybko, Doniu z Ascetoholix podjął się roli producenta muzycznego, pracowano w kilku studiach jednocześnie. W przerwach między koncertami i nagraniami, poszczególni artyści nagrywali i przysyłali swoje partie do Donia, który sklejał materiał w jedną całość. W ciągu kilku dni powstał utwór z polskimi tekstami i niemal całkowicie nową muzyką. Z oryginału zachował się tylko refren.',12,'www_hhbd_pl_v_a-jest_nas_wielu_(2005-03-11).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','UMC 027','',NULL,620),(230,'EP+',3,3,'2005-03-04 23:09:56','2005-12-11 23:31:48',0,NULL,238,'1999-00-00','',6,'www_hhbd_pl_grammatik-ep__(1999-00-00).jpg','image/jpeg',N