ne świetnymi bitami, a to głównie za sprawą: <a href=\"/n/Igor\">Igora</a>, <a href=\"/n/Waco\">Waco</a> - którzy mają po dwa utwory swojego autorstwa na płycie. Pozostali producenci mają na płycie po jednym numerze, co czyni płytę bardzo zróżnicowaną.<br /><br />\r\nNie panują tutaj klimaty \'blokreskie\', nie panują klimaty \'imprezowo-baunsowe\', nie panują klimaty \'mroczne\' ani nazbyt świetliste. Ta płyta to zajebisty kawałek dobrego, polskiego rapu stworzona przez ludzi, którzy reprezentują polską scenę od samego, lub prawie samego początku! Polecamy!',26,'www_hhbd_pl_wojtas-moja_gra_(2005-02-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,2157),(243,'EP',3,3,'2005-03-11 16:31:19','2005-03-11 16:42:08',0,NULL,794,'2005-00-00','',27,'','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,994),(244,'Rap eskadra',3,0,'2005-03-11 17:18:04','0000-00-00 00:00:00',0,NULL,190,'2004-11-08','',12,'www_hhbd_pl_v_a-rap_eskadra_(2004-11-08).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,425),(245,'Bez zabezpieczeń',3,3,'2005-03-11 23:17:49','2005-03-11 23:20:19',0,NULL,793,'2004-00-00','',26,'www_hhbd_pl_maly_esz_esz-bez_zabezpieczen_(2004-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','FCD150','',NULL,672),(246,'+1db',3,1,'2005-03-11 23:35:29','2005-03-12 10:35:04',0,NULL,798,'2005-02-28','Składanka producencka \"Puzzel +1dB\". Gościnnie na znakomitych kompozycjach utalentowanego producenta z Lubawy wokalnie udzielili się: Al-Fatnujah (beatbox), Jimson, Jinx, Koligacja GieKa, Ania Sool, Good Saykas, Mona, KBL, FORT-E, Puni, Skarap, Pyk, PeeRZet, Faczyński & Kidd i wielu innych.<br /><br />\r\nMateriał powstawał w latach 2002-2004, a ostatnich poprawek dokonano już w 2005 roku.',35,'www_hhbd_pl_puzzel-_1db_(2005-02-28).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','311-CD11','',NULL,552),(247,'Galaktao',3,7,'2005-03-12 09:52:39','2005-10-14 15:41:41',0,NULL,799,'2001-03-01','',7,'www_hhbd_pl_pareslow-galaktao_(2001-03-01).jpg','image/jpeg',NULL,'200