ze. Activatior Mario Dziurex, Dj Feel-X, sekcja dęta legendarnego DAAB\'u czy zmysłowe żeńskie trio wokalne krakowskiego Duberman\'a to tylko część z wymienionych tam postaci, które dodają niezwykłego kolorytu tej produkcji, nie dominując jej swoją obecnością, należyty pierwszy plan pozostawiając gospodarzom.<BR>\r\nStudyjne oblicze zespołu, to oblicze równie profesjonalne, pozwalające docenić każdy dźwięk i słowo, które często umykają w koncertowym szale, a do których zespół przywiązuje ogromną wagę.<BR>\r\nTeksty na płycie przesycone są warszawską ulicą. Artyści bawią się tą formą, wykazując, że znakomicie pasuje ona do tematów typowych dla, zdawałoby się odległej, kultury reggae. Gdyby żył dziś Stanisław Grzesiuk i śpiewał ragga, to robiłby to z Vavamuffin!<BR><BR>\r\n<strong>Autorzy o albumie</strong>:<BR> Czołem tu ekipa Vavamuffin. Zakończyliśmy właśnie prace nad naszym małym dziełkiem. Nazwaliśmy je Vabang! I mamy nadzieję że będzie to Bang! Z prawdziwego (czytaj ogniowego) zdarzenia. Napracowaliśmy się, siedząc i dłubiąc w przepięknej Żeleźnicy obok Piły równie gustownej wraz z Tomem Hornem i przy współudziale Activatora Mario Dziurexa. Z utęsknieniem czekaliśmy na pocztyliona, który dowoził nam chórki dziewczyn dubermanśkch, skrecze mighty FeelX-a i dęciaki Korzenia, Strusia i Frytona. Jedliśmy zupki skośne, tosty, piliśmy wodę - sklep był w Krajence 4 kilosy po śniegu. Jedliśmy czosnek. Dużo czosnku. I cebule - bo ziąb i grypa -jamajka co uderza 2 razy. Medal stachanowca otrzymał oczywiście kazan rafi a medal im. śruby - mista olo bwoy! Udekorowani, zasiedliśmy do mixu. Okładkie smażył już wilku a my smażyliśmy 1000nego tosta - brrr. Ale się nie poddawaliśmy bowiem twardym być trza!\r\n<BR><BR>\r\nUderzymy na chwilę w nieznośnie wysoki i naburmuszony ton: Cholera jak się cieszymy, że się udało, że Karrot Komando cierpliwość okazało, że mogliśmy podsumować te 2 lata grania. Jak wyszło, sami się przekonajcie, zapraszamy na traskie koncertową i dziękujemy Wam za całe wsparcie, pomoc i miłość, którą od was dostaliśmy! A teraz poważnie: dyrdaj koleżko/kochanieńka do sklepiku tudzież na sztukie vavamuffinków i kup se nośnik!<BR>P.S. Dla winylowych maniaków info radosne, czarniawa płytka ukaże się za jakieś 2 tyg., szczegóły wkrótce.\r\n<BR>\r\nPps. Hurrra!',37,'www_hhbd_pl_vavamuffin-vabang!_(2005-04-06).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,934),(279,'P.I.Ę.Ć.G.I.E Panama',1,0,'2005-04-27 23:34:50','0000-00-00 00:00:00',0,NULL,955,'2004-07-02','Ten album to debiut warszawskiej formacji dancehall złożonej z muzyków posiadających bardzo bogate doświadczenia sceniczno - nagraniowe. Na uwagę zasługuje fakt, że jest to pierwszy polski album dancehall, świetnie brzmiący i ekskluzywnie wydany. \r\n<BR><BR>\r\nMuzycznie album stanowi energetyczną mieszankę stylu śpiewania a&#8217;la Sean Paul i najświeższych karaibskich brzmień. Szaleńcze rytmy, niebanalne, oryginalne teksty podlane rasową współczesną jamajską muzyką sprawiają , iż otrzymujemy wybuchową mieszankę, która nikogo nie pozostawia obojętnym. \r\n<BR><BR>\r\nPrzebojowe kompozycje sprawdzają się idealnie podczas domowych balang typu homming, a także na parkietach wielkich klubów typu clubbing. Mimo, iż Cinq G ( 5 G )uprawia po polsku jamajski gatunek, ich muzyka nie nosi w sobie martyrologicznego piętna tzw. polskiego reggae. To muzyka świeża, radosna i śmiało mieści się w światowych standardach. <BR>\r\nEuforyczne przyjęcie ponadtysięcznej, zaskoczonej poziomem CINQ G ( 5 G ), publiczności podczas I Jamdance Dancehall Festival potwierdza opinie, iż mamy do czynienia z muzycznym fenomenem.\r\n<BR><BR>\r\nCharyzmatyczny wokalista Duże Pe to czołowa postać polskiego hip hopu. Lider grupy Radikal Irie (Tomek Konca) ma na koncie kilka płyt ( min. Transmisja) i jest animatorem polskiej sceny dancehall, konsekwentnie, jako dj, producent, muzyk i organizator imprez, promuje współczesną jamajską muzykę. W edycji koncertowej CINQ G wspomagają ERUDEIGREK na bassówce oraz DOKTÃ„â€šÃ‚â€œR na perkusji czasami skład poszerzany jest o sekcję dętą.',26,'www_hhbd_pl_cinq_g-p_i_e_c_g_i_e_panama_(2004-07-02).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','FDUB002','',NULL,503),(281,'Coś do zrobienia',3,0,'2005-04-29 21:26:16','0000-00-00 00:00:00',0,NULL,957,'2004-06-17','',11,'www_hhbd_pl_agenda-cos_do_zrobienia_(2004-06-17).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5175372','',NULL,722),(282,'Ewenement',3,3,'2005-04-29 22:11:06','2005-04-29 22:13:43',0,NULL,124,'1999-09-04','',7,'www_hhbd_pl_molesta_ewenement-ewenement_(1999-09-04).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5227762','',NULL,1363),(283,'Jeden dla wszystkich',3,7,'2005-04-29 22:53:53','2005-10-14 15:25:53',0,NULL,594,'2001-09-15','',7,'www_hhbd_pl_onil-jeden_dla_wszystkich_(2001-09-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5349832','',NULL,354),(284,'Nowe wyzwanie',3,0,'2005-05-06 22:07:29','0000-00-00 00:00:00',0,NULL,161,'2002-00-00','',24,'www_hhbd_pl_peku-nowe_wyzwanie_(2002-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,575),(285,'EP',3,0,'2005-05-06 22:29:15','0000-00-00 00:00:00',0,NULL,309,'2004-00-00','',31,'www_hhbd_pl_sistars-ep_(2004-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32',' 5046740862','',NULL,509),(286,'Obejrzyj sobie wiadomości',3,3,'2005-05-06 22:54:03','2005-05-06 23:20:36',0,NULL,77,'2000-00-00','',8,'','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,714),(287,'Tamte prywatki',1,1,'2005-05-10 18:49:01','2005-05-10 18:49:32',0,NULL,697,'2001-01-08','',5,'','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C16','',NULL,538),(288,'La Disco',1,0,'2005-05-10 18:57:48','0000-00-00 00:00:00',0,NULL,987,'2003-10-25','Pierwszy singiel warszawskiego projektu Humaniztikz prowadzonego przez Muslee - czyli dawniej Tigera z historycznej formacji Trials X. W tytułowym utworze \"La Disco\" po francusku rapuje Red, przyśpiewuje mu Lady K a na gramofonach udziela się DJ Platoon, podobnie jak Tiger znany z Trials X. Na singl