ielkie Joł przystało na nadchodzącym krążku nie zabraknie ludzi związanych z wytwórnią. Pojawi się również wielu ciekawych gości zaproszonych do współpracy przy tym albumie. Na &#8222;Jeszcze raz&#8221; usłuszymy: Tede, Kołcza, Analogię, a także Numera Raz, Monikę Brodkę, Anię Sool, AbraDaba, Gutka i HST.<br /><br />\r\nZa warstwę muzyczną projektu &#8222;Jeszcze raz&#8221; odpowiedzialni są głównie: Mateo oraz Rafi, ale usłyszeć można również kompozycje autorstwa Tedego, Młodego Grzecha i Sisquad.<br /><br />\r\nTą płytą WSZ i CNE udowadniają, że doświadczenie artystyczne i dziennikarskie, jakie zdobyli przez wiele lat swojej działalności teraz procentuje. &#8222;Jeszcze raz&#8221; to album dojrzały i pełen ciekawych patentów, zarówno tekstowych jak i muzycznych. To bez wątpienia płyta nie tylko na imprezę, ale również na dynamiczne podróże po mieście.',3,'www_hhbd_pl_cne_i_wsz-jeszcze_raz_(2005-10-13).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1746),(323,'Ogólne Tematy',3,0,'2005-05-26 23:06:51','0000-00-00 00:00:00',0,NULL,1032,'2005-06-04','',17,'www_hhbd_pl_mleko-ogolne_tematy_(2005-06-04).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,929),(324,'W...',3,7,'2005-06-10 11:16:56','2005-10-14 15:14:19',0,NULL,122,'2005-06-25','',7,'www_hhbd_pl_wlodi-w____(2005-06-25).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','3302422','',NULL,922),(325,'Na Klucz',3,1,'2005-06-24 23:16:56','2005-10-01 00:19:39',0,NULL,166,'2005-09-26','Ogromna porcja, lekkich, profesjonalnych, dopracowanych w najmniejszych szczegółach dźwięków prosto ze studia IGS\'a! Prawdopodobnie jedna z bardziej oczekiwanych płyt ostatnich miesięcy (lat?), ponieważ była gotowa już dawno, lecz oczekiwała na konkretnego wydawce. Ostatecznie została wydana przez Doperacje. Mnóstwo znakomitych gości czyni te płytę bardzo ciekawym materiałem! Solidna porcja katowickiego rapu!',18,'www_hhbd_pl_igor-na_klucz_(2005-09-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1512),(327,'Ludzie Maszyny Słowa',3,3,'2005-07-01 18:33:53','2009-04-09 11:57:42',0,NULL,23,'2009-06-21','',3,'','image/jpeg',NULL,'2009-06-13 00:02:32','','czerwiec 2009',NULL,973),(328,'Arogancki Kurier',3,3,'2005-07-01 18:35:25','2008-10-12 09:11:05',0,NULL,1033,'2009-11-29','',17,'','image/jpeg',NULL,'2009-06-13 00:02:32','','Nieznana',NULL,1200),(329,'Alfabetyczny spis',3,3,'2005-07-07 23:28:53','2005-10-05 23:38:50',0,NULL,524,'2005-10-21','',17,'www_hhbd_pl_nowator-alfabetyczny_spis_(2005-10-21).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1570),(330,'Eska Squad 3',3,0,'2005-07-23 13:28:44','0000-00-00 00:00:00',0,NULL,190,'2005-05-30','Po sukcesie dwóch poprzednich składanek ESKA SQUAD, ukaże się trzecia część tego zestawu nagrań hiphopowych w wersji dwupłytowej. CD1 zachowa dawną formę zestawu polskich utworów znanych z anteny rozgłośni sieci Radia ESKA. CD 2 to nagrania zagraniczne, a wśród nich ostanie hity takie jak SNOOP DOGG, NITTY, NELLY, RAPTILE, 50 CENT OUTKAST, JA RULE, JAY Z czy DR DRE z EMINEMEM.',12,'www_hhbd_pl_v_a-eska_squad_3_(2005-05-30).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,810),(331,'To zbyt piękne ...',3,3,'2005-08-23 23:57:56','2005-09-11 00:09:57',0,NULL,1076,'2005-08-19','',2,'www_hhbd_pl_juras_wigor-to_zbyt_piekne_____(2005-08-19)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','PRS027','',NULL,774),(332,'Czas Surferów',3,3,'2005-08-28 11:28:27','2006-02-23 14:14:18',0,NULL,114,'2005-08-19','',12,'www_hhbd_pl_doniu-czas_surferow_(2005-08-19).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','UMC 032','',NULL,795),(333,'Sidney Polak',4,4,'2005-08-28 20:48:24','2005-08-28 22:26:46',0,NULL,1021,'2004-05-22','<br /><br />\r\nPierwsza solowa płyta Sidney`a. Dwanaście piosenek plus trzy skity. Połączenie trzech gatunków muzycznych - hip-hopu, reggae i folku. Koncept album wesoło opowiadający o rzeczywistości przez pryzmat spożywania napojów wyskokowych. Płyta jest hip-hopowa na kilku płaszczyznach. Pierwsza z nich to słowo - słowo, które jest obecne na tej płycie non-stop. Generalnie są to utwory nawinięte, może nie zarymowane, bo to bardziej melodeklamacja niż rym, ale jest. Druga płaszczyzna to bity i jednostajność niektórych podkładów. W kilku piosenkach w ogóle nie ma refrenów w sensie oddzielnych części muzycznych. Płyta powstawała w Tarchostudio pod okiem Kajetana Aronia, a później Adasia Toczki w 2002 i 2003 roku. W kilku miejscach pomógł też asystent Adasia - Szymon Siejko. Powstawała długo, bo studio było za free i jak Sidney chciał już iść do domu, to po porostu szedł i koniec. W między czasie oczywiście grał koncerty z T.Love i wyprodukował koncertowa płytę T.Live. Ciekawi muzycy sesyjni - nieżyjący już niestety Wojciech Seweryn, gitarzysta Janerki, Janek Benedek, filar dawnego T.Love, Mikis Cupas gitarzysta Wilków, kumpel Sidney`a jeszcze z liceum i sekcja dęta w postaci Korzenia, Strusia, Rytki, Dominika Trębskiego i Marcina Ołówka. Goście hip-hopowo-reggae\'owi, czyli Pezet, Trzeci Wymiar i Pablopavo oraz Reggaenerator ze Zjednoczenia Sound System nadają niewątpiwego kolorytu. Płytka zbiera dość dobre recenzje i o dziwo podoba się nie tylko hip-hopowcom czy regałowcom, ale także ludziom nie związanym z żadną subkulturą. Gratulacje złożył nawet znany pisarz Krzysztof Varga:). Płyta podobała się również w Chorwacji, gdzie słuchano z niedowierzaniem piosenki Chorwat:). Mówi się, że zawiera niezłe teksty!',7,'www_hhbd_pl_sidney_polak-sidney_polak_(2004-05-22).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5781712','',NULL,731),(334,'www.tekila.pl',4,0,'2005-08-28 21:49:37','0000-00-00 00:00:00',0,NULL,1021,'2004-05-03','',7,'','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,339),(335,'Otwieram wino',4,0,'2005-08-28 22:29:41','0000-00-00 00:00:00',0,NULL,1021,'2004-07-13','',7,'','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,620),(336,'Kaseta demonstracyjna',1,1,'2005-08-31 23:23:45','2005-08-31 23:25:17',0,NULL,1086,'2003-11-04','',16,'www_hhbd_pl_dinal1982-kaseta_demonstracyjna_(2003-11-04)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,441),(337,'HIT',1,3,'2005-09-05 20:02:06','2008-10-10 23:58:32',0,NULL,1100,'2009-09-30','Obecnie w MTV i Viva zobaczy? mo?na najnowszy teledysk LWW do utworu â€žHitâ€ w wykonaniu 210 featuring Numer Raz, Lady Mocca, Mag - promuj?cy nadchodz?cy album.',39,'','image/jpeg',NULL,'2009-06-13 00:02:32','','nieznana',NULL,1231),(339,'Spoko Dzieciak',1,3,'2005-09-05 20:16:54','2008-08-29 18:57:34',0,NULL,190,'2009-07-15','',39,'','image/jpeg',NULL,'2009-06-13 00:02:32','','2006',NULL,943),(340,'Czarno widzę',1,3,'2005-09-06 14:09:18','2006-02-16 15:15:57',0,NULL,750,'2006-02-06','Na oficjalnej stronie dostępny pierwszy opublikowany numer \'Paranoja na bloku\' z nadchodzącej płyty.',6,'www_hhbd_pl_afro_kolektyw-czarno_widze_(2006-02-06).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1446),(341,'Wysokie loty',3,0,'2005-09-11 00:07:57','0000-00-00 00:00:00',0,NULL,1076,'2005-09-26','',2,'www_hhbd_pl_juras_wigor-wysokie_loty_(2005-09-26).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,983),(342,'Co dwie to nie jedna',3,1,'2005-09-11 00:25:51','2005-12-06 16:39:03',0,NULL,1101,'2006-03-28','Album jest już gotowy, zmasterowany i czeka na wydanie, lecz niestety musi jeszcze poczekać. Wstępny przybliżony termin to koniec marca 2006.<br />\r\nAlbum zostanie wydany nakładem wydawnictwa White Label, będzie dostępny w sieciach sklepów empik, dużych sklepach muzycznych oraz wybranych skateshopach na terenie kraju.<br />\r\nMarian i Wodzu to reprezentanci Tarnowa, tworzą pod szyldem Dwie twarze od 2001 roku, do tej pory mają na koncie jeden nielegal - \"Punkt Widzenia\" wypuszczony w 2003 roku.<br />\r\nJak sami mówią, tworzą \"tradycyjny rap z naciskiem na technikę i formę\".',40,'www_hhbd_pl_dwie_twarze-co_dwie_to_nie_jedna_(2005-10-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','koniec marca',NULL,646),(343,'Muzyka miejska cz.1',3,0,'2005-09-11 00:53:18','0000-00-00 00:00:00',0,NULL,190,'2005-09-22','',14,'www_hhbd_pl_v_a-muzyka_miejska_cz_1_(2005-09-22).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','PIS0023','Wrzesień 2005',NULL,806),(344,'Alkopoligamia: zapiski typa',3,1,'2005-09-13 21:58:59','2005-12-02 17:52:06',0,NULL,35,'2005-10-29','Płyta ukazała się w dwóch wersjach; jedno i dwupłytowej. Wersja dwupłytowa ma zamiast zielonych, pomarańczowe paski na okładce. Usłyszeć/zobaczyć na niej można różnego typu bonusy - wywiad z Mesem, materiał ze studia oraz teledyski w których Mes brał udział. Oprócz tego dwa numery z zeszłorocznego beef\'u z Mezem.\r\n14 numerów z pierwszej płyty do bardzo dobry polski rap! W większości płyta to programowane bębny i żywe instrumenty. Korg na którym gra sam Mes, trąbka <a href=\"/n/ganko_rafal\">Rafała Gańko</a>, Gitara basowa <a href=\"/n/kuzmicz_pawel\">Basologa</a> i <a href=\"/n/glub\">Gluba</a> oraz granie kolektywu <a href=\"/n/stereotyp\">Stereotyp</a> (w składzie Kamil Sajewicz, Tomasz Bogacki, Daniel Christ oraz Marcin Słomiński).\r\nMix i mastering wykonali Noon i Glub (M. Bugajak raz M. Skalski) w S33 Studio (www.s33-studio.com).\r\nOkładkę wyprodukowały Katarzyna Stegnerska i Adela Chapońkowska, przy nieocenionej pomocy Moniki Krysiak i Dawida Bednarskiego. Zdjęcia: Katarzyna Stegnerska (info: 601 380 574). Grafika: Radek Skarżyński.',13,'www_hhbd_pl_mes-alkopoligamia__zapiski_typa_(2005-10-24).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','5902619100391','',NULL,3280),(345,'Mamy to we krwi',3,1,'2005-09-13 22:15:05','2005-09-28 11:01:12',0,NULL,1052,'2005-10-14','Yeah, nadchodzi super produkcja projektantów stylu! Mnóstwo pomorskiego brzemienia, rodem ze Szczecina. Gościnnie między innymi <a href=\"/wykonawca/Aha\">Acha</a> ze <a href=\"/wykonawca/SNUZ\">S.N.U.Z</a>, a za gramofonami <a href=\"/wykonawca/dj_twister\">Dj Twister</a>. Strona muzyczną zajęli się <a href=\"/n/OSTR\">O.S.T.R</a>, <a href=\"/n/rolo\">Rolo</a> (m.in. autor muzyki do numeru \'<a href=\"/s/sciany\">ściany</a>\' z soundtracku do filmu <a href=\"/a/Klatka\">Klatka</a>, oraz <a href=\"/n/dj_twister\">Dj Twister</a>. Dystrybucją zajmie się <a href=\"/l/Fonografika\">Fonografika</a>. Dasz to głośniej - już wkrótce!',13,'www_hhbd_pl_projektanci-mamy_to_we_krwi_(2005-10-14).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1210),(346,'AEIOU',3,0,'2005-09-20 14:46:07','0000-00-00 00:00:00',0,NULL,309,'2005-09-26','',31,'www_hhbd_pl_sistars-aeiou_(2005-09-26).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,997),(347,'Czarny Piątek vol.1',3,7,'2005-09-20 17:54:28','2005-10-14 16:26:57',0,NULL,190,'2005-10-03','',8,'www_hhbd_pl_v_a-czarny_piatek_vol_1_(2005-10-03).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','82876743492','',NULL,1884),(348,'W pracowni słowa i dźwięku',3,3,'2005-09-20 23:51:21','2005-11-26 16:56:21',0,NULL,1117,'2005-12-02','2 grudnia 2005 roku to wstępna data premiery pierwszego oficjalnego krążka Bla-Bla \"W pracowni słowa i dźwięku\". Płytę będzie poprzedzać singiel i teledysk. Na płycie znajdzie się 18 utworów i kilku ciekawych gości. <br /><br />\r\nZa stronę produkcyjną w głównej mierze odpowiada Mahyn, którego czasem wspiera Mroku i w jednym utworze Redżi. Skreczami zajął się Dj Zaju.',7,'www_hhbd_pl_bla_bla-w_pracowni_slowa_i_dzwieku_(2005-12-02).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1660),(349,'Sensi',3,1,'2005-09-21 14:39:58','2005-12-04 02:58:50',0,NULL,116,'2005-12-12','Pierwszy solowy album Pelego. Pierwszym numerem promującym w Internecie ten album jest \'<a href=\"/s/kiedys_2\">Kiedyś</a>\' z gościnnym występem <a href=\"/n/pezet\">Pezeta</a> i <a href=\"/n/olgas\">Olgi</a>.',47,'www_hhbd_pl_pele-sensi_(2005-12-21).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1904),(350,'Kręcioł',1,0,'2005-09-21 22:46:17','0000-00-00 00:00:00',0,NULL,724,'2005-10-10','Drugi singiel promujący album \"<a href=\"/album/fru\">Fru!</a>\". W singlowym utworze gościnnie występuje niezwykle ciepło przyjęty <a href=\"/wykonawca/Maly_Ziomek\">Mały Ziomek</a>. Równolegle z premierą singla premiera klipu, którego rozmach produkcji przerósł nie tylko wszystko co do tej pory powstało w <a href=\"/wytwornia/Asfalt_Records\">Asfalt Records</a>, ale dzieło to nie ma także precedensu na całym polskim rynku fonograficznym. Dodatkowo na singlu dwa niepublikowane na albumie, nowe utwory <a href=\"/wykonawca/Fisz_Envee\">Fisz Envee</a>: \"M do Z\" gościnnie Mały Ziomek oraz \"Bocian\". Content multimedialny to oczywiście wspomniany klip video \"Kręcioł\", relacja z planu oraz wybór kadrów. Patronaty: Trójka, Aktivist, www.cgm.pl.',5,'www_hhbd_pl_fisz_envee-kreciol_(2005-10-10)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C48','',NULL,520),(351,'Emisja Spalin',3,3,'2005-09-27 15:11:40','2005-12-01 15:33:31',0,NULL,28,'2005-12-01','Abradab, jak sam mówi, nie spodziewał się, że wyda tak szybko kolejny album. Jednak. Półtora roku po wydaniu \"<a href=\"/a/czerwony_album\">Czerwony Album</a>\". Pojawia się Emisja Spalin.<br />\r\nPłyta jest przemyślana i zaplanowana dobrze od początku do końca - jak powiedział Abradab w wywiadzie w Trójce.<br />\r\nAlbum \"Emisja Spalin\" zawiera utwory napisane pod koniec 2004 i w ciągu 2005 roku, a nagrane w całości w <a href=\"/l/igs_studio\">IGS Studio</a> w Katowicach we wrześniu i październiku 2005. Producentem materiału jest dAb oraz Igs, duży wkład w finalne brzmienie miał również Sebastian Witkowski aka Madmagister (odpowiedzialny m.in. za \"Czerwony Album\" i \"3:44\" Kalibra 44).<br />\r\nMożna na nim usłyszeć głosy <a href=\"/n/gutek\">Gutka</a>, <a href=\"/n/joka\">Joki</a>, <a href=\"/n/numer_raz\">Numer Raza</a> oraz <a href=\"/n/czarne_zloto\">Czarnego Złota</a> (<a href=\"/n/hst\">HST</a>, <a href=\"/n/jajonasz\">Jajonasz</a>, <a href=\"/n/gano\">Gano</a>) oraz kompozycje dAba, <a href=\"/n/jajonasz\">Jajonasza</a>, <a href=\"/n/dj_feel_x\">Feel-Xa</a>, <a href=\"/n/zusto\">Żusta</a> oraz <a href=\"/n/igor\">IGSa</a>. Na płycie wystąpił ponownie skład <a href=\"/n/idios_bravos\">Indios Bravos</a>. Za gramofonami, jak zwykle, <a href=\"/n/dj_feel_x\">DJ Feel-X</a> i <a href=\"/n/dj_bart\">DJ Bart</a>.<br />\r\nZa stronę graficzną albumu oraz wizualną teledysku odpowiedzialny jest Kobas Laksa, twórca teledysku \"Rapowe Ziarno 2 (Szyderap)\" oraz okładek do \"<a href=\"/a/czerwony_album\">Czerwonego Albumu</a>\" i \"<a href=\"/a/w_63_minuty_dookola_swiata\">W 63 min Dookoła świata</a>\" <a href=\"/n/kaliber_44\">Kalibra 44</a>.',4,'www_hhbd_pl_abradab-emisja_spalin_(2005-12-03).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','początek grudnia',NULL,3595),(352,'Rap Eskadra 3',3,1,'2005-09-27 15:52:31','2005-11-29 15:56:58',0,NULL,190,'2005-11-28','Trzecia część przebojowej kompilacji wydawanej przy współpracy Radia Eska i zawierającej najciekawsze nagrania z kręgu polskiego rapu oraz hip hopu. Tym razem jest to wydawnictwo pięciopłytowe obejmujące ponad sześć godzin muzyki. Całość została podzielona na tematyczne części. Pierwsza płyta to utwory premierowe, a wśród wykonawców między innymi <a href=\"/n/mezo\">Mezo</a>, <a href=\"/n/jeden_osiem_l\">Jeden Osiem L</a>, Cin Q i <a href=\"/n/verba\">Verba</a>. Druga płyta zawiera największe hity, a trzecia i czwarta \"utwory podziemne\" czyli nagrania nadesłane przez konkursowiczów. Wydawnictwo uzupełnia piąta płyta zawierająca osiemnaście teledysków.',12,'www_hhbd_pl_v_a-rap_eskadra_3_(2005-10-28).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1922),(353,'Sens Życia',3,3,'2005-09-27 16:44:16','2007-01-30 21:50:59',0,NULL,300,'2007-01-30','A tak o nowym albumie mówi Owal - \"Materiał na płytę zbierałem 2 lata. W tym czasie napisałem ponad 50 tekstów, nagrałem kilkadziesiąt numerów. Jednak na album musiałem wybrał tylko część, zachowując przy okazji spójność materiału. Nie było to zadanie łatwe, ale musiałem wybrać finalnych 16 numerów. Szanuję ludzi, którzy słuchają mojego rapu i kupują moje płyty, dlatego przygotowałem dla nich prawie godzinę dobrej muzy\"',12,'www_hhbd_pl_owal_emcedwa-sens__ycia_(2007-01-30).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1006),(354,'8 Rano',3,3,'2005-09-27 21:43:33','2007-04-14 13:01:42',0,NULL,767,'2007-02-22','',27,'www_hhbd_pl_red_&_spinache-8_rano_(2007-02-22).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1180),(356,'Na zawsze będzie płonął',3,0,'2005-09-28 16:34:41','0000-00-00 00:00:00',0,NULL,455,'1999-08-27','Debiut grupy znanej wówczas dzięki licznym koncertom nie tylko w macierzystej Warszawie. Wcześniej udział w składance \"Hiphopowy raport\" oraz gościnnie na albumie \"Szejsetkilovolt\". Wszystkie produkcje Ośka plus jeden utwór DJ 600 V.',5,'www_hhbd_pl_plomien_81-na_zawsze_bedzie_plonal_(1999-08-27).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C07','',NULL,1335),(357,'Otzafszetu / Oempe',3,0,'2005-09-28 16:59:22','0000-00-00 00:00:00',0,NULL,456,'1999-06-23','Dwa tytułowe utwory, pochodzące z debiutu OMP, w specjalnych ulepszonych wersjach (revamp) jako vocal, instrumental i acapella. Czeskie tłoczenie, kolorowa okładka. Pierwsza polska płyta winylowa z polskim HipHopem. Nakład 100 sztuk!',5,'','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,767),(358,'Armagedon',3,0,'2005-09-28 22:50:41','0000-00-00 00:00:00',0,NULL,124,'1998-00-00','',7,'www_hhbd_pl_molesta_ewenement-armagedon_(1998-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1977),(359,'Dobre Życie',3,0,'2005-09-28 23:15:40','0000-00-00 00:00:00',0,NULL,828,'2005-00-00','',27,'www_hhbd_pl_rudy_mrw-dobre_zycie_(2005-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','SDCD002','',NULL,1069),(360,'Ninja Comanndo 5',3,3,'2005-09-29 22:58:29','2006-06-20 20:33:18',0,NULL,925,'1998-00-00','',24,'www_hhbd_pl_nagly_atak_spawacza-ninja_comanndo_5_(1998-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,661),(361,'Brat Juzef',3,3,'2005-09-29 23:16:59','2005-09-29 23:17:34',0,NULL,925,'1996-00-00','',46,'www_hhbd_pl_nagly_atak_spawacza-brat_juzef_(1996-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','009-2','',NULL,705),(362,'Psychedryna 97',3,3,'2005-09-29 23:35:41','2006-06-20 20:30:04',0,NULL,925,'1997-00-00','',24,'www_hhbd_pl_nagly_atak_spawacza-psychedryna_97_(1997-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,2377),(363,'Wielka niewiadoma',3,0,'2005-09-29 23:46:02','0000-00-00 00:00:00',0,NULL,128,'2000-00-00','',24,'www_hhbd_pl_17-wielka_niewiadoma_(2000-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,714),(364,'Historie z sąsiedztwa',1,1,'2005-09-30 19:49:02','2005-10-20 11:17:38',0,NULL,455,'2005-10-15','Po 5 latach <a href=\"/n/pezet\">Pezet</a> i <a href=\"/n/onar\">Onar</a>, z dużym dorobkiem solowym jak i związanym z innymi projektami powracają na rynek wydawniczy jako duet! Najnowszy album już 15 października powinien być dostępny w sklepach w całej Polsce. Za warstwe tesktową odpowiedzialni są w całości <a href=\"/n/pezet\">Pezet</a> i <a href=\"/n/onar\">Onar</a>, goście wystąpili tylko w refrenach.<br />\r\nPierwszym teledyskiem promującym płytę będie \'Odwaga\', który już niedługo będziecie mogli oglądać w TV.<br />\r\nPłyta została wydana sumptem Konkret Promo oraz firmy Dobre Ziomy, założonej przez samego Pezeta i Onara już pierwszego dnia mogła się poszczycić sprzedażą na poziomie 3000 egzemplarzy!!! W ciągu pierwszego tygodnia liczba ta wzrosła do 10 tysięcy! Jest to niewątpliwy sukces <a href=\"/n/Plomien_81\">Płomienia 81</a>. Fani nie zawiedli.',26,'www_hhbd_pl_plomien_81-historie_z_sasiedztwa_(2005-10-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','październik 2005',NULL,1881),(365,'Klubing',3,0,'2005-09-30 22:24:33','0000-00-00 00:00:00',0,NULL,697,'2003-00-00','',27,'www_hhbd_pl_onar_i_o$ka-klubing_(2003-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,661),(366,'Obóz Ta',3,0,'2005-09-30 22:34:17','0000-00-00 00:00:00',0,NULL,788,'2000-00-00','',17,'www_hhbd_pl_oboz_ta-oboz_ta_(2000-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,950),(367,'Kocham