:12',0,NULL,77,'2005-11-29','W Witrynach Odbicia \"życie na kredycie\" - Głównym autorem koncepcji tego albumu jest Jędker, który dobierał gości, producentów i tematy kawałków, oraz Deszczu Strugi, który dołożył najwyższej klasy skrecze i cuty. Sokół naturalnie także pojawia się na płycie i znakomicie uzupełnia skład. Gościnnie na tej płycie występują: Pono i Jaźwa z ZIP Składu, Bastek i Foster z PCP, Włodi, Soundkail, Black E-Starr, Toma, Orion, Kontrafakt, śpiewająca Iza Puk oraz znany z telewizji lektor Tomasz Knapik. Produkcją bitów zajęli się: Jędker, L.A.B.Z., Zoober Slimm, Bastek, The Horsemen, Sidney Polak, żusto i DJ Wich.',2,'www_hhbd_pl_wwo-zycie_na_kredycie_(2005-11-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','PRS031','',NULL,9904),(377,'Witam was w rzeczywistości',3,3,'2005-10-13 00:04:16','2005-11-25 23:42:54',0,NULL,77,'2005-11-29','W Wyjątkowych Okolicznościach \"Witam was w rzeczywistości\" - Album, na którym tematy, gości i bity organizował Sokół, a Deszczu zajął się wykończeniem całości dokładając niepowtarzalne dźwięki z gramofonów. Jędker oczywiście również obecny jest na tym krążku z idealnym wyczuciem tematu. Jako goście na płycie pojawiają się: Małolat, Juras, Koras, Proceder, Firma, Intouchable, Wilku, Pono, Bilon, Mercedresu, Kali, ZIP Skład oraz ks. Rafał Praski. W jednym kawałku śpiewa Iza Puk. Bity na ten album wyprodukowali: Uraz, Shuko, Beathoavenz, White House, Emade, Zoober Slimm, Korzeń i Sokół, The Horsemen, Kuba O. ',2,'www_hhbd_pl_wwo-witam_was_w_rzeczywistosci_(2005-11-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','PRS032  ','',NULL,9159),(378,'Kodex 3: Wyrok',3,3,'2005-10-13 22:23:20','2008-01-01 13:23:19',0,NULL,53,'2007-10-08','',13,'www_hhbd_pl_white_house-kodex_3__wyrok_(2007-05-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,6066),(379,'Rewolucje',7,1,'2005-10-14 12:28:33','2005-10-14 12:51:05',0,NULL,1043,'2005-06-18','Ta płyta to przede wszystkim mieszanka żywego, jamajskiego grania z syntetycznymi brzmieniami. Jest tu spora dawka hip-hopu, trochę jazzu, ale w większości słychać inspiracje szeroko pojętą muzyką dancehall. Ponadto coraz śmielsze eksperymenty z muzyką dub i drum&#8217;n&#8217;base. Jednak głównym motorem napędowym tego projektu są słowa. Często bardzo osobiste, odbiegające momentami od jamajskiej stylistyki, nadają Jamalowi głębszego, artystycznego charakteru. <br /><br />\r\nAlbum promuje utwór \"Tubaka\" (premiera singla 23 maja). Jest to jedna z najnowszych produkcji, która ostateczną formę osiągnęła podczas końcowego etapu prac nad materiałem muzycznym. Nawiązuje do stylistyki dynamicznego raggamuffin, osadzonego w mocnym, syntetycznym brzmieniu. Tekstowo jest to pewnego rodzaju bunt na konsumpcyjny styl życia, pokazywanie jego negatywnych stron i namawianie do własnej, wewnętrznej rewolucji. <br /><br />\r\nDo utworu \"Tubaka\" powstaje animowany teledysk w reżyserii Michała śledzia śledzińskiego, rysownika serii komiksowej \"Osiedle Swoboda\". ',7,'www_hhbd_pl_jamal-rewolucje_(2005-05-23).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','0946 3 30135 2 0','',NULL,884),(380,'21 listopada',3,3,'2005-10-15 23:30:09','2006-02-23 14:10:54',0,NULL,709,'2005-11-21','',12,'www_hhbd_pl_verba-21_listopada_(2005-11-21).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','UMC 036','',NULL,3348),(381,'Neurofotoreceptoreplotyka jako magia bytu',3,3,'2005-10-15 23:52:14','2006-02-16 15:24:25',0,NULL,882,'2005-10-21','',27,'www_hhbd_pl_kanal_audytywny-neurofotoreceptoreplotyka_jako_magia_bytu_(2005-12-30).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','Jeszcze w 2005',NULL,755),(382,'(brak tytu?u)',1,3,'2005-10-17 10:41:46','2008-12-03 13:42:25',0,NULL,1194,'2009-12-29','',27,'','image/jpeg',NULL,'2009-06-13 00:02:32','','jeszcze nie ustalona',NULL,927),(383,'Wu-Wei',3,0,'2005-10-19 23:19:54','0000-00-00 00:00:00',0,NULL,360,'2005-10-24','',12,'www_hhbd_pl_banach_piotr-wu-wei_(2005-10-24).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,804),(384,'Mixtape 2005