2;u. Jest to dzie&#322;o samo w sobie zupe&#322;ne i zamkni&#281;te. Brak sampli powoduje, &#380;e muzyk&#281; z \"Siódemki\" trudno b&#281;dzie uto&#380;samia&#263; ze znanymi jazzowymi inspiracjami Ostrego, jednak mimo pos&#322;ugiwania si&#281; wspó&#322;czesn&#261; elektronik&#261; Ostry zachowa&#322; na p&#322;ycie funkow&#261; konwencj&#281; lat 70\'ych i na tym w&#322;a&#347;nie polega oryginalno&#347;&#263; nowego albumu - zarówno na tle jego pierwszych dwóch p&#322;yt jak i (jak&#380;e odmiennych) dwóch ostatnich albumów \"jazzowych\". Pod wzgl&#281;dem tekstowym \"7\" to concept album. To przejrzysta opowie&#347;&#263; o &#380;yciu Ostrego, jego kolegów oraz o &#347;wiecie, jaki ich otacza. Zwarty storytelling oparty jest na prze&#380;yciach typowego polskiego dwudziestokilkulatka, który w&#322;a&#347;nie tak naprawd&#281; wydoro&#347;la&#322; i musi upora&#263; si&#281; zarówno z obci&#261;&#380;eniami jakie le&#380;&#261; na nim za spraw&#261; starego systemu jak i z barierami jakie stawia przed nim nowy system Go&#347;cinnie na albumie wyst&#281;puj&#261;: <a href=\"/n/dj_haem\">DJ Haem</a>, który po raz kolejny osi&#261;gn&#261;&#322; top krajowych mo&#380;liwo&#347;ci, Tame One z kultowego dla cz&#281;&#347;ci s&#322;uchaczy Hiphopu zespo&#322;u The Artifacts, grupa Skill Mega (angielscy przyjaciele Ostrego) oraz <a href=\"/n/Kochan\">Kochan</a>, <a href=\"/n/zeus\">Zeus</a> i <a href=\"/n/hryta\">Hryta</a>.',5,'www_hhbd_pl_o_s_t_r_-7_(2006-02-24).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-C49','',NULL,1752),(390,'Piątek 13',3,3,'2005-11-27 22:42:41','2006-10-12 17:51:19',0,NULL,168,'2006-10-13','',5,'www_hhbd_pl_tworzywo_sztuczne-piatek_13_(2006-10-13).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','AR-','Wrzesień 2006',NULL,702),(391,'Indywidualnie',3,1,'2005-11-28 10:58:54','2005-11-29 16:12:15',0,NULL,552,'2005-12-06','Pierwszy legalny album krakowskiego rapera Aury.',49,'www_hhbd_pl_aura-indywidualnie_(2005-12-06).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,909),(392,'Podróże',3,3,'2005-12-04 00:32:34','2007-11-06 00:33:08',0,NULL,238,'2007-11-23','',27,'www_hhbd_pl_grammatik-podro_e_(2007-11-23).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1158),(393,'Człowiek który chciał ukraść alfabet',3,3,'2005-12-04 00:32:36','2006-05-14 09:56:04',0,NULL,1241,'2006-05-15','',50,'www_hhbd_pl_eldo_bitnix-czlowiek_ktory_ukradl_alfabet_(2006-05-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1650),(394,'Proceder',3,3,'2005-12-05 21:32:54','2009-06-09 18:58:20',0,NULL,54,'2009-06-19','',27,'','image/jpeg',NULL,'2009-06-13 00:02:32','','2009',NULL,309),(395,'Na Linii Ognia',3,3,'2005-12-05 21:40:15','2006-06-22 08:51:50',0,NULL,1242,'2006-06-29','',17,'www_hhbd_pl_skazani_na_sukcezz-na_linii_ognia_(2006-06-29).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1754),(396,'(brak tytułu)',3,3,'2005-12-08 23:54:07','2008-12-29 23:24:54',0,NULL,985,'2009-12-29','',2,'','image/jpeg',NULL,'2009-06-13 00:02:32','','brak informacji',NULL,105),(397,'Nowa jakość',3,0,'2005-12-09 17:11:54','0000-00-00 00:00:00',0,NULL,1243,'2005-12-15','',34,'www_hhbd_pl_massey-nowa_jakosc_(2005-12-15).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,821),(398,'Warszawska Opowiesc',3,3,'2005-12-11 22:52:51','2008-05-09 16:48:00',0,NULL,1251,'2008-05-14','',43,'','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,698),(399,'EP',3,3,'2005-12-11 22:53:30','2005-12-11 23:30:42',0,NULL,1251,'2005-00-00','Projekt \"W czerni i w bieli EP\" pojawił się w sklepach i internecie w postaci ekskluzywnej płyty winylowej o ograniczonym nakładzie. Zamieszczono na niej wybrane utwory przy realizacji których brali udział między innymi: Jano, Pyskaty, Lady K, Dwaku, Paniecopan, Scoop, Dezinte, Fajfun, Młody Biały, Piotrek Pacak... reszta składu jest owiana tajemnicą aż do stycznia 2006 kiedy to na półkach sklepowych znajdziecie \"W czerni i w bieli LP\", czyli kilkanaście numerów pełnego składu.<br />\r\n<br />\r\n\"Fifti-Fifti\" nie przewiduje wydania kompaktowego dla EP, natomiast słuchacze nie posiadający gramofonów będą mięli możliwość zakupu płyty w formie elektronicznej (mp3) w atrakcyjnej cenie poprzez wybrane sklepy internetowe.',43,'www_hhbd_pl_w_czerni_i_w_bieli-ep_(2005-00-00)_(ep).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,986),(400,'(brak tytułu)',3,3,'2005-12-15 22:15:00','2008-10-11 00:05:19',0,NULL,1045,'2009-09-28','',27,'','image/jpeg',NULL,'2009-06-13 00:02:32','','rok 2007',NULL,401),(401,'Zacieram Ręce Dzieciak',3,3,'2006-02-16 15:15:21','2006-11-19 21:06:06',0,NULL,42,'2006-12-05','',17,'www_hhbd_pl_borixon-zacieram_rece_dzieciak_(2006-12-05).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,872),(402,'Bez Cięcia',3,3,'2006-02-16 15:43:39','2006-02-23 14:07:44',0,NULL,463,'2006-02-20','',12,'www_hhbd_pl_wisniowy-bez_ciecia_(2006-02-20).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','UMC 039','',NULL,1280),(403,'Klasyk',3,1,'2006-02-19 00:44:23','2006-03-14 14:57:04',0,NULL,1270,'2006-02-23','Bez Cenzury to druga obok <a href=\"/n/jwp\">JWP</a> formacja wydająca w wytwórni <a href=\"/l/embargonagrania\">Embargo</a> z tak zwanego nurtu \"Hip Hopu ulicznego\".<br />\r\nNagrania na płytę zostały zrealizowane w 2005 roku w studio Siwersa. Mixem i Masteringiem albumu zajął się <a href=\"/n/majki\">Majki</a> i <a href=\"/n/korzen\">Korzeń</a> (Studio Schron). Płytę wyprodukował niemal w całości <a href=\"/n/siwers\">Siwers</a>, lecz dodatkowo na płycie znalazły się beaty produkcji <a href=\"/n/dezmond\">Dezmonda</a>, <a href=\"/n/kuba_o\">Kuby O.</a> (JWP) oraz <a href=\"/n/lukson\">Luksona</a>.<br />\r\nPierwszoligowy rap i najwyższy poziom muzyczny uzupełniają w doskonały sposób skrecze czołowych polskich DJ\'i (<a href=\"/n/dj_panda\">DJ Panda</a>, <a href=\"/n/dj_mini\">DJ Mini</a>, <a href=\"/n/dj_technik\">DJ Technik</a>, <a href=\"/n/dj_ovca\">DJ Ovca</a>) oraz klimatyczne skity i pozdrowienia licznej grupy przyjaciół zespołu, artystów polskiej sceny Hip Hop.<br />\r\nAlbum Bez Cenzury to aż 22 tracki - 16 pełnych utworów, 4 skity, intro i outro, które w połączeniu ze sobą tworzą niepowtarzalny i spójny charakter płyty. Płyta \"Klasyk\" to pozycja obowiązkowa każdego fana bezkompromisowego, autentycznego Hip Hopu, niosącego przekaz.',14,'www_hhbd_pl_bez_cenzury-klasyk_(2006-02-23).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','PIS0034','',NULL,1109),(404,'Eudaimonia',3,3,'2006-02-21 16:17:32','2006-11-19 21:35:39',0,NULL,672,'2006-10-16','',12,'','image/jpeg',NULL,'2009-06-13 00:02:32','','2006',NULL,461),(405,'Co Złego To Nie My',3,3,'2006-02-23 14:31:55','2006-03-14 00:12:53',0,NULL,56,'2006-03-13','Najnowszy album warszawskiego składu z Bemowa to kilkanaście rewelacyjnych utworów, na których prócz wielkiej trójki usłyszeć będzie można pięknie śpiewające i wyglądające <a href=\"/n/a2a\">A2A</a> i <a href=\"/n/iza\">Izę</a> oraz <a href=\"/n/Uelot\">Uelote</a> z KTWDK, Sony, <a href=\"/n/1z2\">1z2</a>, <a href=\"/n/fenomen\">Fenomen</a>, EroJwp, <a href=\"/n/chada\">Chadę</a>, <a href=\"/n/pih\">Piha</a>. Dodatkowym atutem tego albumu jest to, że na &#8220;Co złego to nie my&#8221; za gramofonami dołącza<a href=\"/n/Dj_Onetouch\">Dj One Touch</a> . Całość tworzy więc wybuchową mieszankę hip hopu, która będzie tegoroczną rewelacją na rynku muzycznym..<br /><br /><br />\r\n',26,'www_hhbd_pl_myniemy-co_zlego_to_nie_my_(2006-03-13).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1399),(406,'2+2=7',3,3,'2006-02-24 16:06:28','2006-03-26 13:14:55',0,NULL,34,'2006-04-03','3 kwietnia nakładem <a href=\"/l/camey_studio\">Camey Studio</a> ukaże się drugi album warszawskiego zespołu <a href=\"/n/7_lez\">Siedem Łez</a> \"2+2=7\". Materiał przygotowywany był od ponad dwóch lat, co pozwoliło na maksymalne dopracowanie materiału. Klimat płyty znacznie różni się od wydanych do tej pory w Polsce płyt hip-hopowych i myślę, że dla wielu będzie zaskoczeniem. Na krążku znajdzie się dziewiętnaście pozycji, do których muzykę wyprodukował <a href=\"/n/rzensa\">Rzensa</a>. Wśród gości na znajdują się między innymi: <a href=\"/n/mes\">Mes</a>, <a href=\"/n/juchas\">Juchas</a>, <a href=\"/n/zolf\">Żółw</a> (<a href=\"/n/fenomen\">Fenomen</a>), <a href=\"/n/proceente\">Proceente</a> i inni. Płyta \"2+2=7\" jest zwieńczeniem długoletniej działalności zespołu.<br /><br /><br />\r\nSami wykonawcy o płycie mówią:<br /><br /><br />\r\n<strong>TEKTYW</strong> - Płyta mówiąca z sensem o bezsensownej sytuacji w hiphopie... tragikomedia nie pozbawiona ciekawej oraz różnorodnej tematyki owianej humorem przedstawionym w błyskotliwy sposób... bynajmniej nie zamułka i bynajmniej nie hiphopolo... uniwersalny twór czworga reprezentantów projektu <a href=\"/n/7_lez\">łez siedem</a>... sprawdź to a sam będziesz wiedział czy jesteśmy sezonowe gwiazdki czy ludzie, którzy robią coś ponadczasowego... z ironią i samokrytyką... Usłyszy ten, kto ma słyszeć...<br /><br /><br />\r\n<strong>RZENSA</strong> - To materiał, w który włożyliśmy sporo pracy i czasu. Wydajemy to, żeby miało możliwość trafienia do ludzi. Nie jest to kompilacja radiowych hitów, ani koncept album przedstawiający zawiłe historie&#8230; To porcja hip-hopu, w formie, w jakiej my go odbieramy. To przybliżona wizja tego co nam grało w duszy przez ostatnie lata.<br /><br /><br />\r\n<strong>SENN</strong> - Ta płyta jest zwieńczeniem naszej działalności jako Siedemłez. Zamyka i podsumowuje ośmioletni rozdział działalności projektu. Jej forma jest wypadkową naszych zainteresowań i inspiracji, stąd spory eklektyzm brzmieniowy i tematyczny. Każdy z uczestników przedsięwzięcia ma inne podejście to hip-hopu i muzyki w ogóle, co zaowocowało, mam nadzieję, ciekawym materiałem.<br /><br /><br />\r\n<strong>STOPA</strong> - Prace nad płytą 2+2=7 wspominam zajebiście, mimo że dużo się działo w tamtym czasie i dużo się pozmieniało. Długo czekaliśmy na wydanie tej płyty, ale opłaciło się czekać. Pamiętam, że nieraz rozmawialiśmy o tym, żeby ją wypuścić za friko na stronie, jednak doszliśmy do wniosku, żeby poczekać i dać ją na legalu. Moje ulubione kawałki to pierwsza wersja \"<a href=\"/s/skazany_na_zmiany\">Skazany na zmiany</a>\",  \"<a href=\"/s/to_nie_moj_swiat\">To nie mój świat</a>\", \"<a href=\"/s/anplagd\">Anplagd</a>\" i \"<a href=\"/s/miedzy_zlem_a_dobrem\">Między złem a dobrem</a>\". Dj-e zgrali nam zajebiste skrecze, fajowo się nagrywało z zaproszonymi gośćmi, zajebista atmosfera była podczas kręcenia klipu. Cały czas nagrywamy nowe kawałki, już niedługo w necie PROforma (projekt Pełny, Siwy, Stopa) oraz solowe płyty Tektywa i Słonia. Do usłyszenia.',17,'www_hhbd_pl_7_lez-2_2=7_(2006-03-26).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1428),(407,'(brak tytu?u)',3,3,'2006-03-06 20:14:40','2008-12-03 13:43:16',0,NULL,1290,'2009-12-28','',12,'','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,63),(408,'U CIEBIE W MIEśCIE 3',3,3,'2006-03-07 15:40:05','2006-05-29 15:22:35',0,NULL,190,'2006-05-18','',14,'www_hhbd_pl_v_a-u_ciebie_w_miescie_3_(2006-06-06).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','maj/czerwiec 2006',NULL,750),(409,'JuNouDet',3,3,'2006-03-10 15:52:36','2006-05-12 16:36:32',0,NULL,190,'2006-05-05','Kolejny po <a href=\"http://www.hhbd.pl/a/JuNouMi_vol_1\">JuNouMi 1</a>, <a href=\"http://www.hhbd.pl/a/JuNouMi_vol_2\">JuNouMi 2</a> i <a href=\"http://www.hhbd.pl/a/JuNouMi_vol_3\">JuNouMi 3</a> winyl spod znaku <a href=\"http://www.hhbd.pl/l/JuNouMi_Records\">JuNouMi Records</a>! Założenia projektu JuNouDet, podobnie jak poprzednio: jak zwykle tylko na winylu, niski nakład (200 sztuk), kolorowa okładka wykonana przez ZBIRa [vhs, kob, montana gold team, junoumi crew], utwory tylko na zamówienie.<br /><br /><br /><br /><br /><br /><br />\r\nTermin wydania był przekładany kilkukrotnie, najnowsze informacje wskazują na przełom marca i kwietna bieżącego roku.<br /><br /><br /><br /><br /><br /><br />\r\nNa płycię wystąpią: donGURALesko, Brudne Serca, Dizky, Numer Raz i Dj Zero, Jarosz KTR, Łona, BlaBla, 2cztery7, Eldo, Chlopaki z ferajny, Dinal, Lilu, Raprezentracja, Jezozwierz, Tymon, oraz dje: M-Easy, Feel-X, Kostek, Eprom, Romek, Haem, Twister.',19,'www_hhbd_pl_v_a-junoudet_(2006-05-07).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','marzec/kwiecien 2006',NULL,3836),(411,'Znasz zasady',1,0,'2006-03-21 12:21:47','0000-00-00 00:00:00',0,NULL,190,'1998-00-00','Jest to druga składanka wydana przez RRX.',24,'www_hhbd_pl_v_a-znasz_zasady_(1998-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,727),(412,'Wspólna scena',1,0,'2006-03-21 12:38:51','0000-00-00 00:00:00',0,NULL,190,'1997-00-00','Pierwsza składanka wytwórni RRX. Na płycie 16 hip-hopowych numerów. Składankę promował (o ile w tamtych czasach można było mówić o promocji) teledysk do utworu \"Wspólna scena\", w którym rapowali: <a href=\"/n/Wzgorze_Ya_Pa_3\">Wzgórze Yapa 3</a>, <a href=\"/n/born_juices\">Born Juices</a>, <a href=\"/n/zeke\">Zeke</a>, <a href=\"/n/tede\">TDF</a>, <a href=\"/n/radoskor\">Radoskór</a> oraz <a href=\"/n/dziki\">Dziki</a>.\r\nNa całej płycie w wielu numerach słychać połączone siły różnych raperów - co udowadnia, że \"Wspólna Scena\" naprawdę ma miejsce.',24,'www_hhbd_pl_v_a-wspolna_scena_(1997-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1010),(413,'S.P.',1,0,'2006-03-21 13:09:15','0000-00-00 00:00:00',0,NULL,190,'1996-00-00','Pierwsza składanka wytwórni S.P. Records. Na składance można usłyszeć pierwsze wersje utworów m. in. Kalibra i Wzgórza YaPa 3, które potem znalazły się na ich płytach.\r\nNa płycie znajduje się równierz utwór zespołu Funk Jello, będący parodią <a href=\"/s/scyzoryk\">Scyzoryka</a>\", oraz nagrany przez VOLTa kawałek \"Wyłącz Mikrofon\" zespołu 1kHZ, możemy w nim usłyszeć młodego Tasa z <a href=\"/n/trzyha\">3H</a>.',4,'www_hhbd_pl_v_a-s_p__(1996-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,666),(414,'Hip-Hopla',1,0,'2006-03-21 13:19:51','0000-00-00 00:00:00',0,NULL,190,'1997-00-00','Druga składanka wytwórni S.P. Records. Nie jest w całości hip-hopowa, ponieważ obok wykonawców stricte hip-hopowych występują inni twórcy wydający dla S.P. Records. Na płycie obok znanych już wykonawców jak <a href=\"/n/kaliber_44\">Kaliber 44</a> czy <a href=\"/n/wzgorze_ya_pa_3\">Wzgórze Yapa3</a> występują nowe składy, m. in: <a href=\"/n/veto\">V.E.T.O</a>. To mocna pozycja na ówczesnym rynku wydawnictw gatunku hip-hop.',4,'www_hhbd_pl_v_a-hip-hopla_(1997-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','S.P. 38/97/2','',NULL,1466),(415,'Prosto z ulicy',1,0,'2006-03-21 13:37:49','0000-00-00 00:00:00',0,NULL,1294,'1997-00-00','W skład Born Juices wchodzą Mleko, Malik, Bitter oraz DJ Crazy, grają od kilku lat gangsta-rap, czego również można posłuchać na tej płycie. Sami swój styl określają jako bandycki, ponieważ w Polsce nie ma gangsterów, tylko bandyci. Także mamy na płycie bandycki hip-hop osadzony w realiach życia w Polsce.',24,'www_hhbd_pl_born_juices-prosto_z_ulicy_(1997-00-00).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,804),(416,'Oryginał',3,3,'2006-03-22 20:40:03','2006-06-22 08:50:59',0,NULL,1304,'2006-06-26','',34,'www_hhbd_pl_ceha-oryginal_(2006-05-19).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,796),(417,'Inni Niż Wszyscy',3,3,'2006-03-24 15:46:47','2006-04-26 17:01:09',0,NULL,82,'2006-05-08','24 kwietnia 2006 ukaże się długo oczekiwany album zespołu Trzeci Wymiar. Płyta nosi tytuł &#8222;Inni Niż Wszyscy&#8221; a materiał na niej zawarty na pewno zaskoczy wszystkich. Jednocześnie możemy śmiało powiedzieć, że podniesie baaaardzo wysoko poprzeczkę w polskim hip hopie. Artyści pracując nad albumem ponad rok, stworzyli materiał, który już dziś możemy śmiało powiedzieć, zostanie na długo zapamiętany. To Dolnośląski Hip Hop na wysokim poziomie umiejscowiony w klimacie klasycznego Hip Hopu lat 90tych w Stanach. Produkcją płyty zajęło się czterech bardzo dobrych producentów z Dolnego śląska: Dj Sph, Creon, Laska i Magiera(WhiteHouse). Wśród gości usłyszymy pozostałych przedstawicieli KASTY takich jak: Wall-E, Gural, Esse, One Man Army oraz dolnośląską Puentę. Cała idea płyty jest ukierunkowana na promowanie charakterystycznego dla tego regionu Polski Hip Hopu. Niebawem będzie gotowy klip promujący płytę pod tytułem \"Wuuuf-6 Styli\" z gościnnym udziałem: Wall-E, Esse, Gural.',17,'www_hhbd_pl_trzeci_wymiar-inni_niz_wszyscy_(2006-04-24).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,870),(418,'Kwiaty Zla',3,3,'2006-03-24 15:47:48','2009-01-30 12:33:35',0,NULL,55,'2008-12-22','',57,'www_hhbd_pl_pih-kwiaty_zla_(2008-12-11).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,1167),(419,'Talent',3,3,'2006-03-24 15:50:32','2008-10-12 09:10:22',0,NULL,218,'2009-01-22','',17,'www_hhbd_pl_teka-talent_(2009-01-22).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,931),(420,'Nigdy nie mów nigdy',3,3,'2006-03-26 13:05:50','2006-11-19 22:08:09',0,NULL,124,'2006-10-23','',26,'www_hhbd_pl_molesta-(brak_tytulu_)_(2006-12-11).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','FCD226-2','listopad 2006',NULL,1099),(421,'Miraż',1,0,'2006-03-27 19:24:40','0000-00-00 00:00:00',0,NULL,1077,'2006-04-03','Projektor i Straho instrumentals, zapowiada się debiut roku 2006!',52,'www_hhbd_pl_projektor-miraz_(2006-04-03).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,2023),(422,'HIPHOPSTACJA 3',3,3,'2006-03-30 16:56:54','2006-04-17 11:25:51',0,NULL,190,'2006-04-06','Hiphopstacja 3 to już trzecia z serii kompilacji firmowanych i promowanych przez &#8222;Radiostacje&#8221;. Album składa się z płyty CD, zawierającej 17 starannie dobranych utworów, głównie singli, które stały się przebojami i były istotne dla rozwoju polskiej muzyki miejskiej w tanim czasie. &#8221;Hiphopstacja 3&#8221; to przekrój najlepszych utworów pochodzących z albumów wydanych w 2005 i 2006 roku przez przodujące w tym gatunku wytwórnie i tabele fonograficzne, miedzy innymi: EMi, Embargo Nagrania, Prosto, T1-teraz, Warner i Wielkie Joł.',14,'www_hhbd_pl_v_a-hiphopstacja_3_(2006-04-06).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,880),(423,'Tak to widzę...',3,3,'2006-04-17 23:49:52','2006-06-12 18:16:41',0,NULL,45,'2006-06-12','Po czterech latach Pono powraca z kolejnym solowym projektem. Prosto wydaje jego nowy album \"Tak to widzę\" na początku czerwca. Pono (ZIP Skład, Zipera) to raper obecny na polskiej scenie od jej początków. Zaczynał z Sokołem (ZIP Skład, WWO) jako TPWC. Razem wystąpili w 1997 roku podczas imprezy Rap Day, supportując przed koncertem Run DMC. Ich utwory pojawiły się na składankach DJ-a 600 Volt. Później mieliśmy okazję usłyszeć Pono na płycie \"Chleb powszedni\" ZIP Składu (1999). W następnych latach Pono nagrał 2 albumy z Ziperą: \"O.N.F.R.\" (2000) i \"Druga strona medalu\" (2004). W 2002 roku Pono zrealizował swój solowy projekt. Był to \"Hołd\" - pierwszy album wydany przez wytwórnię Prosto. Na tej płycie znalazły się klasyczne już utwory jak \"Nieśmiertelna nawijka ZIP Składowa\" czy \"Tabu\" \"temat zakazany\". 15 maja w sklepach pojawi się singiel handlowy \"Robię, co chcę\", promujący najnowszy album Pono. Zawiera on utwór singlowy w wersji oryginalnej i radiowej oraz w remiksie Korzenia, a także skit wyprodukowany przez Jędkera oraz kawałek \"Robię swoje\", w którym oprócz Pono usłyszymy Korasa i Freda. Album Pono \"Tak to widzę\" to 15 kawałków z gościnnym udziałem Korasa (ZIP Skład, Zipera), Bilona i Wilka (Hemp Gru), Erosa (JWP, PCP, Bez Cenzury), oraz śpiewających: Waca, Ani i Pauliny. Najważniejszym producentem albumu jest Fred - debiutant. Ale na płycie usłyszymy też bity spod ręki Waca, Jędkera, Korzenia i Diesa.',2,'www_hhbd_pl_pono-tak_to_widze____(2006-05-22).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','Czerwiec',NULL,1266),(424,'Brak informacji',3,3,'2006-04-26 17:04:27','2008-12-26 00:47:46',0,NULL,1346,'2009-12-26','',27,'','image/jpeg',NULL,'2009-06-13 00:02:32','','Brak informacji',NULL,913),(425,'Brak informacji',3,3,'2006-04-26 17:08:23','2009-04-29 18:01:27',0,NULL,13,'2009-12-30','',3,'','image/jpeg',NULL,'2009-06-13 00:02:32','','Brak informacji',NULL,24),(426,'Brak informacji',3,3,'2006-04-26 17:09:19','2008-12-03 13:45:38',0,NULL,483,'2009-06-22','',2,'','image/jpeg',NULL,'2009-06-13 00:02:32','','Brak informacji',NULL,22),(427,'Numer Jeden Wróg Publiczny',3,3,'2006-04-26 17:10:21','2007-11-05 23:51:29',0,NULL,363,'2007-10-05','',14,'www_hhbd_pl_jwp-numer_jeden_wrog_publiczny_(2007-10-05).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','','',NULL,378),(428,'Fturując',3,3,'2006-04-29 14:28:28','2006-04-29 14:32:59',0,NULL,102,'2006-05-02','Futrując to kolejny album w dorobku Peji. Tym razem jest to płyta zawierająca takie najlepsze utwory Peji nagrane w towarzystwie innych artystów jak Zło w duecie z Wojasem, czy Jest taki dzień wspólne nagranie z zespołem Sweet Nosie. Nie zabrakło tutaj także takich przebojów jak Mój rap moja rzeczywistość, Pogoda dla bogaczy, Każdego dnia, czy Ile jeszcze. Dodatkową atrakcją tego wydawnictwa są cztery nigdy niepublikowane kawałki: Dzień zagłady, No to co by było gdyby/RMX Decs, No to co by było gdyby/RMX szuja i Klasyczna Fuzja. Album ukazuje się też w wersji limitowanej zawierającej dodatkową płytę DVD z teledyskami.<br />\r\n',26,'www_hhbd_pl_peja-fturujac_(2006-05-02).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','FCD212-2','',NULL,1189),(429,'Robię co chcę',0,3,'2006-05-20 09:29:45','2006-06-12 18:18:49',0,NULL,45,'2006-05-15','Singiel promujący drugą solówkę Pono \"Tak to widzę\". Na płytce 4 wersje utworu singlowego \"Pierdolę to\": oryginalna, ocenzurowana i 2 remiksy (Korzenia i Jędkera). Do tego kawałek \"Robię swoje\" z Korasem i Fredem. Całość zmiksowana przez Waca.',2,'www_hhbd_pl_pono-robie_co_chce_(2006-05-22).jpg','image/jpeg',NULL,'2009-06-13 00:02:32','PRS035-2','',NULL,510),(430,'Łza wyobraźni',0,0,'2006-05-27 20:22:24','0000-00-00 00:00:00',0,NULL,890,'1997-00-00','',4,'www_hhbd_pl_3-x-klan-lza_wyobrazni_(1997-00-00)_(ep).jpg','image/jpeg',NULL,'2