INSERT INTO `artists` VALUES (1,'Fokus','Wojciech Alszer','','2004-06-05 00:46:09','2004-11-02 00:07:43','','www_hhbd_pl_Fokus_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,2900,100,NULL,'oficjalna strona pokahontaz',''),(2,'Magik','Piotr Łuszcz','','2004-06-05 00:56:19','2005-11-28 21:41:53','Urodził się w biednej rodzinie robotniczej, jego ojciec pracował w hucie, matka była sprzątaczką. Hip-hopem zainteresował się w roku 1990. Na początku rapował na podwórku z Abra DaBem, a podkłady do swoich tekstów tworzył na amidze 500.\r\n\r\nW 1992 roku powstała grupa Kaliber 44, w skład której wchodzili Magik, Dab i Joka (brat Daba). Po wydaniu jednego singla w 1996 roku ukazał się pierwszy album zespołu, Księga tajemnicza &#8211; prolog. Była to druga, po Wzgórzu Yapa 3, kapela z żywym scratchingiem. Płyta ta wyróżniała się na tle innych hiphopowych produkcji specyficznym stylem, który sami twórcy nazwali magia i miecz. Styl nazywano również hardcorepsychorapem. Pierwsza płytę zespoły cechowały oryginalne, mroczne brzmienia i psychodeliczne teksty. Dużą popularność z tego krążka zdobył solowy kawałek Magika Plus i minus, który traktował o obawach przed wirusem HIV. Do utworu nakręcono teledysk. Przy kolejnym albumie, W 63 minuty dookoła świata, który ukazał się w 1998 roku, zespół zrezygnował z psychodelicznego stylu na rzecz luźniejszej zabawy słowem. Na tej płycie Magik nie udzielał się już tak dużo jak na poprzedniej (nie nagrał ani jednego solowego utworu). Jednak mimo to popisał się wieloma dobrymi zwrotkami, na przykład tą z piosenki Film.\r\n\r\nPo wydaniu płyty Magik odszedł z zespołu. Magik, Dab i Joka nigdy oficjalnie nie powiedzieli dlaczego. Wokół tej sprawy narosło wiele plotek, jednak żadnej z nich nie można do końca potwierdzić. Jedyną wskazówką pozostaje nagrany przez Piotrka kawałek Nowiny, który zadedykował między innymi Dabowi i Joce.\r\n\r\nNiedługo później Magik założył Paktofonikę, w skład której wchodzili także Fokus i Rahim. Po dwóch latach współpracy, w 19 grudnia 2000 roku, wydali płytę Kinematografia. Tydzień po tym wydarzeniu, 26 grudnia o godzinie 6.15, Magik popełnił samobójstwo. Podobnie jak w przypadku odejścia z Kalibra 44, motywy nie są jasne. Krążyły opinie, że miał problemy z narkotykami, wielką niechęć do służby wojskowej, jaką Magik miał odbyć, bądź schizofrenię. Zmarł w wieku dwudziestu dwóch lat, pozostawiając żonę i trzyletniego syna, Filipa.\r\n\r\nPółtora roku później Paktofonika wydała płytę Archiwum kinematografii, na której zamieszczono m.in. nagrania z udziałem Magika, które nie znalazły się na Kinematografii. 23 marca 2003 w katowickim Spodku odbył się pożegnalny koncert Paktofoniki, po którym Fokus i Rahim ogłosili rozwiązanie grupy (zespół przekształcił się w Pokahontaz, do Fokusa i Rahima dołączył jeszcze DJ Bambus).\r\n<i>źródło: www.wikipedia.org</i>','www_hhbd_pl_Magik_1.jpg','image/jpg',NULL,NULL,'','1978-01-18','2000-12-26',1,'',1,1,3593,100,NULL,'',''),(3,'Rahim','Sebastian Salbert','','2004-06-05 00:58:39','2004-11-02 00:07:55','','www_hhbd_pl_Rahim_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,2744,100,NULL,'M.Grochowina','http://sfotografuj.to.pl'),(4,'O.S.T.R.','Adam Ostrowski','http://asfalt.pl/ostr.html','2004-06-05 01:02:40','2008-02-22 15:59:36','OSTR pierwsze własne próby z HipHopem rozpoczął w 1993 r. - wtedy jeszcze przy pomocy domowego radiomagnetofonu \"Kasprzak\". Nie był to jednak jego pierwszy kontakt z muzyką - od dziecka jego hobby to gra na skrzypcach. Aktualnie jest studentem II roku Akademii Muzycznejw Łodzi i laureatem kilku renomowanych konkursów. Poważniejsze nagrywki zaczęły się w 1995 r. w ramach grupy BDC, która w 1998 r. przeformowała się w LWC (OSTR, Ahmed, Mussi, Celo, Kasina), by w następnym roku zawiesić działalność w wyniku działania tak zwanych sił wyższych. OSTR działał dalej solo, a także ze swymi kolegami w ramach projektu Obozu TA.<BR>OSTR jest niezwykle żywiołowy na koncertach, nie ogranicza się do żelaznego repertuaru kilku utworów, w Łodzi (i nie tylko) znane są jego doskonałe parodie najbardziej charakterystycznych, polskich emce. Ma powszechną opinię najlepszego polskiego freestyle\'owca. W lutym 2001 podpisał umowę z Asfalt na wydanie solowej, przez siebie wyprodukowanej płyty. Debiut \"Masz to jak w banku\" ukazał się w październiku tego samego roku poprzedzony singlem i teledyskiem \"Ile jestem w stanie dać\". Płyta okrzyknięta została odkryciem i spotkała się z samymi pozytywnymi ocenami (cztery i pół płyty w \"Klanie\"). Po wydaniu albumu OSTR rozpoczął imponującą trasę koncertową oraz podjął pierwsze przymiarki do produkcji następnego albumu.<BR>7/12 OSTR spotkał się po raz pierwszy na wspólnym koncercie z Tede, wynikiem tego clashu osobowości nie był jednak kolejny battle/beef lecz rozpoczęcie trwającej do dzisiaj ścisłej współpracy między tymi dwoma artystami. Na bazie zapotrzebowania wywołanego entuzjastyczną recenzją w piśmie \"Playa\", w kwietniu 2002 r. opublikowany został w Asfalt Records mixtape freestyle\'owy Ostrego, nagrany przez niego w domowych warunkach dwa lata wcześniej. Oficjalne wydanie tego zremasterowanego materiału (100% freestyle) utwierdziło pozycję OSTR jako najlepszego freestyle\'owca w Polsce.<BR>Wreszcie pod koniec czerwca do sklepów trafia drugi studyjny album: \"Tabasko\". Tym razem OSTR nie prezentuje tak różnorodnego stylu jak na debiucie, ale za to wyraźnie podnosi jeszcze wyżej swe zdolności raperskie i producenckie. Wydarzeniem na płycie jest doskonały i robiący silne wrażenie wspólny kawałek OSTR i Tedego pt. \"Ziom za ziomem\". 27 października 2002 r. O.S.T.R. bierze udział w wielkim koncercie \"Dzień Kotana\" na Placu Defilad w Warszawie (koncert ku pamięci traficznie zmarłego Marka Kotańskiego).<BR>W lutym 2003 r. album \"Tabasko\" zdobywa nominację do \"Fryderyka 2002\" w kategorii \"Album Roku - Hip-Hop\". W wakacje tego samego roku O.S.T.R. dostaje propozycje poprowadzenia od września nowego programu hiphopwego w MTV Polska. Będzie to polska edycja kultowego, legendarnego programu \"Yo! MTV Raps\", na którym wychował się O.S.T.R. i cała generacja polskich miłośników Hiphopu.<BR>W grudniu 2003 ukazał się jego trzeci, tym razem podwójny album \"Jazz w wolnych chwilach\". Na obie płyty wybrano 42 utwory z niemalże 100 nagranych w ciągu roku poprzedzającego premierę. W marcu 2004 Ostry (obok francuskiej grupy Soundkail i polskiej Zipery) został zaproszony przez miesięcznik \"Ślizg\" na 6 koncertową trasę \"Ślizgery 2003\", która była olbrzymim sukcesem frekwencyjnym w całej Polsce. Na ostatnim koncercie z tej trasy, 28/03 w w warszawskiej \"Stodole\" O.S.T.R. otrzymał dwa \"Ślizgery 2003\" - za najlepszy album roku (\"Jazz w wolnych chwilach\") oraz dla \"Osobowości roku 2003\".<BR>18 listopada 2004 ukazał się jego najnowszy, czwarty album \"Jazzurekcja\" będący kontynuacją serii jazzowych inspiracji zapoczątkowanych na poprzedniej płycie. Tym razem jednak O.S.T.R. sięga samego sufitu - nagrywając jedną z najlepszych pod każdym względem płyt w historii polskiego Hiphopu. W ramach promocji albumu pod patronatem \"Trojki\", 9/12/2004 w Studio im. Agnieszki Osieckiej odbył się specjalny, retransmitowany na całą Polskę, koncert O.S.T.R. z udziałem \"żywych\" muzyków grupy Sofa w składzie: Adam Staszewski (bas), Tomasz Organek (gitara), Bartek Staszkiewicz (klawisze), Michał Bryndal (perkusja) oraz Kasia Kurzawska (wokal). A już na kwiecień przyszłego roku planowany jest wspólny album z Emade jako \"P.O.E. - Projekt Ostry Emade\").','www_hhbd_pl_O_S_T_R__1.jpg','image/jpg',NULL,NULL,'<a href=\"\">www.megafonpromo.com</a><BR>\r\nbooking:<BR>\r\n<a href=\"\">tytus@asfalt.pl</a><BR>\r\n502 313 300<BR>\r\n','0000-00-00','0000-00-00',1,'gra na skrzypcach',4,3,6089,100,NULL,'Asfalt Records','http://www.asfalt.pl'),(5,'Paktofonika','','','2004-06-13 12:06:14','2005-10-17 02:09:59','W 1998 Magik - <a href=\"/n/kaliber_44\">Kaliber 44</a> opuszcza zespół i proponuje Rahimowi (dawniej <a href=\"/n/3_x_klan\">3&#8211;X&#8211;Klan</a>) założenie wspólnego projektu. Znudzeni sytuacją w polskim hip hopie, postanowili połączyć swe siły i stworzyć muzykę, jakiej jeszcze w Polsce nie było. Pojawia się <a href=\"/n/Fokus\">Fokus</a> z propozycją trójosobowego składu. Demonstruje swe \" powierzchnie tnące \" i wchodzi do składu. Łączą swoje siły pod kryptonimem Paktofonika (dźwięki płynące z głośników miały być spoiwem i celem zawartego przez nich układu ).\r\nWiosną 1998 powstają 3 pierwsze utwory \"<a href=\"/s/priorytety\">priorytety</a>\", \"<a href=\"/s/ja_to_ja\">ja to ja</a>\" oraz \"<a href=\"/s/gdyby\">gdyby...</a>\", które pół roku później zostają zarejestrowane w katowickim studiu Music Project, na rzekomy singiel, który miał się ukazać jesienią &#8216;98 nakładem wytwórni <a href=\"/l/rrx\">RRX</a>. Następuje rozpad 3-X-Klanu. Czas płynie. Brak jakichkolwiek znaków ze strony wytwórni. Paktofonika zostaje członkiem organizacji HaiHaieR. Kilka utworów wchodzi w obieg lokalnych odbiorców i pocztą pantoflową informacje o zespole rozchodzą się niemalże w całej Polsce, zyskując olbrzymią sympatię publiczności. Zaczynają się koncerty. W 2000 roku dochodzi do spotkania z <a href=\"/l/Gigant_Records\">Gigant Records</a>. Po długotrwałych debatach dotyczących ewentualnego podpisania umowy - następuje podpisanie umowy na płytę. Wakacje 2000. Rozpoczynają się przygotowania do nagrania materiału muzycznego w domowym studio <a href=\"/n/rahim\">Rahima</a> MAXFLO Studio. Dochodzi do nieporozumień z HaiHaieR i wyłączenia Paktofoniki z szeregów tej organizacji. Chłopaki wyjeżdżają na koncert do niemieckiego miasta Witten obok Dortmundu i wstępują do światowego zgrupowania PROPS Entertaiment, zrzeszającego artystów z Europy, a także zza oceanu. Po powrocie z wakacji zostają wszczęte dalsze nagrania. Efektem wspólnych, dwuletnich działań muzycznych jest album \"<a href=\"/a/Kinematografia\">Kinematografia</a>\".\r\n8 dni po premierze albumu 26 grudnia 2000 o godz. 6 rano <a href=\"/n/Magik\">Piotr \"Magik\" Łuszcz</a> popełnił samobójstwo, wyskakując z okna swego mieszkania w Katowicach - Bogucicach. Pozostawił po sobie żonę i małego synka. Tragedia krzyżuje wiele planów zespołu odnośnie dalszej działalności.\r\n\"Po śmierci <a href=\"/n/Magik\">Magika</a> przez jakiś czas nie mogliśmy dojść do siebie\" - zwierza się <a href=\"/n/Rahim\">Rahim</a>. \"Nie mogłem uwierzyć w to, że już go nie ma, ale teraz wiem, że będziemy dalej grać, choćby tylko z szacunku dla Niego\". Paktofonika realizuje swój pierwszy teledysk do utworu \"<a href=\"/s/Jestem_Bogiem\">jestem bogiem</a>\". Realizacji podejmuje się młoda ekipa filmowa: Arek Tomiak, Grzegorz Lewandowski, Ola Dembska oraz Paweł Maliszczak. Teledysk nakręcono w jeden marcowy weekend w różnych miejscach Katowic i o różnych porach. Powstały ponad dwie godziny materiału. Teledysk zostaje emitowany w większości polskich stacji muzycznych stając się hitem.\r\nPiętno śmierci <a href=\"/n/Magik\">Magika</a> odbija się na <a href=\"/n/Rahim\">Rahimie</a> i <a href=\"/n/Fokus\">Fokusie</a>. Decydują się zaprzestać grania koncertów pod szyldem Paktofonika w których to partie wokalne <a href=\"/n/Magik\">Magika</a> odgrywane były z taśmy. \"... dla nas Magik cały czas żyje. Dlatego na koncertach puszczamy jego partie wokalne z płyty. Jest tak, jakby grał razem z nami\" - mówi <a href=\"/n/Rahim\">Rahim</a>. W 2001 roku <a href=\"/l/Gigant_Records\">Gigant Records</a> wydaje płytę EP z 3 nowymi utworami zespołu oraz 5 remiksami \"<a href=\"/a/Jestem_bogiem\">Jestem bogiem</a>\". Pól roku później powstaje pierwszy winyl, wyprodukowany przez zaprzyjźnioną <a href=\"/l/Doperacja\">Dooperację label</a>. Odcinając się od wszelkich działań medialnych Paktofonika nie pojawia się na wręczeniu nagród Polskiej Akademii Fonograficznej \"Fryderyk\" w kwietniu 2002. Zespół zdobywa statuetkę za najlepszy album hip hopowy w 2001 roku. Nagrodę odbierają managerowie <a href=\"/l/Gigant_Records\">Gigant Records</a>: Paweł Maliszczak i Gustaw Szepke. 3 miesiące wcześniej Empik uhonorował Paktofonikę wyróżnieniem Asa Empiku za największy wkład w kulturę polską kategorii muzyka.\r\nWe wrześniu 2002 upamiętniając twórczość i osobę <a href=\"/n/Magik\">Magika</a>, Paktofonika decyduje się wydać \"<a href=\"/a/Archiwum_Kinematografii\">Archiwum Kinematografii</a>\", długo zapowiadaną i oczekiwaną przez fanów, wspólną płytę z archiwalnymi utworami z sesji nagraniowej w 2000 roku.\r\nPo rozpadzie Paktofoniki <a href=\"/n/Rahim\">Rahim</a> i <a href=\"/n/Fokus\">Fokus</a> tworzą jednak <a href=\"/n/PFK_Kompany\">PFK &#8211; Kompany</a> - grupę kilkunastu młodych muzyków ze Śląska, których łączy miłość do hip hopu. Oprócz <a href=\"/n/Rahim\">Rahima</a> i <a href=\"/n/Fokus\">Fokusa</a> należą do niej m.in. <a href=\"/n/Dj_Bambus\">Bambus</a> i <a href=\"/n/Sot\">Sot</a>. <a href=\"/n/Dj_Bambus\">Bambus</a> jest DJ\'em wspomagającym Paktofonikę na koncertach a <a href=\"/n/Sot\">Sot</a> jest beatboxer\'em. Jest jednym z niewielu w Polsce przedstawicieli human-beatbox\'u, techniki, w której ustami naśladuje się podkłady rytmiczne i słynne \"scratche\". W skład <a href=\"/n/PFK_Kompany\">PFK&#8211;Kompany</a> wchodzą również <a href=\"/n/Dj_Haem\">Dj Haem</a>, producent oraz muzyk w takich projektach jak: <a href=\"/n/Larifari\">Lari Fari</a>, <a href=\"/n/Godziny_Szczytu\">Godziny Szczytu</a>, <a href=\"/n/Zywe_srebro\">Żywe Srebro</a>, <a href=\"/n/Ideo\">Ideo</a> oraz <a href=\"/n/Sliwka\">Śliwka</a> (<a href=\"/n/Pijani_Powietrzem\">Pijani Powietrzem</a>, <a href=\"/n/Ego\">Ego</a>).',NULL,'',NULL,NULL,'  ','0000-00-00','0000-00-00',1,'',1,1,1852,100,NULL,'',''),(6,'Tede','Jacek Graniecki','','2004-06-13 23:51:45','2005-05-12 18:13:23','','www_hhbd_pl_Tede_3.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,7,5242,100,NULL,'Wielkie Joł','http://www.wielkiejol.com'),(7,'Bezele','','','2004-06-14 00:03:24','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1417,100,NULL,'',''),(8,'Sushi','','','2004-06-14 00:03:24','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,815,100,NULL,'',''),(9,'Sośnicka Zdzisława','','','2004-06-14 00:10:06','2004-06-14 22:18:24','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,3,321,100,NULL,'',''),(10,'Dj RX','','','2004-06-14 00:11:47','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,567,100,NULL,'',''),(11,'O$ka','','','2004-06-14 00:12:57','2005-09-01 11:49:25','O$ka - pierwsze kroki warszawskiego producenta związane były z raperem Jano z którym w 1997 r. stworzył zespól OMP. <br />\r\nZ biegiem czasu Ośka i Jano nawiązali studyjny kontakt z DJ Voltem, dzięki czemu nagrywali, a potem występowali gościnnie na płytach DJ 600 V (\"Ogród zwany Eden\" na \"HipHop Produkcja\", gdzie Ośka występuje także solo w utworze \"Po prostu Lato\"). <br />\r\nW drugiej połowie 1998 roku Ośka zajął się produkcja płyty OMP dla niezależnej wytwórni Asfalt Records. \"OMP - Wilanów... zobacz różnicę\" ukazuje się w grudniu 1998 r.<br />\r\nDzięki współpracy z Asfalt, Ośka urządził sobie w międzyczasie małe studio, w którym swego czasu nagrywane były wokale nie tylko na płyty Asfalt ale także na niektóre tytuły dominującej wówczas wytwórni RRX (między innymi składanka \"Hip Hop Raport w Najlepszym Wykonaniu\").<br />\r\nW połowie 1999 nakładem Asfalt Records ukazuje się winylowy singel OMP, na którym znalazły się specjalne, zrevampowane przez Ośke wersje utworów \"Otzafszetu\" i \"Oempe\" z płyty \"Wilanów...\". Była to pierwsza polska HipHopowa płyta winylowa.<br />\r\nNastępnym krokiem była produkcja płyty \"Płomień 81 - Na zawsze będzie płonął\", która ukazała się na kasecie w sierpniu 1999 oraz na wytłoczonym tym razem we Francji, podwójnym winylu w lutym 2000. <br />\r\nPod koniec 1999 ukazuje się pierwsza autorska płyta producencka Ośki,<br />\r\nOśka zadebiutował tą płytą jako samodzielny producent w czasach kiedy ten termin był utożsamiany wyłącznie z osobą DJ 600 V. Na płycie najlepszy w historii kawałek trio Kosi, Wzori, Rzemi. <br />\r\nDo połowy 2000 roku, Ośka skończył jeszcze drugi album OMP pt. \"Dobra Oferta\"<br />\r\nJego kolejnym osiągnieciem było nagranie płyty z białostockim raperem KOMA (z grupy PWRD).<br />\r\nW marcu 2001, po długim okresie produkcji, wychodzi \"Kompilacja 2\".<br />\r\nDruga producencka płyta powstawała bardzo długo (prawie 1,5 roku) ale konsekwencją tego jest wysoki współczynnik jakości do ilości. Pierwsze w historii Ośki kooperacje z Grammatikiem, z doskonale zapowiadającym się Łoną i oczywiście - z Fiszem <br />\r\nTakże w 2001 roku Ośka wraz z Onarem, z którym tworzy całkowicie nowy projekt, zmieniają wytwórnie na niezależne wydawnictwo RRX i wydają pierwsza wspolną płyte \"Onar i Ośka - Superelaks\". Wspólnie osiągają sprzedaż 9 tys. egzemplarzy przy niewielkiej promocji. Na krążku znalazło się 18 utworów. Najbardziej znanym utworem grupy, do którego powstał teledysk, jest utwór Od lat. Przez wiele, długich tygodni goscił on na róznych listach przebojów.<br />\r\nW roku 2003 Ośka wraz z Onarem otrzymują propozycje współpracy od wytwórni Warner Music co w rezultacie kończy się podpisaniem nowego kontraktu i kolejną zmianą wytwórni. W marcu 2003 ukazuje się album \"Wszystko co mogę mieć\". Znajduje się tam osiemnaście utworów przygotowanych przez Michała Ośkę i Onara. Gościnnie wspomagają ich: Selma, Borixon, Pezet, 2Cztery7, Fenomen, Żądło i Lerku. Wszystkie utwory posiadają charakterystyczne dla Ośki, ciekawie zaaranżowane i odznaczające się swoistą lekkością bity. Utwór \"Klubing\" z tego krążka przez wiele tygodni znajdował się na pierwszym miejscu na polskiej liscie MTV.<br />\r\nWspółpraca przy tej i przy solowej płycie Borixona zaowocowała powstaniem wspólnego projektu pod nazwą HaKa. Album HaKa którego Ośka stał się głównym producentem ukazał się w maju 2003. Hitem z tej płyty był utwór \"Platynowe Sombrero\" który jak inne dzieła Ośki goscił na telewizyjnych i radiowych listach przebojów.<br />\r\nNa początku 2004 r. Ośka wraz z Arekcore (z hardcore\'owej grupy AmetriA) i DeMonique (z zespołu Dive3D) rozpoczynaja prace nad wspólna płyta. Bedzie to zupelna nowoś na polskim rynku, muzycznie przypominajaca klimat płyt amerykanskiego artysty Everlasta.<br />\r\nPod koniec roku 2004 Ośka ma gotową trzecią autorską składankę na któej znajdują sie czołowi polscy raperzy (Tede, Numer Raz, Mes, Pezet, Borixon, Onar, Teka, Stasiak oraz wielu innych.<br />\r\nOśka na stałe wspólpracuje z czołowymi artystami polskiej sceny takimi jak: Tede, Pezet, Mes, Numer Raz, Onar.<br />\r\n<br />\r\nUDZIAŁ:<br />\r\nV/A Asfalt Wiosna 2000 EP<br />\r\nAsfalt 26/04/00<br />\r\nNa tej EPce, zapowiadającej asfaltowe premiery w 2000 r., znalazł się utwór \"Trzeba wiedzieć\" nagrany z Ashem na Kompilację 2. Oprócz wersji albumowej specjalny EP Remix - także autorstwa Ośki (remix niedostępny na albumie).<br />\r\nV/A \"Asfalt Wiosna 99 EP\"<br />\r\n(Asfalt 1999) <br />\r\nJedensiedem \"Wielka niewiadoma\"<br />\r\n(RRX 1999) <br />\r\nSnuz \"Towar to sprawdzony...\"<br />\r\n(RRX 1999) <br />\r\nPłomień 81\"Nasze dni\"<br />\r\n(RRX 2000) <br />\r\nWYP3/Borixon \"Kolejna Część\"<br />\r\nZ tej płyty pochodzi hit \"Bauns/Rap Tętni\"<br />\r\n(RRX 2001)<br />\r\nPęku \"Nowe wyzwanie\"<br />\r\n(RRX 2001)<br />\r\nTede \"Hajs Hajs Hajs\"<br />\r\n(Wielkie Joł 2003)<br />\r\n<br />\r\nNumer Raz <br />\r\n(Wielkie Joł 2003) <br />\r\nSTREFA<br />\r\n(Rockers Publishing 2004)<br />\r\nTede \"Notes\"<br />\r\n(Wielkie Joł 2004) <br />\r\nTeka \"Chcę, więc potrafię<br />\r\n(Camey Studio 2004)','www_hhbd_pl_O$ka_1.jpg','image/jpg',NULL,NULL,'  ','0000-00-00','0000-00-00',1,'',3,7,1822,100,NULL,'Camey Studio','http://www.camey.pl'),(12,'Magiera','','','2004-06-14 00:13:44','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,845,100,NULL,'',''),(13,'Kołcz','','','2004-06-14 00:14:58','0000-00-00 00:00:00','Artysta określający siebie jako \"130 kilogramów absurdalnego poczucia humoru\". \r\n\r\nPojawił się po raz pierwszy na albumie \"Dj Buhh prezentuje: Wolumin I - Hałas\", a już od ponad dwóch lat koncertuje wraz z Tede i Kiełbasą. Ponadto można go usłyszeć na płytach: Tede \"Notes\", Kodex 2. Suplement\" oraz Ośka \"Przez $ jak&#8230;\". Wraz z Tede jest współtwórcą programu Bezele emitowanego w telewizji muzycznej Viva Polska. \r\n\r\nObecnie pracuje nad solowym albumem.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1793,100,NULL,'',''),(14,'Berd','','','2004-06-14 00:15:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,514,100,NULL,'',''),(15,'Maluta','','','2004-06-14 00:16:33','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1057,100,NULL,'',''),(16,'Wini 100%','','','2004-06-14 00:16:33','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,395,100,NULL,'',''),(17,'CNE','Tomek Kleyff','','2004-06-14 00:17:12','2005-12-09 16:09:29','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,3,1187,100,NULL,'',''),(18,'Mikser','','','2004-06-14 00:17:12','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,905,100,NULL,'',''),(19,'Bastir','','','2004-06-14 00:19:42','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,627,100,NULL,'',''),(20,'Kiełbasa','','','2004-06-14 00:21:05','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,747,100,NULL,'',''),(21,'Osa','','','2004-06-14 00:21:05','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1169,100,NULL,'',''),(22,'Mateo','','','2004-06-14 00:21:05','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,756,100,NULL,'',''),(23,'Numer Raz','Michał Witak','www.numerraz.com','2004-06-14 00:24:16','2005-10-05 22:59:36','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,3,2095,100,NULL,'',''),(24,'Dj 600V','Sebastian Imbierowicz','','2004-06-14 11:20:31','2004-12-08 23:35:45','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,3,4283,100,NULL,'',''),(25,'Żusto','','','2004-06-14 11:27:26','2004-06-14 17:02:16','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,1105,100,NULL,'',''),(26,'Mea','','','2004-06-14 11:30:19','2005-01-07 20:36:04','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,687,100,NULL,'',''),(27,'Kiwi','','','2004-06-14 11:31:14','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,312,100,NULL,'',''),(28,'Abradab','Marcin Marten','http://www.abradab.pl','2004-06-14 11:34:07','2005-12-15 22:25:24','Abradab, raper pochodzący ze Śląska. Urodzony w listopadzie 1978 roku. Hip-Hopem zainteresował się na samym początku lat dziewięćdziesiątych w wieku mniej więcej 14 lat. Razem z bratem <a href=\"/n/joka\">Joką</a> i <a href=\"/n/magik\">Magikiem</a>. Założył kultowy skład <a href=\"/n/kaliber_44\">Kaliber 44</a>, z którym związany jest do dzisiaj.\r\nAbradab lubi zabawe słowem, jego teksty pełne są trafnych porównań, świetnych rymów i gry słownej. Oprócz pisania tekstów Abradab jest też bardzo dobrym producentem, co udowadniał każdą z płyt, które były wydawane jako <a href=\"/n/kaliber_44\">Kaliber 44</a> i jako jego solówki.\r\nNajbardziej znanym i popularnym numerem Abradaba, jeszcze z czasów <a href=\"/n/kaliber_44\">Kalibra 44</a> są prawdopodobnie \"<a href=\"/s/konfrontacje\">konfrontacje</a>\" z albumu: \"<a href=\"/album/3_44\">3:44</a>\". Do którego powstał teledysk.\r\nNa początku czerwca 2004 roku, zostaje wydany w końcu solowy album Abradaba: \"<a href=\"/album/Czerwony_album\">Czerwony Album</a>\", na który kazał czekać fanom prawie dwa lata (pierwszy singiel \"<a href=\"/album/Miasto_jest_nasze_goscinnie_Gutek\">Miasto jest nasze</a>\" został wydany na przełomie lat 2002 i 2003!!!). Drugim singlem do solowego albumu jest \"<a href=\"/album/__singiel_bez_tytulu\">... (singiel bez tytułu)</a>\". Oba single przyjętę z dużym zainteresowaniem i jeszcze większymi nadziejami. Abradab nie rozczarował słuchaczy. Single jak i cały album okazały się świetnym materiałem.\r\nRazem z <a  href=\"/n/joka\">Joką</a> Abradab koncertował w USA, a w roku 2004 zagrali kilka koncertów w starym koncertowaym składzie jako \'pełny skład\' Kalibra.\r\nW lutym 2005 ogłoszono nominacje do Fryderyków 2004. W kategorii Album Roku Hip-Hop/R&B nominowany został Abradab za album \"<a href=\"/album/Czerwony_album\">Czerwony Album</a>\". Zaś w kategorii Videoklip Roku nominację zdobył Kobas Laksa za videoklip Abradab - \"Rapowe ziarno 2 (Szyderap)\". Abradab wygrał w swojej kategorii i odebrał swoją statuetkę Fryderyka 2004 za \"<a href=\"/album/Czerwony_album\">Czerwony Album</a>\".','www_hhbd_pl_Abradab_1.jpg','image/jpg',NULL,NULL,'','1978-11-00','0000-00-00',1,'',3,3,4973,100,NULL,'www.igs.prv.pl',''),(29,'WSZ','','','2004-06-14 11:34:07','2005-11-16 16:19:09','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,939,100,NULL,'',''),(30,'Gutek','Piotr Gutkowski','','2004-06-14 11:34:07','2005-07-25 21:42:40','O sobie: \"Urodziłem się w Katowicach, gdzie do dziś mieszkam, stamtąd wyjeżdżam na koncerty i nagrania i spędzam tyle samo czasu poza nimi, co i w nich.<br />\r\nMuzyką interesowałem się odkąd tylko pamiętam, a pierwsze zespoły współtworzyłem mając lat 14. Były to : Over Mind - założony przez producenta hip-hopowego, IGS\'a, ówcześnie gitarzysty Overów, oraz After Birds w których śpiewałem, czasem równolegle.<br />\r\nOba zespoły nie miały nic wspólnego z reggae, a moja przygoda z tą muzyką zaczęła się dopiero po poznaniu Banacha.<br />\r\nMiałem wtedy 16 lat, było to na targach muzycznych w katowickim Spodku, gdzie grałem z Over Mind, reklamując sprzęt na jednym ze stoisk.<br />\r\nZnajomość ta zmieniła diametralnie moje podejście do muzyki, żeby nie powiedzieć, do całego życia i zaowocowała płytą Banach & Indios Bravos, w 1999 roku.<br />\r\nRównolegle do nauki reggae, postępowała moja zażyłość z hip hopem. Do liceum chodziłem z pionierami polskiej sceny: Dabem, Joką i Jajonaszem założycielami Kalibra 44, co musiało prędzej czy później zaowocować współpracą.<br />\r\nDziś jestem rozpoznawalny zarówno dzięki działalności reggae, jak i hip hopowej.<br />\r\nW najbliższych planach nie znajdzie się jednak wiele miejsca na rapowe featuringi, co mam nadzieje będzie z korzyścią dla tych, którzy wolą \" Gutka Reggae\'owca\".<br />\r\nInnymi słowy: \" Indios Bravos- ponad wszystko!\"','www_hhbd_pl_Gutek_1.jpg','image/jpg',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','1979-03-29','0000-00-00',1,'',3,7,1770,100,NULL,'IB web','http://www.indiosbravos.com'),(31,'Franek','','','2004-06-14 11:34:44','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,617,100,NULL,'',''),(32,'Truka skład','','','2004-06-14 11:36:15','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,501,100,NULL,'',''),(33,'Red','','','2004-06-14 11:37:47','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1473,100,NULL,'',''),(34,'7 Łez','','','2004-06-14 11:38:48','2004-12-14 22:20:27','','www_hhbd_pl_7_lez_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,3,1827,100,NULL,'www.umc.pl',''),(35,'Mes','Piotr  Szmidt','','2004-06-14 11:42:17','2009-04-11 00:01:08','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,3,3501,100,NULL,'',''),(36,'Lerek','','','2004-06-14 11:42:17','2005-09-01 11:54:31','Rocznik \'83<br />\r\nWarszawa Ursynów<br />\r\nUlubiony Arysta: Maxwell, Craig David<br />\r\nFirma odzieżowa: MORO<br />\r\n<br />\r\nHobby: fotografia i grafika komputerowa<br />\r\nPierwszy instrument: keyboard od ojca<br />\r\nTo co ważne: wiara, dom rodzinny, kobiety<br />\r\nDebiut: \"Pieprzyć szary beton\" - VINYL - Junoumi z udziałem: Pezet, Pjus, Stasiak<br />\r\n<br />\r\n<br />\r\nJest młodym, utalentowanym Artystą, którego poznaliśmy już w nagraniach hip-hopowych DJ600V, Ośki, Onara, PIHa, Pezeta, 2cztery7, Mes\'a, Blef\'a, <br />\r\nLerek wystąpił gościnnie w teledyskach : \"Weź to poczuj\" oraz \"Drugie piętro\" Onara.<br />\r\nLerek zafascynowany muzyką r\'n\'b postanowił  temu nurtowi poświęcić dużo miejsca na swojej debiutanckiej płycie.','www_hhbd_pl_Lerek_1.jpg','image/jpg',NULL,NULL,'  ','0000-00-00','0000-00-00',1,'',3,7,2331,100,NULL,'Camey Studio','http://www.camey.pl'),(37,'Kasta','','','2004-06-14 11:44:13','2004-06-14 16:31:23','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1532,100,NULL,'',''),(38,'Mor W.A.','','http://www.morwa.pl','2004-06-14 11:46:03','2005-07-25 17:05:07','Zanim w 1997 roku zrodził się projekt hip hopowy o nazwie MOR W.A., każdy z chłopaków próbował swoich sił udzielając się muzycznie i wokalnie w hardcorowych zespołach. Wigor pisał pierwsze rymy, Peper grał na garach, Łyskach na basie, ale już wtedy zaczynali słuchać rapowych produkcji, które docierały do Polski zza Oceanu. Nikt z nich jednak nie myślał jeszcze wtedy o robieniu podkładów czysto hip hopowych, ponieważ nie było takich możliwości. <br />\r\nÓwczesną enklawą stołecznego środowiska hip hopu były klub Hybrydy, natomiast do audycji radiowych nadających tym tonem, zaliczał się jedynie blok rapowy, prowadzony przez Bognę Świątkowską - początkowo w Radiu Kolor, później w Radiu Jazz. To właśnie tutaj można było usłyszeć pierwsze dokonania MOR W.A., powstałe dzięki przychylności DJ-a Volta, który jako pierwszy użyczył własnych beatów dla promowania polskich rymów. Z biegiem czasu, rozwijająca się w zaskakująco szybkim tempie, warszawska (zresztą nie tylko) scena hip hopowa zaowocowała produkcjami, jak pierwsza 600-ta (która wyszła spod ręki wspomnianego już DJ-a). Na tej składance, wśród innych wykonawców, znalazł się również pierwszy, oficjalnie wydany utwór MOR W.A. - Unoszę głowę.<br />\r\nPo niespodziewanie pozytywnym odbiorze debiutu przez słuchaczy w całym kraju, chłopaki z MOR W.A. zaczęli poważnie myśleć o nagraniu płyty długogrającej, zwłaszcza, że posiadali już gotowe kawałki z nieoficjalnej demówki (prezentowane wcześniej w audycjach Bogny). W realizacji tego pomysłu przeszkadzał im brak regularnego dostępu do sprzętu, jednak mimo tych trudności wciąż nagrywali coś nowego. Dzięki temu wzięli udział w kolejnej składance Volta: Raport z osiedla. Po tej produkcji wystąpili gościnnie na debiutanckiej płycie Warszafskiego Deszczu/3H, w utworze Razem z chłopakami. W połowie roku 1999 nagrali wraz z Zip Składem kawałek Tragikomedia, który znalazł się na albumie Chleb Powszedni. Niedługo później pojawili się w utworze Nie Prowokuj na drugiej płycie Molesty Ewenement. W marcu 2000 werszli do studia, aby wreszcie zrealizować własną płytę, która powstawała przez te wszystkie lata.<br />\r\nRezultatem jest krążek Te słowa mówią wszystko, którego premiera odbyła się 23 września 2000 roku. Płytę promował singiel pod tytułem Żyć nie umierać (można go było usłyszeć jesienią roku 2000). Po debiutanckiej płycie, w maju 2001, ukazał się kolejny singiel Idź za ciosem. Do utworu tytułowego został nakręcony teledysk, w którym oprócz chłopaków z Mor W.A. można zobaczyć także Włodka z Molesty, Sokoła z WWO oraz Fu z Zipery. Jeszcze w tym samym roku ukazał się ostatni singiel promujący tę produkcję - B.S.N.T., a także płyta producencka Waco - Świeży Materiał, na której zespół zaznaczył swoją obecność utworem Determinacja.<br />\r\nZ końcem roku 2001, MOR W.A., rozpoczęli pracę nad drugą płytą Morwa Drzewo, która ukazała się w październiku 2002. Na albumie tym pojawili się gościnnie artyści z Francji i Litwy, a promował go singiel My to my, który został wyprodukowany przez Waco. Po bardzo dobrym przyjęciu przez media, zespół	ruszył w trasę, którą podsumował teledysk koncertowy Tam i z powrotem. W międzyczasie chłopaki pojawili się również na kilku innych produkcjach. Rok 2003 minął na koncertowaniu i przygotowaniach dwóch kolejnych płyt, a także na tworzeniu własnego niezależnego studio o nazwie Drugi Dom. To przedsięwzięcie pozwoliło chłopakom na istotny progres w twórczości. Na początku marca 2004 zakończona została praca nad trzecim albumem studyjnym - Dla słuchaczy, którego premiera odbyła się 1go maja. W jej nagraniu wzięli udział także Włodi, Vienio i Pele. W tworzeniu tego materiału pomogły też dwie wokalistki - Anita Jadacka i Olga S., a muzycznie - Waco, Korzeń i Pele.',NULL,'',NULL,NULL,'	  ','1997-00-00','0000-00-00',1,'',3,7,1132,100,NULL,'',''),(39,'Juchas','','','2004-06-14 11:48:06','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,628,100,NULL,'',''),(40,'Fenomen','','','2004-06-14 11:52:00','2004-06-17 02:54:59','',NULL,'',NULL,NULL,'','1996-00-00','0000-00-00',1,'',3,1,2128,100,NULL,'',''),(41,'Żurom','','','2004-06-14 11:52:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1630,100,NULL,'',''),(42,'Borixon','Tomek Borycki','','2004-06-14 11:52:56','2005-09-01 11:45:51','Członek kilku istniejących i nieistniejących już formacji m.in.: WYP3, Gibgibon, Haka, Flahaha, Vemblematy. Swoją karierę rozpoczynał u boku Liroya, grając z nim koncerty na trasie albumu \"Scyzoryk\". Dołączył do składu WYP3, po odejściu z niego Radoskóra. Razem ze Wzgórzem zagrał ponad 170 koncertów, nagrał albumy \"Centrum\", \"Trzy\", \"Ja Mam To Co Ty\", \"Precedens\" i \"Stara Szkoła Rapu\". We wrześniu 2001 roku ukazał się pierwszy solowy album pod tytułem: \"WYP3/Borixon-Kolejna Część\" który był jednym z najlepszych albumów 2001 roku. Dwa teledyski do tej płyty odbiły się mocnym echem w środowisku, pierwszym do utworów \"Bauns/Rap Tętni\" wzbudził kontrowersję, drugi do utworu \"A Miało Być Tak Pięknie\" - smutek i melancholię. Kolejna pozycją z pod szyldu artysty była płyta &#8222;Mam Pięć Gram&#8221;, niesamowicie przebojowa i zróżnicowana. Utwory takie jak &#8222;Mam Pięć Gram&#8221;, &#8222;Trwam W Tym&#8221; czy &#8222;Tak To Wygląda&#8221; są doskonale znane nie tylko w środowisku hip-hopowym. W przerwie pomiędzy solowymi wydawnictwami artysta zajął się niesamowicie kontrowersyjnym projektem HAKA czego owocem jest między innymi hit &#8222;Platynowe Sombrero&#8221;. Ostatnim wydawnictwem Borixona jest album &#8222;Rap Daje Mi Siłę&#8221; który ukazał się pod koniec 2004 roku. A z nim standartowo już hity :) : &#8222;Sprawdź To Działa&#8221;, &#8222;Rap Daje Mi Siłę&#8221; czy &#8222;Ja Tu Zostaje&#8221;. Kolejne płyty już niebawem.<br />\r\nBorixona potrafi z łatwością nadać swoim utworom taneczny posmak, budzić kontrowersję jak i wprowadzać elementy głębokich przeżyć. Niesamowity temperament i poczucie humoru zjednuje mu wiele sympatii, przyjaciół i fanów jak również wrogów. Wieloletni staż na scenie hip-hop polska sprawia, że jego utwory są dopracowane i interesujące. Potrafi ostro rapować i melodyjnie śpiewać. ','www_hhbd_pl_Borixon_1.jpg','image/jpg',NULL,NULL,' ','0000-00-00','0000-00-00',1,'',3,7,2813,100,NULL,'Camey Studio','http://www.camey.pl'),(43,'Fu','','','2004-06-14 12:05:14','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,3431,100,NULL,'',''),(44,'Baku-Baku Skład','','','2004-06-14 13:35:35','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1144,100,NULL,'',''),(45,'Pono','','','2004-06-14 13:36:23','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,2105,100,NULL,'',''),(46,'Sokół','','','2004-06-14 13:36:23','2008-12-03 13:24:07','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,3,2648,100,NULL,'',''),(47,'Felipe','','','2004-06-14 13:36:23','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,892,100,NULL,'',''),(48,'ZIP Skład','','','2004-06-14 13:36:23','2004-08-15 16:05:25','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,3,2685,100,NULL,'',''),(49,'Koras','','','2004-06-14 13:36:53','2004-06-14 18:50:43','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,1627,100,NULL,'',''),(50,'Mieron','','','2004-06-14 13:36:53','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1330,100,NULL,'',''),(51,'Jędker','','','2004-06-14 13:36:53','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,2366,100,NULL,'',''),(52,'Joka','Michał Matren','','2004-06-14 14:05:29','2005-12-15 22:13:25','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,3,2190,100,NULL,'',''),(53,'White House','','','2004-06-14 14:08:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1596,100,NULL,'',''),(54,'Chada','','','2004-06-14 14:20:30','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1876,100,NULL,'',''),(55,'PIH','','','2004-06-14 14:20:30','2005-09-01 11:47:33','W 2000r. na polskim rynku fonograficznym, nakładem wytwórni RRX, pojawiła się płyta nieznanego jeszcze wtedy zespołu Jedensiedem \"Wielka Niewiadoma\". Zespół ten tworzyło dwóch białostockich emce Pih i Tymian. W związku z tym, iż dystrybucją zajmowała się undergroundowa wytwórnia do dziś nie wiadomo dokładnie w jakim nakładzie rozszedł się debiutancki krążek chłopaków z Białegostoku. Materiał, który zaprezentowali, został jednak bardzo dobrze przyjęty przez środowisko hiphopowe i otworzył Pihowi i Tymiemu drzwi do całego hiphopowego światka. Na płycie tej, można było zauważyć własny styl i niepowtarzalny klimat, który jest właściwy dla rapu Piha i Tymiana i będzie towarzyszył wszystkim późniejszym produkcjom tego pierwszego. Produkcją płyty zajął się DJ 600 VOLT, zaś w jednym z utworów refren zaśpiewała Reni Jusis. <br />\r\nWkrótce po debiucie, Piha i Tymiana zaczęto zapraszać do współpracy i można było usłyszeć ich na najlepszych w tamtym okresie produkcjach (m.in. kompilacje DJ 600 VOLT, Wzgórze Ya Pa 3, Paktofonika, Onar i O$ka). Z każdym kolejnym miesiącem widoczny był rozwój zespołu. <br />\r\nW 2001r. Hirek Wrona widząc zasługi Jedensiedem w budowaniu polskiej sceny hiphopowej zaprosił Piha i Tymiana na 38 Krajowy Festiwal Piosenki Polskiej w Opolu (pierwszą tego typu imprezę, na której zagościła rodzima hiphopowa muzyka). Mniej więcej w tym okresie nastąpił rozpad Jedensiedem. Od tego czasu Pih nagrywa solowe projekty. <br />\r\nSolowa kariera Piha rozpoczęła się od maxi singla \"Nie Ma Miejsca Jak Dom\" (2002r.), który rozszedł się w dość niespotykanym, jak na polski rynek hiphopowy, nakładzie 6 tys. egz. Chwilę później, również w 2002r. światło dzienne ujrzał longplay \"Boisz Się Alarmów... (Peiha Solo Album I)\", jedna z najbardziej niedocenionych płyt w historii polskiego rapu. Żenująca promocja i dystrybucja plajtującej wytwórni (RRX) pogrążyła materiał Piha na płaszczyźnie komercyjnej, jednak został on bardzo doceniony przez hiphopową społeczność. Jedna z najbardziej autorytatywnych stron www.tylkokonkret.net wśród 10 punchlinów roku 2002 wymieniła 3 Piha. Flinstone, bardzo ceniony dziennikarz i jednocześnie zagorzały przeciwnik Piha, napisał: \"...Boisz się alarmów?!/ Pe-i-ha solo album / piętnaście sekund przed końcem będziesz wpierdalać Valium - Pih w \"Wiesz kto ma ogień\" z albumu \"Boisz się alarmów\". Wykrzyczany, ściśnieniowany wers białostockiego cynika. Rozpoczęcie rozgrywki, atutowym asem. Najmocniejsze otwarcie albumu w polskim hh.\" Do współpracy nad tym krążkiem Pih zaprosił m.in. Wzgórze Ya Pa 3, Fenomen, Cameya, DJ 600 VOLT, Jajonasza, Bartosza (Endefis) i Chadę. Właśnie współpraca z tym ostatnim miała później zaowocować najdojrzalszym, jak do tej pory, materiałem Piha, tzn. albumem Chada i Pih - O Nas, Dla Was (2003). Promujący ten album singiel \"Zobacz Na Podwórko\" szybko wskoczył na listę na Viva Polska i nie spadał z czołowych pozycji przez długi okres. Była to dość nieoczekiwana sytuacja, ponieważ materiał tych dwóch emce miał raczej antykomercyjny charakter, jednak treść i przekaz celnie trafiały do odbiorców i przysporzyły Chadzie i Pihowi kolejnych wiernych fanów. <br />\r\nOd tamtej pory Pih nagrywał dwutorowo, solowe projekty oraz materiał z Chadą. W 2003r. Pih pojawił się m.in. na płycie Borixona (Wzgórze Ya Pa 3) oraz licznych kompilacjach. <br />\r\n2004r. przyniósł Pihowi same sukcesy. Wraz z Chadą nagrał cover utworu \"Moi Przyjaciele\" z Repertuaru Oddziału Zamkniętego, który znalazł się na płycie byłego frontmana OZ, Krzysztofa \"Jarego\" Jaryczewskiego, \"Vinyl\". Wraz z Odziałem Zamkniętym Chada i Pih zostali zaproszeni do programu Muzyka Łączy Pokolenia, gdzie wspólnie zagrali takie utwory jak \"Party\", \"Moi Przyjaciele\" oraz \"Zobacz Na Podwórko\". Duet białostockiego i warszawskiego emce stał się wkrótce dość rozpoznawalny i popularny. Do współpracy nad \"Kodex II - Proces\" zaprosili Chadę i Piha najbardziej rozchwytywani producenci ostatnich dwóch lat Magiera i LA (WhiteHouse). <br />\r\nW czerwcu 2004r. Pih umieścił na najpopularniejszej, stricte hiphopowej, stronie www.hip-hop.pl singiel \"2003\", który do dnia dzisiejszego mimo zerowej promocji broni się dość dobrze na liście przebojów tej strony i liczy około 38 tys. pobrań. <br />\r\nW lipcu Pih podpisał z Camey Studio kontrakt na 3 kolejne solowe płyty. Pierwsza, \"Krew, Pot i Łzy\", ukazała się w październiku 2004r. Można na niej usłyszeć całkiem nowe brzmienie w polskim rapie. Produkcją zajął się m.in. Szyha, Jajonasz, Teka, Camey, Waves i Magiera. Wśród gości między innymi: Mes, Pezet, Pyskaty, Hst, Gutek czy Chada. Z płyty pochodzą takie numery jak: &#8222;Nigdy Już Nie Wróci&#8221;, &#8222;Cokolwiek&#8221; czy &#8222;Zaklubować się na śmierć&#8221;. Od tamtego momentu Pih pracuje nad kolejnym albumem solowym, płyta zespołu Skazani Na Sukcezz (który tworzy wraz z Pyskatym Skurwielem) oraz nad materiałem na projekt Chada/Pih. Niebawem będziecie mogli usłyszeć efekty tej pracy.','www_hhbd_pl_PIH_1.jpg','image/jpg',NULL,NULL,'	  ','0000-00-00','0000-00-00',1,'',3,7,7942,100,NULL,'Camey Studio','http://www.camey.pl'),(56,'Myniemy','','http://www.myniemy.com','2004-06-14 14:20:30','2005-08-23 23:48:41','Zespół nagrywa od 1998 roku. Wcześniej kojarzeni byli z Edytoriałem, Maesto i Gramatikiem , z którymi tworzyli kawałki i grali koncerty. W 2000 roku pojawili się gościnnie na płycie Rubato \"Czysta Gra\" pod nazwą Myniemy. Obecnie w skład grupy wchodzą : Dj OneTouch , Koras (BMW), Siwy (Dym). Zespół jest ściśle powiązany z Specyfik Sound Studio i Szyhą, który zajmuje się produkcją. Ponadto formacja dała się poznać na innych produkcjach takich jak choćby: KODEX 2, Proces, (T1 teraz 2004), Chada, Pih, Myniemy - \"Dziś judaszu wczoraj bracie\". 1z2 \"Nic co ludzkie\" (Promil 2004), Jeszcze raz. PIH , \"Krew pot i łzy\" (Camey studio 2004), Wariat \"Przedstawienie\", Składanka (Rekord rekords 2003), \"Taki czas\" Rubato, Czysta Gra, (Sony Music Polska 2000), \"Cocaina\" Rubato, Czysta Gra, (Sony Music Polska 2000), Road To HipHop 2004/2005, Składanka Fonografika 2004/2005), \"Nauczyli...\" i na wielu nielegalach.','www_hhbd_pl_Myniemy_1.jpg','image/jpg',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',3,3,3102,100,NULL,'Marcin Szambelan','http://Tuhart.net'),(57,'Daniello','Daniel Pomorski','','2004-06-14 14:20:30','2004-06-14 16:20:22','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,287,100,NULL,'',''),(58,'Dj Kostek','','','2004-06-14 14:20:30','2005-09-25 20:49:02','DJ Kostek jeden z czołowych polskich dj&#8217;ów. Laureat kilku konkursów dj\'skich w tym Mistrzostwa Polski DMC 2001/2002, Vice Mistrz International Turntablism Federation 2003. Jego skrecze można usłyszeć na wielu produkcjach m.in. na Kodex I, Kodex II Proces, Fenomen &#8222;Sam na sam&#8221;, Pih i Chada, Borixon, OSTR. Jest członkiem Sweet Nosie, z którymi nagrał 2 płyty (Czas ludzi cienia, Rewolta), i z którymi gra koncerty. Aktywnie działa cały czas na scenie, można go zobaczyć na dobrych imprezach w całym kraju, a także jako dj\'a prowadzącego Projekt Teatralny 12 Ławek.','www_hhbd_pl_Dj_Kostek_1.jpg','image/jpg',NULL,NULL