,'','0000-00-00','0000-00-00',0,'',3,1,227,100,NULL,'',''),(73,'Tewu','','','2004-06-14 15:01:30','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,3076,100,NULL,'',''),(74,'L.A.','','','2004-06-14 15:04:48','2004-06-14 15:04:59','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,760,100,NULL,'',''),(75,'Tymon','','','2004-06-14 15:05:19','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,703,100,NULL,'',''),(76,'Natalka','','','2004-06-14 15:05:19','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,499,100,NULL,'',''),(77,'WWO','','http://www.wwo.pl','2004-06-14 15:07:23','2005-12-19 23:21:31','WWO tworzą raperzy Sokół i Jędker oraz Dj Deszczu Strugi. Pochodzą z Warszawy i tam tworzą. Związani są z polską sceną HH prawie od samego początku. WWO to\r\nW Wyjątkowych Okolicznościach, to W Witrynach Odbicia. Zmiany dokonali pod koniec roku 2001, oto wyjaśnienie Prosto od grupy: \"...W listopadzie 2001 oficjalnie po pierwszej płycie W Witrynach Odbicia przestaliśmy nagrywać pod tą nazwą. To wszystko z powodu konfliktu między nami a BMG Poland, poprostu mogliśmy albo się poddać w tym sporze, albo robić dalej swoje, w innym składzie i pod inna nazwą. To wszystko kwestia prawa. Oficjalnie od grudnia 2001 w stałym składzie WWO pojawił się Deszczu Strugi, a nasza nazwa brzmi W Wyjątkowych Okolicznościach. Teraz jesteśmy w trakcie nagrywania nowego materiału...\".',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,7871,100,NULL,'',''),(78,'Dj Deszczu Strugi','','','2004-06-14 15:07:23','2004-06-14 16:12:32','','www_hhbd_pl_Dj_Deszczu_Strugi_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1824,100,NULL,'M. Grochowina','http://www.sfotografuj.to.pl'),(79,'Miejski Klasyk','','','2004-06-14 15:08:42','2004-06-14 20:54:44','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,520,100,NULL,'',''),(80,'Nigel Jaamann','','','2004-06-14 15:11:54','2004-06-14 16:24:51','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,459,100,NULL,'',''),(81,'1z2','Kuba Walczewski','','2004-06-14 15:13:46','2004-11-28 23:27:07','',NULL,'',NULL,NULL,'','1980-00-00','0000-00-00',0,'',3,1,1514,100,NULL,'',''),(82,'Trzeci wymiar','','http://trzeciwymiar.eu','2004-06-14 15:24:00','2006-04-26 20:11:11','Zacznijmy od początku początków, które umiejscowiłbym jakoś na rok 99, a ściślej na jego końcówkę. Wtedy to powstało pierwsze połączenie sił Szada i Nulla pod nazwą, po której dziś pozostał już tylko sentyment, pod nazwą Poetikanonim. Mało kto, wtedy robił cokolwiek w materii hip- hopu w naszym mieście. Pod tą nazwą mamy na koncie pierwszą demówkę ? Od zawsze tu byłem?, która jednak była materiałem bardzo słabym jakościowo i nie nadawała się naszym zdaniem do wypuszczenia na szersze wody. Potem nastąpił okres zawieszenia działalności zespołu na czas około 1,5 roku, w którym to czasie, Nullo zrobił drugą w historii Wałbrzycha demówkę. Solo Nulla zatytułowane było ?Wszystko rymowanym słowem? i spotkało się z dużym lokalnym rozgłosem, a także z pozytywnymi opiniami w szerszych kręgach - nie tylko hip hopowych. Z materiałem z tego właśnie nielegala Nullo wygrał festiwal hip hopowy w Żarowie, gdzie udział brało kilkanaście zespołów z całej Polski. Pierwszą nagrodą w tamtym konkursie była nagrywka i pomoc Magiery, do której de facto na razie nie doszło, ale może kiedyś? Ogólnie tamten materiał był już lepszy jakościowo, umiejętności także wykazywały tendencje zwyżkową, przede wszystkim jednak na tamtym nielegalu została spuszczona ze smyczy wyobraźnia, co widać po pomysłach z tamtego krążka. To był chyba najistotniejszy fakt, który procentuje od tamtego momentu cały czas. To wszystko nie zmieniło jednak faktu, że także i w związku z tamtym materiałem nie zostały podjęte żadne  poważniejsze kroki. Widocznie tak musiało jednak być po to, żeby w sierpniu 2001 roku doszło do zjednoczenia sił Nulla z Porkiem (eMCe miejscowego składu W-klika). Do nich dwóch doszedłem także ja (Szad), powracający z długiej podróży po ?oceanie życia? oraz Dj Splash znany w Polsce jako Dj SPH (mający na swoim koncie wiele koncertów w całej Polsce, grając gościnnie z czołowymi składami naszej sceny, między innymi ma za sobą występ na hip-hopowymOpolu). Podjęliśmy wówczas w składzie poważne decyzje odnośnie przyszłej twórczości zespołu, który początkowo nosił nazwę Peo-eTe-iK. Nazwa ta jednak w momencie podpisania kontraktu płytowego, w związku ze swoim podobieństwemdo kilku innych nazw polskich zespołów, zmieniona została na 3Wymiar. Dlaczego TrzeciWymiar? Dlatego, że to wymiar, którego na pierwszy rzut oka nie widać, w momencie jednak, kiedy się wpatrzymy uważnie widzimy to, czego nie dostrzegaliśmy wcześniej. To ?coś? właśnie tkwi w twórczości 3Wymiaru, która różni się od całego nurtu polskiego hip- hopu. <br />\r\n<br />\r\nW tym cztero osobowym składzie nagraliśmy kilkanaście utworów, z których część jako demo rozesłaliśmy po wytwórniach płytowych. Dosyć szybko nastąpił odzew ze strony kilku wytwórni, po rozmowach jednak wybraliśmy ofertę Cameya, która w związku z najbardziej perspektywicznym spojrzeniem na przyszłość była najkorzystniejsza dla naszych planów. Materiał na nasz premierowy krążek gromadzony jest od połowy 2002 roku i cały czas przechodzi fazę powstawania. Premiera jest wstępnie zaplanowana na wiosnę 2003 roku. Termin może jednak ulec przesunięciu, ponieważ nie chcemy wydać kolejnej przeciętnej płyty na polskim rynku hip-hopowym i gwarantujemy Wam, że będzie to materiał jedyny w swoim rodzaju, a przede wszystkim kurewsko dobry!!! Chcemy naszą płytą postawić poprzeczkę dużo wyżej niż jest umiejscowiona teraz. Myślimy, że będzie to z pożytkiem zarówno dla słuchacza, jak i dla całego polskiego hip-hopu. <br />\r\nDJ SPH <br />\r\n<br />\r\nTrzeci Wymiar jest sponsorowany przez: <br />\r\nERROR CLOTHEZ ( www.error.com.pl ) ','www_hhbd_pl_Trzeci_wymiar_1.jpg','image/jpg',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',3,3,2893,100,NULL,'Camey Studio','http://www.camey.pl'),(83,'Dj SPH','','','2004-06-14 15:24:00','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,504,100,NULL,'',''),(84,'Zipera','','','2004-06-14 15:26:51','2004-06-14 18:56:13','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1925,100,NULL,'',''),(85,'Korzeń','P. Korzeniowski','','2004-06-14 16:02:19','2004-11-23 00:18:40','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,3,992,100,NULL,'',''),(86,'Ana','','','2004-06-14 16:03:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,834,100,NULL,'',''),(88,'FMR','','','2004-06-14 16:10:20','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,995,100,NULL,'',''),(89,'Dj Bambus','','','2004-06-14 16:17:25','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,1171,100,NULL,'',''),(90,'PFK Kompany','','','2004-06-14 16:17:25','2004-08-15 16:06:22','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,3,883,100,NULL,'',''),(91,'WSP','','','2004-06-14 16:18:53','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1397,100,NULL,'',''),(92,'Wychowani Na Błędach','','','2004-06-14 16:18:53','2004-06-14 16:22:24','','www_hhbd_pl_Wychowani_Na_Bledach_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1044,100,NULL,'kuba dąbrowski','http://www.kubadabrowski.com'),(93,'Dj Dec','','','2004-06-14 16:18:53','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,559,100,NULL,'',''),(94,'Alex','','','2004-06-14 16:20:45','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,714,100,NULL,'',''),(95,'Metaphora','','','2004-06-14 16:25:32','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,284,100,NULL,'',''),(97,'Gural','','','2004-06-14 17:10:11','2005-09-11 14:00:29','Pierwsze rapowe kroki Gural postawił niemal 10 lat temu, w ekipie, która z Rapscalion X przekształciła się w Killaz Group. To właśnie w 1995 roku, razem z Kaczorem, Kukiem i Orzechem postanowili przejść od słuchania rapu w konkretne działanie. \"Darzę jakimś sentymentem czasy, kiedy się napierdalało z chłopakami zupełnie inaczej niż teraz, tak naprawdę strasznie kulawo, ale to było fajne. Nikt wtedy nie pokazywał jak się powinno robić hiphop\" - twierdzi. W ramach działalności w Killaz Group pojawiły się trzy produkcje, w 1998 roku debiutancka kaseta \"Prawdziwość dla gry\", dwa lata póżniej singiel \"Zjednoczone emiraty poznańskie\" i legalny \"Nokaut\", wydany nakładem Blend Records.\r\nJako, że muzyka była jego motorem napędowym, wkrótce zebrał wystarczająco dużo materiału, aby wydać solowy album. Brzmieniowy wizerunek tej płyty stworzył wraz z ekipą WhiteHouse, z którą współpracowali już przy singlu Killaz. Wydane w 2002 \"Opowieści z betonowego lasu\" nie okazały się jednak jednorazowym zrywem. Po serii koncertów, Gural zabrał się do tworzenia kolejnego materiału.\r\nW międzyczasie na rynku pojawiła się także podwójna płyta K.A.S.T.A Składu, gdzie Gural zastąpił Sztrajta. Wcześniej pojawił się jedynie gościnnie w utworze \"Peryferie\" na debiutanckim krążku wrocławian \"Kastaniety\" (2002). Razem z Wall\'em i Kut-O zagrali wiele koncertów w całej Polsce. Doprowadziło to do powstania powszechnej opinii, że K.A.S.T.A. Skład na scenie zapewnia najlepsze widowisko w Polsce.','www_hhbd_pl_Gural_1.jpg','image/jpg',NULL,NULL,'<ul>\r\n<li>Kamil \"Jakuza\" Jaczyński</li>\r\n<li>tel.: 502 214 585</li>\r\n<li>mail: jakuza@wielkiejol.com</li>\r\n</ul>','0000-00-00','0000-00-00',1,'',1,1,2797,100,NULL,'oficjalna strona www',''),(98,'Wally','','','2004-06-14 17:10:11','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1390,100,NULL,'',''),(99,'Marta EF','','','2004-06-14 17:48:37','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,7