0-00','0000-00-00',0,'',3,0,537,100,NULL,'',''),(113,'Piooro','','','2004-06-14 18:23:53','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,714,100,NULL,'',''),(114,'Doniu','Dominik Grabowski','','2004-06-14 18:26:56','2005-09-02 02:26:26','Doniu czyli Dominik Grabowski to w chwili obecnej jeden z najbardziej znanych i cenionych producentów i raperów na polskiej scenie hip-hopowej. Pochodzący z Obornik Wielkopolskich, koło Poznania, z muzyką związany od dziecka, pierwsze kroki na scenie postawił mając lat kilkanaście za sprawą konkursów dla instrumentalistów solistów. Zdobywając pierwsze szlify na pianinie i innych instrumentach klawiszowych nie sądził zapewne jak blisko z nimi będzie związana jego przyszłość. Około roku 96` słuchając rapowych płyt zza oceanu, klasyków takich jak EPMD, Notorious BIG czy M.O.P zarażony siłą kultury hiphopowej postanowił dać jej coś od siebie. Zaczynał od prostych bitów tworzonych jeszcze za pomocą trackerów. Jak sam mówi: &#8222;To były siermiężne początki, muzyka w ogóle nie przypominała hiphopu, jakieś nieposkładane rytmy robione na Protrackerze, wiesz, toporny sprzęt i ciągła nauka&#8221;. W latach 98/99 w piwnicy swojego domu powstały pierwsze nagrania tworzone z kumplem z podwórka - Liberem. W nagraniach uczestniczyło więcej ludzi, była to luźna ekipa, która z czasem sformowała się w grupę o abstrakcyjnej nazwie &#8222;Ascetoholix&#8221;. Od roku 98&#8217; tworzy ją trzech chłopaków: Kris, Liber oraz Doniu. Do 2000 roku nagrali razem dwa nielegale, by po wstępnych rozmowach z wytwórnią Camey&#8217;a podpisać umowę na legalną płytę zespołu &#8222;A&#8221;. Doniu na stałe związany z Poznaniem, zaczął nawiązywać współpracę z innymi grupami i wykonawcami: Hansem i Deepem z ówczesnego 52, Mezo, SLU później z Owalem. Koneksje zaowocowały wspólnymi nagraniami, dokonywanymi już w pół profesjonalnym studiu &#8222;Dillegal&#8221;, które w 2001 powstało w domu u Donia. Udział w płycie &#8222;Blokersi&#8221; Sylwestra Latkowskiego, kompilacja &#8222;Robię Swoje 2&#8221; to jedne z pionierskich płyt, na których można było usłyszeć Donia i resztę ekipy promujących m.in. numer &#8222;Już Dawno&#8221;. Kawałek przeszedł do klasyki a grupa zaczęła liczne koncerty po całej Polsce. Poznań, Elbląg, Wrocław, Łódź, Częstochowa i wiele innych miast poczuło powiew rapu z Wielkopolski. Koncertowali również na dużych festiwalach hiphopowych w Opolu (KFP) czy Wrocławiu. Doniu przez większość czasu koncentrował się przede wszystkim na pracy producenta. Szkoląc swój warsztat na przestrzeni ostatnich 2 lat, współprodukował takie płyty jak: Mezo &#8222;Mezokracja&#8221;, Fu &#8222;Wrodzony Instynkt&#8221;, 18L &#8222;Wideoteka&#8221;, 52 Dębiec &#8222; Poznań VI&#8221;, Dj Decks &#8222;Mixtape nr3&#8221;, Ascetoholix &#8222;Apogeum&#8221;, Liber &#8222;Bógmacher&#8221; czy Owal/Emcedwa &#8222;Wirus&#8221;, oraz wspomagał nielegalne produkcje poznańskich składów takich jak W.B.U, czy Green Team. Jak wspomina: &#8222;Rok 01&#8217; i 02&#8217; czy 03&#8217; to duży wysiłek: koncerty, praca w studiu z wieloma wykonawcami, ale przychodzi też zawsze czas na refleksję i pisanie tekstów, do których zawsze wracam, siadam wieczorem, puszczam bit i piszę, tak po prostu&#8221; I tak Doniu zaznacza się w pamięci jako &#8222;szowinista&#8221; z perfidną zwrotką w hicie &#8222;Suczki&#8221;, charakterystycznie puentuje refren w &#8222;Jestem Tu&#8221; z Owalem, przypomina nam o rzeczach najważniejszych w życiu w niewątpliwym hicie &#8222;Skarby&#8221; z Liberem czy ironicznie rymuje o Polakach w refrenie z Hansem w numerze &#8222;To my&#8221;. Rok 2004 to kolejny pracowity rok dla artysty: kilkadziesiąt koncertów i rozpoczęcie prac nad solowym albumem. W międzyczasie nagrywanie numerów na polsko-francuską kompilację &#8222;Visa&#8221;, współpraca z kultowym zespołem z lat 70&#8217; &#8211; Kombi i&#8230; niestety poważny wypadek samochodowy w sierpniu tego roku, w którym ginie menadżer artysty. Doniu wraca jednak do prac nad albumem mówiąc &#8222; Mój album odbiega od wcześniejszych projektów, mówiąc prosto o realiach ma dawać ludziom energię, jakieś światło, pogodę ducha. Chcę też pokazać że raper to nikt inny jak chłopak z sąsiedztwa, czasem cwaniak, czasem skurwiel, ale często normalny uśmiechnięty gość jak każdy inny, ziomek. Muzycznie materiał ociera się o różne gatunki: jest szczypta dancehallu, tradycyjnego hiphopu z połowy lat 90&#8217;, jest też trochę samplowania, ale i dużo elektroniki&#8230;Ogólnie nie chcę się zamykać w stereotypach, lubie sobie podśpiewać refren, pokrzyczeć do majka, wyżyć się w studiu, proste!&#8221; kwituje wypowiedź.',NULL,'',NULL,NULL,' ','0000-00-00','0000-00-00',1,'',3,7,2335,100,NULL,'',''),(115,'Pomorski D.','','','2004-06-14 18:28:27','2004-06-14 20:47:42','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,927,100,NULL,'',''),(116,'Pele','','','2004-06-14 18:49:01','2005-12-20 00:34:07','','www_hhbd_pl_Pele_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,4606,100,NULL,'Marcin Grochowina','http://www.sfotografuj.to.pl'),(117,'Dj Feel-x','Sebastian Filiks','http://www.djfeelx.pl','2004-06-14 20:51:51','2005-05-12 18:20:23','',NULL,'',NULL,NULL,'tel: 507 961 640<br />\r\ne-mail: djfeelx@djfeelx.pl<br />\r\ngg: 3016472<br />\r\nskype: for1234','1978-02-07','0000-00-00',1,'',1,7,1499,100,NULL,'',''),(118,'Dj Bart','','','2004-06-14 20:51:51','0000-00-00 00:00:00','','www_hhbd_pl_Dj_Bart_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,1507,100,NULL,'Muuody',''),(119,'CBK','','','2004-06-14 20:54:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1126,100,NULL,'',''),(120,'Jimson','','','2004-06-14 20:54:07','2005-09-01 12:59:19','Obdarzony niską i mocną barwą głosu, jeden z najlepiej technicznie nawijających w kraju niemalże z miejsca po ukazaniu się płyty zyskał duży respekt zarówno wśród słuchaczy jak i twórców. Poza epką możecie kojarzyć go z występu razem z CEbk (jako Miejski Klasyk) na płycie Magiery i L.A. - \"Kodex 2\" w utworze \"Dokładnie w Twoich Uszach\" jak też i z featuringu na płycie Deobe/Dena w kawałku \"Ucieczka\". ',NULL,'',NULL,NULL,'Jeśli interesuje Cię organizacja koncertu, któregoś z artystów, prezentowanych na www.eternia.pl, pisz na booking@eternia.pl','0000-00-00','0000-00-00',0,'',1,7,570,100,NULL,'',''),(121,'Michał','','','2004-06-14 20:54:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,366,100,NULL,'',''),(122,'Włodi','','','2004-06-14 21:03:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,3022,100,NULL,'',''),(123,'Wilku','','','2004-06-14 21:03:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,2146,100,NULL,'',''),(124,'Molesta','','','2004-06-14 21:03:07','2006-03-26 22:44:27','Trzon zespołu Molesta Ewenement (wcześniej znana jako Mistik Molesta, a potem Molesta) tworzą <a href=\"/n/vienio\">Vienio</a> oraz <a href=\"/n/wlodi\">Włodi</a>. Zespół powstał w 1995 roku, a debiut fonograficzny odbył się w 1997 roku - po raz pierwszy można było ich usłyszeć na składance \"<a href=\"/a/smak_b_e_a_t_records\">Smak B.E.A.T. Records</a>\" w hardcorowym kawałku <a href=\"/s/osiedlowe_akcje\">Osiedlowe Akcje</a>. Na tejże znajduje się też solowa produkcja <a href=\"/n/wlodi\">Włodka</a> - <a href=\"/s/nie_dla_slawy\">Nie dla sławy</a>.\r\nPotem nadszedł czas na debiutancki album \"<a href=\"/a/skandal\">Skandal</a>\" (1998). Płyta ta uważana jest przez wielu za pierwszą polską produkcje hardcorową-uliczną. I rzeczywiście to oni byli tymi, którzy rozpoczęli ten kierunek w polskim hip hopie. Wiele fragmentów tekstów i fragmentów utworów na stałe wpisało się w polską kulturę hip hop (każdy fan hip hopu zna takie utwory jak <a href=\"/s/sie_zyje\">Sie żyje</a>, <a href=\"/s/xeroboj\">Xeroboj</a>, <a href=\"/s/wiedzialem_ze_tak_bedzie\">Wiedziałem, że tak będzie</a>). Już na tej pierwszej produkcji można zauważyć specyficzny styl Molesta. Oszczędne podkłady (wtedy jeszcze robione przez współpracującego z Włodkiem i Vieniem - <a href=\"/n/dj_600v\">DJ 600 V.O.L.T.\'a</a>) doskonale współbrzmią z ostrymi tekstami chłopaków. A w tekstach przewijają się przede wszystkim fragmenty ich codziennego życia - osiedlowe problemy, imprezy, kumple, ale także tematy poważniejsze - zaufanie do przyjaciół, oryginalność, narkotyki.\r\nNastępna płyta pod tytułem \"<a href=\"/a/ewenement\">Ewenement</a>\" wydana została we wrześniu 1999 roku. Album ten kontynuuje drogę obraną na debiutanckiej produkcji, dojrzalsze teksty podejmują jednak poważniejsze tematy (nadal pozostając oczywiście w ulicznym klimacie) - problemy, które dręczą nasze społeczeństwo: narkomania, jednostka kontra system, szacunek do samego siebie. Tym razem muzykę Vienio i Włodek robili wspólnie z Voltem (wyraźnie słychać rozwój nie tylko w tekstach, ale także w podkładach).\r\nW roku 2000 z inicjatywy Vienia i Włodka powstaje Baza Label - hiphopowa wytwórnia wydająca swoje płyty pod szyldem <a href=\"/l/Pomaton_EMI\">Pomatonu</a>. To oni odpowiadają za to co ukazuje się w BAZIE LEBEL i w jaki sposób jest promowane.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,5879,100,NULL,'',''),(125,'Bilon','','','2004-06-14 21:04:24','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,1536,100,NULL,'',''),(126,'Hemp Gru','','','2004-06-14 21:04:24','2004-06-14 21:04:48','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,3811,100,NULL,'',''),(127,'Tymi','','','2004-06-14 21:09:39','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,685,100,NULL,'',''),(128,'17','','','2004-06-14 21:09:39','2004-06-14 21:10:56','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,1166,100,NULL,'',''),(131,'Jajo','','','2004-06-14 22:10:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,622,100,NULL,'',''),(132,'Talaga Mac