5:50','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1277,100,NULL,'',''),(160,'KRI','','','2004-06-15 19:38:15','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,416,100,NULL,'',''),(161,'Pęku','','','2004-06-15 19:44:35','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1061,100,NULL,'',''),(162,'Jaźwa','','','2004-06-15 20:02:04','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,906,100,NULL,'',''),(163,'Dj Haem','Piotr Jończyk','','2004-06-15 21:07:35','2005-07-19 14:16:17','DJ i producent. Urodzony w 1980 w Opolu, mieszka w Częstochowie. Za gramofonami od 1997, pierwsze imprezy zaczął grać w roku 1998. Jego przygoda z hip-hop\'em rozpoczęła się od graffiti w roku 1995. Następnie grywał i nagrywał z lokalnymi składami rapowymi, w latach 2000 i 2001 wystąpił na festwialach piosenki aktorskiej we Wrocławiu w roli turntablisty, grając m.in. z: Mateuszem i Marcinem Pospieszalskim, Januszem \"Yaniną\" Iwańskim, Piotrem \"Stopą\" Żyżlewiczem, Michałem Dąbrówką, Jerzym Styczyńskim, Wojciechem Karolakiem, Stanisławem Sojką, Justyną Steczkowską, Anna Marią Jopek, Maciejem Maleńczukiem, Muńkiem Staszczykiem. Grywał również w jazzowych składach eksperymentalnych m.in. z zespołami: \"UniversalSuperSession\" - złożonym z muzyków z Holandii, Niemiec, USA i Polski, w projekcie basisty VOOVOO - Karima Martusewicza - złożonym z muzyków z Austrii i Polski. Od 2001 roku zaczął koncertować z PFK Kompany (Ego i Paktofonika), od roku 2003 koncertuje z O.S.T.R. Rezyduje również jako \"party dj\" w warszawskich klubach: Scena2000, Paragraf 51, Live. Od 2004 prowadzi cykliczną, autorską audycję \"KWINTESENT\" w częstochowskim radiu FON. Trzykrotnie uczestniczył w roli wykładowcy na Vestax DJ Campie. Od 2000 roku pracuje jako realizator dźwięku i producent w częstochowskim studiu nagrań \"Radioaktywni\". Wydawnictwa (w roli producenta): IDEO \"Stan Rzeczy\", EGO \"Nibylandia\", Cudawianki \"Udawanki\", LARIFARI \"Dusza\", MixCD \"Atomistyka\", IDEO \"Mentalnie\", Ciągdalszy \"Zagadka?\", HABAKUK \"Rozczochrany Łeb - Remixy\", PAKTOFONIKA \"Jestem Bogiem\" (singiel), Pijani Powietrzem \"Zawieszeni W Czasie I Przestrzeni\", Kodex2 \"Suplement\", JuNouMIi \"vol.3\", Godziny Szczytu \"Zanim Minie Czas...\", DonGuralesko \"Drewnianej Małpy Rock\", Grammatik \"3\". W roli dj\'a gościnne występy na płytach: F.F.O.D. \"Promillenium\", MAKLE KFUCKLE \"La Bomba\", V.A. \"2071\", DonGuralesko \"Opowieści Z Betonowego Lasu\", HABAKUK \"Muzyka, Słowo, Liczba, Kolor\", Magiera & L.A. \"Kodex\", Paktofonika \"Archiwum Kinematografii\", Rahim \"Experyment Psyho\", Żusto \"Hiphobbitz\", O.S.T.R. \"Jazz W Wolnych Chwilach\", O.S.T.R \"Jazzurekcja\". ','www_hhbd_pl_Dj_Haem_1.jpg','image/jpg',NULL,NULL,'		  ','0000-00-00','0000-00-00',1,'',1,7,1660,100,NULL,'Asfalt Rec.','http://www.asfalt.pl'),(164,'Bit-Bak','','','2004-06-15 21:18:25','2005-04-13 17:49:05','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,7,1322,100,NULL,'',''),(165,'Fisz','Bartek Waglewski','','2004-06-15 21:20:32','2005-09-11 01:47:03','Oryginalne teksty urodzonego w 1978 roku Fisza niosą osobisty, wewnętrzny przekaz, pełen para-poezji oraz introwertycznych obserwacji. W swej twórczości Fisz od zawsze korzysta z pomocy cenionego producenta a prywatnie rodzonego brata - Emade (ur. 1981), który oprócz operowania samplerami powrócił ostatnio także do gry na perkusji, gitarze i klawiszach. Tworzy on dla Fisza muzykę przestrzenną i spokojną a jednocześnie mocną i sto procent autentyczną. Muzykę, której pierwsze inspiracje miały swe korzenie w starej hiphopowej szkole Native Tongues (NYC) i we współczesnym Concious HipHopie. W muzyce tej słychać także Nu Soul, Nu Jazz a często po prostu stary Soul i Funk lat 70ych. Ostatnio coraz częściej słychać w niej także szereg najnowszych i awangardowych nurtów współczesnej muzyki miejskiej (click/noise).\r\nStyl pierwszych dwóch płyt Fisza jest w porównaniu do ówczesnego oblicza polskiego HipHopu zdecydowanie bardziej ciepły i refleksyjny.\r\nDebiut Fisza \"Polepione dźwięki\" z 26 czerwca 2000 r. to przełomowa pod względem muzycznym i tekstowym płyta, która zrobiła duże zamieszanie na scenie hiphopowej i spotkała się z samymi najwyższymi ocenami. Nie jest przesadą stwierdzenie, że swym debiutem Fisz nieodwracalnie zmienił polską scenę hiphopową. Wcześniej, dla wymagającego słuchacza HipHopu, na krajowej scenie nie było liczącej się alternatywy dla nurtu głęboko osadzonego w monotonnych realiach brudnej ulicy. Dzięki Fiszowi, zjawisko jakim jest polski HipHop zaczęło być wówczas odbierane jako coś rozwijającego intelektualnie i emocjonalnie.\r\nWzbogacona o skromny udział instrumentalistów, druga płyta Fisza pt. \"Na wylot\" operowała bardziej jazzowymi nastrojami. Na płycie gościnnie wystąpiła Novika (wokalistka Futra) a także muzycy sesyjni: Karim (kontrabas, gitara basowa, piano Fendera, analogowy syntezator basowy), Horst \"AGMS\" Michael-Schaffer (trąbka + efekty), Milo Kurtis (przeszkadzajki) oraz ostatni co do kolejności ale nie ostatni co do ważności Wojciech Waglewski (gitara). Płyta ta jeszcze przed jej wydaniem (24/09/2001) narobiła więcej szumu niż debiut \"Polepione...\". W \"Machinie\" 9/2001 album został oceniony na 4,5 klucza (4 klucze: rewelacja, 5 kluczy - klasyk). W recenzji padły stwierdzenia: \"tak jak brzmi \'Na wylot\' nie brzmiało już dawno nic w tym kraju\", \"między nim a resztą rapowej sceny znad Wisły nie da się już postawić znaku równości\", \"znów zawstydza konkurencję, nie tylko hiphopową\".\r\nTrzecia płyta Fisza, którą nagrał wraz z własnym, kompletnym zespołem sesyjno-koncertowym, w ogóle wymyka się hiphopowej klasyfikacji i powinna być odbierana jako dzieło niezależne od jakiegokolwiek trendu obecnego w polskiej muzyce. Jest to płyta bardzo autorska i eklektyczna. Wśród zaproszonych muzyków znaleźli się między innymi: tradycyjnie Karim Martusewicz na basie, Marek Piotrowski (Sistars) na klawiszach Rhodes, Dominik Trębski na trąbce oraz rewelacyjnie śpiewająca i ruszająca się Nuno (wcześniej z Modfunk). Nowością jest też Emade siedzący teraz za perkusją oraz grający na innych instrumentach. Pojawiają się także dwaj raperzy - Peteero (znany z debiutu Fisza) a także - po raz pierwszy na płycie - Max zwany teraz Pablo Chudini (na koncie kilkadziesiąt zagranych z Fiszem koncertów). Album ukazał się na rynku 9 grudnia 2002 r.\r\nNowy, czwarty album pt. \"Wielki Ciężki Słoń\" (poprzedzony singlem \"Tysiąc pięćset sto gwiazd\") ukazał się pod koniec maja 2004 r. Jest to pierwszy album firmowany w całości tylko przez nazwę siedmioosobowego zespołu Fisza i Emade - \"Tworzywo Sztuczne\". Album wyprowadził słuchaczy Fisza, czy raczej Tworzywa Sztucznego, na kompletnie nowe tereny muzycznej wrażliwości. Robert Sankowski, krytyk \"Gazety Wyborczej\", napisał tak o albumie: \"Jedna z ważniejszych polskich płyt tego roku. Mimo, że mamy dopiero koniec maja\".\r\nW listopadzie 2004 ukazuje się długo oczekiwany album koncertowy Tworzywa Sztucznego p.t. \"Na rzywo w Mózgu\". Jak sam tytuł wskazuje koncert został zarejestrowany w klubie \"Mózg\" w Bydgoszczy (w maju tego roku).\r\nFisz zdobył nominację do Nagrody Akademii Fonograficznej Fryderyk 2000 w kategorii debiut roku oraz album roku - Rap & Hip-Hop. Nominacja w kategorii album roku - Rap & Hip-Hop powtórzyła się także przy Fryderyku 2002. Nominacja do Fryderyka 2003 za album \"F3\" przyszła za to w kategorii album roku - muzyka klubowa. Fisz zdobył nagrodę Machiner 2000 w kategorii \"Płyta niszowa\" oraz za sprawą Pawła Sito, wówczas szefa Radiostacji, nominację do \"Paszportu Polityki\" w kategorii \"Jazz, Rock, Pop, Estrada\". \"Polepione dźwięki\" wybrane zostały polską płytą roku 2000 przez redakcję pisma \"Fluid\". Hiphopowy miesięcznik \"Klan\" nazwał Fisza \"najlepszym / najważniejszym wykonawcą polskim 2001\", jego brata Emade \"najlepszym / najważniejszym producentem polskim 2001\" a video do singla \"Tajemnica\" - \"najlepszym klipem polskim 2001\". Jakby tego było mało, album \"Na wylot\", otwiera listę \"najlepszych / najważniejszych płyt polskich 2001\". Otrzymał \"Ślizgera 2001\" w kategorii \"Osobowość\". Album \"F3\" został (obok 4 innych albumów) wyróżniony w podsumowaniu roku 2002 pisma \"Klan\" za - \"za wyjście poza hip-hop\". W tym samym podsumowaniu wyróżniono producenta płyty - Emade - \"za organiczne i elektroniczne smaczki \"F3\"\" (obok 4 innych producentów). Kolejnego współ-wyróżnienia doczekał się także pochodzący z albumu singiel \"Sznurowadła\" (\"za chill outowy niepokój\") i teledysk do tego utworu autorstwa Tomasza Nalewajka (\"za krew i umywalkę\").\r\nOprócz trzech płyt oraz wcześniejszego udziału w ramach grupy RHX, Fisz wystąpił gościnnie na płytach: Grammatik \"Światła miasta\" (T1 2000), Ośka \"Kompilacja 2\" (Asfalt 2001), DJ 600 V \"Wrukwione bity\" (RRX 2001), Paktofonika \"Archiwum Kinematografii\" (Gigant 2002) oraz na czeskiej kompilacji \"East Side Unia 2\" (Terrorist! 2000). Gościnny występ Fisza znalazł się na także na ostatniej płycie zespołu T.Love. Nie należy też zapomnieć o dwóch winylowych (12\") singlach Fisza z utworami \"Polepiony\" i \"Huragan\" (Asfalt 2001) oraz \"Tajemnica\" (Asfalt 2001), a także o dwóch kompaktowych maxi-singlach z albumu \"Na Wylot\": \"Tajemnica\" (Asfalt 2001) oraz \"30 cm\" (Asfalt 2002).\r\n18 października 2003 w Teatrze \"Wybrzeże\" miała miejsce polska prapremiera spektaklu \"Tlen\" Iwana Wyrypajewa w inscenizacji Agnieszki Olsten z muzyką wyprodukowaną przez Fisza i Emade z udziałem Olo Walickiego, Dominika Trębskiego i Jurka Zagórskiego.\r\nFisz i Emade stale koncertują od 2000 r. (od września 2002 r. zawsze jako sześcioosobowy zespół w składzie: Fisz, Emade - perkusja, Dominik Trębski - trąbka, efekty, Jurek Zagórski - gitara, Staszek Starszip - bas, Pablo Hudini - rap oraz ostatnio w siedmioosobowym składzie powiększonym o Łukasza Moskala - konga). W sumie (od września 2000 do listopada 2004) Fisz wystąpił na 138 koncertach, w tym w Berlinie, Bordeaux, Calvi (Korsyka), Dijon, Marsylii, Wiedniu, Pradze, Paryżu i Saint Vallier. (20/10/04).','www_hhbd_pl_Fisz_1.jpg','image/jpg',NULL,NULL,'<ul>\r\n<li>mail: tytus@asfalt.pl</li>\r\n<li>tel.: 502-313-300</li>\r\n</ul>','0000-00-00','0000-00-00',1,'',1,1,3388,100,NULL,'Asfalt Records','http://www.asfalt.pl'),(166,'Igor','','','2004-06-15 21:20:32','2004-06-16 19:43:09','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,1744,100,NULL,'',''),(167,'Emade','Piotr Waglewski','','2004-06-15 21:30:12','2005-05-13 00:50:22','Producent wszystkich pięciu albumów Fisza i Tworzywa Sztucznego (dwa pierwsze zdobyły nominacje do \"Fryderyków\" w kategorii \"Album roku - Hip-Hop\", trzeci w kategorii \"Album roku - muzyka klubowa\"). Muzyk, producent, perkusista, DJ. Na 20. Przeglądzie Piosenki Aktorskiej (Wrocław 1999) akompaniował na gramofonach występowi Nicka Cave\'a i Bad Seeds. Polski producent roku 2001 w/g hiphopowego pisma \"Klan\". W podsumowaniu roku 2002 tego samego pisma Emade został wyróżniony \"za organiczne i elektroniczne smaczki \"F3\"\" (jedno z 4 wyróżnień producenckich). W 2005 wraz z bratem - Bartkiem [Fisz] oraz ojcem - Wojciechem [frontman VooVoo] został uchonorowany jako osobość tygodnika \"Przekrój\".<br /><br />\r\n<br /><br />\r\nZabawę z muzyką rozpoczął jako 13 letni perkusista własnej formacji hardcore\'owej. Kilka lat później zajął się czynnie swą nową fascynacją - Hiphopem - w ramach zespołu RHX, sformowanego wraz z Fiszem i Inespe (debiutancki album w 1999 roku). W 2001 roku wyprodukował w całości solowy album Inespe. W 2003 roku na zaproszenie Smolika wykonał remix utworu \"Who Told You\" z Miką Urbaniak a na zaproszenie WWO remix utworu \"Bezsenna noc\". Pod koniec 2003 roku, po niemalże roku pracy ukazał się jego solowy debiut - autorski album producencki (poprzedzony czerwcowym singlem \"Dam Ci przeżyć\" z gościnnym udziałem Sokoła z WWO). Do udziału w albumie zostali zaproszeni: wspaniała retro-jazzowa wokalistka Iza Kowalewska z zespołu Muzykoterapia, O.S.T.R., Włodi, Inespe, Sokół, Fisz oraz gość z USA: brooklyńska grupa Little Egypt. Wszyscy krajowi goście, przy akompaniamencie żywego zespołu towarzyszącego Emade, wystąpili na wielkim koncercie promocyjnym albumu 19 marca 2004 r. w Warszawie. Album zdobył nominację do \"Fryderyka 2004\" w kategorii \"Album roku - Hip-Hop\". W 2004 roku Emade wraz z Wojciechem Waglewskim współpracował nad produkcją albumu Marii Peszek.','www_hhbd_pl_M_A_D_1.jpg','image/jpg',NULL,NULL,'tytus@asfalt.pl<br />\r\ntel.: 502-313-300<br />\r\n			  ','0000-00-00','0000-00-00',1,'',1,7,2251,100,NULL,'Asfalt Records','http://www.asfalt.pl'),(168,'Tworzywo Sztuczne','','','2004-06-15 21:30:12','2005-05-13 01:23:28','','www_hhbd_pl_Tworzywo_Sztuczne_1.jpg','image/jpg',NULL,NULL,'tytus@asfalt.pl<br />\r\ntel.: 502-313-300<br />\r\n			  ','0000-00-00','0000-00-00',1,'',1,7,1263,100,NULL,'Asfalt Records','http://www.asfalt.pl'),(169,'Lu','','','2004-06-15 23:01:29','2004-06-15 23:04:23','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,3,1000,100,NULL,'',''),(170,'Olsen','','','2004-06-15 23:01:29','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1215,100,NULL,'',''),(171,'Dejot','','','2004-06-15 23:26:02','2004-06-17 02:46:27','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,352,100,NULL,'',''),(172,'Iman','','','2004-06-15 23:29:00','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,583,100,NULL,'',''),(173,'Głos Ulic','','','2004-06-15 23:36:33','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,687,100,NULL,'',''),(174,'Tazer','','','2004-06-15 23:36:33','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1047,100,NULL,'',''),(175,'Koźlik Dorota','Dorota Koźlik','','2004-06-15 23:47:58','2004-06-16 12:06:16','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,923,100,NULL,'',''),(177,'Dizkret','Wojtek Nosowski','www.dizkret.com','2004-06-16 01:11:30','2005-12-09 16:11:13','\"Wielki krok w stronę tego, żebyśmy więcej nie wstydzili się za polski hip-hop. Bardzo dobra płyta\" W ten sposób jeden z dziennikarzy muzycznych zakończył swoją recenzję albumu Dizkret&Praktik \"IQ\". W czasach, gdy gatunek ten zdominowany jest przez banał i tandetę, twórczość Dizkreta to powiew świeżości i kreatywności. Swoją profesjonalną przygodę z muzyką zaczął bardzo wcześnie. Już w wieku 15 lat, wraz ze swoim zespołem TJK, grał przed legendarną amerykańską grupą RUN-DMC podczas ich występu na pierwszym w historii polskim<br />\r\nfestiwalu hip-hopowym RAP DAY`97. Jako założyciel i członek TJK, obserwował powstanie i rozwój polskiej sceny hip-hopowej na długo zanim teledyski rapowe zagościły na antenach stacji telewizyjnych a całe zjawisko na łamach poczytnych tygodników. Wraz z zespołem zagrał serię koncertów w ramach kultowych już imprez w klubie Riviera Remont a TJK zdobyło szacunek i uznanie, zarówno wśród odbiorców jak i reszty sceny.<br />\r\n      Następnym krokiem było zaproszenie, w 1998 roku, do udziału w projekcie Stare Miasto razem z Dj Romkiem, Wujlokiem oraz producentami z kręgu jazz/funk: Majki Majkiem, Korzeniem i Trojanem. Wielotygodniowe sesje nagraniowe były pierwszym w Polsce przypadkiem połączenia hip-hopu z \"żywym\" instrumentarium. Praca w studio była poważną szkoła profesjonalizmu, a przede wszystkim otwartości na różne style muzyczne. W przerwach między nagraniami Dizkret poznawał twórczośc Herbiego Hancocka, Jamesa Browna, Milesa Davisa. Materiałem zgromadzonym przez Stare Miasto natychmiast zainteresowała się wytwórnia Polygram Polska (obecnie Universal) i zaproponowała zespołowi wydanie debiutanckiej płyty. Był to milowy krok w artystycznej drodze Dizkreta, kontrakt z dużą wytwórnią wiązał się bowiem z profesjonalną, kompleksową promocją. I rzeczywiście, zespół zaistniał w mediach, radio i telewizji a singlowy utwór \"Jak się poruszać?\" stał się dużym wydarzeniem. Płyta \"Stare Miasto\" zaowocowała serią kilkudziesięciu koncertów w całej Polsce, zarówno w klubach, jak i podczas festiwali (np. \"Odjazdy\" w Katowicach). Pozytywna, jazzowo-funkująca muzyka Starego Miasta zdobyła grupie wielu fanów w całym kraju.<br />\r\n      Prace nad drugą płytą trwały do roku 2001, kiedy to ukazał się LP \"Minuty\" wraz z singlami \"Showbiz\" oraz \"Minuty\". Do obydwu zrealizowano wideoklipy, które telewizje muzyczne włączyły do swoich rotacji. \"Minuty\" cieszyły się popularnością zarówno wśród publiczności, jak i krytyków. Pozytywnie oceniano brzmienie, klimat płyty, lecz również warstwę tekstową stanowiącą nową jakość w polskiej muzyce hip-hopowej. Stare Miasto porównywano do takich zespołów zza oceanu jak The Roots, A Tribe Called Quest czy The Pharcyde. Oprócz kolejnych koncertów w całej Polsce następstwem płyty \"Minuty\" były zaproszenia do gościnnych udziałów na płytach innych wykonawców. Wśród artystów, którzy zaprosili Dizkreta na swoje wydawnictwa znaleźli się między innymi: Waco (wspólny utwór z Pezetem pt. \"Przyjdz na chwilę\"), Eldo (Grammatik), soulowo-jazzowy projekt Lari Fari, Red). Dizkret zdobył opinię jednego z najlepszych polskich tekściarzy dzięki kreatywnemu podejściu do rymów, słow i języka polskiego. W międzyczasie połączył siły ze znajomym gitarzystą jazzowym, producentem muzycznym i kolekcjonerem płyt winylowych Praktikiem i rozpoczął pracę nad pierwszym solowym albumem. Płyta \"IQ\" ukazała się w 2002 roku a gościnnie wystąpiła na niej czołówka polskich raperów (Pezet, Mes) a także młoda szkoła polskiego hip-hopu (popularne w Warszawie trio 247, śląski raper Majkel oraz Pan Wankz z grupy Dinal). Do pracy nad płytą zaproszono czołówkę polskich DJ`ów (DJ Twister, DJ Romek). Po raz kolejny winylowe brzmienie zostało wzbogacone o \"żywych\" muzyków. Jarej ze znanego funkowego zespołu Łąki Łan na klawiszach, Stasiu Starship (Łąki Łan, obecnie Tworzywo Sztuczne) na basie, Darek \"Struś\" Plichta na puzonie to tylko niektórzy z nich. Doskonałe recenzje, nie tylko w prasie branżowej (Gazeta Wyborcza, Fluid, Maxim, City) potwierdziły wysoki poziom wydawnictwa. Płyta trafiła do wielu słuchaczy, na co dzień nie słuchających hip-hopu, ale potrafiących docenić eklektyczne i kreatywne podejście do muzyki duetu Dizkret Praktik.<br />\r\n      \"Nagrywanie płyt, piosenek to dla mnie niesamowite doświadczenie. Pozwala skanalizować cała pozytywną energię i przekazać ja reszcie świata\" mówi 22-letni wokalista. \"Nie mam wiele wspólnego z buntowniczo-narzekająca estetyką, ostatnio dosyć popularną. Nie interesują mnie jednak żadne szufladki, bo tak samo dużo czerpię z klasycznego hip-hopu jak soul`u czy oldschoolowego funk`u\". Obecnie jest w trakcie realizacji nowej płyty długogrającej. \"To będzie nareszcie to, co zawsze chciałem zrobić, a dopiero teraz do tego dojrzałem. Skompletowaliśmy doskonały skład muzyków, wokalistów, producentów i jestem szczęśliwy, że mogę pracować z tak kreatywnymi ludźmi\" mówi o swojej nowej produkcji, \"Muzycznie będzie to mariaż moich wszelkich fascynacji muzycznych, od filadelfijskiego soul`u, jazz-funk`u z lat 70`tych (Roy Ayers, Gil Scott-Heron), Fela Kuti do współczesnych brzmień takich artystów jak Dwele, Jay Dee, New Sector Movements, Amp Fiddler, Jazzanova\". Muzycznej pasji daje również wyraz, okazjonalnie, jako dziennikarz muzyczny w lifestylowym piśmie Hiro a także w roli DJ`a, podczas swoich setów prezentując to, co najciekawsze we współczesnej (i nie tylko) muzyce.<br />\r\n      Na koncertach, pod szyldem \"Dizkret\", występuję on razem z 6 osobowym składem (perkusja, bas, gitara, piano fender rhodes oraz chórki w wykonaniu dwóch wokalistek). Wieloletnie doświadczenie sceniczne Dizkreta zapewnia doskonały kontakt z publicznością, a występy zespołu to profesjonalizm i ogromna dawka pozytywnej energii.',NULL,'',NULL,NULL,'Jeśli interesuje Cię organizacja koncertu, któregoś z artystów, prezentowanych na www.eternia.pl, pisz na booking@eternia.pl','0000-00-00','0000-00-00',1,'',4,3,1360,100,NULL,'',''),(178,'Praktik','Jakub Nowak','','2004-06-16 01:13:04','2005-12-09 16:11:34','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',4,3,619,100,NULL,'',''),(179,'Mustafarai','','','2004-06-16 01:39:18','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',4,0,946,100,NULL,'',''),(180,'Lady','','','2004-06-16 01:44:39','2004-11-25 21:54:30','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,1,304,100,NULL,'',''),(181,'Wujrock','','','2004-06-16 01:44:39','2005-05-12 20:06:30','',NULL,'',NULL,NULL,'	  ','0000-00-00','0000-00-00',1,'',4,7,1237,100,NULL,'',''),(182,'Stasiak','','','2004-06-16 01:53:20','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',4,0,966,100,NULL,'',''),(183,'Pezet','Paweł Kapliński','','2004-06-16 01:53:20','2005-01-18 19:44:19','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',4,1,3050,100,NULL,'',''),(184,'Majkel','','','2004-06-16 01:57:17','2004-11-25 22:01:03','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,1,423,100,NULL,'',''),(185,'Wanklej','','','2004-06-16 01:57:17','2004-06-16 15:11:06','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,1,1020,100,NULL,'',''),(186,'Pjus','','','2004-06-16 01:57:17','2004-06-16 11:53:03','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',4,1,732,100,NULL,'',''),(187,'Dj Romek','','http://www.djromek.rytm.org','2004-06-16 02:02:14','2005-07-19 18:18:09','Począwszy od udziału w projekcie \'SinSemila\', po dzień dzisiejszy DJ Romek nagrywał swoje skrecze lub produkował muzykę na bardzo wielu płytach. Mówi o sobie, że jest osobą zawsze gotową do współpracy przy \'dojrzałych\' projektach.','www_hhbd_pl_Dj_Romek_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',4,7,1388,100,NULL,'Marcin Grochowina','http://www.sfotografuj.to.pl'),(188,'Flexxip','','','2004-06-16 02:04:41','2005-09-01 12:51:24','Zespół Flexxip powstał sześć lat temu. Stworzyły go dwie całkowicie odmienne osobowości. Ten Typ Mes i Emil Blef mieszając swoje inspiracje, wizje rapu i podejście do życia, wytworzyli jakość, którą określili jako flexxstyl. Zanim wyszli ze swoją twórczością - jak to zawsze podkreślali - długo nagrywali, ćwiczyli swoje umiejętności, aby ich styl z czasem stał się rozpoznawalny.<br />\r\nZanim zespół opuściły dwie inne osoby: Maciek i Fauo, nagrali kilkadziesiąt utworów. W już dwu osobowym składzie skoncentrowali się na nagraniu dema. Trzecią demówkę z kolei uznali za materiał na tyle reprezentatywny, żeby zacząć udzielać się w ówczesnym undergroundzie. Pierwszym utworem, który pojawił się w świadomości szerszej grupy ludzi, w radiu, czy obiegu internetowym, było \"Ladies\". Natomiast pierwszym wydanym legalnie zaistnieli na winylowej składance niezależnego wydawnictwa Junoumi vol.1 z kawałkiem \"Flexxstyl\" z gościnnym występem Dizkreta. W tym czasie zaczęli koncertować, aby z czasem uzyskać miano \"ulubieńców warszawskiej publiczności\".<br />\r\nZespół Flexxip, jeszcze bez legalnie wydanej płyty, często pojawiał się na płytach innych wykonawców: Junoumi vol.2 (2002), Dizkret&Praktik \"IQ\" (2002), Mes na płycie Pezet/Noon \"Muzyka Klasyczna\" (2001) i Reda \"Al-hub\" (2002). Jednak ważnym dla nich momentem był występ na Kodex (2002) z kawałkiem \"Oczy otwarte\" razem z Pezetem. Utwór długo nie schodził z wysokich pozycji na listach. W 2003 Flexxip otrzymał nagrodę (głosowanie publiczności) \"Ślizger\" za debiut roku przyznawaną przez czasopismo \"Ślizg\".<br />\r\nFlexxip podpisał kontrakt na płytę \"Fach\" z wytwórnią t1-teraz (2002) - o zespół starały się cztery wytwórnie - wydaną we wrześniu 2003 r. Recenzenci podkreślali, że jest to krążek długo oczekiwany, spekulowali czy Flexxip, zawsze stawiający wysoko poprzeczkę, nie zawiedzie słuchaczy. Mocno autobiograficzna (było to nowością na scenie hiphopowej), nowatorska tematycznie, ale klasyczna muzycznie, stylowo zawieszona w połowie lat 90, została bardzo dobrze przyjęta. Promowana singlami: \"Oszuści\", \"List\" i \"Szukam\" Tego Hajsu udowodniła ogromną pracę i zdolności tego duetu. Stała się bardzo ważną pozycją w polskim hiphopie. \"Płyta z tak dobrymi tekstami, wypasionymi bitami, oryginalnymi stylami, świeżą tematyką i większym współczynnikiem przebojowości od tej, już się raczej [..] nie ukaże\" - pisano w gazetach.<br />\r\nObecnie Flexxip ma na koncie sporą ilość koncertów w całej Polsce, dwa razy wystąpili w Berlinie, a w tym roku byli gośćmi festiwalu w Opolu. Zawsze wciągają do zabawy swoją publiczność serwując im solidna dawkę hiphopu.',NULL,'',NULL,NULL,'mail: booking@eternia.pl','0000-00-00','0000-00-00',1,'',4,7,1593,100,NULL,'',''),(189,'Blef Emil','Emil Blef','','2004-06-16 02:13:51','2004-06-16 11:57:02','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',4,1,969,100,NULL,'',''),(190,'V/A','','','2004-06-16 14:26:43','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1833,100,NULL,'',''),(191,'Noon','Mikołaj Bugajak','','2004-06-16 14:29:52','2004-11-27 16:18:42','',NULL,'',NULL,NULL,'','1979-00-00','0000-00-00',1,'',3,1,2246,100,NULL,'',''),(192,'Dj Taśmy Trzaski','','http://www.djtasmy.art.pl/','2004-06-16 14:35:42','2005-05-15 17:04:07','Jest DJ`em od 2001 roku. W tak krótkim czasie zdążył uplasować się w ścisłej czołówce polskich turntablistów. Na pierwszych zawodach, na których startował - Vestax POPDJ 2003 - zdobył tytuł mistrzowski, natomiast na polskich eliminacjach do Mistrzostw Świata ITF 2003 zajął wysokie 3. miejsce. Jest uczestnikiem większości najważniejszych wydarzeń turntablistycznych w Polsce. Na codzień tworzy www.skrecz.com - polskie centrum turntablismu w Internecie.<br />\r\nSwoimi klubowymi setami DJ Taśmy wraca do początków kultury Hip Hop grając sporo klasycznego rapu, funku i disco-breaks, wzbogacając wszystko o nowości hiphopowe i dancehall, omijając przy tym aktualne single grane w mediach. Grał na wspólnych imprezach m.in. z De La Soul (USA), Rahzelem (The Roots, USA), Looptroopem (Szwecja). Jako DJ jest również członkiem Diztrikt Crew.<br />\r\nJego fonograficznym debiutem był udział na winylowych składankach JuNouMi 3 oraz - wspólnie z producenckim kolektywem Bitnix - RapFrancuski EP. Na koncie ma również swój mix-cd \"Inna Caribbean Stylee!\" z muzyką dancehall, soca i hiphop (gościnnie na mixtapie pojawili się: Dizkret oraz Mr. Frenchman).<br />\r\nW chwili obecnej DJ Taśmy koncertuje z zespołem Grammatik oraz pracuje nad swoim drugim mixtapem o roboczym tytule \"Back In The Days\".<br />\r\n<br />\r\nBattle:<br />\r\n2003 : 1. miejsce na eliminacjach Vestax POPDJ Gdańsk, PL<br />\r\n2003 : 1. miejsce na finałach Vestax POPDJ - Warszawa, PL<br />\r\n2003 : 3. miejsce na Mistrzostwach Polski ITF Poland 2003 (Advancement Class) - Kraków, PL<br />\r\n2004 : 4. miejsce na Mistrzostwach Polski ITF Poland 2004 (Advancement Class) - Warszawa, PL<br />\r\n<br />\r\nMixtape`y:<br />\r\n- \"Inna Caribbean Stylee!\" Dancehall + soca + hiphop mixcd (2004)<br />\r\n<br />\r\nNagrania:<br />\r\n- cuty @ Grammatik - \"3\" (2005)<br />\r\n- cuty @ Deobe/Dena - \"Deobedena.com\" (2004)<br />\r\n- cuty @ Triptik - \"Inintitule\" (Bitnix Remix) @ RapFrancuski EP 12\" (2004)<br />\r\n- Intro @ Junoumi EP3 12\" (2003)<br />\r\n<br />\r\nVideo:<br />\r\n- ITF Poland 2004 (DVD)<br />\r\n- ITF Poland 2003 (VHS)','www_hhbd_pl_Dj_Tasmy_Trzaski_1.jpg','image/jpg',NULL,NULL,'W sprawie imprez proszę kontaktować się telefonicznie +48 606 20 52 62 lub e-mailowo: booking@djtasmy.art.pl<br />\r\n<br />\r\nJeżeli razem z Dj Taśmy Trzaski chcesz zabookować zespół Grammatik - skontaktuj się z agencją Bongos Promocja (www.bongos.pl)','0000-00-00','0000-00-00',1,'',3,7,998,100,NULL,'Dj Taśmy web','http://djtasmy.art.pl/'),(193,'2cztery7','','http://www.2cztery7.com','2004-06-16 14:37:51','2006-08-08 15:34:21','Zespół 2cztery7 powstał w 2001 roku. W skład zespołu wchodzą trzy osoby: Pjus, Stasiak, a także znany już szerszej publiczności Mes.<br />\r\nJako zespół zadebiutowali utworem \"Cały czas\" na płycie \"Junoumi Records EP Vol.1\", która ukazała się na winylach w limitowanym nakładzie. Od tamtej pory zespół udzielając się na wielu znaczących i najwyższej jakości polskich produkcjach, takich jak Płomień 81, Junoumi EP Vol.1-3, Pezet-Noon, Flexxip, Fu, PiH, Onar&Ośka, DizkretPraktik, Eldo, 600V, Ośka, Praktik, Małolat&Ajron, zyskał ogromne uznanie oraz rozgłos.<br />\r\n2cztery7 to grupa trzech zupełnie różnych osobowości, co w połączeniu daje wybuchową mieszankę. Pjus ze swoją ogromną wiedzą, którą przekazuje zgrabnie w swoich tekstach, Stasiak ze swoim charyzmatycznym stylem oraz zabójczym głosem oraz Mes i jego niebywały styl bycia, niesamowity flow oraz ogromne wyczucie muzyki powodują, że jest to aktualnie najbardziej oczekiwany debiut w Polsce.<br />\r\n2cztery7 posiada niesamowitą umiejętność robienia hip-hopowych hitów, które od paru lat goszczą w głośnikach słuchaczy. Zespół żartobliwie określa swoją muzykę mianem \"HIT-HOP\" lub \"FUNK-HOP\" gdyż interesuje ich zdobywanie czołowych miejsc na listach przebojów jak i rozgrzewanie klubowych parkietów, jednak tylko w taki sposób jak czynią to ich koledzy za oceanem - z dużą dozą Funk\'u, rytmicznych brzmień i niekiedy soulowych refrenów. Na tym albumie sampling został zastąpiony przez produkcję opartą na żywych brzmieniach, będzie można usłyszeć gitary, syntezatory analogowe czy nawet flet, co w dobie rapowych \"przebojów\" opartych na rozpoznawalnych samplach i popowych zaśpiewach ma za zadanie przywrócić muzyce hip-hop jej dawną świeżość. ','www_hhbd_pl_2cztery7_1.jpg','image/jpg',NULL,NULL,'email: booking@eternia.pl','0000-00-00','0000-00-00',1,'',3,1,1766,100,NULL,'marcin grochowina',''),(194,'Abel','','','2004-06-16 14:37:51','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1226,100,NULL,'',''),(195,'Onar','','','2004-06-16 14:37:51','2005-09-01 11:47:06','Onar jest osobą, której nie trzeba przedstawiać. Od ponad siedmiu lat zadomowiony jest na polskiej scenie hip-hopowej, którą również sam tworzył. Jego pierwszym składem była formacja TJK, którą tworzył z kolegami. Po rozpadzie zespołu wraz z Pezetem założyli Płomień 81. W wyniku kolaboracji tych dwóch bardzo dobrze zapowiadających się MC w 1998 roku nakładem Asfalt Records ukazał się ich debiutancki materiał \"Na zawsze będzie płonął\". Kolejnym wydawnictwem zespołu (do którego dołączył Deus) była wydana przez RRX w 2000 roku płyta \"Nasze Dni\". Następnym etapem artystycznym Onara była współpraca z Ośką znanym wcześniej z zespołu OMP, która to zaowocowała dwoma kolejnymi pozycjami w dorobku Onara. Były to wydane nakładem RRX \"Superelax\" i \"Wszystko co mogę mieć\" - Warner. Oprócz wyżej wymienionych płyt Onara mogliśmy usłyszeć na wielu pierwszoligowych płytach i składankach. <br />\r\nW połowie 2004 roku ukazał się kolejny materiał z pod szyldu artysty. Tym razem solówka. Płyta nosi tytuł \"Osobiście\" i jest zdecydowanie najlepszym materiałem stworzonym przez Onara. Muzycznie wspierają go tacy producenci jak: Kociołek, Rx, Scoop, Camey i Szogun. Goście to tym razem: Lerek oraz Pezet. <br />\r\n<br />\r\nOnar jest wspierany przez:: MASS DENIM ( www.massdnm.com ) ','www_hhbd_pl_Onar_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,7,2832,100,NULL,'Camey Studio','http://www.camey.pl'),(196,'Kaosloge','','','2004-06-16 14:37:51','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,875,100,NULL,'',''),(197,'Dj Pete','','','2004-06-16 14:37:51','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,601,100,NULL,'',''),(198,'Dj Kut-O','','','2004-06-16 14:40:57','2005-12-09 13:49:25','http://waxwork.pl/ - winyl distro',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,7,1159,100,NULL,'',''),(199,'Kociołek','','','2004-06-16 14:45:00','2005-09-30 03:37:36','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,633,100,NULL,'',''),(200,'Dunaj','','','2004-06-16 14:49:05','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,851,100,NULL,'',''),(201,'Baks','','','2004-06-16 14:49:05','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,812,100,NULL,'',''),(202,'Erbe','','','2004-06-16 14:49:05','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1109,100,NULL,'',''),(203,'Dj Supreme','','','2004-06-16 14:49:05','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,897,100,NULL,'',''),(204,'Micro','','','2004-06-16 14:51:06','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,658,100,NULL,'',''),(205,'Damion','','','2004-06-16 14:51:06','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,965,100,NULL,'',''),(206,'Deobe','','','2004-06-16 14:52:39','2005-09-01 13:01:35','Przygodę z rapem rozpocząłem w 2001 roku. Zaczynałem od nagrań na najgorszych mikrofonach do instrumentali ściągniętych z Internetu. Kolejnym etapem było nagranie nielegala \"Piastowskich bloków pejzaż\", z której to płyty dwa numery pojawiły się na CD dołączonym do 24 numeru Klanu. W tamtym okresie moją gościnną zwrotkę można było również usłyszeć w utworze \"Ignoranci\" na płycie Afirmacji. W 2003 roku na trzeciej części winylowego wydawnictwa spod znaku Junoumi pojawił się kawałek \"Masz tu rap\" wyprodukowany przez Kadę. W międzyczasie nagrywam numery z ekipą All Star Teamu. ',NULL,'',NULL,NULL,'mail: booking@eternia.pl','0000-00-00','0000-00-00',1,'',3,7,582,100,NULL,'',''),(207,'Kada','Katarzyna Lesińska','http://www.kada.tk','2004-06-16 14:52:39','2005-09-30 20:37:17','1989. Na początku było 6 lat lekcji gry na pianinie, potem kilka wystąpień ze szkolnym chórkiem w podstawówce. 1999. W liceum brała udział w różnych koncertach, zarówno okolicznościowych, jak i charytatywnych. Chęć robienia hiphopu spowodowana była przywiązaniem do grania dla ludzi. Po pewnym okresie pisania tekstów przyszła pora na działanie. 2001. Pierwsze nagrania powstały przy współpracy z Ritą, która chwilę wcześniej opuściła Aifam Klika. Zadebiutowały na składance producenckiej dj\'a Ike\'a. Utwór \"Już wiem na czym stoję\" był jednak ostatnim ich wspólnym kawałkiem. Pierwsza recenzja zmobilizowała do wytrwałej pracy nad sobą. Bywało różnie: Kada najpierw chciała rapować, potem, kiedy nie miała bitów, równolegle robiła muzykę i rap. Raz skupiała się bardziej na rymach, innym razem na podkładach, potem doszedł do tego też śpiew. 2004. Rezultatem jej trzyletniej działalności jest kilkanaście płyt, na których się pojawiła, w tym jedno wydawnictwo winylowe.<br />\r\nDotychczas współpracowała z takimi wykonawcami jak: 2ND, Ania Sool, Afirmacja, Azrael, Cani Boha Camp, DeeJay Delta, Deobe/Dena, Desant Zwiad, DJ Ike, Dna & Gal (nagrany utwór nie doczekał się publikacji), DonGuralesko, Eskaubei, Fenomen, Finch, Freez, Kobra & Oldas a.k.a. Wizja Lokalna, Manufaktura, Masło, Mezo, MPR, Niczego Sobie, Owal/Emcedwa, Ramona 23, Skarap, ZDN/Tabb','www_hhbd_pl_Kada_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,1118,100,NULL,'Oficjalne ww',''),(208,'Dj Hen','','','2004-06-16 14:52:39','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,687,100,NULL,'',''),(209,'Miloopa','','','2004-06-16 14:57:23','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,598,100,NULL,'',''),(210,'Bit Do Bitu','','','2004-06-16 14:59:16','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,219,100,NULL,'',''),(211,'Słoniu','','','2004-06-16 15:00:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1054,100,NULL,'',''),(212,'Swiftu','','','2004-06-16 15:00:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,458,100,NULL,'',''),(213,'Dwunasty','','','2004-06-16 15:00:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,445,100,NULL,'',''),(214,'Godziny Szczytu','','','2004-06-16 15:01:57','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1174,100,NULL,'',''),(215,'Frenchman','','','2004-06-16 15:07:58','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1478,100,NULL,'',''),(216,'Oxy','','','2004-06-16 15:10:52','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,673,100,NULL,'',''),(217,'Thomass','','','2004-06-16 15:10:52','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,760,100,NULL,'',''),(218,'Teka','Tomasz Kucharski','','2004-06-16 23:32:35','2005-09-01 11:48:48','W rzeczywistości nazywam się Tomasz Kucharski. Jestem jednym z członków grupy producenckiej Rafpak w skład której wchodzą również: Remek, Żółty oraz Nolte. Muzyką zajmuję się praktycznie od urodzenia. Pierwszym instrumentem jakim nauczyłem się posługiwać były nerwy bliskich:). Następnym krokiem mojej edukacji muzycznej była nauka gry na pianinie oraz w późniejszym okresie na gitarze. Niestety naukę tą z czystego lenistwa przerwałem czego w tej chwili bardzo żałuję, ponieważ uważam że umiejętności, które mogłem nabyć były by teraz bardzo przydatnym elementem przy komponowaniu muzyki. No ale cóż  chwilowo musi mi wystarczyć to czego dowiedziałem się za tamtych czasów plus własna wena oraz kreatywność. <br />\r\nMuzyką hip hopową zacząłem interesować się jeszcze w podstawówce, około roku 95. Wtedy to powstał pierwszy podkład muzyczny zrobiony przy pomocy kiepskiego kiborda. Była to niezła porażka, ale innego sprzętu wtedy jeszcze nie posiadałem, a wiadomo, od czegoś trzeba zacząć. Kolejnym krokiem był zakup komputera, który dawał już zupełnie inne, dużo większe możliwości. Jest on do dziś nieodzownym elementem mojej pracy. W pewnym okresie korzystałem również z samplerów: Emu Esi 32 oraz Emu E Synth ale w dobie dzisiejszej techniki cyfrowej skoncentrowałem się ostatecznie na sprzęcie komputerowym który w zupełności wystarcza do profesjonalnej produkcji podkładów muzycznych. W większości przy pomocy kompa powstała wyprodukowana wraz z Remkiem składanka &#8222;Pomysł Goni Pomysł&#8221;, która ukazała się nakładem Camey Studio w 2001 roku i była.  Praca nad składanką dała mi możliwość pracy w profesjonalnym studiu muzycznym (Studio 7), co wzbogaciło moją wiedzę na temat sprzętu i technik realizacji czy zapisu dźwięku co w chwili obecnej wykorzystuję pracując w Camey Studio jako realizator. <br />\r\nOd około 96-97 roku zajmuję się również rymowaniem, co daje mi równie dużą satysfakcję, jak klejenie bitów. Masa tekstów zapisanych w kilku grubych zeszytach, mnóstwo nagranych kawałków  oraz kilka lat treningów pozwoliły mi na owocne zakończenie prac nad swoją solową płytą &#8222;Chcę Więc Potrafię&#8221; która ukazała się nakładem Camey Studio w 2004 roku. Gościnnie na płytę postanowiłem zaprosić czołówkę polskiej sceny hip-hopowej czyli takich artystów jak: Pih, Chada, Trzeci Wymiar, Jano (Omp), HST, Proceente, Ciech, Żelu (MSP) oraz Tymi. Płyta od strony muzycznej to: Camey, Teka :) , Nolte, Mes, Żółty, Szyha, Ośka oraz francuski producent Mohamed Kanzallah. Dodatkowo w wielu utworach wspierają mnie dziewczyny z zespołu Chick&#8217;s: Cayra i Aksa, co jest bardzo rzadko spotykane na polskim rynku hip-hopowym<br />\r\nPłyta &#8222;Chcę, Więc Potrafię&#8221; została bardzo dobrze przyjęta przez środowisko muzyczne między innymi dzięki takim utworom jak &#8222;Przestroga&#8221;, &#8222;Jesteś...&#8221; czy &#8222;Gorączka Sobotniej Nocy&#8221; a doskonała promocja ze strony Camey Studio pozwoliła szerszemu gronu zapoznać się z moja osobą. Zagrałem mnóstwo koncertów, zwiedziłem niemal że całą Polskę, odwiedziłem masę programów telewizyjnych itp. <br />\r\nW chwili obecnej jestem w trakcie prac nad kolejnym solowym materiałem który ukaże się wkrótce nakładem oczywiście Camey Studio. Mam już przygotowanych kilka z planowanych 12-14 utworów. Myślę że większość z nich może być dużym zaskoczeniem dla wielu osób zarówno jeśli chodzi o muzykę jak i tematykę utworów. Tak jak na poprzedniej płycie w większości numerów  wspierać będą mnie młode i utalentowane wokalistki takie jak: Cayra, , Lena i zespół Honeys. Wśród pozostałych gości na płycie znajdą się między innymi francuscy artyści tacy jak: Kardesch, Maleek, Dje-an i Sebas oraz Polacy: Nowator, Skazani Na Sukcezz (Pih/Pyskaty) i Borixon. Muzycznie tym razem za płytę będą odpowiadali: Camey, PR.WRS, Mohamed Kanzallah, RX, Emer, David Gutjar, Ośka i inni.<br />\r\nW najbliższych planach jest również projekt Teka/Tymi, który ze względów osobistych został przesunięty na dalszy plan, aczkolwiek zamierzamy rozpoczęcie nagrywek jak najszybciej będzie to tylko możliwe i mamy nadzieje że projekt ten szybko ujrzy światło dzienne. Wiadome jest już na pewno że na całej płycie udzielać się będzie obok nas dwóch wokalistka której pseudonimu chwilowo nie zdradzamy. <br />\r\nRozpocząłem również pracę nad płyta producencką. Nie będzie to typowy składak z raperami do których to przyzwyczaili nas już polscy producenci. W moim przypadku będzie to produkcja muzyki na płytę młodych niesamowicie utalentowanych wokalistek Honeys.<br />\r\nPomijając solowe projekty współpracuję również z takim artystami jak: Borixon, Chada, Pih, Lerek, Chick&#8217;s, Skazani Na Sukcezz, Ws.Pro, Basti Trauti, 100rymuff,  Kwadratura Koła, MSP, Żelu i innymi.  Jeśli chodzi o moje inspiracje muzyczne to są one głownie związane z gatunkami  hip-hop / r&#8217;n&#8217;b, ale klimaty takie jak soul, nu-soul, jazz czy funk również nie są mi obce. Jeśli chodzi o wykonawców hip-hopowych najbardziej cenię sobie takich wykonawców jak: Jay-z (oraz większość artystów ze stajni Rocafella), Fabolous, Jadakiss, Ja-Rule, obóz G-Unit itp.  Wśród producentów najbardziej podobają mi się bity takich artystów jak: Scott Storch, Timbaland, Just Blaze, The Neptuns, Hi-tek, Pete Rock, Mohamed Kanzallah czy Trackmasters.  Z polskich: Camey, Emer, Żółty, Nolte, PR.WRS, RX, David Gutjar czy Ośka<br />\r\n<br />\r\nPozdrawiam Teka <br />\r\n<br />\r\nTeka jest wspierany przez: <br />\r\nERROR CLOTHEZ ( www.error.com.pl ) <br />\r\nARTTOO - studio tatuażu artystycznego Warszawa ul. Kasprowicza 62<br />\r\n( www.arttoo.waw.pl ) <br />\r\nBIŻUTERIA ARTYSTYCZNA 609-802-364 - MARCO <br />\r\nTRAK-POLSKA (www.trak-polska.pl)<br />\r\n','www_hhbd_pl_Teka_1.jpg','image/jpg',NULL,NULL,'Info koncertowe: 604-55-63-71 ','0000-00-00','0000-00-00',0,'',3,7,2827,100,NULL,'Camey Studio','http://www.camey.pl'),(219,'Cayra','','','2004-06-16 23:34:30','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,376,100,NULL,'',''),(220,'Nolte','','','2004-06-16 23:34:30','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1033,100,NULL,'',''),(221,'HST','','','2004-06-16 23:36:37','2004-06-17 02:45:07','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1728,100,NULL,'',''),(222,'Żółty','','','2004-06-16 23:36:37','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1111,100,NULL,'',''),(223,'Camey','Maciej Sierakowski','','2004-06-16 23:38:13','2004-11-07 21:12:59','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1011,100,NULL,'',''),(224,'Chick\'s','','','2004-06-16 23:45:11','2005-09-01 11:55:05','Pomysł na stworzenie takiego projektu pojawił się w głowie Cameya już dawno. Na polskim rynku muzycznym od dawna brakuje tak bardzo potrzebnego powiewu świeżości. Wytwórnie płytowe w większości lansują wykonawców, których zaliczyć możemy już dawno do \"dinozaurów\" polskiej muzyki rozrywkowej. Nie zwracają uwagi na panujące na świecie trendy muzyczne. Zarówno w rozgłośniach radiowych jak i w gazetach czy bilbordach wciąż widoczne są te same postacie. Nadszedł najwyższy czas aby to zmienić.<br />\r\nPo długich i ciężkich poszukiwaniach i kilku krotnych rotacjach składu powstała żeńska formacja CHICK\'s. <br />\r\n<br />\r\nZespół składa się z trzech pięknych, utalentowanych muzycznie kobiet. Dwóch wokalistek (Cayra, Lenka) i raperki (Mei), które w połączeniu ze sobą dają wybuchową mieszankę, co na pewno odegra dużą rolę podczas występów scenicznych jak również telewizyjnych. Dziewczyny mimo młodego wieku mają sporo doświadczenia w branży muzycznej (liczne konkursy, koncerty i występy gościnne na płytach innych wykonawców między innymi takich jak: Teka czy Borixon). W chwili obecnej Chick\'s pracują nad nagrywaniem utworów na ich debiutancką płytę, która ukaże się na początku 2005 roku nakładem Camey Studio i będzie na pewno dużym zaskoczeniem na rynku. Za stronę muzyczną projektu odpowiadał będzie w 90 % Camey, słynący z dużej przebojowości komponowanych przez siebie utworów. Ponadto na płycie znajdą się utwory wyprodukowane przez Tekę, Davida Gutjara, Emera,  Żółtego oraz francuskiego producenta Mohameda Kanzallah-a.<br />\r\nPłyta klimatycznie będzie mieszanką soulu, r\'n\'b i hip-hopu, czyli coś czego w polskiej muzyce zdecydowanie brakuje. ',NULL,'',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',3,7,459,100,NULL,'',''),(225,'Żelu','','','2004-06-16 23:48:30','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1064,100,NULL,'',''),(226,'Szyha','','','2004-06-16 23:49:51','2006-12-16 00:18:19','Warszawski producent i raper, jeden z pierwszych w Polsce - ściśle powiązany z Bemowem - członek legendarnej grupy <a href=\"/n/edytorial\">Edytoriał</a>, w raz z zespołem pojawił się w utworze pod tytułem \"Teksty wersy i słowa\" na pierwszej polskiej kompilacji hiphopowej wydanej nakładem wytwórni <a href=\"/l/smak_beat_records\">Smak Beat Records</a>. Utwór ten był jedynym spośród wszystkich na tej kompilacji nie wykonanych przez producenta płyty <a href=\"/n/dj_600v\">Dj Volta</a>, tylko przez samego Szyhe, co już wtedy określiła jego odmienny styl, przejawiający się w nie korzystaniu z sampli, które w tamtych czasach były bardzo popularne, zastąpił je MIDI. Pierwsze kroki pod jego skrzydłem stawiają takie zespoły jak: Edytoriał (w którym był zarówno producentem jak i mc), jeszcze nieznany szerszemu gronu zespół <a href=\"/n/grammatik\">Grammatik i <a href=\"/n/maesto\">Maesto</a> z którego później wyrosło <a href=\"/n/myniemy\">Myniemy</a>. Te zespoły tworzyły grupę zwaną \"KOMPLET\" zrzeszającą ludzi których pasją jest szeroko pojęta kultura hiphop.\r\nW roku (1997) zespół Edytoriał występuje, na wielkim koncercie hiphopowym \"rap day\" w Warszawie, saportując prawdziwą gwiazdę amerykańskiego hiphopu zespół Run DMC. Zespół Edytoriał nigdy nie wydał oficjalnej płyty, ale ich utwory pojawiały się na rożnych produkcjach m. in. na \"Wspólnej scenie\", na pierwszej płycie KLAN Magazynu, a nawet na soundtracku do filmu Spona, w utworze wykonanym przez Szyhe i Mikę Urbaniak: \"Przeszkoda to twoja głowa\" (1998). Podczas pracy nad filmem \"Spona\" szyha zaznajamia się z pracą w nowoczesnym studio. Współpracuje również z takimi muzykami jak: <a href=\"/n/urbaniak_michal\">Michał Urbaniak</a>, Marcin Pośpieszalski co wpływa na jego podejście do muzyki. Po odejściu Zeke z Edytoriału w roku 1999 Szyha wraz Jambetem i didżejem ego tworzą <a href=\"/n/rubato\">Rubato</a>, co owocuje albumem \"<a href=\"/a/prawdziwa_gra\">Prawdziwa gra</a>\" wydanego nakładem wytwórni <a href=\"/l/Sony_Music_Polska\">Sony Miusic Polska</a> w 2000 r. Płyta ta powstała w Szyha Specyfik Sound Studio (S3). Jako goście pojawili się na niej zespół <a href=\"/n/fenomen\">Fenomen</a>, <a href=\"/n/jotuze\">Jotuze</a> (Gramatik) i <a href=\"/n/myniemy\">Myniemy</a>. \r\nPłyta ta charakteryzowała się nowatorskim brzmieniem, zachwycającym jedną część miłośników gatunku a drugą oburzając. Była perfekcyjnie wyprodukowana pod względem technicznym, mastering został wykonany w Hamburgu.\r\nPo wydaniu płyty Rubato w 2000 Szyha zajmuje się produkcją i realizacja płyt. W jego studiu nagrywają: <a href=\"/n/pih\">Pih</a>, <a href=\"/n/chada\">Chada</a>, <a href=\"/n/fenomen\">Fenomen</a>, <a href=\"/n/myniemy\">MyNieMy, <a href=\"/n/1z2\">1z2</a>, <a href=\"/n/Wzgorze_Ya_Pa_3\">Wyp 3</a>, <a href=\"/n/veto\">Veto</a>, <a href=\"/n/sila_dzwieku\">Siła Dzwięku</a>, <a href=\"/n/pezet\">Pezet</a>, <a href=\"/n/mes\">Mes</a>, <a href=\"/n/rudy_mrw\">Rudy Mrw</a>, <a href=\"/n/sokol\">Sokół</a> (<a href=\"/n/wwo\">WWO</a>), <a href=\"/n/numer_raz\">Numer Raz</a>, <a href=\"/n/hst\">Hst</a> i wielu innych, zaowocowało to współpracą przy nagrywaniu i tworzeniu wielu płyt.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,853,100,NULL,'',''),(227,'Ciech','','','2004-06-16 23:53:10','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,673,100,NULL,'',''),(228,'Jano','','','2004-06-16 23:56:24','2004-11-07 15:40:17','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,4,691,100,NULL,'',''),(229,'Proceente','','','2004-06-17 00:02:00','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1654,100,NULL,'',''),(230,'Aksa','','','2004-06-17 00:02:00','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1065,100,NULL,'',''),(231,'Kanzallah Mohamed','','','2004-06-17 00:03:45','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,664,100,NULL,'',''),(232,'Ekonom','','','2004-06-17 02:49:11','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,850,100,NULL,'',''),(233,'Żółf','','','2004-06-17 02:49:11','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,1117,100,NULL,'',''),(234,'Ziaja','','','2004-06-17 02:49:11','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,1210,100,NULL,'',''),(235,'Mazsa','','','2004-06-17 02:54:22','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,844,100,NULL,'',''),(236,'Familia HP','','http://www.familiahp.com','2004-06-17 03:07:33','2005-07-20 11:44:35','Działania ludzi związanych z Familią H.P. (Hocoos Pocoos) - datują sią od końca 1994 gdy zaczęliśmy funkcjonować pod nazwą Y.A.S. Oxy i DJ Joe a.k.a. Jouleen z dzielnicy Dąbrowa weszli w układ z kolesiami z sąsiedniej dzielnicy Zarzew: Jędrzejem i produkującym beaty Shopciem, i tak zaczęli przygotowywać pierwsze kawałki. Twórczość tego okresu charakteryzowała się wpływami wielu innych gatunków muzycznych i przypominała dokonania brytyjskiej grupy Senser.<br />\r\n<br />\r\nGdy wszystko zaczyna się zazębiać i współpraca nabiera rozpędu miejsce Jędrzeja na mikrofonie zastępuje nasz przyjaciel Capsel. Pierwszy kontakt z publiką nastąpił kilkanaście miesięcy później, jak w przypadku Thinkadelic i Funkstazz (w pewnym sensie zalążek Drim Tim\'u) na pierwszej oficjalnej imprezie hip hop\'owej w Łodzi jaka miała miejsce w klubie \"Saturn\" i była przez nas współorganizowana.<br />\r\n<br />\r\nBył to ważny moment dla całej hh sceny w Łodzi i dzięki temu występowi wydana najpierw własnym sumptem całkowicie niezależnie kaseta demo, po małych zmianach w repertuarze, zostaje oficjalnie opublikowana przez raczkującą lokalną wytwórnię Viking Music. Zespół dużo koncertuje w całej Polsce, nagrywa minisesje, pokazuje się w mediach, etc. W miarę rozwoju składu osobowość jednego z członków H.P. - Capsla, wpływa mocno na pojawienie się w naszych numerach dość psychodelicznych textów, jak i pewnych poszukiwań nowych brzmień, czego efektem są np.kawałki zamieszczone na składankach \"Hip Hopla\" (SP Records) czy \"Hip Hop Trip\" (MIU/SPV). Jednak po rezygnacji Capsla z dalszej współpracy, reszta ekipy powraca do dźwięków wśród których czuli się najlepiej - hip hop\'u opartego na tradycyjnych brzmieniach.<br />\r\n<br />\r\nPrzez skład przewijają się m.in.Adit i rymująca kobieta Aisha, ale początkiem obecnego etapu w działalności Familii H.P. było dopiero przyjście w styczniu 1999 r. do składu pabianickiego emce - Thomass\'a oraz rozstanie z mikrofonem Shopcia i większością jego produkcji. H.P. skupiło się bardziej na pracy studyjnej niż na koncertach i powoli realizowało produkcje na długo oczekiwany pełnometrażowy album. Beatami zajął się będący od początku w składzie emce - Oxy, natomiast na gramofonach jak od zawsze kręcił Joe a.k.a. Jouleen. Kilka tłustych podkładów użyczył także nowy człowiek związany z Familią - Raadradd, znany m.in. jako webmaster serwisu o łódzkim hip hopie: www.eudezet.org<br />\r\n<br />\r\nWreszcie z końcem 2000 roku nakładem Gigant Records / Koch Int. ukazuje się płyta Familii H.P. \"Sprawdź Sytuację\" zawierająca kilkanaście tracków materiału, który jest jakby podsumowaniem tego co ludzie związani z H.P. do tej pory zrobili. Obok kawałków mocno osadzonych w hip hop\'owej tradycji pojawiają się także nowe brzmienia, i to zróżnicowanie sprawia, że praktycznie każdy słuchacz hh znajdzie na tej płycie swoje \"pięć minut\". Album otrzymuje pochlebne recenzje m.in.w pismach Klan czy DosDeDos, a także kilku serwisach internetowych.<br />\r\nLatem w kanałach muzycznych rozpoczęto emisję videoclipu do kawałka \"Co mi zrobisz jak mnie złapiesz\", aktualnie też zaczyna się praca nad nowymi produkcjami.<br />\r\n<br />\r\nFamilia H.P. pojawia się w międzyczasie na innych wydawnictwach, m.in.winylowej EP\'ce Junoumi rec vol.I w składzie superprojektu Eudezet Allstars, gdzie obok Thomass\'a i Oxy\'ego wystąpili również O.S.T.R., Spinache oraz Dedote. Innym wydawnictwem była składanka \"Atomistyka\" gdzie FHP pojawia się wspólnie z O.S.T.R. w kawałku \"Z innej strony\". Rok 2002 to znowu sporo koncertów i przygotowania do drugiego pełnometrażowego albumu. W listopadzie tego roku trafia on na półki sklepowe nakładem Blend Records i jest promowany dwoma teledyskami. Szczególnie pierwszy klip \"A kiedy miasto zasypia\" jest gorąco przyjęty i przez długi okres czasu utrzymuje się w ścisłej czołówce hip hopowej listy stacji muzycznej Viva Polska. Trafia też na DVD z polskim hip hopem oraz składankę Viva Hip Hop 2. Drugi klip do numeru \"Nie ma utraconych chwil\" wyróżnia się ciekawą fabułą i największym jak na te czasy udziałem profesjonalnych statystów w teledysku hip-hopowym.<br />\r\n<br />\r\nDobra zabawa i świetne przyjęcie produkcji projektu Eudezet Allstars sprawiło, że pod koniec 2003 roku ujrzał światło dzienne 40-minutowy mixtape Eudezet Allstars vol.1, a już pod swoim szyldem Familia H.P. pojawiła sie na 3 części winylowej składanka Junoumi rec. z numerem \"Pozytyw\". Rok 2004 to start do pracy nad trzecim albumem, który w tym właśnie roku trafi w Wasze ręce i uszy!!!<br />\r\n<br />\r\nWarto nadmienić, że ludzie związani z Familią H.P. są praktycznie zawsze zaangażowani w organizacje wszelkiego rodzaju koncertów (m.in.nowy cykl imprez \"miejskie wibracje\"), wydarzeń, audycji radiowych i cyklicznych imprez w naszej okolicy (Eudezet) propagujących kulturę hip hop.','www_hhbd_pl_Familia_HP_2.jpg','image/jpg',NULL,NULL,'Infolinia koncertowa: <br />\r\n0604 688 249','1994-00-00','0000-00-00',1,'',1,7,1722,100,NULL,'Oficjalne www','http://www.familiahp.com'),(237,'Joe','','','2004-06-17 03:10:03','2004-06-17 03:14:21','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,1,565,100,NULL,'',''),(238,'Grammatik','','','2004-06-18 01:23:36','2005-09-22 00:57:54','Grammatik powstał pod koniec lat 90 na warszawskim Bemowie. Formację założyło dwóch młodych raperów - Eldoka i Jotuze. Zadebiutowali na legendarnej, podziemnej składance prezentującej dokonania młodego wówczas warszawskiego Hip-Hop\'u - \"Enigma: 0-22\". Skład zespołu skrystalizował się, kiedy do Grammatika dołączył Noon - producent i kolekcjoner płyt. \r\nWłasnym sumptem wydali Ep\'kę, która zwróciła uwagę społeczności hip-hop\'owej jako oryginalna i ambitna. Materiałem zainteresowała się Wrocławska wytwórnia Blend, a materiał poszerzony o nowe utwory i remixy wydano jako \"EP+\". Dzięki ogólnopolskiej dystrybucji muzyka Grammatika trafiła do wielu odbiorców i w szybkim czasie zespół stał się jedną z najpopularniejszych i najczęściej koncertujących ekip w kraju. \r\nNastępnym etapem w karierze zespołu była pierwsza długogrająca płyta studyjna - \"Światła Miasta\". Przez wielu uznawana za klasyczną i przełomową, płyta spotkała się z ciepłym przyjęciem zarówno ze strony publiczności jak i krytyków. Po \"Światłach Miasta\" Noon uznany został za jednego z najlepszych polskich producentów. Pomysłowość, doskonałe brzmienie i swoista \"etyka zawodowa\" ustawiła wysoko poprzeczkę dla innych beatmakerów. Wydanie płyty pociągnęło za sobą falę koncertów (ponad 170!!) w całym kraju i Grammatik zyskał status jednej z największych gwiazd polskiej muzyki miejskiej. \r\nNoon, poruszający się w klimatach nie tylko Hip-Hop\'u, ale również tak zwanych nowych brzmień, wydał w Holenderskiej wytwórni DD Records własną, instrumentalną płytę która zyskała doskonałe recenzje na całym świecie. Eldoka natomiast zdecydował się na wydanie płyty solowej, w całości wyprodukowanej przez Denę \"Opowieść o tym, co tu dzieje się naprawdę\". \r\nPo dwuletnim okresie ciszy z obozu Grammatika - w roku 2002 Eldo wydał swoją drugą, solową płytę \"Eternia\" i pomimo wielomiesięcznej przerwy w realizacji studyjnych nagrań zaprezentował wysoką formę a płyta spotkała się z doskonałym przyjęciem. W międzyczasie Grammatik kilkakrotnie zawieszał i wznawiał działalność aby pod koniec 2003 zdecydować się na wydanie projektu Grammatik - \"Reaktywacja\". ','www_hhbd_pl_Grammatik_1.jpg','image/jpg',NULL,NULL,'tel. 502 555 252<BR>\r\nemail: koncerty@embargonagrania.pl','0000-00-00','0000-00-00',1,'',3,1,3754,100,NULL,'http://www.embargonagrania.pl',''),(239,'Jotuze','','','2004-06-18 01:27:08','0000-00-00 00:00:00','','www_hhbd_pl_Jotuze_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,2243,100,NULL,'http://www.embargonagrania.pl',''),(240,'Ash','','','2004-06-18 01:27:08','2005-10-02 00:07:47','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1476,100,NULL,'',''),(242,'Elemer','','','2004-06-18 01:47:33','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,948,100,NULL,'',''),(243,'WDK','','','2004-06-18 12:04:30','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,580,100,NULL,'',''),(245,'Sztyku','','','2004-06-18 12:32:45','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1904,100,NULL,'',''),(246,'Miki','','','2004-06-18 12:42:00','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,301,100,NULL,'',''),(247,'Webber','Andrzej Mikosz','www.dobrzewiesz.net','2004-06-19 08:11:55','2005-10-13 12:45:03','Urodziłem się w 1980r. w Szczecinie i tu mieszkam, aż po dziś dzień. Od dziecka bardzo lubiłem słuchać muzyki, szczególnie z płyt winylowych, do czego wiernie służył mi przez czas jakiś gramofon Daniel. Do czasu, kiedy wykończyłem w nim elektronikę. W czasach szkoły podstawowej zajarałem się rapem, początkowo z telewizji, później z kaset, które były naprawdę ciężko zdobyć w tamtych czasach. W mieście,w którym mieszkam ,wiele osób w tamtym czasie podjęło się próby zrobienia czegoś własnego, jarałem się tym, brakowało im muzyki, która wówczas mnie mocno intrygowała, postanowiłem się sprawdzić. W drugim półroczu 1997ego roku dołączyłem do grupy Wiele C.T. Po wielu zmaganiach sprzętowych (dwukrotna utrata bitów i kawałków z dysku) udało nam się stworzyć spójne demo - &#8220;Owoce miasta&#8221;, które po ponownym nagraniu wydaliśmy na nielegalu na początku roku 1999. Z czasem zacząłem współpracować z innymi lokalnymi twórcami rapu (Czekon, Pako, Projekt, Snuz), a także rozpoczęliśmy z Łoną pracę nad krążkiem &#8220;Koniec Żartów&#8221;. Ta zabawa z czasem przyniosła pożądany efekt i album ujrzał światło dzienne zimą 2001r. nakładem wytwórni ASFALT Records. Wspólnymi siłami udało nam się stworzyć małe studio, w którym możemy spokojnie realizować nasze nagrania, na odpowiednim poziomie.','www_hhbd_pl_Webber_1.jpg','image/jpg',NULL,NULL,'','1980-06-20','0000-00-00',1,'',1,7,716,100,NULL,'Marcin Grochowina','http://www.sfotografuj.to.pl'),(248,'Ajron','','http://ajron.prawda.org','2004-06-19 11:14:21','2005-10-01 23:20:32','Ajron, młody producent z Warszawy dał się poznać szerszej publiczności po wydaniu przez <a href=\"/l/junoumi_records\">Junoumi Records</a> winyli <a href=\"/a/JuNouMi_vol_1\">Junomi 1</a> i <a href=\"/a/JuNouMi_vol_2\">Junomi 2</a>. Na które z <a href=\"/n/dj_romek\">Dj Romkiem</a> wyprodukował dwa podkłady.\r\nKolejnym osiągnięciem Ajrona była współpraca z <a href=\"/n/eldo\">Eldo</a> nad jego płytą \"<a href=\"/a/eternia\">Eternia</a>\". Ajron zrobił na ten album trzy bity, w tym jeden do singla: \"<a href=\"/s/tylko_slowo\">Tylko słowo</a>\"\r\nZnany jest ze współpracy z młodszym bratem <a href=\"/n/pezet\">Pezeta</a>: <a href=\"/n/malolat\">Małolatem</a> jako <a href=\"/n/Malolat_Ajron\">Małolat&Ajron</a>. Na początku roku 2005 wydali płytę <a href=\"/a/W_pogoni_za_lepszej_jakosci_zyciem\">W pogoni za lepszej jakości życiem</a>.\r\nO Ajronie było głośno podczas sprawy nielegalnego wykorzystania sampla zespołu Fatum (utwór \"Nie Jestem Dawno\") na albumie duetu <a href=\"/n/Pezet_Noon\">Pezet Noon</a>. Ajron był autorem remixu utworu, o który toczyła się sprawa. Sprawa na szczęście została rozwiązana polubownie.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1401,100,NULL,'',''),(249,'Cybulski Maciej','','','2004-06-19 11:21:53','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,941,100,NULL,'',''),(250,'Dj Twister','','','2004-06-19 11:33:03','2005-07-19 14:26:27','Dj Twister zaczął grać w wieku 16 lat. Na początku używał w tym celu własnoręcznie przerobionego gramofonu. Nagrał kasetę, którą wysłał do audycji \"Wu-doo\", prowadzonej przez Joannę Tyszkiewicz. Został następnie zaproszony do współpracy przy nagrywaniu płyty z zespołem Snuz i automatycznie stał się członkiem tej formacji. Później wraz z dj\'em Sebą zaczął grać imprezy hip-hop\'owe w szczecińskich klubach. W międzyczasie Twister nagrał pierwszy mixtape pt. \"Turbulencja\", który przyczynił się do uplasowania go w czołówce polskich dj\'ów i twórców mixtape\'ów. Od tego czasu skrecze Twistera pojawiały się na płytach takich wykonawców, jak: Wiele C.T., Esenuzet, Inespe, Ostry, Eldo, Łona, Dizkret, DonGuralesko i in. Zagrał także jako support min. przed Das Efx, Jeru The Damaja, Dj\'em Tomkk\'iem, Killa Kella, Cappadonną, Afu Rą, Defari i podczas najbardziej prestiżowej imprezy breakdancowej na świecie - Battle Of The Year. Grał wiele imprez nie tylko w Polsce lecz także w Niemczech, Czechach (gdzie był w składzie jury na mistrzostwach DMC w Pradze) i na Słowacji. Po \"Turbulencji\" ukazała się \"Rotacja kontrolowana\", która spotkała się z bardzo dobrym przyjęciem i szybko zniknęła z półek sklepowych. Na ponad dziewięćdziesięciominutowej \"Rotacji...\" znalazły się: remix utworu Mykill\'a Miers\'a \"Killing Spree\", niepublikowana wersja utworu \"Box In Hand\" Ghostface Killah z Meth\'em i Street\'em, remix \"M.V.P.\" Big L\'a wyprodukowany przez Lorda Finessa, numery których nie ma na albumach (atrakcyjna wersja przeboju Dilated Peoples \"Work The Angels\" z gościnnym udziałem AG, Defari\'a i Xzibit\'a), Phife Dawg, Mad Skillz, Pharcyde, Prodigy, Common i blendy: U-God, Channel Live, Jurassic 5, D&D Crew, Phife Dawg & Top Gog. Ponadto znakomite utwory wykonawców i grup takich jak: J Sands, K-OTIX, Shabaam Sahdeeq, High&Mighty czy M.O.P. Całość świetnie zmiksowana z odpowiednią ilością skratch\'y. Trzeci mixtape \"Stereomania\" był propozycją dla dojrzałego słuchacza muzyki hip-hop. Znalazły się na nim utwory takich wykonawców jak: X-Ecutioners, Mos Def, Talib Kweli, Biz Markie, Ed O.G., J-Live, Krumb Snatcha, Rasco, Show& A.G., Lone Catalysts, Akbar, Shabaam Sahdeeq i in. W przerwach między doskonałym rapem nagrane były wyśmienite skrecze, wstawki z kabaretów i dialogi z filmów. Dj Twister jest także autorem dancehallowego mixtapu z muzyką jamajską okraszoną skreczami i wstawkami z hip-hopowych bitów. ','www_hhbd_pl_Dj_Twister_1.jpg','image/jpg',NULL,NULL,'  ','0000-00-00','0000-00-00',1,'',3,7,1795,100,NULL,'Marcin Grochowina','http://www.sfotografuj.to.pl'),(251,'Indy','','','2004-06-19 11:39:37','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,875,100,NULL,'',''),(252,'Dj Wich','','','2004-06-19 11:39:37','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,774,100,NULL,'',''),(253,'Joter','','','2004-06-19 11:42:51','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,424,100,NULL,'',''),(254,'Zjawin','','','2004-06-19 12:10:36','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1046,100,NULL,'',''),(255,'Nuno','','','2004-06-19 12:19:26','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,352,100,NULL,'',''),(256,'Supra','','','2004-06-19 12:19:26','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,831,100,NULL,'',''),(257,'Mienta','','','2004-06-20 23:21:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,664,100,NULL,'',''),(258,'Senne Oko','','','2004-06-20 23:21:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,824,100,NULL,'',''),(259,'Dj Decks','','','2004-06-20 23:21:56','2004-06-21 23:29:16','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1730,100,NULL,'',''),(260,'Gorb','','','2004-06-20 23:25:24','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,342,100,NULL,'',''),(261,'Wezu','','','2004-06-20 23:25:24','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1008,100,NULL,'',''),(262,'Zabor','','','2004-06-20 23:25:24','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,481,100,NULL,'',''),(263,'Stelmi','','','2004-06-20 23:25:24','0000-00-00 