tudia w Obornikach wychodzi kolejny krążek \'Nazwij to sam\', tym razem produkcja znacznie dojrzalsza technicznie i merytorycznie, na pewno oryginalna, zwiastująca pozostanie grupy na scenie rapowej. W tym czasie Liber poznał Meza, działającego wtedy pod szyldem Lajnera, czego efektem był wspólnie nagrany numer. Z kolei do \'Umiejętności\', innego kawałka z tej legendarnej płyty powstał nawet klip, nakręcony własnymi siłami kamerą VHS. Równorzędnie z płytami, Ascetoholix zaczęli grać pierwsze koncerty, najpierw na przeglądzie kapel rockowych w Obornikach, potem pierwsze koncerty w Poznaniu. Tego samego roku pojechali na festiwal młodych grup do Żarowa przywożąc stamtąd drugie miejsce. Wszystkie te działania nie mogły zostać niezauważone. W roku 2001 kolejny materiał Libera i spółki, za sprawą Camey Studio ukazał się już jako oficjalny krążek. W międzyczasie na stacjach telewizyjnym krążył klip do \'Już dawno\' promujący pierwszą \'legalną\' płytę o tytule \'A\' jak również ścieżkę dźwiękową do filmu \'Blokersi\' S. Latkowskiego. O chłopakach z Obornik Wlkp. Było coraz głośniej, grali coraz więcej koncertów, m.in. na pierwszym festiwalu we Wrocławiu, potem na drugiej edycji festiwalu w Opolu. Gościnnie Liber ze swoim zespołem pojawił się także na osławionej płycie Peji \'Na legalu\' w kawałku \'Moje miasto\' obok całej ówczesnej reprezentacji poznańskiej sceny. Współpraca z poznańskimi z artystami zaczęła się na dobre. Ascetoholix pojawili się na oficjalnym debiucie Owala w numerze \'Jestem tu\'. Liber z załogą nie spoczywali na laurach. W marcu 2003r. nakładem UMC Rekords pojawił się nowy krążek \'Apogeum\', na którym prócz lokalnych raperów pojawili się też goście z Warszawy - Pono i Fu, z Wałbrzycha - Szad, beatboxer RDW z Gdyni oraz producent z Elbląga - Dj. Zel. Do płyty nakręcono dwa klipy \'Plany\' oraz grane do dziś kontrowersyjne \'Suczki\'. Chłopaki pojawili się również na płycie Dj Decksa promując jego album kawałkiem \'Dario\'. Liber, któremu zawsze dobrze współpracowało się z Mezem, nagrał gościnnie 2 numery na \'Mezokrację\'. O dobrej współpracy świadczyć może fakt, że zarówno \'Żeby nie było\' jak i \'Aniele\' stały się numerami singlowymi, i odniosły nie lada sukces. 1 marca 2004 wychodzi pierwsza solowa płyta Libera \'Bógmacher\'. Pojawiają się na niej goście tacy jak: Doniu, 52 dębiec, Mezo, Owal, Kris, GiM, Nullo (Trzeci wymiar), Born i Marian. Muzyką zajęli się: Doniu, Tabb, Dj. Zel, Reze, Wdk. W dwóch refrenach pomagają: Agata, Kinga i Paulina. Skeczami zajął się Dj. Story (Lordz of Faderz). Pierwszym singlem promującym jest kawałek \'Skarby\' z gościnnym udziałem Donia, trochę sentymentalny, jeden ze spokojniejszych na płycie.','www_hhbd_pl_Liber_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,7,3621,100,NULL,'Sewer','http://www.sewerx.com'),(290,'Marian','','','2004-08-12 15:22:22','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,869,100,NULL,'',''),(291,'Kris','Krzysiek Piotrowski','','2004-08-12 15:24:40','2005-07-19 11:06:02','',NULL,'',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',3,7,981,100,NULL,'',''),(292,'52 Dębiec','','','2004-08-12 15:24:40','2004-08-15 16:04:55','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,3,1701,100,NULL,'',''),(293,'Born','','','2004-08-12 15:24:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,473,100,NULL,'',''),(294,'Agata','','','2004-08-12 15:24:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1344,100,NULL,'',''),(295,'GiM','','','2004-08-12 15:36:27','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,386,100,NULL,'',''),(296,'Nullo','','','2004-08-12 15:36:27','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,757,100,NULL,'',''),(297,'Kinga','','','2004-08-12 15:38:16','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,734,100,NULL,'',''),(298,'Paulina','','','2004-08-12 15:38:16','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,580,100,NULL,'',''),(299,'Mezo','','','2004-08-12 15:58:45','2005-09-02 02:44:21','Mezo (wcześniejsze ksywy Mejger, Mez) hiphopem zajmuję się od połowy lat 90-tych, nagrywając płyty pod szyldem Lajner. Wielki sukces odniósł w roku 2003 wydając płytę pt. &#8222;Mezokracja&#8221;,sprzedaną dotychczas w ponad 20tyś. Egzemplarzy, i zdobywając popularność takimi utworami jak: &#8222;Żeby Nie Było&#8221;, &#8222;Mezokracja&#8221; czy &#8222;Aniele&#8221;. Wcześniej aktywnie działał w wielkopolskim undergroundzie wydając trzy \'nielegale\' (Demo - 1999, Mezo - 2000, Słowem - 2001) Teksty Meza są mocno techniczne, skoncentrowane jednak na przekazie. Pisze zarówno zaangażowane społecznie utwory, &#8222;przechwalcze&#8221; kawałki w stylu barggadocio jak i refleksyjne i motywacyjne numery. Ulubionymi wykonawcami Meza są głównie wykonawcy tzw. Złotej Ery hiphopu lat 1986-89 tacy jak: Rakim, Masta Ace, Big Daddy Kane czy Will Smith. <br />\r\n<BR><BR><br />\r\nMezo pojawiał się gościennie na wielu płytach innych znanych raperów m.in. Owala/Emcedwa (Pełen Pokus, Repteatr) Pana Duże Pe (Nasze Życie) Ascetoholix (Suczki) Liber (Kolejny Szczyt) Slums Attack ( I moje miasto złą sławą owiane) Od września 2002 roku, co czwartek w godz. 22-24, prowadzi audycje hiphoppwą BLESS DA MIC nadawaną na całą Wielkopolskę w radiu RMI FM.<BR><BR><br />\r\nDo pracy nad nową płytą Mezo zaprosił zaprzyjaźnionego producenta Tabba. Ich wspólna płyta Mezo/Tabb jako Lajner pt. &#8222;Wyjście z bloków&#8221; pojawi się na rynku już 28 lutego 2005 roku. Zaproszeni goście to: Owal/Emcedwa, Pan Duże Pe, Liber, Aro, Dj Spox, a także wokalistki: Kasia Wilk i Ania Karwan. <br />\r\n<BR><BR>Poza działalnością artystyczną studiuje politologię na Uniwersytecie im. Adama Mickiewicza w Poznaniu. Interesuje się socjologią, historią, filozofią. Hobby to sport, głównie piłka nożna (były piłkarz Lecha Poznań w zespołach juniorskich) i tenis. Za swój duży wyczyn uważa ukończenie poznańskiego maratonu w roku 2002 z czasem 3godz. 54min.','www_hhbd_pl_Mezo_1.jpg','image/jpg',NULL,NULL,'DL Promotion tel. 502 532 411','0000-00-00','0000-00-00',1,'',3,7,2732,100,NULL,'Sewer','http://www.sewerx.com'),(300,'Owal/Emcedwa','','http://www.emcedwa.com','2004-08-12 15:58:45','2005-09-02 02:44:43','Owal rozpoczynał działalność na polskiej scenie w 1995 roku, będąc założycielem nie istniejącego już zespołu \"Przystanek 75\" w skład którego finalnie - po paru modyfikacjach - wchodził Owal oraz jego najbliższy kuzyn, Vektor. Pozostawiając po sobie kilka numerów oraz koncerty, zmieniając w międzyczasie nazwę na \"Emcedwa\", w zespole pozostał wyłącznie Owal, który po odejściu Vektora zaczął nagrywać jako \"Owal/Emcedwa\". Do roku 2000 zostaje nagranych kilkanaście numerów czego finałem wyprodukowane w całości przez Owala demo \"Samo życie\", będące do dzisiaj klasykiem dla fanów poznańskiego hip-hopu.<br /><br />\r\n<br /><br />\r\nPrace nad kolejnym, legalnym już albumem, trwały do 2002 roku, w międzyczasie nawiązała się współpraca z producentem z osiedla - Tabbem - który wyprodukował całą nową płytę. Krążek \"Epizod II: Rapnastyk\" został wydany w nowopowstałej wytwórni poznańskiej \"UMC Records\", zapisując się w pamięci fanów jako niepowtarzalna i oryginalna płyta, na której znalazły się takie hity jak \"Rapnastyk\" czy \"Pełen pokus\" a także nigdy nie posiadający teledysku kawałek \"Przepraszam\".<br /><br />\r\n<br /><br />\r\nPo dziesiątkach koncertów zagranych w Polsce powstaje materiał, który otrzymuje tytuł \"Epizod III: Wirus\" i zostaje wydany w czerwcu 2004 roku. Jest to podsumowanie silnego związku artysty z rapem oraz gorzka refleksja dotycząca rozwoju tej kultury w Polsce. Płyta jest doskonałą produkcja skierowaną głównie do koneserów ze względu na jej mocny i wyrazisty charakter, który jednak potrafi zarażać niczym wirus nowych słuchaczy, nawet jeśli dopiero zaczynają przygodę z rapem.<br /><br />\r\n<br /><br />\r\nOwal jest artystą który wie, w którą stronę zmierza i doskonale to słychać na jego produkcjach. Bezkompromisowość, szczerość, autentyczność oraz mocne rymy to najtrafniejsza charakterystyka tego rapera.','www_hhbd_pl_Owal_Emcedwa_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,7,2728,100,NULL,'Sewer','http://www.sewerx.com'),(301,'Małolat','','','2004-08-12 16:56:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1655,100,NULL,'',''),(302,'Endefis','','','2004-08-12 23:56:58','2005-09-02 02:42:43','Druga płyta zespołu Endefis powstała w poszerzonym składzie już na początku 2004 roku (Bartosz, Miexon + JedenZdwóch). Zarówno muzycznie i tekstowo jest zdecydowanie bardziej zróżnicowana od pierwszej płyty (od kawałków spokojnych, poprzez żywe i dynamiczne, do hardkorowych). Produkcją muzyczną zajęli się zarówno producenci z wyrobioną już renomą np. Mazsa z zespołu Fenomen oraz Kociołek, jak i młodzi i mniej znani, ale bardzo utalentowani (np. WDK, DNA). Mimo tych różnorodności płyta muzycznie jest spójna. Gościnnie występują nie tylko wykonawcy z najwyższej półki O.S.T.R., Fenomen, ale i mało znani szerszemu gronu, choć reprezentujący wysoki poziom (np. SZTYKU, STEFCZI, RDS). Na krążku nie zabrakło oczywiście skreczy, którymi zajął się jeden z trzech najlepszych polskich dj-ów &#8211; DJ Kostek.',NULL,'',NULL,NULL,'','1998-01-00','0000-00-00',1,'',3,7,1619,100,NULL,'',''),(303,'Bartosz','','','2004-08-13 00:07:12','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1291,100,NULL,'',''),(304,'Łyskacz','','','2004-08-13 15:29:59','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1007,100,NULL,'',''),(305,'Dj Zero','Andrzej Giegiel','','2004-09-01 22:25:20','2005-06-03 20:53:25','',NULL,'',NULL,NULL,' ','0000-00-00','0000-00-00',1,'',3,7,1355,100,NULL,'',''),(306,'Dj Mario','','