szy oficjalnie pokazać się na scenie podczas \'wolnego mikrofonu\' na jednej ze stołecznych imprez. Jego występ wywarł na obecnych w klubie pozytywne wrażenie, co pozwoliło mu uwierzyć we własne umiejętności i dało impuls do dalszego rozwoju. Również na tej imprezie poznał innego zawodnika działającego w warszawskim podziemiu - Zajmującego się produkcją i turntablismem DJ\'a Spox\'a. Okazało się iż obaj panowie nadają na tych samych falach, co doprowadziło do rozpoczęcia współpracy i założenia w wakacje 2000 zespołu Cisza&Spokój, nawiązującego do tradycji składów MC + DJ takich jak Gangstarr czy Eric B & Rakim. Jednocześnie Duże Pe cały czas udzielał się na mikrofonie przy okazji każdej niemal wolnostylowej sesji w mieście, zdobywając tym szacunek za talent i prezentowane umiejętności. Od pierwszego koncertu w maju 2001, mimo braku oficjalnie wydanego materiału Cisza&Spokój zagrali około 50 koncertów na terenie całego kraju, zaliczając też występy w Berlinie i w Pradze. Żywiołowe show, bogate w improwizację zarówno ze strony MC jak i DJ\'a, pełne humorystycznego dialogu między nimi, pozwoliły zyskać im \'fame\' wykraczający daleko poza granicę Warszawy.','www_hhbd_pl_Pan_Duze_P_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,3,3793,100,NULL,'Sewer','http://www.sewerx.com'),(318,'Prezes','','','2004-09-07 13:00:29','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,812,100,NULL,'',''),(319,'Visa','','','2004-09-07 15:59:57','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,923,100,NULL,'',''),(320,'Hohoł','','','2004-09-07 16:03:01','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,545,100,NULL,'',''),(321,'Ancja','','','2004-09-07 22:16:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,797,100,NULL,'',''),(323,'Karton','','','2004-09-07 22:29:39','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,