ążył podbić nie tylko kluby w całej Polsce, ale także w Anglii, Czechach oraz w Niemczech. Jego niepowtarzalne skrecze można usłyszeć na płytach czołowych polskich wykonawców, takich jak Pezet, Dizkret, Onar, Flexxip, Grammatik, czy T-Love. Ma za sobą setki zagranych koncertów, na codzień wspierając duet Pezet-Noon, jednak można go było także zobaczyć udzielającego się z zespołami Grammatik, czy Flexxip. Latem 2003 stanął przed wyzwaniem zagrania koncertu jako DJ ekipy Tha Liks, co w efekcie okazało się wielkim sukcesem. Prócz tego wystąpił jako support przed takimi sławami jak Sean Paul, Mobb Deep, Gangstarr, De La Soul, Afu-Ra, czy Beat Junkies. Obecnie można go spotkać, regularnie grającego imprezy w warszawskich klubach Live, Harlem, czy Scena 2000, w których jest bez wątpienia ulubiencem bawiącej sie tam publiki. ',NULL,'',NULL,NULL,'mail: booking@eternia.pl','0000-00-00','0000-00-00',1,'',3,7,1006,100,NULL,'',''),(338,'Polańska Magda','','','2004-09-09 22:07:59','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,591,100,NULL,'',''),(339,'JR','','','2004-09-09 22:17:04','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,483,100,NULL,'',''),(340,'Szajewski A.','','','2004-09-09 22:25:58','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,449,100,NULL,'',''),(341,'Bartek G.','','','2004-09-09 22:30:39','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,492,100,NULL,'',''),(343,'Kowalewska Iza','Iza Kowalewska','','2004-10-09 19:04:08','2004-10-27 20:15:27','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,4,417,100,NULL,'',''),(344,'Inespe','','','2004-10-09 19:14:10','2005-05-13 00:51:27','Inespe ma 20 lat i pochodzi z warszawskiego osiedla Imielin - dokładnie tak samo jak jego długoletni przyjaciel DJ M.A.D. z którym tworzy od 1997 roku grupę RHX. Ten nierozłączony duet wpadł na pomysł nagrywania materiału solowego Inespe już dawno temu, zaraz po nagraniu debiutanckiego albumu RHX, kiedy to M.A.D. postanowił ograniczyć się do produkcji i gościnnego udziału na mikrofonie, całą resztę - w tym stworzenie koncepcji kawałków i całej płyty - pozostawiając Inespe. Niestety, w związku z różnymi przesunięciami i przeszkodami album \"Ocean Szarych Bloków\" ukazał się dopiero w kilka miesięcy po ostatecznym zamknięciu materiału (w międzyczasie do gotowej już płyty zgrywał się fenomenalny DJ Twister ze Szczecina). Prywatnie Inespe ceni sobie czas spędzony w towarzystwie kolegów i koleżanek z osiedla, najchętniej przy konsoli, piłce lub innych rozrywkach. Muzyczne sympatie koncentrują się ściśle wokół sceny nowojorskiej - szczególnie klimaty QB, BCC i DITC. Jego powolny, cedzony, pozornie prosty flow często zaskakuje błyskotliwie ujętymi spostrzeżeniami i celnymi metaforami.','www_hhbd_pl_Inespe_1.jpg','image/jpg',NULL,NULL,'mail: tytus@asfalt.pl<br />\r\ntel.: 502-313-300  ','0000-00-00','0000-00-00',1,'',4,7,927,100,NULL,'Asfalt Records','http://www.asfalt.pl'),(345,'Little Egypt','','','2004-10-09 19:32:12','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,0,538,100,NULL,'',''),(346,'Łebek Dominik','','','2004-10-25 18:18:58','2005-11-26 15:59:33','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,3,695,100,NULL,'',''),(347,'Thinkadelic','','http://www.thinkadelic.art.pl','2004-10-27 14:45:58','2005-07-20 11:38:45',' Thinkadelic to Bartek \"Czizz/CeZet\" Serafiński, Paweł \"Spinache/3Oko\" Grabowski oraz działający z doskoku Paweł \"Senior\" Serafiński. Czizz i Spinache poznali się w klasie \"0\". Po krótkiej przewie spotkali się ponownie w szkole podstawowej, Tam pod koniec ósmej klasy podjęli decyzję o rozpoczęciu działalności muzycznej. Pierwsze podkłady Spinache tworzył, już w 1994 roku, na sprzęcie swojej matki, nieco chaotyczne, nigdy nie zostały użyte, trzymane na kasecie w archiwach zespołu, dziś wzbudzają lekki uśmiech. Jakiś czas później powstał zespół o uniwersalnej nazwie \"No Name\". Wraz z kumplami przy użyciu gitary, basu, perkusji, gramofonu i dwóch mikrofonów szukali swojego stylu. Po kilku burzliwych zmianach personalnych, zostali znowu we dwóch. Myśląc coraz poważniej o Rapie, zwrócili się z prośbą o pomoc do Seniora. Senior widząc zapał i szczere chęci Pawła i Bartka zgodził się od razu. Nazwa zespołu powstała spontanicznie. Odtąd podkłady Thinkadelic powstawały już pod okiem Seniora w jego pracowni. Do premierowego koncertu CeZet i Spinache przygotowywali się pół roku. Dokładnie wyselekcjonowane bity i w większości jeszcze angielskie rymy, złożyły się na sukces. Wraz z zespołami Yas ( teraz Familia HP ) i Funkstaz ( zalążek Drim Timu ) zorganizowali pierwszy Hip Hopowy koncert w mieście Łódź. Po koncercie otrzymali propozycję, od powstającej niezależnej firemki fonograficznej, nagrania i wydania materiału \"Demo\". Przy współpracy z \"Lurys & Viking Music\" wydali pierwszą kasetkę z dwudziesto minutowym materiałem. Rozprowadzona drogą podziemną, z zerową promocją, wzbudziła zainteresowanie i zyskała uznanie w całej Polsce. Utwór z tej kasetki \"To nie jest takie łatwe\" był grany przez szereg lokalnych radiostacji. Zaczęli grywać koncerty na terenie całego kraju. Zagrali razem z Michałem Urbaniakiem i jego formacją \"Urbanator\" w Łódzkim Teatrze Wielkim. Współpracowali z Krystyną Prońko, przy jej płycie \"Złość\" i kilku projektach koncertowych. Poza licznymi koncertami klubowymi aktywnie brali udział w najważniejszych imprezach HipHopowych- Ogólnopolski Festiwal Rap/Hip Hop w Katowicach ( marzec 96 ), jako support RUN DMC na Rap Day w Warszawie ( kwiecień 97 ), Polski Hip Hop Szczyt\'99 w Łodzi. Nagrali kilka numerów z zespołem P\'Am( m.in. \"Twoja Twarz/Where You\'re at?\" ), której skład stanowią rezydujący w Hoff- Kevin Nixon z Virginii i Mikołaj Sobczyński z Warszawy. Razem z Red\'em, MizOne\'em, Emes\'em, Ostr\'em i Miko stworzyli formację Obóz TA. Uniwersalność swojej twórczości potwierdzili grając szereg imprez masowych, na których grając w towarzystwie wielu \"gwiazd dużego formatu\" świetnie sobie radzili .<br />\r\n<br />\r\nPierwsza połowa 98 roku stanowi przełom na ich drodze. To co wciąż dla wielu zespołów jest marzeniem, dla TA stało się rzeczywistością. Podpisali kontrakt z największą wytwórnią płytową POMATON/EMI, w której jesienią 98 ukazała się ich autorska płyta pt. LEK. Na płycie wystąpili gościnnie - Krystyna Prońko, Reni Jusis, P\'Am i reprezentanci Katowickiego Hip Hopu Kaliber44. \"Lek\" promowany był trzema singlami ( \"Wyżej i wyżej\", \"Jesteś lekiem na całe zło\" i \"Zdobycz\" ) oraz dwoma teledyskami \"Wyżej i Wyżej\" i \"Jesteś lekiem na całe zło/Lek\". Płyta była nominowana do nagród Fryderyk\'98 w kategorii \"Rap/Hip Hop)oraz FriDeHa\'99. Niemiecka VIVA nadawała ich polskie klipy jako pierwszego polskiego wykonawcy. W Hip Hopowym programie Word Cup prowadzący Tyron (MC z niemieckiej formacji Mellow Bag) pokazując T-Shirt Thinkadelic podawał adres Fan klubu Thinkadelic. Po wydaniu pierwszej płyty nagrali i wydali w niezależnej firmie \"Camey music\" materiał ze swoją formacją Obóz TA. We wrzśniu 2000 wyszła ich druga płyta zatytułowana \"Obiecana ziemia\". Promowana klipami \"Pokaż się\" i \"To jest dla was\", dwoma singlami radiowymi ( \"Zarobię trochę\"/\"Ramię w ramię\" i \"Pokaż się\" ) z remiksami. We wrześniu 2002 ukazała się solowa płyta Spinache \"Za wcześnie\", promowana klipem \"Za wcześnie\". Klip nakręcony przez Bogumiła Godfrejowa wzbudził wielie kontrowersji i był blokowany w stacjach telewizyjnych. Dotychczasowe nagrania z udziałem Spinache\'a i Czizz\'a znalazły się na wielu składankach m.in. \"Hip Hop Trip\" (M.I.U/Spv/Koch), \"Wspólna scena\" (RRX), \"Hip Hopla\" (SP Records), \"Robię Swoje2\" (Camey music), \"Atomistyka\" (Gigant Records). Thinkadelic koncertuje z \"Not Necessary Band\" interpretując fragment twórczości Zbigniewa Koniecznego (projekt powstał w Łodzi, lecz już jego trzecie wykonanie odbyło się w \"Piwnicy pod Baranami\" w Krakowie). Spinache w 2001 roku wziął udział w koncercie świątecznym rymując przy akompaniamencie \"Youth Rock Symphony Orchestra\" w Filharmonii Łódzkiej.','www_hhbd_pl_Thinkadelic_1.jpg','image/jpg',NULL,NULL,'koncerty@thinkadelic.art.pl','0000-00-00','0000-00-00',1,'',1,7,891,100,NULL,'Oficjalna strona','http://www.thinkadelic.art.pl'),(348,'CeZet','Bartek Serafiński','','2004-10-27 14:51:10','0000-00-00 00:00:00','','www_hhbd_pl_CeZet_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,883,100,NULL,'Oficjalne www','http://www.thinkadelic.art.pl'),(349,'Spinache','Paweł Grabowski','','2004-10-27 14:51:56','0000-00-00 00:00:00','','www_hhbd_pl_Spinache_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,903,100,NULL,'Oficjalne www','http://www.thinkadelic.art.pl'),(350,'Senior','Paweł Serafiński','','2004-10-27 14:52:34','2005-07-20 11:42:52','',NULL,'',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',1,7,739,100,NULL,'',''),(351,'Raq','Kuba Raczyński','','2004-10-27 15:01:38','2004-10-27 15:19:09','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,1,361,100,NULL,'',''),(352,'Ciemniewska Karolina','','','2004-10-27 15:11:22','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,971,100,NULL,'',''),(353,'Mizone','','','2004-10-27 15:13:46','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,612,100,NULL,'',''),(354,'Koma','','','2004-10-27 15:33:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,926,100,NULL,'',''),(355,'Mały','','','2004-10-27 15:33:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,716,100,NULL,'',''),(356,'Knockwood','','','2004-10-27 15:37:48','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,394,100,NULL,'',''),(357,'RHX','','','2004-10-27 15:40:00','2004-10-27 15:44:01','',NULL,'',NULL,NULL,'','1997-00-00','0000-00-00',1,'',1,1,2449,100,NULL,'',''),(358,'Łona','Adam Zieliński','','2004-10-27 16:20:30','2005-05-13 00:52:16','Łona to kolejny oryginalny, niepowtarzalny raper z Asfalt Records. Jego debiutancki, solowy album \"Koniec żartów\" ukazał się 26/11/2001 (singiel \"Rozmowa\" 12/11/2001). Urodzony w 1981 r. Łona mieszka i uczy się w Szczecinie, znany jest między innymi z wcześniejszego udziału w grupie Wiele CT oraz z solowego kawałka na \"Kompilacji 2\" Ośki. Z jego tekstów pełnych gigów i dowcipów bije wrodzony optymizm, dystans do problemów dnia codziennego oraz inteligentne obserwacje podawane zawsze z dużym poczuciem humoru, co w połączeniu z doskonałymi bitami Webbera, mixem i masteringem samego Noona, doprowadziło do powstania tłustego solowego albumu (dostępnego także - podobnie jak singiel - w jednopłytowej wersji winylowej). Album promowany był przy pomocy dwóch clipów (do utworów \"Rozmowa\" oraz \"Hiphop Non Stop\"). 4/11/2002 r. ukazał się maxi singiel Łony zawierający między innymi nowy utwór \"Nie słuchać przed 2050 r.\" (do którego powstał dostępny także na singlu clip). Pod koniec roku 2002 ukazał się album producentów WhiteHouse pt. \"Kodex\", na którym znalazł się gościnny występ Łony w utworze \"Piękny dzień by zadzwonić\". Utwór ten promował album \"Kodex\" w Radiostacji. Łona zagrał około 20 koncertów w całym kraju a także w Czechach i na Słowacji. Od początku 2003 roku Łona i Webber rozpoczeli prace nad nowym, długo już oczekiwanym albumem \"Nic dziwnego\", termin premiery: kwiecień 2004. Wcześniej zostanie opublikowany singiel internetowy pod tym samym tytułem.','www_hhbd_pl_lona_1.jpg','image/jpg',NULL,NULL,'mail: tytus@asfalt.pl<br />\r\ntel.: 502-313-300','1981-00-00','0000-00-00',1,'',1,7,2611,100,NULL,'Asfalt Records','http://www.asfalt.pl'),(359,'Indios Bravos','','http://www.indiosbravos.com','2004-10-27 23:31:17','2005-07-25 21:39:43','Trudno powiedzieć, kiedy tak naprawdę zaczęła się historia grupy Indios Bravos. Czy za jej początek można uznać moment, gdy Banach po raz pierwszy zobaczył, a co ważniejsze usłyszał Gutka? Było to w katowickim Spodku na jakiejś branżowej imprezie w roku bodajże 1996. Banach grał wtedy w zespole Hey, a Gutek wspomagał swoim głosem grupę Overmind. Czy to jednak mogłoby być uznane za początek, skoro wtedy nie zamienili ze sobą ani słowa? Zrobili to co prawda niedługo potem, ale było to zbyt formalne spotkanie w jednej z warszawskich pizzerii, aby traktować je w formie wstępu do artystycznej współpracy. Więc może początkiem Indios Bravos były pierwsze ich spotkania na gruncie muzyki? Też chyba nie, bo te miały charakter poszukiwawczo badawczy i polegały głównie na wspólnym słuchaniu muzyki, choć oczywiście zawierały również nieśmiałe próby tworzenia. Tyle tylko, że było to tak odległe od tego, co zrobili razem potem, że z pewnością nie może być to uznane za początek Indios Bravos. Tym właściwym początkiem jest chyba powstanie piosenki \"Drogi&#8221;, która dwa lata później pojawiła się na płycie \"Part One\". Dla Gutka była to pierwsza nagrana płyta, zaś dla Banacha trochę dziesiąta, a trochę paradoksalnie pierwsza. Po raz pierwszy bowiem nagrywał płytę w taki sposób. Wyglądało to tak, że co jakiś czas przyjeżdżał do Warszawy Gutek i w małym mokotowskim mieszkanku śpiewał trzymając w ręku wymontowaną z kolumny głośnikowej siatkową osłonę, co by nie dmuchać w mikrofon. Mikrofon jak się w niego dmucha wydaje z siebie nieprzyjemne stuki, a Gutek chciał śpiewać a nie postukiwać. Żeby było jeszcze dziwniej bardzo często w tym samym pokoju Dziunka oglądała telewizję, a po dywanie hasał Królik. Sam proces tworzenia muzyki też był dla Banacha czymś zupełnie nowym, po raz pierwszy bowiem nagrywał wszystkie instrumenty i to nie tylko jako muzyk, ale również jako realizator dźwięku. Pojawił się też plan stworzenia własnej wytwórni fonograficznej, tyle tylko, że wymagało to większego zaangażowania, a całe zaangażowanie zużyło się na etapie powstawania płyty. Z pomocą przyszedł Kuba Wojewódzki, który specjalnie w celu wydania tego materiału powołał do życia niezależną wytwórnie o nazwie \"Pałac Kultury\". Płyta \"Part One\" ukazała się w maju 1999 i choć nie trafiła do tak zwanej szerokiej dystrybucji, jej nakład uległ całkowitemu wyczerpaniu. Wyczerpany okazał się również Banach, ale nie nagrywaniem tej płyty tylko tak ogólnie po całości. Zrobił więc sobie przerwę w działalności muzycznej i następne trzy lata spędził podróżując po świecie u boku Dziunki. Gutek w tym czasie rozpoczął współpracę ze środowiskiem hip hopowym i powołał do życia własny muzyczny projekt Mustafarai. <br />\r\nW roku 2002 zapadła decyzja o nagraniu drugiej płyty Indios Bravos. Do pierwszego spotkania po latach doszło tym razem w bardziej sprzyjających tworzeniu okolicznościach. Gdzieś tak w połowie drogi pomiędzy Szczecinem a Koszalinem na strychu stojącego pod lasem domu powstała pierwsza piosenka- \"Mental Revolution\". A potem jeszcze \"Sign\" i \"The Sun\", choć pomysł na te dwie narodził się dużo wcześniej podczas pobytu Banacha w Grecji. To w ogóle bardzo kosmopolityczna płyta. Dwóch Polaków pod hiszpańsko brzmiącą nazwą nagrywa piosenki rodem z Jamajki, których pierwsze szkice powstawały we Francji, Grecji i Japonii. Nawet jeśli chodzi o terytorium polski trudno jest przypisać Indios Bravos jakiemuś konkretnemu miejscu. No bo tak, Gutek urodził się i mieszka w Katowicach, Banach zaś, choć aktualnie mieszka w Warszawie, to bez wątpienia szczecinianin. Ze Szczecina pochodzą też muzycy, którzy tworzą koncertowy skład Indios Bravos. Bo Indios Bravos od października 2002 to już nie tylko studyjny projekt, ale regularna, koncertowa kapela. Pierwszy koncert był jeszcze skromny. Na scenie Gutka i Banacha wsparli grający na klawiszach i śpiewający chórki Paweł Gawroński i gitarzysta Krzysztof Sak. Potem do tego składu dołączyli potem basista Ryszard Łabul, klawiszowiec Przemek Filipkowski i perkusista Tomek Kubik.','www_hhbd_pl_Indios_Bravos_1.jpg','image/jpg',NULL,NULL,'	  ','0000-00-00','0000-00-00',1,'',1,7,2118,100,NULL,'IB web','http://www.indiosbravos.com'),(360,'Banach Piotr','Piotr Banach','','2004-10-27 23:35:48','2005-07-25 21:41:02','O sobie: \"Swój pierwszy koncert zagrałem 17 lutego 1982 z grupą \"Paragraf 4\". Od tamtej pory nie zajmuję się praktycznie niczym więcej, jak tylko graniem koncertów, nagrywaniem płyt, zawiązywaniem i rozwiązywaniem coraz to nowych zespołów :) Oprócz Indios Bravos grałem między innymi w: Kolaboranci, Dum-Dum, Hey. Na stronie: www.banach.prv.pl znajdziesz więcej informacji na ten temat. Zapraszam :)\" ','www_hhbd_pl_Banach_Piotr_1.jpg','image/jpg',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','1965-03-05','0000-00-00',0,'',1,7,1688,100,NULL,'IB web','http://www.indiosbravos.com'),(361,'Deluks','','','2004-10-28 08:15:32','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,743,100,NULL,'',''),(362,'Incydent','','','2004-10-28 08:16:35','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,660,100,NULL,'',''),(363,'JWP','','','2004-10-28 08:29:19','2008-02-28 19:46:38','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,3,2171,100,NULL,'',''),(364,'Kozak Karolina','','','2004-10-28 08:56:14','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,804,100,NULL,'',''),(365,'ST Martin','','','2004-10-28 09:00:02','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,689,100,NULL,'',''),(366,'1000','','','2004-10-28 16:56:37','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,694,100,NULL,'',''),(367,'DJ Teraz Polska','','','2004-10-28 17:09:43','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,959,100,NULL,'',''),(368,'Peude','','','2004-10-28 17:15:52','2004-10-28 17:17:52','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,1,1018,100,NULL,'',''),(369,'Parker','','','2004-10-28 17:15:52','2004-10-28 17:17