'','0000-00-00','0000-00-00',0,'',1,0,709,100,NULL,'',''),(392,'Goozek','','','2004-10-28 19:46:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1064,100,NULL,'',''),(393,'Siek','','','2004-10-28 19:46:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,940,100,NULL,'',''),(394,'Olo','','','2004-10-28 19:46:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1004,100,NULL,'',''),(395,'ET','','','2004-10-28 19:49:27','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,555,100,NULL,'',''),(396,'DCR','','','2004-10-28 19:49:27','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,526,100,NULL,'',''),(397,'Dwaes','','','2004-10-28 19:53:16','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,713,100,NULL,'',''),(398,'MCFalograf','','','2004-10-28 19:54:05','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,314,100,NULL,'',''),(399,'MCF','','','2004-10-28 19:54:32','2004-10-28 19:55:03','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,567,100,NULL,'',''),(400,'Soundtrack','','','2004-10-28 20:27:29','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,909,100,NULL,'',''),(401,'Ascetoholix','','http://ascetoholix.com','2004-10-29 23:40:23','2005-10-02 00:01:56','Wszystko zaczęło się (jak zwykle) od pasji hip-hopem, chęci wyrażenia siebie i walki z małomiasteczkowymi stereotypami. Najpierw powstała nazwa zespołu &#8211; Ascetoholix, która nie odnosi się bezpośrednio do leksykalnego znaczenia słowa &#8222;asceta&#8221;, lecz oznacza raczej ascezę moralną, polegającą na unikaniu konformizmu życiowego i zaprzestaniu wybierania &#8222;łatwych dróg&#8221; na rzecz rzetelnej pracy i czystości duchowej. Grupa liczyła początkowo 5 osób, 4 osoby rozpoczęły tworzyć demówkę, aż w końcu 3 ją ukończyły (oczywiście <a href=\"/n/kris\">Krzychu</a>, <a href=\"/n/liber\">Liber</a> i <a href=\"/n/doniu\">Doniu</a>, z czego Dominik najmniej rymował, a zajmował się głównie muzyką i produkcją). Pierwsza wytwórczość w formie kasety magnetofonowej nosiła nazwę &#8222;3 x lak&#8221; (12 utworów) i była rozprowadzana za pośrednictwem poczty i Internetu. Zawierała ona wiele niedociągnięć &#8211; liczne szumy, niska jakość dźwięku, zdeterminowane brakiem dostępu do fachowego sprzętu (płyta przez niedoróbki została ostro skrytykowana i jednoznacznie negatywnie oceniona przez &#8222;Playę&#8221;). Owe braki były rekompensowane jednak zarysem oryginalnego stylu, który w wyniku ewolucji (czyli ciężkiej pracy autorów nad samo udoskonalaniem) stał się niepowtarzalny i powszechnie rozpoznawalny. Rzut okiem na ówczesną scenę polską Asceci swoją karierę rozpoczynali w czasach, kiedy polski hip-hop istniał w fazie rozwoju embrionalnego; a mianowicie bytowały zaledwie zalążki scen; legale wydało kilka squadów m.in. <a href=\"/n/kaliber_44\">Kaliber</a>, <a href=\"/n/Wzgorze_Ya_Pa_3\">Wzgórze</a>, <a href=\"/n/Trzyha\">Trzyha</a>. W Wielkopolsce prawowitego hip-hopu jeszcze nie było, gdyż istniało tam praktycznie 100% podziemia. Znany był jedynie <a href=\"/n/peja\">Peja</a>, głównie dzięki kilku wydanym hardcore\'owym płytom oraz swojemu gościnnemu występowi na płycie <a href=\"/n/Nagly_Atak_Spawacza\">Nagłego Ataku Spawacza</a>, który stanowił karykaturę hip-hopu oraz obrazę <a href=\"/n/liroy\">Liroya</a>). Bezpośredni kontakt z odbiorcami W tak trudnych czasach Ascetoholicy nastawili się głównie na bezpośredni kontakt z publicznością, a mianowicie grali liczne koncerty (nawet za darmo). Pierwszy koncert, który się odbył z ich udziałem, był to przegląd Obornickich kapel, przede wszystkim rockowych, na którym publiczność początkowo była bardzo sceptycznie nastawiona do nowego rodzaju muzyki, lecz po kilku utworach zaakceptował ascetyczny styl i zaczęła się bawić. Początkowo Asceci dawali lokalne koncerty, później także w Poznaniu, Elblągu, Ostrowie Wlkp., Pile, Warszawie, Żarowie, gdzie udało im się nawet wygrać konkurs hip-hopowy. \"Nazwij to sam\" W czasie owej trasy koncertowej promowali swoją drugą demówkę: \"Nazwij to sam\", która ukazała się w listopadzie 2000 roku i stała się kluczem do dalszej kariery zespołu, przede wszystkim dzięki kawałkowi \"Umiejętności\", który <a href=\"/n/camey\">Camey</a> postanowił zamieścić na swojej płycie \"Robię swoje 2\". Amatorski teledysk do utworu (nakręcony kamerą VHS przez Donia w obornickiej cegielni) został zamieszczony w osiemnastym numerze \"Klanu\".\r\nCałość historii zespołu, znajdziecie na stronie ich wydawcy: <a href=\"/l/umc_records\">UMC</a>.',NULL,'',NULL,NULL,'email: info@dlpromotion.com<BR>\r\ntel.: 502 532 411','0000-00-00','0000-00-00',1,'',3,1,2909,100,NULL,'',''),(402,'Iza','','','2004-10-29 23:42:13','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,956,100,NULL,'',''),(403,'Szad','','','2004-10-29 23:48:30','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,984,100,NULL,'',''),(404,'Sandra','','','2004-10-29 23:51:44','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,718,100,NULL,'',''),(405,'Jeden Osiem L','','','2004-10-29 23:55:43','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1204,100,NULL,'',''),(406,'Krzychu','','','2004-10-30 00:36:03','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,807,100,NULL,'',''),(407,'Chłopaki z Szarego Tłumu','','','2004-10-30 13:06:32','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1056,100,NULL,'',''),(408,'Mikey Kim','','','2004-10-30 13:23:47','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,978,100,NULL,'',''),(409,'Pbc','','','2004-10-30 13:28:31','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1129,100,NULL,'',''),(410,'Dedote','','','2004-10-30 22:41:43','2004-12-21 00:40:33','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,1,1012,100,NULL,'',''),(411,'Dj Sekta','','','2004-10-30 22:43:33','2005-09-01 13:06:22','Zaczynał około 1999 roku. Grał dziesiątki imprez i koncertów w całym kraju, ale także w Czechach, Austrii. Grał m.in. przed Afu-Ra, Group Home, De La Soul, Beat Junkies Crew, Prince Paul, Blak Twang, Mr.Gentleman, Declaime, Grand Agent, Beat Camp Soundsystem. Dał się poznać jako bardzo dobry dj imprezowy, skutecznie rozkrecając publikę w ramach cyklu imprez Konkret oraz na imprezach towarzyszacych koncertom artystów, z ktorymi grał w całej Polsce. Miał przyjemność koncertować z takimi polskimi wykonawcami jak: Grammatik, Pezet/Noon, OSTR, Łona, Flexxip, Echo itd. Pojawiał się także na antenie Radiostacji jeszcze gdy jej szefem był Sito. Obecnie koncertuje głównie z Grammatik\'iem oraz z MasalaSoundsystem - Maxa Cegielskiego. Gra także solowo imprezy w całej Polsce. Jest także na etapie przygotowywania swojego pierwszego mixtape\'u.',NULL,'',NULL,NULL,'mail: booking@eternia.pl','0000-00-00','0000-00-00',1,'',1,7,262,100,NULL,'',''),(412,'Urb','','','2004-10-30 22:46:24','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1024,100,NULL,'',''),(414,'Dj Spox','','','2004-10-30 22:49:05','2004-10-31 00:26:34','','www_hhbd_pl_Dj_Spox_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,1429,100,NULL,'Sewer','http://www.sewerx.com'),(415,'Zając','','','2004-10-31 00:06:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,636,100,NULL,'',''),(416,'Słońce','','','2004-10-31 00:06:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1052,100,NULL,'',''),(417,'GDM','','','2004-10-31 00:06:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,660,100,NULL,'',''),(418,'Larwa','','','2004-10-31 00:08:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,525,100,NULL,'',''),(419,'DrinAllStars','','','2004-10-31 00:16:39','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,708,100,NULL,'',''),(420,'TrzyStyle','','','2004-10-31 00:18:36','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,704,100,NULL,'',''),(421,'Pako','','','2004-10-31 00:24:00','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,890,100,NULL,'',''),(422,'Nec','','','2004-10-31 00:24:00','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,668,100,NULL,'',''),(423,'Tek','','','2004-10-31 20:43:03','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,955,100,NULL,'',''),(424,'Eskaubei','','','2004-10-31 21:20:33','2005-10-10 09:45:07','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,7,714,100,NULL,'',''),(425,'Manufaktura','','','2004-10-31 21:23:14','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,685,100,NULL,'',''),(426,'Afront','','http://asfalt.pl/afront.html','2004-10-31 22:41:49','2005-10-01 22:56:30','Łódzki zespół Afront to <a href=\"/n/janek\">Janek</a>, <a href=\"/n/kasina\">Kasina</a> i <a href=\"/n/dj_funksion\">DJ Funksion</a>.\r\nPoczątki ich wspólnej muzycznej działalności to rok 1998, kiedy to wraz z <a href=\"/n/ostr\">Ostrym</a>, Mussim (obecnie <a href=\"/n/tomila\">Tomila</a> - Tabasko) i Ahmedem stworzyli grupę LWC. Po roku współpracy i kilkunastu amatorsko nagranych numerach zespół zaprzestał działalności. Przez kolejne trzy lata poszczególni członkowie LWC koncentrują się na swoich odrębnych projektach doraźnie sobie pomagając. W roku 2001 powstaje Afront. Nagrane zostaje pierwsze demo, a w rok później zespół zajmuje drugie miejsce na wrocławskim przeglądzie młodych zespołów hiphopowych. Konsekwencją zajęcia wysokiego miejsca na wrocławskim festiwalu jest kontrakt z wytwórnią <a href=\"/l/blend_records\">Blend Records</a> i rozpoczęcie pracy nad debiutanckim albumem \"Już takich nie robią...\". Płyta zostaje nagrana w łódzkim studiu Marka Dulewicza (m. in. <a href=\"/n/ostr\">O.S.T.R</a>, <a href=\"/n/familia_hp\">Familia H.P.</a>, <a href=\"/n/oboz_ta\">Obóz TA</a>).\r\nPo wielokrotnym przekładaniu daty premiery przez wytwórnię kontrakt z <a href=\"/l/blend_records\">Blend Records</a> zostaje rozwiązany a Afront praktycznie z dnia na dzień staje się pierwszym zespołem w stajni nowopowstałego sublabelu <a href=\"/l/asfalt_records\">Asfaltu</a> - <a href=\"/l/Tabasko_Nagrania\">Tabasko Nagrania.</a>\r\nCzłonkowie Afrontu jednomyślnie dochodzą do wniosku, że nagrana już płyta jest zbyt mało aktualna (najstarsze numery miały ok. 2 lat), aby prezentować obecne oblicze zespołu. W lipcu 2003 rozpoczynają się prace nad nową płytą. Płyta prawie w całości wyprodukowana jest przez <a href=\"/n/ostr\">Ostrego</a> (dwa bity robi <a href=\"/n/dj_funksion\">DJ Funksion</a> a jeden <a href=\"/n/janek\">Janek</a>) i nawiązuje klimatem do hiphopu z początku lat 90\', szczególnie do nowojorskich klasyków. Garściami czerpie z czarnej muzyki lat 60\' i 70\' jak i z polskiego jazzu. Album &#8222;<a href=\"/a/A_mialo_byc_tak_pieknie\">A miało być tak pięknie</a>\" nagrany oczywiście w studiu Marka Dulewicza, który jest także realizatorem albumu, wyróżnia się ciekawymi eksperymentami z brzmieniem i nowatorskim podejściem. Album tekstowo prezentuje to szerokie spektrum tematów. Od klasycznych dla hiphopu motywów przedstawionych jednak w świeży sposób poprzez bragga po teksty bardzo osobiste.','www_hhbd_pl_Afront_1.jpg','image/jpg',NULL,NULL,'email: tytus@asfalt.pl<br />\r\ntel.: 502 313 300','0000-00-00','0000-00-00',1,'',1,1,2362,100,NULL,'Sewer','http://www.sewerx.com'),(427,'Kasina','','','2004-10-31 22:51:32','0000-00-00 00:00:00','','www_hhbd_pl_Kasina_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1527,100,NULL,'fot. M. Grochowina','http://www.sfotografuj.to.pl'),(428,'Janek','','','2004-10-31 22:51:32','2004-11-04 01:50:27','','www_hhbd_pl_Janek_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,1,1743,100,NULL,'m. grochowina','http://www.sfotografuj.to.pl'),(429,'Dj Funksion','','','2004-10-31 22:51:32','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1591,100,NULL,'',''),(430,'Analogia','','','2004-11-02 22:48:46','2005-10-01 23:43:17','Analogia powstała w połowie 1998 roku. Stworzyło ją trzech fanów dobrego rapu z Trójmiasta: <a href=\"/n/benio\">Benio</a>, <a href=\"/n/rdw\">RDW</a> oraz <a href=\"/n/kaszalot\">Kaszalot</a>. \r\nBenio wraz z RDW zajmują się głównie rapem, a Kaszalot produkcją. Pierwsze swoje nagrania zarejestrowali na przełomie 1999 i 2000 roku, kiedy powstało ich demo pt. &#8222;To co w nas drzemie&#8221;. Zawierający 9 utworów materiał pokazywał, że Analogia ma coś do powiedzenia i, że już niebawem będzie o nich głośno. Płyta znalazła się nawet na I miejscu listy przebojów Radiostacji, co pozwoliło chłopakom zaprezentować się większej publiczności. \r\nW swojej historii zagrali już niezliczoną ilość koncertów w wielu miejscach naszego kraju. Duży rozgłos przyniósł im występ na poznańskim festiwalu Bless Da Mic oraz Festiwalu w Opolu w roku 2003. \r\nIch utwór znalazł się na kompilacji Szkoła Życia, a solowe dokonania RDW na płytach <a href=\"/n/wwo\">WWO</a>, <a href=\"/n/ski_sklad\">Ski Składu</a>, <a href=\"/n/ascetoholix\">Ascetoholix</a> oraz <a href=\"/n/dj_decks\">Dja Decksa</a>. \r\nJak sami mówią robią ...dobry, solidny rap... Można się o tym przekonać słuchając albumu: \"<a href=\"/a/Esencja_Czysta\">Esencja Czysta</a>\". Za stronę muzyczną projektu odpowiedzialny będzie Kaszalot, a także po części <a href=\"/n/ske\">SKE</a> z Elegant. Ich pierwszy krążek zawierający 14 utworów trafił do sklepów latem 2004 nakładek wytwórni <a href=\"/l/wielkie_jol\">Wielkie Joł</a>.','www_hhbd_pl_Analogia_1.jpg','image/jpg',NULL,NULL,'Kamil \"Jakuza\" Jaczyński<br>\r\nemail: jakuza@wielkiejol.com<BR>\r\ntel.: 502 214 585','0000-00-00','0000-00-00',1,'',3,1,1971,100,NULL,'strona Wielkie Joł','http://www.wielkiejol.com'),(431,'Kaszalot','','','2004-11-02 23:26:45','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,889,100,NULL,'',''),(432,'Benio','','','2004-11-02 23:26:45','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1540,100,NULL,'',''),(433,'Dj Wojak','','','2004-11-03 09:42:13','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,661,100,NULL,'',''),(434,'Rak','','','2004-11-03 09:43:44','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,420,100,NULL,'',''),(436,'Emil','','','2004-11-03 09:47:31','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,597,100,NULL,'',''),(437,'Ske','','','2004-11-03 09:50:39','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1140,100,NULL,'',''),(438,'Cybul','','','2004-11-03 22:52:30','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,827,100,NULL,'',''),(439,'Ski Skład','','http://www.skisklad.com.pl','2004-11-03 23:15:02','2005-10-17 02:34:59','Zespół SKI SKŁAD narodził się na początku 2000 roku podczas koncertowego wyjazdu zespołu <a href=\"/n/Slums_Attack\">SLUMS ATTACK</a> do Pragi Czeskiej. <a href=\"/n/Peja\">Rychu</a> i <a href=\"/n/Wisniowy\">Łukasz</a> znali się wcześniej, podczas koncertu promującego płytę \"<a href=\"/a/Calkiem_Nowe_Oblicze\">Całkiem nowe oblicze</a>\" w klubie \"Blue Note\" mieli okazje ze sobą porozmawiać. <a href=\"/n/Wisniowy\">Wiśnia</a> w tym czasie był członkiem zespołu UKF Skład, <a href=\"/n/Peja\">Rychu</a> miał już na koncie dwie oficjalnie wydane płyty, Łukasz nagrywał demo w piwnicy Małego razem z w\\w Chomikiem oraz Jędruchą. Peja razem z Deksem grali koncert w całej Polsce, UKF zagrał jeden koncert podczas Jamu Grafitti na Ratajach, po którym skład opuścił Jędrucha. W tym czasie poznali się z <a href=\"/n/MCF\">MCFem-Fidol</a>, <a href=\"/n/Frenchman\">Francuzem-Frenchman</a> oraz NWK-Fogg, którzy brali czynny udział w nagrywkach UKF składu. Następnym, który się wykruszył był Chomik chwile po nim Mały, tym sposobem zespół UKF umarł śmiercią naturalną, a Wiśnia został sam bez wizji dalszej działalności. Kolejne nagrywki odbywały się w składzie <a href=\"/n/Wisniowy\">Wiśnia</a>, <a href=\"/n/MCF\">Fido</a>, <a href=\"/n/Frenchman\">Franc</a>, NWK w mieszkaniach każdego z nich. <a href=\"/n/Peja\">Peja</a> razem z <a href=\"/n/Dj_Decks\">Deksem</a> latem 1999r zorganizowali imprezę na placu Wolności, na której mieli okazje dłużej porozmawiać wypić pare piwek i wspólnie pofreestajlować, pojawiło się tam wiele postaci z poznańskiej sceny: <a href=\"/n/Owal_Emcedwa\">Owal</a>, <a href=\"/n/Hans_52\">Hans</a>, Kornik, <a href=\"/n/Anymaniakh\">Anymaniak</a> i <a href=\"/n/Da_Blaze\">Da Blaze</a>. Następna wspólna sesja odbyła sie na poznańskim squcie podczas koncertu zespołu 52(wtedy jeszcze Hans i Deep), gdzie mieli okazje się sprawdzić. Kolejne spotkanie nastąpiło w klubie \"Esqulap\" przy okazji koncertu zespołu <a href=\"/n/Grammatik\">Gramatik</a>, gdzie wolnomikrofonowa walka trwała dłużej niż było to przewidziane. Rychu w tym czasie nagrywał wraz z Deksem kolejny materiał SLU \"I nie zmienia się nic\" i podczas jednej z imprez zaproponował Wiśni nagranie na nią wspólnego kawałka.\r\n18.12.1999r.lekko wczorajsi zjawili się w studio nagraniowym \"<a href=\"/l/Camey_Studio\">Camey</a>\" gdzie nagrali kawałek pod tytułem \"Wspólne zadanie\". W tym samym tygodniu została dograna zwrotka do kawałka \"Zdegenerowane oczy moje\" oba pojawiły się na płycie \"<a href=\"/s/Nie_Zmienia_Sie_Nic\">Nie zmienia się nic</a>\". Wiosną 2000 roku <a href=\"/n/Peja\">Rychu</a> zadzwonił do <a href=\"/n/Wisniowy\">Wiśni</a> z pytaniem czy pojedzie z nimi na koncert do Krakowa, nad odpowiedzią nie musiał się zastanawiać. To właśnie w mieście Kraka nawiązała się współpraca koncertowa.\r\n31.03.2000r. <a href=\"/n/Slums_Attack\">SLU</a> wyjechało na koncert do Czech gdzie nasi sąsiedzi z południa popisali się swoim poczuciem humoru robiąc zamieszanie przez cały dzień 01.04. To właśnie w trakcie tego wyjazdu narodziła się nazwa SKI SKŁAD. Od tego momentu rozpoczęło się pisaniem zwrotek na płytę Ski Składu. <a href=\"/n/Peja\">Rychu</a> zajął się warstwą muzyczną, a za studio służyło jego mieszkanie. Pierwsze kawałki zostały zarejestrowane w mieszkaniu <a href=\"/n/Dj_Decks\">Deksa</a>: \"Po to żeby dzieci miały\", \"Niech nie zdarzy ci się\", \"No co by było gdyby\", a latem został zagrany pierwszy samodzielny koncert w jednym z poznańskich klubów. SKI jest przez wielu ludzi mylnie kojarzony z rozbudowana formą SLU za co chłopaki mogli tylko podziękować jednemu z redaktorków gazety hiphopowej.\r\nW międzyczasie powstają demówki znajomych Ski Składu w których biorą oni udział: Aifam na który <a href=\"/n/Peja\">Peja</a> z <a href=\"/n/Wisniowy\">Wiśnią</a> nagrali jeden kawałek i jedną improwizacje wraz z Fidolem oraz rzeczy ambitniejsze na które nagrywał <a href=\"/n/Wisniowy\">Wiśnia</a> pierwsza płyta <a href=\"/n/Ascetoholix\">Astetoholix</a> kawałek \"<a href=\"/s/Prestiz\">Prestiż</a>\" wraz z <a href=\"/n/Kris\">Krisem</a>, oraz utwór \"Konflikt światowy\" na demo Techac wudu, a także wspólnie utwór na demo Kornika.\r\nKolejny etap to film \"Blokersi\" w którym udział bierze <a href=\"/n/Peja\">Peja</a>, <a href=\"/n/Dj_Decks\">Deks</a> oraz część poznańskiej sceny. Zespół <a href=\"/n/Slums_Attack\">SLUMS ATTACK</a> dostaje propozycję nagrania kolejnej płyty dla wytwórni <a href=\"/l/T1_Teraz\">T1</a> w którą ponownie zaangażowany jest <a href=\"/n/Wisniowy\">Wiśnia</a>, zwany od tej pory Wiśniowym.\r\nPowstanie płyty \"<a href=\"/a/Na_Legalu\">Na legalu</a>\" pozwala zagrać olbrzymią ilość koncertów zjechać całą Polskę wszerz i wzdłuż, a w międzyczasie zjawiać się w studio aby nagrywać kolejną płytę pod szyldem SKI SKŁADU. Materiał powstawał w przerwach między koncertami w okresie czerwiec-sierpień 2002, wrzesień-listopad 2002, marzec-maj 2003 w studio \"Biały Dom\" przy współpracy Cichego Boba aka Ed.','www_hhbd_pl_Ski_Sklad_1.jpg','image/jpg',NULL,NULL,'tel. 501 644 977 (Wojtek)<br />\r\nmail: wojtek@skisklad.com.pl','2000-00-00','2004-10-12',1,'',3,1,2034,100,NULL,'Oficjalne www zespołu','http://www.SkiSklad.com.pl'),(440,'KNT','','','2004-11-03 23:29:22','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1029,100,NULL,'',''),(442,'D.W.A.','','','2004-11-06 00:34:07','2004-11-22 16:00:04','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,3,438,100,NULL,'',''),(443,'FLM','','','2004-11-06 00:34:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,415,100,NULL,'',''),(444,'Selwa','','','2004-11-06 00:34:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,410,100,NULL,'',''),(445,'Reni Jusis','','','2004-11-06 00:36:04','2004-12-11 00:41:45','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,3,875,100,NULL,'',''),(446,'Peteero','','','2004-11-06 19:33:32','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,0,509,100,NULL,'',''),(449,'Kacza','','','2004-11-07 11:34:28','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',5,0,661,100,NULL,'',''),(453,'Maximiliano','','','2004-11-07 11:49:53','2004-11-07 14:50:11','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,4,901,100,NULL,'',''),(454,'Wiele C.T.','','','2004-11-07 11:59:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',4,0,755,100,NULL,'',''),(455,'Płomień 81','','','2004-11-07 14:53:51','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',4,0,3407,100,NULL,'',''),(456,'OMP','','','2004-11-07 15:03:13','2004-11-07 15:22:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',