ek i w zasadzie mało kto wie że takowe kiedykolwiek istniało.<br />\r\nRok 1999 EGO debiutuje na scenie częstochowskiego klubu \"Wakans\" prezentując owoce swojej rocznej przygody z muzyką. Pozytywne opinie publiczności pośrednio umożliwiły rozkwit późiejszej twórczości. Efektem czego była składanka wydana przez firmę GIGANT RECORDS pod tytułem \"SC 034\" (2000). EGO ubarwia tę płytę utworem \"Kto ty taki\" i tym samym daje o sobie znać ogólnopolskiemu gronu słuchaczy. Muzyka zespołu idzie naprzód zauważalny jest niekonwencjonalny charakter kawałków, których powstaje coraz więcej.<br />\r\nPoczątek 2001 to w zasadzie \"początek wszystkiego\", początek \"poważnego podejścia do sprawy\". Na rynku pokazuje się \"Nibylandia\" - debiutancki album zespołu. Tytuł płyty zamierzenie odzwierciedla jej klimat... Album jest czymś zaskakująco innym różni się od wcześniejszych dokonań EGO jak również od muzycznych dokonań w ogóle. Praca nad materiałem przebiegła bardzo sprawnie mimo nieobycia ze studyjnymi realiami. Z roku na rok twórczość zespołu stawała się coraz bardziej pożądana. Kilkuletnia współpraca z PAKTOFONIKÃ„â€ž, wspólne koncerty, utwory, pomysły i plany połączyły te składy w jeden o nazwie \"PFK Kompany\".<br />\r\nRok 2003 przyniósł wiele zmian, niby nic już nie było, a jednak czuło się tego obecność. Zaczyna się praca nad nową płytą. Coraz rzadziej można zobaczyć i usłyszeć jednocześnie skład, który całkowicie pochłonęła praca w studio. Dziś wiadomo już że te osiemnaście miesięcy potrzebne było aby wpuścić w każdy poszczególny dźwięk odrobinę powietrza - tak by powstało coś na kształt \"bańki mydlanej\". W 2005 ukazał się kolejny wytwór wyobraźni - drugie EGO \"Nie ma takiego drugiego\".',NULL,'',NULL,NULL,' ','0000-00-00','0000-00-00',1,'',1,7,1679,100,NULL,'',''),(482,'Bitnix','','','2004-11-17 23:24:57','2006-04-26 20:08:30','Bitnix, czyli Tomasz i Jan, to bazujący w Warszawie duet producencki, zajmujący się zarówno kompozycją, jak i produkcją wykonawczą muzyki. Od początku znakiem rozpoznawczym Bitnix jest ciepłe, organiczne brzmienie, konstruowane z licznych sampli, wspomagane użyciem syntezatorów oraz żywych instrumentów.<br>Stylistyka, w której poruszają się Bitnix, to nowoczesna muzyka miejska, mieszcząca się głównie w ramach gatunkowych Hip-Hop&#8217;u, broken beatu oraz 2stepu. Elementem spajającym te, jakże różne, gatunki jest... Jazz, z którego obaj \'bitnicy\' czerpią nieustającą inspirację.<br>Spójność w różnorodności to bez wątpienia największa siła Bitnix. Bujający Hip-Hop, energetyczny 2step, broken beat, house, drum\'n\'bass, neo-soul... Bitnix łączą różne gatunki, popisując się rzadko spotykanym wyczuciem i smakiem.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,3,1488,100,NULL,'',''),(483,'Kuba O.','','','2004-11-18 22:08:50','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,771,100,NULL,'',''),(484,'Rzemi','','','2004-11-19 23:40:21','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,0,317,100,NULL,'',''),(485,'Wzorowy','','','2004-11-19 23:40:21','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,0,615,100,NULL,'',''),(486,'Doz','','','2004-11-19 23:44:57','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,418,100,NULL,'',''),(487,'Siwy I Siwy','','','2004-11-19 23:53:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,0,417,100,NULL,'',''),(488,'Sobota','','','2004-11-20 00:02:04','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,0,1041,100,NULL,'',''),(489,'I.N.K.I.','','','2004-11-20 00:08:13','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',4,0,826,100,NULL,'',''),(490,'Novika','Kasia Nowicka','','2004-11-21 13:09:46','2004-11-21 15:48:34','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,881,100,NULL,'',''),(491,'Futro','','','2004-11-21 15:49:17','0000-00-00 00:00:00','',NULL,'',N