','0000-00-00',0,'',3,3,592,100,NULL,'',''),(520,'Koras (BMW)','','','2004-11-22 16:12:14','2005-10-17 17:31:20','','www_hhbd_pl_Koras_(BMW)_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,1248,100,NULL,'Marcin Szambelan','http://Tuhart.net'),(521,'Jary','','','2004-11-22 16:12:14','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,900,100,NULL,'',''),(522,'Selma','','','2004-11-22 19:48:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,386,100,NULL,'',''),(523,'Ewa','','','2004-11-22 19:52:20','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1059,100,NULL,'',''),(524,'Nowator','Paweł Lipski','','2004-11-22 19:52:49','2005-09-01 11:50:22','Nazywam się Paweł Lipski obecnie mam 19 lat, Nowator, dlatego ponieważ pierwszy mój nielegal nazywał się TeOeR, co oznaczało Teoria Opoczyńskiego Rymowania, a ja za wszelka cenę chciałem by to była Nowa Teoria Rymów, cos świeżego, cos, co jeszcze nigdy nie było robione w moim mieście, byłem bardzo młody w wieku 15 lat, stad powstał NOWATOR, jednak ksywa odzwierciedla się także teraz, bynajmniej w podkładach, w których używam wątków muzycznych z rożnej kultury świata, od muzyki Latynoamerykańskiej, typu Cha-cha, Salsa, Rhumba, Samba, po muzykę poważną. Te zainteresowania wiążą się na pewno z tym, ze cenie niezmiernie muzykę, ponieważ skończyłem Szkołę Muzyczna I stopnia, w której grałem na klarnecie i fortepianie. Mój ojciec także jest muzykiem, tylko nie robi Hip Hopu.. :) Na swoim koncie mam nielegal TeOeR i dwa Projekt Kwadrat Rap, który tworze z bardzo utalentowanym MC- BliznaHH i dj V.I.P. <br />\r\nRobię także mixtepy ostatni nazywał się NOWATOR KompMix 2003, który został dobrze odebrany. Uwielbiam także muzykę Regae, która zaraził mnie dj Feel-x, za czasów imprez w Piekarni w Końskich. W tej chwili nagrałem nawijkę pod Dance Hall- owy mixtape mojego człowieka dj Ras Juniora, z którym najczęściej gram na imprezach tego typu muzyki. Mam teledysk, z którego jestem zadowolony, nie miałem na niego wielkiego budżetu, reżyserem był Tygrys. Obecnie współpracuję i chce nawiązać współpracę z Makulem, który robi świetne bity, z Teką, z Rzensą i oczywiście z BliznaHH. Z producentów bardzo cenie produkcje Jajonasza, IGSa, Szychy i Cameya. Inspirują mnie także Timbaland, The Neptunes, uwielbiam brzmienia takie jak Kanye West, Just Blaze. Chce się rozwijać powoli, nie chce robić nic na sile. Trzeba wierzyć w siebie, bo jak w siebie nie uwierzysz, to nikt inny tez tego nie zrobi.<br />\r\nPozdrawiam Nowator ','www_hhbd_pl_Nowator_1.jpg','image/jpg',NULL,NULL,'tel.: 692-247-175','0000-00-00','0000-00-00',1,'',1,7,3811,100,NULL,'Camey Studio','http://www.camey.pl'),(525,'Packa Piotrek','','','2004-11-22 22:43:21','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,282,100,NULL,'',''),(526,'Raminiak Przemysław','','','2004-11-22 22:43:21','2004-11-22 22:45:31','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,3,789,100,NULL,'',''),(527,'Foster','','','2004-11-22 22:45:12','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,706,100,NULL,'',''),(528,'Ero','','','2004-11-22 22:45:12','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,851,100,NULL,'',''),(529,'Lilu','','','2004-11-22 22:49:27','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1141,100,NULL,'',''),(530,'Urbaniak Michał','','','2004-11-22 22:52:13','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,334,100,NULL,'',''),(531,'Pietia','','','2004-11-23 02:41:42','2005-01-13 15:49:27','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,1,1072,100,NULL,'',''),(532,'Skierny','','','2004-11-23 18:10:04','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,670,100,NULL,'',''),(533,'Zawodnik','','','2004-11-23 18:10:04','2004-11-23 18:10:53','',NULL,'',