rozwoju muzycznym nastąpił około 1999 roku, kiedy to powstało LPS. Przestałem tylko słuchać, zapragnąłem tworzyć :) Kupiłem pierwszego pirata z progsami i... Zaczynałem od trackerów, szybko je jednak odłożyłem, ze względu na ich malutkie możliwości. Zafascynowany syntezą zacząłem używać Buzz\'a. Na nim właśnie stworzyłem najwięcej kawałków, lecz żaden z nich nie przetrwał próby czasu...<br />\r\nJak wygląda aktualnie moje wirtualne studio możesz zobaczyć tu, tutaj z kolei możesz zapoznać się z moimi dotychczasowymi osiągnięciami i projektami.\"','www_hhbd_pl_Tabb_1.jpg','image/jpg',NULL,NULL,'		  ','0000-00-00','0000-00-00',1,'',1,7,1072,100,NULL,'Sewer','http://www.sewerx.com'),(540,'Ike','','','2004-11-23 22:44:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,929,100,NULL,'',''),(541,'Oliwka','','','2004-11-23 22:51:48','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,660,100,NULL,'',''),(542,'Rada','','','2004-11-23 22:55:09','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1091,100,NULL,'',''),(543,'DNA','','','2004-11-23 23:02:34','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,933,100,NULL,'',''),(544,'Tymi i Żółty','','','2004-11-24 21:30:00','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,913,100,NULL,'',''),(545,'El Gaouli','','','2004-11-24 21:50:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,347,100,NULL,'',''),(546,'Szafrańska Marta','','','2004-11-24 21:58:59','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,955,100,NULL,'',''),(547,'Esee','','','2004-11-24 22:03:55','2004-11-24 23:31:14','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,642,100,NULL,'',''),(548,'Kobranocka','','','2004-11-24 22:05:13','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,682,100,NULL,'',''),(549,'Mixer