arytatywnym (prowadzone głównie w ramach Ogólnopolskiego Programu na Rzecz Rozwoju Utalentowanych Dzieciaków \"Spoko Dzieciak\", w której to akcji zespół bierze czynny udział). Równocześnie z działaniami podejmowanymi w ramach Siły Dźwięq obaj członkowie zespołu stale realizują własne projekty. Od kilku lat <a href=\"/n/dj_spajki\">Spike</a> organizuje plenerowe imprezy sportowe we współpracy z Red Bullem: \"Event Red Bull Air&Water\" (1998) support przed zespołem The Herbaliser , support przed zespołem Africa Bambaataa \"the Zulu Nation\" (1999), Oficjalne Mistrzostwa Świata w ekstremalnych Skokach Narciarskich \"Zieleniec Red Bull Snów Air\" (2002, 2003), \"Red Bull Kapsel Trophy\" (2004), \"Red Bull Busters\" (2004), \"Red Bull Monstairs\" (2005). Był również rezydentem warszawskich klubów \"Alfa\", \"Nemo\", \"Punkt\", gdzie prowadził cykliczne imprezy funkowe-breakbitowe i hip hopowe. Jako Tres Amigos, wspólnie z dj Benito i <a href=\"/n/dj_ojciec_karol\">dj Ojcem Karolem</a>, tworzą team ludzi wykożystujacych morzliwości nie jednego a trzech zestawów gramofonów , lawirując pomiędzy dźwiękami breakbeatu przez big beat, b boy breaks, funk i hip-hop. Dużo instrumentalnych brzmień, połamanych bitów, żywej perkusji, wgniatającego basu, skreczy i pozytywnej energii. Można ich obejrzeć i posłuchać w całej Polsce.\r\n<a href=\"/n/mc_kfiat\">Kfiat</a> realizuje swoje taneczne pasje. W 2002 r. zaczął nauczać break\'a w studiu \"Forma\" i \"Moc Tańca\" najmłodszych fanów kultury hip hopowej zafascynowanych umiejętnościami i talentem młodego b-boy\'a. W 2005 r., dzięki nawiązaniu współpracy z Fundacją Centrum Twórczości Narodowej, miał okazję zatańczyć (wraz z Bożkiem i .Wezyrem) przed samym Ojcem Świętym Janem Pawłem II podczas prywatnej audiencji. Po raz pierwszy w historii hip hop rozbrzmiał w Sali Klementyńskiej w Watykanie.\r\nTwórczość Siły Dźwięq ukazała się do tej pory na 2 krążkach: wydanym nielegalnie albumie \"Siła Dźwięq - <a href=\"/a/przedsmak\">Przedsmak</a>\" (2000) oraz produkcji \"<a href=\"/a/funkkrok24\">Funkkrok24</a>\" (2005). Usłyszeć ich można również na kilku składankach: \"Pomysł Goni Pomysł\", \"Kadencja\", \"<a href=\"/a/instynkt\">Instynkt</a>\" - <a href=\"/n/dj_kadet\">dj Kadeta</a> oraz składance \"Polski Hip Hop\". W ramach promocji zespołu powstały dwa teledyski: Klip do debiutanckiego krążka zatytułowany \"Reprezentacja Polski\" został zrealizowany przez Michała Marczaka. Twórca i jego teledysk zdobyli kilka prestiżowych nagród m.in. Białego Yacha na IX Festiwalu Polskich Wideoklipów (2000), nagrodę na Europejskim Festiwalu Filmowym \"Euroshorts 2000\" oraz nagrodę specjalną na Festiwalu Jutro Filmu 2001. Drugim teledyskiem promującym najnowszą płytę jest \"<a href=\"/s/zgadnij_kto_przy_mikrofonie\">Zgadnij kto przy mikrofonie</a>\", który miał swoją premierę w maju 2005.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,1785,100,NULL,'',''),(598,'Rufin MC','Artur Piekut','','2004-12-07 03:11:29','2005-09-30 20:36:19','',NULL,'',NULL,NULL,'	  ','0000-00-00','0000-00-00',1,'',1,1,2499,100,NULL,'',''),(599,'Rhazi','','','2004-12-07 11:20:59','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,296,100,NULL,'',''),(600,'Kombi','','','2004-12-07 11:23:03','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,960,100,NULL,'',''),(601,'Ice T','','','2004-12-09 09:41:47','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',0,0,478,100,NULL,'',''),(602,'G.E.R.M','','','2004-12-09 09:41:47','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',0,0,839,100,NULL,'',''),(603,'Grubas','','','2004-12-09 20:47:50','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,879,100,NULL,'',''),(604,'Eskobar','','','2004-12-09 20:49:02','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,833,100,NULL,'',''),(605,'Kapeć','','','2004-12-09 20:49:02','0000-00-00