zyli Projekt Wszystkie Rymy Dozwolone.\r\n\r\n1998r.\r\nW styczniu 1998 na jednej z imprez, na której graliśmy poznaliśmy DJ. Volta, który to później zaprosił nas, jak i kilka innych białostockich zespołów, do Warszawy na koncert promujący jego składankę. We wrześniu na płycie dołączonej do magazynu \"Brum\" pojawił się nasz kawałek \"Na fonii\". W październiku wygraliśmy jedną z nagród na Street Festiwalu. Pod koniec 1998 roku ukazała się składanka \"Hiphopowy raport z osiedla w najlepszym wykonaniu\", na której to pojawił się nasz kawałek \"Bez morału (wszystko w porządku)\".\r\n\r\n1999r.\r\nW 1999r. dostaliśmy propozycję od Volta nagrania naszej pierwszej płyty. Od września rozpoczęliśmy jej nagrywanie w studiu Ośki.\r\n\r\n2000r.\r\nNa początku roku nasz kawałek \"Trzeba sobie radzić\" ukazuje się na składance \"Hiphopowy raport z osiedla 2000\". W kwietniu nakładem THC/RRX wyszła nasza debiutancka płyta \"PierWsza RunDa\".\r\n\r\n2001r.\r\nKoma rozpoczął współpracę z Ośką, u którego najpierw nagrał utwory \"Leniwy czas\" i \"Hallo Hallo (wspólnie z Małym) - oba znalazły się na składance K2. Później wspólnie z Ośką pracował nad materiałem na swoją solową płytę A.M.O.K, nagrał także kawałek \"Ilu?\" (który znalazł się na składance V6). W październiku nakładem Asfalt Records wyszedł singiel \"Nie igraj z ogniem\", a w listopadzie album A.M.O.K.\r\n\r\n2002r.\r\nNagraliśmy drugą płytę \"PozostaWić tRwały ślaD\", która w czerwcu została wydana przez wytwórnię Rekord Records. Płytę promował klip do kawałka \"Co mnie tu trzyma\" (feat. Fabuła), oraz zrealizowany własnymi środkami (nagranie, montaż i realizacja - Rudi) klip do kawałka \"Życie to nie gra\".\r\n \r\n2003r.\r\nOd początku roku pracujemy nad kolejnym albumem PWRD, w międzyczasie ukazały się dwie składanki z naszym udziałem \"Hip Hop\" (kawałek \"Chodź i weź to\") i \"Przedstawienie\" (kawałek \"Za dużo chce\"). \r\n','www_hhbd_pl_PWRD_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,2097,100,NULL,'strona oficjalna PWRD',''),(618,'NAIS','','','2004-12-11 12:21:01','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,676,100,NULL,'',''),(619,'Wysoki lot','','','2004-12-11 12:28:06','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,525,100,NULL,'',''),(621,'Josef','','','2004-12-11 21:44:35','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,927,100,NULL,'',''),(622,'Kubano','','','2004-12-11 21:44:35','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,909,100,NULL,'',''),(623,'Plankton','','','2004-12-11 21:49:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1053,100,NULL,'',''),(624,'Romeo','','','2004-12-11 21:54:35','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,932,100,NULL,'',''),(625,'Żary','','','2004-12-11 21:57:10','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,991,100,NULL,'',''),(626,'Niewidzialna Ręka','','','2004-12-11 21:57:10','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,766,100,NULL,'',''),(627,'Hudy','','','2004-12-11 22:00:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,607,100,NULL,'',''),(628,'Suja','','','2004-12-11 22:00:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,471,100,NULL,'',''),(629,'Asfalt','','','2004-12-11 22:02:05','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1079,100,NULL,'',''),(630,'Pablopavo','','','2004-12-11 22:03:22','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1129,100,NULL,'',''),(631,'Thunder','','','2004-12-14 12:52:31','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',0,0,373,100,NULL,'',''),(632,'Kalecik','','','2004-12-14 19:56:10','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'',