005-12-04 03:02:07','Vienio I Pele są na scenie HH od samego jej początku. Vienio jest współzałożycielem legendarnej już grupy Molesta Ewenement, Pele od początku jej istnienia jeździł na koncerty i gościnnie występowałna płytach, aby w końcu przy trzecim albumie Molesty dołączyć oficjalnie do zespołu.\r\nW roku 2001 Molesta zawiesza działalność, a w rok później (2002) Vienio i Pele \"debiutują\" swoją płytą pt. \"Autentyk\". Na płycie wystąpili goście tacy jak: Sokół, Pono, Deluks , Tomek Lipiński (Brygada Kryzys, Tilt).\r\nRok później (2003) wychodzi druga część z serii Autentyk w której gościnnie udział wzięli: Andrzej Smolik, Novika, Mehdi Mesrine (Soundkail), Wacim, WIGOR (MOR.W.A.), Lui, Olga.S.Włodi, Dj 600V, DJ Mini.\r\nW roku 2004 Biorą udział w projekcie \"U Ciebie W Mieście\". Jest to największa trasa koncertowa w Polsce. Z tej okazji zostaje wydana okolicznościowa Epka, z której dochód przeznaczony jest na szczytny cel.\r\n04.05.2005 odbyła się premiera 3 części Autentyk, płyta cieszy się sporym zainteresowaniem wśród odbiorców. Wśród gości WWO, Eis, Gutek, Mercu, i inni.\r\nZostali zaproszeni na koncerty w USA oraz w Anglii, W polsce dotychczas zagrali ich ok. 250. \r\nW Nowym Jorku zagrali razem z legendą amerykańskiego HH - Dj Premierem z Gang Starr. W czerwcu 2005 r. ponownie wezmą udział w RBK HIPHOP TOUR 2005 razem z Ostr, Pezet-Noon, Lildap (Grouphome), JWP, Waco.\r\nVienio i Pele Licznie się udzielali jako goście m.in. Schizma(HC), Cool Kids of Death (alternativ punk), HipHopDekalog, Zipera, MOR.W.A., OSTR, Wzgórze Ya-Pa3, Rocca (La Cliqua, Tres Coronas), Lil Dap (Group Home), Pezet, Waco, Fu, i wiele, wiele innych. Na stałe koncertuje i nagrywa z nimi w studio Dj Romek.','www_hhbd_pl_Vienio_&_Pele_1.jpg','image/jpg',NULL,NULL,'tel.: 601 897 353 (Marek Zioło)<br>\r\nVienio & Pele z muzykami sesyjnymi<br>\r\ntel.: 698 222 266, 698 300 303','0000-00-00','0000-00-00',1,'',3,1,7150,100,NULL,'vieniopele.pl',''),(648,'Wacim','','','2004-12-18 22:23:42'