Początki muzycznej drogi Drugiej Strony Lustra sięgają roku 1994, kiedy to Max udzielał się jako wokalista i kompozytor w post-punkowych grupach reggae Apokalipsa i Propaganda. W tym okresie Zigi współpracował jako grafik z rockowymi zespołami Acid Drinkers, Flapjack i Bandog. W 1998 roku z inicjatywy Maxa powstał projekt muzyki eksperymentalnej \"Persona\", który po dołączeniu Zigiego do składu, przyjął psychodeliczno hip-hopową stylistykę. Grupa zadebiutowała na albumie kompilacyjnym \"19 Południk - Własnym Torem\" (Blend Records 2001), oraz LP \"Strefa Cienia\" (Gigant Records 2002). W roku 2002 Persona zawiesiła działalność, dzieląc się na dwa projekty: Druga Strona Lustra i Siła NaRasta. Po ostatecznych roszadach personalnych w składzie DSLa pozostali Max i Zigi.\r\nPraca nad materiałem przebiegała dwutorowo: hip-hopowy materiał na nielegal \"Schiz Nocy Letniej\" i album reggae \"Język Żywiołów\". Z czasem nie starczało energii na takie rozdwojenie, w wyniku czego zespół podjął decyzję o powrocie do korzeni - czyli muzyki reggae (roots, dancehall). Hip-hopowy materiał ukazał się na kilku krajowych \"składankach\".\r\nObecnie grupa współpracuje z wieloma artystami gatunków reggae i hip-hop (dodatkowe info w dziale \"współpraca\". Ma na swoim koncie szereg koncertów i festiwali z czołówką polskich raperów, zespołów reggae i soundsystemów (dodatkowe info w dziale \"koncerty\"). Wielkimi krokami zbliża się ich album \"Język Żywiołów\", na którym gościnnie wystąpią min.: Dj Hen i Dj Kostek - Poznań, Single Dread - Warszawa, Bas (Mustafarai, 13 Czyli Pół Fuksa) - Dąbrowa Górnicza, Mea (PFK Kompany) - Mysłowice, Jaosh - Kraków, Żoołw (Sponta) - Kraków, Nowa Ziemia - Andrychów. ','www_hhbd_pl_DSL_1.jpg','image/jpg',NULL,NULL,'Management:\r\nJarek Szklarczyk\r\ntel.: +48 501 044 676\r\nMail: menago@drugastronalustra.com ','0000-00-00','0000-00-00',0,'',1,7,862,100,NULL,'DSL website','http://www.drugastronalustra.com'),(662,'Małolat&Ajron','','','2005-01-08 22:13:59','20