kte.de','2005-01-24 11:05:31','2005-09-03 09:59:00','SIDO czyli Super Intelligentes Drogen Opfer, członek niemieckiego AGGROBERLIN (<a href=\"http://www.aggroberlin.de\">http://www.aggroberlin.de</a>). Od 1997 razem z B-Tight tworzy Die Sekte.','www_hhbd_pl_Sido_1.jpg','image/jpg',NULL,NULL,'fax: 030/21912675<br />\r\nmail: info@aggroberlin.de','0000-00-00','0000-00-00',1,'',1,1,954,100,NULL,'Aggroberlin','http://www.aggroberlin.de'),(704,'Slums Attack','','','2005-01-24 12:16:17','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,1675,100,NULL,'',''),(705,'Wilk Kasia','','','2005-02-12 12:08:36','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1110,100,NULL,'',''),(706,'Karwan Ania','','','2005-02-12 12:11:44','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,636,100,NULL,'',''),(707,'Orzech','','','2005-02-12 12:12:18','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,353,100,NULL,'',''),(708,'Aro','','','2005-02-12 12:15:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,855,100,NULL,'',''),(709,'Verba','','','2005-02-12 12:24:10','2005-02-12 12:32:08','Zespół VERBA powstał w 1997 roku w Pile w Wielkopolsce. W skład wchodzą BARTAS I IGNAC. Produkcją muzyczną zajmuje się właśnie BARTAS. Starzy kumple z jednej klasy szkoły podstawowej szybko odkryli, że mają wspólne zainteresowania i postanowili połączyć siły. Bartas i Ignac zaczęli współpracować bardzo wcześnie, kiedy jeszcze hip-hop w Polsce nie cieszył się popularnością. Zafascynowani muzyką powoli zaczynali myśleć o zrobieniu czegoś podobnego, jednak na początku reprezentowali różnorakie style muzyczne. Poprostu, jak mówią \"bawili się muzyką\". Bartas swoją przygodę z komponowaniem utworów zaczął bardzo wcześnie, bo już w wieku 5 lat rozpoczął naukę gry na instrumentach klawiszowych. Przez 18 lat aż do dziś nie rozstawał się z muzyką, bo jest ona jego życiem. Szukał w różnych klimatach od techno, house , electro, jungle poprzez pop i aż po hip-hop. I tak już zostało. Razem bardzo szybko zainteresowali się pisaniem tekstów. jednak przez długi czas rymował tylko Ignac. Z czasem i Bartas zabrał się za rymowanie. Tworzą to, czego sami lubią słuchać, choć przyznają, że lubią hip-hop w każdym wydaniu. Ich zdaniem hip-hop musi być różnorodny i szczery. W ich utworach często przewijają się tematy codziennego życia i miłości i własne przemyślenia z nimi związane. Jest to muzyka dla wszystkich. Chłopaki z Verby występowali w wielu miastach Polski jako support przed: Jeden Osiem L, Ascetoholix, Mezo, Owal, 52 Dębiec, Pan Duże Pe, Sistars, Kasta Squad, Tede, O.S.T.R., Vienio i Pele, Gutek, Trzeci Wymiar, Don Guralesko. Na swoim koncie mają trzy nielegale, jednak w ciągu ostatniego roku zaszyli się w domowym studio i rozpoczęli prace nad płytą demo, których efektem zainteresowała się wytwórnia UMC Records.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,3,9026,100,NULL,'',''),(710,'Bartas','','','2005-02-12 12:30:41','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,2734,100,NULL,'',''),(711,'Ignac','','','2005-02-12 12:30:41','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,952,100,NULL,'',''),(712,'Dialektyka','','','2005-02-13 12:16:08','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1179,100,NULL,'',''),(713,'ASB','','','2005-02-13 12:28:31','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1121,100,NULL,'',''),(714,'QBC','','','2005-02-13 12:28:31','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,819,100,NULL,'',''),(715,'Cichy','','','2005-02-13 12:33:14','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,865,100,NULL,'',''),(716,'Mind','','','2005-02-13 12:36:11','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00