 niezwykle różnorodnym i w sumie kompilacyjnym albumie znaleźć można zarówno down-tempo, nu-jazz, klasyczny hip-hop (gdzie w kilku kawałkach Fisz wraca do rapu!) jak i utwory nie podlegające jakiemukolwiek zaszufladkowaniu - między innymi singlowy \"Kryminalny Bluez\", utwór który jest świetnym przykładem na wszechobecne na płycie: spontaniczność, humor i przymróżenie oka.','www_hhbd_pl_Fisz_Envee_1.jpg','image/jpg',NULL,NULL,'mail: tytus@asfalt.pl<br>\r\ntel.: 502-313-300 ','0000-00-00','0000-00-00',1,'',3,7,1218,100,NULL,'Asfalt Records','http://www.asfalt.pl'),(725,'Envee','Maciej Goliński','','2005-02-17 12:02:19','2005-09-27 15:57:56','Muzyk, DJ i producent, członek i współzałożyciel kolektywu dj-skiego \"Niewinni Czarodzieje\", znanego na Świecie dzięki londyńskiej wytwórni Fluid Ounce jako Innocent Sorcerers. Nakładem FO ukazały się dwa 12\" single Innocent Sorceres (m.in. z udziałem szkockiego wokalisty Joseph\'a Malik\'a ). W 2003 w Polsce ukazał się pełnopłytowy debiut Envee nakładem wytwórni Kayax pt.\"Envee i Niewinni Czarodzieje\", efektem tego albumu był również udział w kompilacji \"Panorama- Nu Europa Fusion\" monachijskiej oficyny Perfekt Toy oraz \"Jazz no Jazz vol.2\" włoskiej Energy Productions. Pomysłodawca i producent re-aranżacji utworu \"Find our love\" autorstwa berlińskiego duetu Slope, która ukazała się nakładem wytwórni Sonar Kollektiv, wytwórni prowadzonej przez światowej sławy kolektyw Jazzanova. Współproducent kilku utworów na albumie Marysi Sadowskiej. Wraz z Andrzejem Smolikiem tworzy duet Poika. Jako DJ występuje w eksperymentalnym koncertowym projekcie Tomasza Stańko. Autor muzyki teatralnej, współpracuje z niezależnymi teatrami Usta Usta (m.in. \"Rzeźnia Lila Róż\"), Porywacze Ciał (\"Best of\"), Polskim Teatrem Tańca (\"Dancing Hz\"), Michałem Znanieckim (\"Innocenti Czarodzieje\"). Jego utwory zostały wykorzystane w filmach (\"Egoiści\", \"Wtorek\"), w słuchowiskach radiowych i niezależnych, undergroundowych produkcjach audiowizualnych. Aktywny studyjnie i scenicznie, kręci winylami na scenach wielu klubów w całej Polsce, wykonuje remiksy na zamówienie jak i bez (na wiosnę). Ma na koncie wiele wydawnictw tego typu, m.in. dla takich wykonawców jak Futro, Husky, Kameral Projekt, Kasa, Marysia Sadowiska, Miennta, Modfunk, Reni Jusis, Smolik, Tworzywo Sztuczne. Znalazł się na takich krajowych kompilacjach, jak \"Transheteroelectro\", \"Klubokawiarnia\", \"Radio Leniwa Niedziela\". Programowo beznurtowy, miłośnik muzyki z wyraźnym sonicznym hologramem HQ, który stara się umieścić również we wszystkich swoich nagraniach.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,1,1125,100,NULL,'',''),(726,'OlsenFu','','','2005-02-17 13:32:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1357,100,NULL,'',''),(727,'Waldas','','','2005-02-17 19:45:29','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,493,100,NULL,'',''),(728,'Heniu','','','2005-02-17 19:45:29','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,878,100,NULL,'',''),(729,'Dibo','','','2005-02-17 19:48:36','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,305,100,NULL,'',''),(730,'Glaca','','','2005-02-17 19:50:39','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,945,100,NULL,'',''),(731,'Magic','','','2005-02-17 19:50:39','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,900,100,NULL,'',''),(732,'SLU','','','2005-02-17 19:55:41','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,899,100,NULL,'',''),(733,'ST. One','','','2005-02-17 19:57:58','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,965,100,NULL,'',''),(734,'Ron','','','2005-02-18 23:22:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,892,100,NULL,'',''),(735,'Yaro','','','2005-02-24 16:18:40','000