,'0000-00-00',0,'',3,0,798,100,NULL,'',''),(749,'Hołdys Zbigniew','','','2005-02-24 16:43:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,573,100,NULL,'',''),(750,'Afro Kolektyw','','http://afrokolektyw.elysium.pl','2005-02-26 02:11:30','2005-11-24 12:10:04','Pierwsza nazwa zespołu to Shit Lives Forever, której pierwszy wyraz - według samego Afro Kolektywu - oddawał jednocześnie poziom ich zespołu został założony na przełomie lat 1994 i 1995. W skład wchodzili wtedy <a href=\"/n/afrojax\">Afrojax</a> i <a href=\"/n/nestor\">Nestor</a>. Nagrali przez dwa lata trzy demówki, z których żadna nie została udostępniona szerszej publiczności.\r\nKolejna nazwa to Kawiarnia, pod która powstała kolejna demówka \"Demo Tape No 1\" - i znów członkowie Afro Kolektywu nie byli zadowoleni z wyników, a dobiło ich jeszcze to, że do wydania płyty zgłosiła się tylko wytwórnia Pro Dance. Wiosną 1999 roku, w studiach Sadyba i N\'d\'N powstaje album \'Negatywne Wibracje\'. Wydany własnym sumptem album rozszedł się w ilości ok. 200 egzemplarzy.\r\nRok 2000 to kontrakt z wytwórnią <a href=\"/l/t1_teraz\">T1-Teraz</a>. Po dwóch latach pełnych przygód, 8 grudnia 2001 zostaje wydany album \"<a href=\"/a/Plyta_Pilsniowa\">Płyta Pilśniowa</a>\" nakładem tejże wytwórni. Recenzje albumu były pozytywne, lecz przez marną promocję (akcja plakatowania miasta przez sam Afro Kolektyw i brak wsparcia ze strony wytwórni) album nie dotarł do szerokiej publiczności.\r\nAktualnie Afro Kolektyw tworzą: Afrojax (mikrofon, beatmaszyna), Mariusz Chibowski (bas), Michał Szturomski (gitara), Miłosz Wośko (klawisze). Na scenie i w studiu z Afro Kolektywem występują także: Artur Chaber (perkusja), Łukasz Poprawski (saxofon altowy), Kinga Miśkiewicz (śpiew), Marcin Masecki (konga).\r\nMuzyka grana przez Afro Kolektyw to mieszanka hip-hopu i acid jazzu używają w tym celu żywych instrumentów. Teksty dzięki wielkiemu poczuciu humoru Afrojaxa są bardzo wesołe, pozbawione przypisywanego dla polskiego hip-hopu \'blokerskiego klimatu\', pozytywne i bardzo autokrytyczne (oczywiście tego autokrytycyzmu nie należy traktować całkiem dosłownie).\r\nHistoria zespołu w wersji pełnej opisanej w świetny sposób przez samego <a href=\"/n/afrojax\">Afrojaxa</a>, dostępna jest na oficjalnej stronie zespołu (<a href=http://afrokolektyw.elysium.pl target=\"_blank\">http://afrokolektyw.elysium.pl</a>), na która serdecznie zapraszamy - uwaga, duża dawka śmiechu!\r\nAktualnie zespół kończy swoją drugą studyjną płytę <a href=\"/a/Czarno_widze\">Czarno Widzę</a>. Której premiera już w tym roku&#8230;','www_hhbd_pl_Afro_Kolektyw_1.jpg','image/jpg',NULL,NULL,'email: johanbengtson@o2.pl','1995-00-00','0000-00-00',1,'',4,1,2438,100,NULL,'strona oficjalna',''),(751,'Bunio','Michał Skrok','','2005-02-26 03:03:52','2005-07-19 14:19:57','Producent, gitarzysta, gitarzysta basowy a ostatnio także soniczny wokalista. Wydał trzy solowe albumy producenckie z muzyką ewoluującą od abstract Hiphopu po jazzowy ambient (\"Perz\", \"Historie+R\", \"Symfonia Lo-Fi\"). W przeszłości uczestniczył także w projektach \"Legwan Allstars\" oraz \"Mazoll & Arytmic Elektron\". Aktualnie zaangażowany jest w cieszący się dużym uznaniem trójmiejski projekt Ludzie. Ma na swym koncie wiele występów - zarówno solowych jak i z towarzyszeniem zaprzyjaźnionych muzyków (Arszyn, Emiter, Bartweba).',NULL,'',NULL,NULL,'		  ','0000-00-00','0000-00-00',1,'',4,7,1235,100,NULL,'',''),(752,'SSS','','','2005-02-26 14:46:05','2005-05-13 00:58:19','<p>Stylowa Spółka Społem to Decó i DJ Domel. W liczniejszym wydaniu formacja ta znana jest głównie z b-boyowej strony swojej działalności - SSS zajęła II miejsce na BOTY East Europe 2003. Ekipa produkuje się sama, muzycznie korzysta szeroko z funkowego i soulowego dorobku lat 70 (DJ Domel nie marnował długiego czasu spędzonego w Stanach). Swym Stylem Spółka przypomina old-schoolowe konwencje pielęgnowane współcześnie przez takie zespoły jak np. J5 czy Ugly Duckling.</p>\r\n<p>Historia Stylowej Spółki Społem zaczyna się od B-Boyingu. DJ Domel buja od około 1992, Decó od 1994. Chłopaki przewijali się przez różne składy break-dance, najbardziej znane to: \"2 Hard To Boken\" (I miejsce na \"Brekowisku\" we Włocławku \'95) i \"Heart Attack Squad\" (II miejsce w Bydgoszczy \'96, występ na legendarnym \"Rap Day \'97\"), poza tym chłopaki mają na koncie także: III miejsce B.Berlin Open \'99, udział w East Side Battle Praga \'99, III miejsce B.Boy Contest Szczecin \'99, II miejsce Kraśnik 2000, I miejsce \"Spin Off Haga\" 2000. W 1999 r. powstaje projekt Stylowa Spółka Społem, w której skład wchodzą ludzie ze Świdnicy, Dzierżoniowa i Strzegomia. Później dołączają Mysza (Koszalin/Warszawa), Sancho, Bioły (Kielce) i Przeplach (Kraków). Ekipa zdobywa 1. miejsce na \"Breakers Revenge\" 2000 w Wiśle i od tej pory, w tym składzie występuje pod tą nazwą \"Stylowa Spółka Społem\". Zespół cechuje indywidualizm i zróżnicowanie, każdy rozwija i prezentuje swój własny, niepowtarzalny styl. B-boying, będący do tej pory podstawą działania grupy, ma ogromny wpływ na muzyczną stronę jej działalności. Z powodu tańca korzenie SSS głęboko sięgają do starego, dobrego, śmierdzącego funk\'a, groove, soul\'u, go-go, reggae, acid jazz\'u, breakbitu i old school\'u. Są to trendy muzyczne, które najbardziej kręcą chłopaków z SSS i tego słuchają przede wszystkim. Pierwsze bity i rymy w SSS zaczął robić Decó (\'98/\'99), używając do tego PC P100/2GB. 2 lata później do projektu dołączają Hiro, Pastor a następnie DJ Domel. DJ Domel zaczynał DJ\'ing w czasach kiedy nie było innego wyboru niż gramofony Unitra. Z biegiem czasu uzbroił się jednak w Technicsy i Vestaxa po czym wyjechał do USA, gdzie przez pół roku tyrał na 2 zmiany, co pozwoliło mu na zakup maaaaasy starych winyli. Początkowo tylko DJ, z czasem zajął się także produkcjami. W swym czteroosobowym składzie grupa nagrała pierwsze kawałki demo, w tej chwili skład zawęził się do Decó i DJ Domela. Do tej pory grupa nagrywała głównie w \"domowej roboty\" studio w klubie \"Kasyno\" (Strzegom), ale swój debiutancki album dla Asfalt Records nagra w Warszawie, w Suchybrut Studio Emade.</p>','www_hhbd_pl_SSS_1.jpg','image/jpg',NULL,NULL,'mail: tytus@asfalt.pl<br />\r\ntel.: 502-313-300','0000-00-00','0000-00-00',1,'',1,7,1116,100,NULL,'Asfalt Records','http://www.asfalt.pl'),(753,'P.O.E.','','','2005-02-26 14:48:45','2005-05-13 00:57:39','',NULL,'',NULL,NULL,'mail: tytus@asfalt.pl<br />\r\ntel.: 502-313-300	  ','0000-00-00','0000-00-00',1,'',1,7,1521,100,NULL,'',''),(754,'Muzykoterapia','','','2005-02-26 14:51:31','2005-05-13 00:53:07','Grupa powstała w październiku 2002 roku w składzie:<BR><br />\r\n- Iza Kowalewska (wokal)<BR><br />\r\n- Domink Trębski<BR><br />\r\n- Wojtek Traczyk (kontrabas)<BR><BR>Ich wspólne studia i doświadczenia powodują, że zespół wypracował swój własny, osobisty styl. Jednocześnie każdy z muzyków ma różnorodną przeszłość muzyczną czerpiącą z wielu gatunków muzycznych. Formacja czerpie i inspiruje się założeniami muzykoterapii, która jest pojmowana jako forma terapii dźwiękowej. Duża część tego co tworzą muzycy poza projektem (dub, ethno, jazz, soul) przenika do twórczości Muzykoterapii i pozwala słuchaczom zanurzyć się w słodkie dźwięki terapii muzycznej.<BR><BR>Muzykoterapia wystąpiła na licznych koncertach, między innymi 27 grudnia 2004 w ramach cyklu \"Generacja Teatru Rozmaitości\" w Warszawie.','www_hhbd_pl_Muzykoterapia_1.jpg','image/jpg',NULL,NULL,'mail: tytus@asfalt.pl<br>\r\ntel.: 502-313-300\r\n			  ','0000-00-00','0000-00-00',1,'',1,7,638,100,NULL,'Asfalt Records','http://www.asfalt.pl'),(755,'Bassisters Orchestra','','','2005-02-26 14:55:31','2005-10-02 00:34:51','Bassisters Orchestra to projekt muzyczny, który tworzą muzycy gdańskiej sceny underground. Pomysłodawcą projektu jest Wojciech Mazolewski. Muzyka zespołu oscyluje wokół transowych improwizacji i eksperymentów dźwiękowych.\r\nSkład tego superkolektywu jest imponujący: Bunio (smp), Emade (smp), Fisz (voc), Wojtek Mazolewski (bas), Macio Moretti (dr), Mikołaj Trzaska (sax).\r\nAktualnie kolektyw pracują nad swoją płytą <a href=\"/a/_bez_tytulu_2\">(na razie brak tytułu)</a> która ukaże się nakładem <a href=\"/l/asfalt_records\">Asfaltu</a>.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,830,100,NULL,'',''),(756,'Mazolewski Wojtek','','','2005-02-26 15:19:37','2005-02-26 15:21:03','W Bassisters Orchestra gra na basie.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,1,779,100,NULL,'',''),(757,'Moretti Macio','','','2005-02-26 15:20:24','0000-00-00 00:00:00','W Bassisters Orchestra gra na perkusji.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,548,100,NULL,'',''),(758,'Trzaska Mikołaj','','','2005-02-26 15:20:24','0000-00-00 00:00:00','W Bassisters Orchestra gra na saksofonie.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,994,100,NULL,'',''),(759,'Dreadsquad Sound System','','','2005-02-26 15:28:29','0000-00-00 00:00:00','DREADSQUAD SOUNDSYSTEM to projekt ukierunkowany na szerzenie szeroko rozumianej kultury jamajskiej. Przez dwa lata działalnosci ugruntowali sobie znaczaca pozycję na scenie, czego uwieńczeniem było dwukrotne zajęcie pierwszego miejsca na poznańskiej edycji ogólnopolskiego SOUNDCLASH\'u, w latach 2003 i 2004. \r\n\r\nZespół tworzy dwóch selektorów: MMF oraz FUNKSION. Ich muzyka to Reggae, Dancehall, Jungle, Hip Hop, 2step i wszystko oparte na głębokim brzmieniu basów i połamanych rytmach, które rozruszaja każda imprezę. \r\n\r\nCzęsto podczas wystepów wspomagaja ich zaprzyjaznieni wokalisci: C-Mon i Groove HQ [Ri!CODEH] oraz mc AKIRA i mc MANIAC [Burning Lion]. \r\n\r\nSety miksowane na dwóch gramofonach to fuzja imprezowych utworów w stylistyce RAGGAMUFFIN, RAGGA-HIP-HOP, energetycznego SOCA oraz klasyków muzyki REGGAE -DANCEHALL. \r\n\r\nNa imprezach granych przez Dreadsquad usłyszysz również dubplate\'y (od takich artystów jak Reggaenerator, PIĘĆ G, Ri!Codeh, Pablopavo), produkcje DREADSQUADU prezentujace polska scenę DANCEHALL oraz autorskie remiksy znanych wykonawców. \r\n\r\nPod koniec stycznia 2003 ukazał się na CD pierwszy oficjalny polski MIXTAPE [mix wielu utworów] produkcji DREADSQUADU. Album utrzymany w stylistyce ragga - hip-hop - reggae znajduje się na pierwszym miejscu wsród najlepiej sprzedajacych się płyt na stronie www.siodemki.com.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,1881,100,NULL,'',''),(760,'Funksion','','','2005-02-26 15:31:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,362,100,NULL,'',''),(761,'MMF','','','2005-02-26 15:31:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,959,100,NULL,'',''),(762,'Marika','','','2005-02-26 15:35:15','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1264,100,NULL,'',''),(763,'Wilko','','','2005-02-26 15:35:15','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,306,100,NULL,'',''),(764,'Kameral','','','2005-02-26 15:35:15','0000-00-00 00:00:00','Kameral formalnie istnieje od 2002 roku., ale niezwykle trudno mówić o konkretnym momencie, w którym powstał. To trio powstało bardzo spontanicznie, a wszystko właściwie zaczęło się, gdy Misza i Wilko rozpoczęli pierwsze próby tworzenia muzyki na sprzęcie komputerowym. Wtedy jeszcze Marika była wokalistką zespołu \"Po godzinach\" - formacji złożonej z muzyków związanych z Teatrem Strefa Ciszy. Po jej rozpadzie dołączyła do sound systemu Bass Medium Trinity i niedługo po tym do drum\'n\'bass\'owego crew Breakbeat Propaganda. Pomiędzy \"Po godzinach\", a Bass Medium Trinity, Marika pojawiła się w jednej z produkcji duetu Wilko i Misza. Efekt był tak zachęcający, że postanowili dalej wspólnie robić muzykę. \r\n\r\nMają niebanalne podejście do muzyki, która tworzą. Interesują ich rzeczy z różnych obszarów muzycznych. Każdy ma pewne swoje inspiracje i tendencje: Wilko - deep house, Misza - nu-jazz, zaś Marika brzmienia jamajskich wykonawców, jungle oraz drum\'n\'bass. Łączy ich na pewno miłość do muzyki, ciekawych melodii niezależnie od ograniczeń gatunkowych czy stylistycznych.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1486,100,NULL,'',''),(765,'Abor','','','2005-02-26 15:36:19','2005-02-26 15:36:37','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,1,945,100,NULL,'',''),(766,'Bass Medium Trinity','','','2005-02-26 15:36:19','2005-10-02 00:16:55','Jest to poznański sound systemu grającego imprezy w Polsce i za granicą. Styl Bass Medium Trinity to sety didżejskie oparte  na muzyce jamajskiej: reggae, dancehall, raggamuffin granej z 7 calowych płyt  winylowych w połączeniu z wokalami na dwa mikrofony. Od początku w składzie byli wokalistka <a href=\"/n/marika\">Marika</a>, MC <a href=\"/n/frenchman\">Frenchman</a> oraz selektor (cżłowiek odpowiedzialny za selekcje muzyki) <a href=\"/n/abor\">Abor (ABselektOR)</a>.\r\nSpecjalnością grupy są covery oraz własne teksty śpiewane do oryginalnych podkładów jamajskich tzw. version znajdujących się na str. B winylowych singli. Muzycznie Bass Medium Trinity oscylują między reggae, dancehall a ostrym raggamuffin. Mimo swej niedługiej działalności w obecnym składzie Bass Medium Trinity ma na koncie wiele udanych imprez w większości polskich klubów prezentujących ten rodzaj muzyki, audycje radiowe oraz występ na CREAMFIELDS 2003. Grupa zagrała również na ubiegłorocznym, wrocławskim SOUND CLASH&#8217;U (pojedynek najlepszych polskich reggae mc) gdzie zdobyli drugie miejsce oraz nagrodę publiczności.\r\n<a href=\"/n/marika\">Marika</a> i <a href=\"/n/frenchman\">Frenchman</a> zaśpiewali również na mix tape Dancehasll Clash Test autorstwa <a href=\"/n/dj_feel_x\">DJ FEEL-Xa</a>. Materiał ukazał się we wrześniu 2004.\r\nOprócz typowo zabawowego podejścia Bass Medium Trinity w swoich występach nawiązują do ideologii rasta opowiadając się za pozytywnymi wartościami pokoju, miłości i jedności czyli \"peace, love and unity\".','www_hhbd_pl_Bass_Medium_Trinity_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,1,1271,100,NULL,'augustynowicz','http://www.augustynowicz.tk'),(767,'Red & Spinache','','','2005-02-28 15:22:28','0000-00-00 00:00:00','','www_hhbd_pl_Red_&_Spinache_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,1339,100,NULL,'oficjalna strona www',''),(768,'Zag.Mad.Fany','','','2005-03-07 17:50:44','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,444,100,NULL,'',''),(769,'Norbullo','','','2005-03-07 17:50:44','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,967,100,NULL,'',''),(770,'Ri!codeh','','','2005-03-07 17:51:37','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,869,100,NULL,'',''),(772,'Tu1','','','2005-03-07 17:57:10','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,410,100,NULL,'',''),(773,'ASP','','','2005-03-07 19:36:10','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,938,100,NULL,'',''),(774,'Larifari','','','2005-03-08 23:57:29','0000-00-00 00:00:00','<p>Lari Fari jest pierwszym w 100% żywym zespołem hiphopowym. Muzyka oscyluje w klimatach smooth hiphop - rnb. Brzmieniem przypomina \"czarne\" zespoły soulowo - funkowe z lat 70 - tych.</p><p>Założycielem grupy jest haem - producent i dj znany z projektów: IDEO, EGO, Pijani Powietrzem, Cudawianki oraz ze współpracy z zespołem PAKTOFONIKA.</p><p>Bębny, bass i ciepły rhodes buduj? podstawę brzmienia LARI FARI, nie brakuje również sekcji dętej w wykonaniu Daniela Pomorskiego (i Tomka Próchnickiego (uczeń Piotra Wojtasika) i smyczków - kwartetu Quattro Stggioni na codzień muzycy Filharmonii Częstochowskiej, skrecze występują tutaj jako instrument solowy, całokształt wykańcza głos wokalistki: Pauliny Kujawskiej (absolwentki Wydziału Jazzu i Muzyki Rozrywkowej w Katowicach). Paulina Kujawska &#8211; wokalistka występująca czynnie w wielu projektach muzycznych na terenie całej polski m.in. Ewa Bem, Marek Raduli, Krzysztof Ścierański, Jerzy Filar. Doskonały \"puls\" płynnie przenika się z melodią i przemyślanymi tekstami, pomiędzy którymi pojawiają się solówki Mateusza Pospieszalskiego - saksofony, flet, klarnet basowy, instrumenty klawiszowe, akordeon, śpiew. Współpracował z zespołem \"Maanam\". Obecnie współpracuje z zespołami \"Tie Break\" i \"GRAAL\" oraz Stanisławem Sojkś i Janusza \"Yaniny\" Iwańskiego - jedna z najważniejszych osobowości wywodzących się z ruchu \"young power\". Iwański od ponad 20 lat jest podporą najbardziej kultowej z polskich grup okołojazzowych, Tie Break. Kilka lat partnerował na scenie Staszkowi Sojce.</p><p>Tekstowo Lari Fari to połączenie filozofii i ulicznego rapu, ironii i pozytywnego hiphopu - co daje doskonałą, wybuchową mieszankę...</p><p>Skład zespołu: Paulina Kujawska &#8211; głosy, Maciek Szewczyk &#8211; rhodes, wurlitzer, piano, Jacek Fedkowicz &#8211; bass, kontrabas, Wojtek Fedkowicz &#8211; perkusja, Dj Haem &#8211; skrecze, programowanie.</p>',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,1206,100,NULL,'',''),(775,'Żywe srebro','','','2005-03-09 17:38:59','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,503,100,NULL,'',''),(776,'Seru','','','2005-03-09 17:40:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,886,100,NULL,'',''),(777,'Patryk','','','2005-03-09 17:40:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,717,100,NULL,'',''),(778,'Pełka Romek','','','2005-03-09 17:48:17','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,374,100,NULL,'',''),(779,'Fedkowicz Jacek','','','2005-03-09 17:48:17','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,755,100,NULL,'',''),(780,'Ściubidło Magda','','','2005-03-09 17:48:17','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00