awali się członkowie Obozu.<br />\r\nPierwsza płyta \"Obóz TA\" wydana w 2000r. nakładem firmy \"Camey\" śmiało może być nazwana prekursorską, brzmieniowo do dziś jest ona nowatorska. Obóz to pierwsza polska płyta, na której przejawił się Ego Trip, dziś wszechobecny na rodzimych płytach rapowych. <br />\r\nSkład zespołu to: Red (producent, raper, prezenter programu \"MTV Squad\" i RBK hiphop TV), Spinache (Thinkadelic-producent i raper), Czizz (raper), Miko (P\'AM-producent i raper), Mizone (raper) i Emes (raper), gościnnie Kevin (P\'AM-raper).',NULL,'',NULL,NULL,'		  ','0000-00-00','0000-00-00',1,'',1,7,1864,100,NULL,'',''),(789,'Szybki szmal','','','2005-03-11 15:05:27','2005-11-16 19:29:23','Szybki Szmal to grupa kilku chłopaków reprezentujących wysoki poziom warszawskiego rapu. Zadebiutowali legalnym albumem w 2001 roku nakładem wytwórni <a href=\"/l/promil\">Promil</a>. Następnie kilku z nich (<a href=\"/n/proceente\">Proceente</a>, <a href=\"/n/maly_esz_esz\">Mały Esz Esz</a>) wydało swoje solowe albumy. Aktualnie ukończone zostały prace nad najnowszym, drugim albumem: \"<a href=\"/a/mixtape_2005\">Mixtape 2005</a>\", na którym wielu znakomitych gości. Producentem projektu jest Szogun.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,2173,100,NULL,'',''),(790,'Poema Faktu','','','2005-03-11 15:17:21','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1094,100,NULL,'',''),(791,'Kamilson','','','2005-03-11 15:36:30','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,196,100,NULL,'',''),(792,'Faust','','','2005-03-11 15:52:29','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,477,100,NULL,'',''),(793,'Mały Esz Esz','','','2005-03-11 16:38:21','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1241,100,NULL,'',''),(794,'Emazet i Proceente','','','2005-03-11 16:42:08','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00'