gii, w skład którego wchodzą zespoły muzyczne: \"Baterie (słoneczne)\" - w kategorii: Jazz, \"Akumulator\" - w kategorii: Drum\'n\'Bass, Breakbeat, Nu-jazz, \"Muzykoterapia\" - w kategorii: Jazz i Triphop. Po zejściu ze sceny często mylony z Fiszem.','www_hhbd_pl_Trebski_Dominik_1.jpg','image/jpg',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',1,7,1212,100,NULL,'Asfalt Rec.','http://www.asfalt.pl'),(820,'Traczyk Wojciech','','','2005-03-13 18:14:10','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,481,100,NULL,'',''),(821,'Staszu Starship','','','2005-03-13 18:16:48','2005-07-19 14:34:28','Grać na basie uczył się sluchając nagrań Parliament, Funkadelic i Jamesa Brown\'a. Zafascynowany głównie twórczością czarnoskórych wykonawców i brzmieniem lat 60\' i 70\'. W roku 1999 debiutował na scenie warszawskiego \"Akwarium\". Jamował w \"Muzie\" z Kool & The Gang (w czasie ich \"tajnego\" pobytu w Warszawie). Grał na \"Djazzporach\" w \"Galerii Off\". Udzielał się na płycie Dizkret/Praktik \"IQ\" oraz na drugim albumie Pare Słów. Od maja 2000 związany z undergroundowym funkowym zespołem \"Łąki Łan\".','www_hhbd_pl_Staszu_Starship_1.jpg','image/jpg',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',1,7,963,100,NULL,'Asfalt Rec.','http://www.asfalt.pl'),(822,'Moskal Łukasz','','','2005-03-13 18:16:48','2005-07-19 14:35:12','Pochodzi z miasta rowerów - Stalowej Woli. Przygodę z muzyką rozpoczął jako dziecko w szkole muzycznej - w eksperymentalnej klasie skrzypiec (zajęcia połączone z treningami aerobiku), ale już wtedy chodząc na zajęcia do szkoły zbaczał z drogi lądując w piwnicy u starszych kolegów, gdzie w oparach przedziwnych substancji przyglądał się grającemu tam perkusiście - jak i wywieszonym na ścianach ciekawym plakatom. To tam stawiał pierwsze kroki wybijając rytm do dziwnej i mało zrozumiałej na ten czas dla niego muzyki (to a propos punkowych tekstów typu \"pierdolę system, kiram klej, mam to w dupie\" itd.). Klasę skrzypiec ukończył z wyróżnieniem! Z aerobikiem też nie było najgorzej. A jednak to nie było to... znudzony patrzeniem na niekończący się peleton rowerzystow pędzących do huty, pewnego przepięknego poranka wstaje i wyrusza w kierunku: Dworzec Centralny - Warszawa. To tutaj poznaje tajniki sztuki, wstępując do kolejnej dziwnej szkoły. Podejmuje współpracę z wieloma artystami i grupami, koncertuje, nagrywa płyty na perkusji i instrumentach perkusyjnych.','www_hhbd_pl_Moskal_lukasz_1.jpg','image/jpg',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',1,7,1087,100,NULL,'Asfalt Rec.','http://www.asfalt.pl'),(823,'Zagórski Jurek','','','2005-03-13 18:16:48','2005-07-19 14:33:57','W dzieciństwie przez trzy lata pobierał prywatne lekcje gry na fortepianie. W 1998 rozpoczął naukę w Szkole Muzyki Rozrywkowej im. Krzysztofa Komedy w klasie gitary elektrycznej. Naukę przerwał na korzyść Akademii Muzycznej im. Karola Szymanowskiego w Katowicach, gdzie w 2000 roku dostał się na Wydział Jazzu i Muzyki Rozrywkowej. W 2001 zdał egzaminy do Szkoły Muzycznej Drugiego Stopnia im. Fryderyka Chopina w Warszawie. Jednak po dwóch latach nauki przerwał edukację w jednej ze szkół w związku z nadmiarem informacji, które ani trochę nie wydawały mu się potrzebne. Obecnie jest w trakcie pisania pracy magisterskiej. Brał udział w Warsztatach Jazzowych, prowadzonych przez czołówkę muzyków polskiej sceny jazzowej oraz wykładowców z Bostonu. Wielokrotnie występował jako muzyk sesyjny.','www_hhbd_pl_Zagorski_Jurek_1.jpg','image/jpg',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',1,7,1100,100,NULL,'Asfalt Rec.','http://www.asfalt.pl'),(824,'Pablo Hudini','','','2005-03-13 18:16:48','0000-00-00 00:00:00','','www_hhbd_pl_Pablo_Hudini_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,0,1464,100,NULL,'sKa!mjuzik','http://sfotografuj.to.pl'),(825,'Dj Domel','','','2005-