,837,100,NULL,'',''),(835,'Ksieżyc','','','2005-03-26 10:00:59','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,613,100,NULL,'',''),(836,'Norek','','','2005-03-26 10:03:06','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,333,100,NULL,'',''),(837,'Siwy Dym','','','2005-03-26 10:09:27','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,475,100,NULL,'',''),(838,'Eros','','','2005-03-26 10:09:27','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,719,100,NULL,'',''),(839,'Wdowa','Małgorzata','','2005-03-26 10:12:37','2005-10-09 18:14:58','Reprezentantka warszawskiego podziemia od około pięciu lat, nie była witana w kręgach hip-hopowych z otwartymi ramionami. Chociaż obcuje z tą kulturą od 13 roku życia, kiedy to w 97 roku przypadkiem trafiła na płytę Coolio`a \"It takes a thief\", czynnie i świadomie zdecydowała się ją budować dopiero po kilku latach.\r\nZaczęła w roku 2000 od produkowania bitów, ale jak mówi \"nie sprawdzała się w tym i nie czerpała z tego satysfakcji\". Niestety jeszcze około roku musiała radzić sobie sama, ponieważ środowisko nie było zainteresowane produkowaniem rapującej kobiety.W takich okolicznościach powstał jej pierwszy nielegal 2000/2001 o długim tytule: \"Też byś nikogo nie zawiódł, gdybyś też nie miał nikogo\" &#8211; prywatna kolekcja rozeszła się bardzo szybko. Raperka nawiązała współpracę z Dj Emka z warszawskiej Ochoty i Yelonek (projekt D.Y.M), pojawiła się na kilkunastu podziemnych albumach w całej Polsce. W 2003 roku wydala kolejny nielegal &#8211; bez tytułu, który był zbiorem tracków nagrywanych 2 lata, na bitach producentów z całej Polski. W międzyczasie, WdoWę można było oglądać w każdą środę na ekranie internetowej telewizji muzycznej Tv Fly gdzie przez przeszło rok prowadziła program W-Raps (woman raps), traktujący o kobietach na scenie rap/r`n`b.\r\nOstatnimi numerami prezentującymi umiejętności Pierwszej Damy warszawskiego rapu są tracki pochodzące ze składanek: Rap In Underground &#8211; Warszawa, Road Hip-Hop 2005, gościnne wersy na produkcji CfanyGapa/Bobslej, RudyMRW &#8211; Dobre Życie, oraz Szybkiego Szmalu.\r\n\r\nPod koniec 2005, na półkach sklepowych znajdziecie pozycje zatytułowaną \"BRAGGACADABRA\" &#8211; solowy album WdoWy, a zarazem pierwszy w Polsce, solowy, rapowy album w wykonaniu kobiety. Jednak jak podkreśla artystka \"nie ma zamiaru zejść ze szczytu ani tym bardziej wyjść z podziemia...\"','www_hhbd_pl_Wdowa_2.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,7,4112,100,NULL,'Wdowa',''),(840,'Elem','','','2005-03-26 10:14:34','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,566,100,NULL,'',''),(841,'Cisu','','','2005-03-26 10:14:34','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,999,100,NULL,'',''),(842,'Parkita','','','2005-03-26 10:14:34','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,692,100,NULL,'',''),(843,'Szogun','','','2005-03-26 10:16:11','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,760,100,NULL,'',''),(844,'Jurand','','','2005-03-26 10:17:45','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,752,100,NULL,'',''),(845,'Pawlak','','','2005-03-26 10:20:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,864,100,NULL,'',''),(846,'Kamis','','','2005-03-26 10:24:36','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,412,100,NULL,'',''),(847,'Mat','','','2005-03-26 10:24:36','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,297,100,NULL,'',''),(848,'Mezi','','','2005-03-26 10:24:36','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,501,100,NULL,'',''),(849,'Sobieraj Magda','','','2005-03-26 10:24:36','0000-00-00 00:00:00','',NULL,'',NULL,NULL,