 hip-hopowe, nie współpracując na stałe z innymi wykonawcami. Gres/Snatch przygotowywuje się do wydania swojej pierwszej EP\'ki, która powinna się ukazać w 2005 roku. W roku 2004 zajęli 1 miejsce w konkursie FAMA Hip-Hop 2004 w Łodzi. Kilka utworów projektu zostało udostępnione w Strefie MP3 na stronach Wirtualnej Polski. Utwór \"Kosmos\" uplasował się w pewnym momencie na 2 miejscu Totalisty WP - został sciągnięty prawie 16.000 razy. Sam projekt był polecany na głównej stronie www.wp.pl. Autorzy starają się tworzyć dobry, dopracowany, inteligentny hip-hop. Teksty Gresa często ocierają się o krok o pozeję, a podkłady Snatch\'a oparte są w całości, wyłącznie na samplach ze starych płyt winylowych. Zagrali wspólnie kilkadziesiąt koncertów. W kwietniu 2004 roku szeregi projektu zasilił znany w Łodzi DJ Bartech.\r\n',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,3,664,100,NULL,'',''),(877,'Zeus','','','2005-04-10 12:59:03','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,1405,100,NULL,'',''),(878,'Koncept','','','2005-04-10 12:59:15','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,783,100,NULL,'',''),(879,'Dj Bartech','','','2005-04-10 12:59:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,302,100,NULL,'',''),(880,'Dj Scream','','','2005-04-10 12:59:57','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,444,100,NULL,'',''),(881,'Tojesto','','','2005-04-10 13:18:22','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,552,100,NULL,'',''),(882,'Kanał Audytywny','','','2005-04-10 13:19:29','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',7,0,1719,100,NULL,'',''),(886,'Minix','','http://www.minixer.prv.pl','2005-04-10 14:04:04','2006-04-04 01:13:52','Katowicki beatbox\'er, rodzony brat <a href=\"/n/Rahim\">Rah\'a</a>',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,754,100,N