szulki; reklam dla sklepów, klubów; plakatów koncertowych po projektowanie wystroju wnętrza klubu Labo i klubu Harlem w Warszawie, scenografię do koncertu Run DMC w 1995 r., kampanię reklamową \"Brok&Roll\" realizowaną dla agencji reklamowej \"MegaSound\" (1998 r.).',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,1,1289,100,NULL,'',''),(896,'Dj Ojciec Karol','','','2005-04-18 12:26:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,626,100,NULL,'',''),(897,'Mc Kfiat','','http://www.siladzwieq.pl','2005-04-18 12:29:39','2006-03-17 10:17:05','MC Kfiat swoją przygodę z hip hopem rozpoczął już jako 13-latek tańcząc breaka w jednym z koszalińskich domów kultury. Jego niezwykły talent, w połączeniu z pasją, kreatywnością sprawiły, że szybko wypracował swój własny, niepowtarzalny styl, będący mieszanką widowiskowych figur, charakterystycznych salt, stójek, podanych w szybkiej i energicznej formie. Umiejętności Kfiata doceniono m.in.: na Mistrzostwach Polski \"Dzień Prawdy\" w 2003 r. - I miejsce, na Turnieju Tańca \"Rytm Ulicy\" w 2004 r - I miejsce, mistrzostwach Polski \"Dzień Prawdy\" - III miejsce, na Turnieju o Mistrzostwo Warszawy \"Trójki Warszawskie\" - I miejsce (występował ze składem Strona B, który założył wraz ze Spike-m).\r\nDrugim żywiołem Kfiata jest rymowanie i konferansjerka. O jego talencie do spontanicznej freestylowej nawijki, którym potwierdza łatwość i wyczucie w operowaniu słowem można było się przekonać m.in.: na cyklu imprez realizowanych w ramach Ogólnopolskiego Turnieju Koszykówki \"Idea Pop Basket Tour\", \"Oficjalnych Zawodach Break Dance Polski Wschodniej\" w Kraśniku - w latach 2000 - 2004, czy szeregu imprez plenerowych organizowanych w całym kraju.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,1,1476,100,NULL,'',''),(898,'Pierwsza Flotylla','','','2005-04-18 12:48:21','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,329,100,NULL,'',''),(899,'Dj Noz','','','200