pistolet.com','2005-04-22 16:51:44','2005-12-09 00:45:46','DJ Pistolet swoją przygodę z turntablismem zapoczątkował w roku 2002. 8 miesięcy później zadebiutował na Mistrzostwach polski Dj-ów ITF 2003 (advancement class) zajmując bardzo wysokie 4 miejsce. Od tego momentu uważany jest za jednego z najlepszych turntablistów w Polsce, co udowadnia w roku 2004 zdobywając tytuł mistrza Polski ITF (kat. Beat Juggling) oraz wysokie 4 miejsce na Mistrzostwach Europy ITF w tej samej klasie.\r\nDJ Pistolet w swojej kolekcji płytowej posiada ogromna dawkę imprezowego hip-hopu, R\'n\'B, oraz Dancehallu. Swoje imprezowe sety prezentował m.in. w: Warszawie, Zielonej Górze, Lublinie, Rudzie Śląskiej, itd.\r\nJednak najwiekszą popularnością cieszą się cykliczne imprezy w klubie IGUANA w jego rodzinnym mieście Częstochowie.\r\nOSIÃ„â€žGNIĘCIA:<ul><li>2005 Mistrzostwa Polski ITF (advacement) 2 miejsce</li><li>2005 Mistrzostwa Polski ITF (beat juggling) 1 miejsce</li><li>2005 Eliminacje ITF Katowice (advacement) 1 miejsce</li><li>2004 Eliminacje ITF Katowice (beat juggling) 1 miejsce</li><li>2004 Mistrzostwa Polski ITF (beat juggling) 1 miejsce</li><li>2004 Eliminacje POP DJ Łódz 1 miejsce</li><li>2004 Finał konkursu POP DJ 2 miejsce</li><li>2004 Mistrzostwa Europy ITF (beat juggling) 4 miejsce</li><li>2003 Mistrzostwa Polski ITF (advancement class) 4 miejsce','www_hhbd_pl_Dj_Pistolet_1.jpg','image/jpg',NULL,NULL,'mail: djpistolet@op.pl','0000-00-00','0000-00-00',1,'',7,1,967,100,NULL,'oficjalna strona www',''),(927,'Elita Kaliska','','','2005-04-24 11:17:43','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1190,100,NULL,'',''),(928,'Aha','','','2005-04-24 20:42:56','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,937,100,NULL,'',''),(929,'Nova','','','2005-04-24 21:06:14','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,486,100,NULL,'',''),(930,'MoralGano','','','2005-04-24 21:22:44','0000-