nawijaczy i producentów. Ju&#380; we wczesnej m&#322;odo&#347;ci pomagali swemu ojcu graj&#261;c w jego zespo&#322;ach sals&#281; na bongosach, pó&#378;niej zainteresowali si&#281; podk&#322;adami muzycznymi. W&#347;ród znajomych z osiedla znale&#378;li ludzi ch&#281;tnych do wspó&#322;pracy. &#346;wietne przyj&#281;cie pierwszych koncertów i publikacja w internecie utworu \"Obud&#378; w sobie lwa\" spowodowa&#322;y, &#380;e o zespole zrobi&#322;o si&#281; nagle bardzo g&#322;o&#347;no. M&#322;od&#261; ekip&#261; zainteresowano si&#281; w &#347;rodowisku zarówno reggae, jak i hip hopowym, co zaowocowa&#322;o kolejnymi koncertami (m.in. jako support przed francuskim Soundkail, polskimi WWO, K.A.S.T.A. Sk&#322;ad, Abradab, Dj Feel X, Indios Bravos) i by&#322;o dla muzyków mocnym impulsem do dalszego tworzenia.\r\n<BR><BR>\r\nNatural Dread Killaz nigdy nie byli zespo&#322;em w tradycyjnym tego slowa rozumieniu, od pocz&#261;tku byli raczej rodzinno-przyjacielskim kolektywem, stanowi&#261;cym barwny kola&#380; utalentowanych osobowo&#347;ci. Oprócz Mesajaha i paXona w sk&#322;ad formacji wchodzi wokalistka Natty, której zdolno&#347;ci pozwalaj&#261; z niezwyk&#322;a &#322;atwo&#347;ci&#261; dopasowa&#263; si&#281; zarówno do podk&#322;adów szybkich i rytmicznych, jak i zmys&#322;owych i wolnych, zahaczaj&#261;cych o r\'n\'b i soul. Dzi&#281;ki jej umiej&#281;tno&#347;ciom muzyka Natural Dread Killaz zr&#281;cznie nawi&#261;zuje do nurtu nowoczesnego, europejskiego tanecznego reggae i dubu, tworzonego przez s&#322;awnych producentów - Mad Professora i Zion Train. Kolejn&#261; postaci&#261; wspó&#322;tworz&#261;c&#261; zespó&#322; jest Yanaz - nawijacz, który zaczyna&#322; od rapowania w hiphopowym sk&#322;adzie, przez co jego styl jest bliski tej muzyce. Pod wp&#322;ywem kolegów z zespo&#322;u szybko poszerzy&#322; kr&#261;g swych zainteresowa&#324; o wszelakie brzmienia rodem z Karaibów. Brzmienia reggae, dancehall i ragga sta&#322;y si&#281; dla niego nowym polem do popisu. Selektorem (DJem) w zespole jest Ko-Tune, który wykorzystuje w swoich setach g&#322;ównie jamajskie produkcje - od ci&#281;&#380;kich powolnych dubów, przez tradycyjne roots reggae, a&#380; do stricte nowoczesnego dancehallu. Nie stroni tak&#380;e od hip hopu, r\'n\'b i jazzu. Swoje selekcje ubarwia efektami i samplami, a tak&#380;e zaczerpni&#281;tymi z kultury hip hopowej skreczami i beat jugglingiem. Oprócz tego Natural Dread Killaz wspó&#322;pracuj&#261; w czasie koncertów z muzykami graj&#261;cymi na tradycyjnych instrumentach, &#322;&#261;cz&#261;c &#380;ywe granie z t&#322;ustymi podk&#322;adami i wokalami.\r\n<BR><BR>\r\nNajbardziej znanym utworem Natural Dread Killaz jest \"Biba!\" oparta na oryginalnym, opracowanym przez zespó&#322; rytmie (riddimie). Moc i przebojowo&#347;&#263; \"Biby!\" doceni&#322;a wroc&#322;awska filmowa \"Grupa 13\" , zapraszaj&#261;c Natural Dread Killaz do udzia&#322;u w teledysku \"Raptowne realia\". \"Biba!\" ukaza&#322;a si&#281; tak&#380;e na wysokonak&#322;adowej, sk&#322;adance promocyjnej Blend. Jak ka&#380;e jamajska tradycja, przed oficjaln&#261; premier&#261; \"Naturalnie\" zespó&#322; planuje wydanie p&#322;yty winylowej, zawieraj&#261;cej dwana&#347;cie wersji rytmu \"Biba!\" z go&#347;cinnym wykonaniem tuzów muzyki reggae z ca&#322;ej Polski. Pod koniec maja swoj&#261; premier&#281; b&#281;dzie mia&#322; równie&#380; teledysk realizowany do utworu Biba!, re&#380;yserowany przez Darka Szermanowicza z wroc&#322;awskiej \"Grupy 13\" wspólnie z Markiem \"Pro\" Gluzi&#324;skim z Blend Records.','www_hhbd_pl_Natural_Dread_Killaz_1.jpg','image/jpg',NULL,NULL,'mail: danielr@magma-net.pl','0000-00-00','0000-00-00',1,'',1,0,1686,100,NULL,'strona oficjalna',''),(937,'Mesajah','','','2005-04-27 01:14:11','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,5225,100,NULL,'',''),(938,'paXon','','','2005-04-27 01:15:17','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0