0,1945,100,NULL,'',''),(986,'Projekt Hamas','','','2005-05-06 22:18:52','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1039,100,NULL,'',''),(987,'Humaniztikz','','','2005-05-10 18:57:48','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,642,100,NULL,'',''),(988,'Prosper','','','2005-05-12 19:05:17','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,761,100,NULL,'',''),(989,'Stare Miasto','','','2005-05-12 19:25:04','2005-07-19 14:04:59','Zespół \'Stare Miasto\' powstał w 1997 roku. Na początku w jego skład wchodziło 7 osób: Majki Majk, Trojan, Korzeń, Kret, Wujrokk, Wube oraz dj Romek. W 1998 roku wydana została pierwsza płyta, nakładem Polygram Polska (obecnie Universal Music Polska).<br />\r\nByła to jedna z pierwszych polskich płyt hip-hopowych wydana przez tak dużą wytwórnię. Obok takich zespołów jak Molesta (płyta \'Skandal\' wydana także w 98 roku) czy Kaliber 44, Stare Miasto zalicza się do jednych z pierwszych zespołów reprezentujących ten rodzaj muzyki. <br />\r\nNa przełomie lat 1999-2000 nagrana została druga płyta (\'Minuty\'), która pojawiła się w sklepach na wiosnę 2000 roku.<br />\r\nDzisiaj, pomimo braku nowych nagrań zespołu, płyty Starego Miasta cieszą się dużym zainteresowaniem. Grupa zyskała miano kultowego zespołu, łączącego Hiphopowe brzmienie z niebanalnymi tekstami.',NULL,'',NULL,NULL,'	  ','0000-00-00','0000-00-00',1,'',3,7,1572,100,NULL,'',''),(991,'Provincea','','http://www.provincea.com','2005-05-12 20:02:02','2005-05-12 20:24:26','PRVN (Provincea) to hip-hop\'owy squad z Parczewa k/Lublina. Istniejemy od jesieni 2001 roku&#8230; Nasza muzyka to 75% - owy hip-hop z 25% - ową domieszką innych gatunków: ragga, bounce, trip-hop, a nawet elementy ostrych gitar spod znaku hardkoru (poniekąd hc i reggae to nasze korzenie)&#8230; rymy wzbogacone są solidnie o śpiew, wokalizy, krótko mówiąc - spora dawka harmonii i melodyjności połączona z konkret bitem&#8230;<br /><br />teksty - zasadniczo traktują o pozytywach życia, znajdowaniu drogi do nich w szalonym świecie ;-) - mocno osobiste - ale dotykające też tego, co każdy w swoim sercu, słabiej lub mocniej, na pewno przeżywa - miłość, reakcja na sukces i porażkę, zniechęcenie sytuacją polityczną, znaczenie muzyki, Bóg, itd.<br /><br />\r\nObecnie nagraliśmy w studiu nieleghala, a od marca, wraz z DJ HaeM\'em (O.S.T.R.), już nie gościnnie, a razem, przygotowujemy z wolna materiał na legalną płytę, pod pełną nazwą składu: Provincea.<br /><br />\r\nBierzemy również udział w innych projektach muzycznych, wychodzących poza hip-hop - bądź udział wokalny, bądź też instrumentalny, mi .in.: B.E.T.H. (hc/Wwa), bnrgsz (hc/Krk), i kilka innych.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,3,416,100,NULL,'',''),(992,'Zybi','','','2005-05-12 20:02:59','0000-00-00 00:00:00','Producent składu Provincea',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,529,100,NULL,'',''),(993,'Luka','','','2005-05-12 20:03:25','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,265,100,NULL,'',''),(994,'Jerry','','','2005-05-12 20:04:02','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,928,100,NULL,'',''),(995,'OSWP','','','2005-05-13 10:39:57','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1018,100,NULL,'',''),(996,'Da-Emon','','','2005-05-13 11:09:03','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,854,100,NULL,'',''),(997,'TZWM','','','2005-05-13 12:17:12','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,888,100,NULL,'',''),(998,'Czizz','Bartek Serafiński','','2005-05-13 12:55:50','2005-07-20 11:42:13','','www_hhbd_pl_Czizz_1.jpg','image/jpg',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',3,7,719,100,NULL,'Oficjalne www','http://www.thinkadelic.art.pl'),(999,'Dj Cube','','','2005-05-13 12:55:50','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1109,100,NULL,'',''),(1000,'Raqba','','','2005-05-13 13:00:35','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,569,100,NULL,'',''),(1001,'S.P.E.C','','http://www.lenka.pl/spec/','2005-05-13 14:18:08','0000-00-00 00:00:00','S.P.E.C. został założony w 2001 roku przez Andrzeja Izdebskiego i jest wynikiem jego współpracy z Krzysztofem Radzimskim (Dr Yry) znanym z takich projektów jak El Dupa, TPN25, Pieseeek, czy zespół filmowy SKURCZ. Autorzy postawili przed sobą zadanie stworzenia materiału z jednej strony nie banalnego muzycznie, z drugiej zaś intrygującego w warstwie tekstowej. Pozostając głównie w hip-hopowej idiomatyce muzycznej, a także wykorzystując charakterystyczny dla takich produkcji język ulicy, poruszają tematykę odmienna od zazwyczaj spotykanej w muzyce hip-hop. Przeważa tu formuła quasi-kabaretowa, obnażająca mechanizmy zachowań społecznych, unikając jednak pretensjonalnego \"politykowania\". W 2002 roku nakładem niezależnej wytórni Lenka Music ukazała się debiutancka płyta zespołu pod tytułem \"PYK\", z której to pochodzą takie utwory jak Młot Pneumatyczny, Rytmy Częstochowskie czy (kultowy już w niektórych kręgach) Robbie loe d\'Amour. Na listopad 2004 planowane jest wydanie drugiej płyty w nagraniu której gościnny udział wziął Kazik Staszewski. Skład koncertowy SPECa obok autorów projektu tworzy dwóch doświadczonych muzyków- klawiszowiec Michał Marecki (m.in. Sidney Polak, Marcin Rozynek) oraz związany z gdańska sceną muzyki alternatywnej perkusista Michał Gos (m.in. Boys Band Trio, Jacek Lachowicz).<BR>\r\nS.P.E.C. jest nie tylko projektem muzycznym. Autorzy starają się stworzyć platformę współpracy dla twórców o różnorakich zainteresowaniach. Jedną z takich inicjatyw jest projekt S.P.E.C. KINO gdzie promowane są produkcje leżące na marginesie przemysłu filmowego (m.in. dwumiesięczny przegląd najgorszych filmów świata, czy cykliczne projekcje produkcji Zespołu Filmowego SKURCZ połączone z koncertami zespołów alternatywnych).','www_hhbd_pl_S_P_E_C_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,562,100,NULL,'Archiwum zespołu','http://www.lenka.pl/spec/'),(1002,'Yez Yez Yo','','','2005-05-15 10:06:34','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1183,100,NULL,'',''),(1003,'Dzieciaki','','','2005-05-15 10:38:25','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,754,100,NULL,'',''),(1004,'Czarnecka Ł.','','','2005-05-15 10:39:57','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,847,100,NULL,'',''),(1005,'Małolatki','','','2005-05-15 10:45:01','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,919,100,NULL,'',''),(1006,'El Sancho','','','2005-05-15 10:45:41','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,629,100,NULL,'',''),(1007,'Sabot','','','2005-05-15 10:47:16','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,501,100,NULL,'',''),(1008,'Gruber','','','2005-05-15 10:47:16','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,338,100,NULL,'',''),(1009,'Dj 666','','','2005-05-15 10:48:14','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,923,100,NULL,'',''),(1010,'Da Blaze','','','2005-05-15 11:04:32','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,983,100,NULL,'',''),(1011,'Klika Aifam','','','2005-05-15 11:06:15','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,777,100,NULL,'',''),(1012,'Lamzas','','','2005-05-15 11:06:54','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1103,100,NULL,'',''),(1013,'Peel Motyf','','','2005-05-15 11:42:22','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,1115,100,NULL,'',''),(1014,'Dj Eprom','','','2005-05-15 15:56:44','0000-00-00 00:00:00','','www_hhbd_pl_Dj_Eprom_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',7,0,1095,100,NULL,'m. grochowina','http://www.sfotografuj.to.pl'),(1015,'Dj Motyl','','','2005-05-15 15:57:19','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,1044,100,NULL,'',''),(1016,'Trakmajster','','','2005-05-15 15:59:58','2005-09-25 18:50:24','','www_hhbd_pl_Trakmajster_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',1,'',7,7,979,100,NULL,'Marcin Grochowina','http://www.sfotografuj.to.pl'),(1017,'Dj Ike','Piotr Zawalkiewicz','http://www.djike.com','2005-05-15 16:47:00','2005-05-15 16:56:16','O sobie samym [źródło: djike.com]:<br /><br />\r\nO turntablismie:<br />\r\nGramofonami zajmuje sie od 2001 roku. Na poczatku dzialałem na jednym decku Numark Pro TT-1 i mikserze Numark 2000x. Pod koniec 2002 roku kupiłem mikser Vestax PMC 06 pro A, a w marcu 2003 roku drugi gramofon - Numark pro TT-2. Gram na systemach Concorde DJ z końcówkami \"scratch\".<br />\r\nPreferuję muzykę trueschoolową; unikam sytuacji, w których ktokolwiek mógłby powiedzieć, że jestem szafą grajacą - staram się żeby muzyka, którą puszczam na imprezach, była wyselekcjonowana i zroznicowana, a nie stanowiła tylko i wyłącznie miksu świeżych landrynek z telewizji (..). Do tej pory zagrałem kilkadziesiąt imprez (mniejszych i wiekszych). Jeśli chodzi o uczestnictwo w zawodach to startowalem tylko w Turntable contest 2004 (2 miejsce w kategorii advancement, 4 miejsce w kategorii scratching). Na należyte przygotowania do ITF 2004 niestety zabrakło czasu.<br /><br />\r\nMam w swojej kolekcji okolo 200 albumow winylowych z czarną muzyką i prawie 1500 analogów z muzyką różną (jazz, soul, lata 60., 70., 80. i 90., muzyka powazna).<br /><br /><br />\r\nO produkcji:<br /><br />\r\nProdukowaniem muzyki zajmuję się od 1999 roku. Obecnie moimi podstawowymi narzędziami z jakich korzystam, są: Fruity Loops (2.11 i 3.4),SF Acid 4.0, Sound Forge 4.5, Cool Edit Pro 2.1 oraz wtyczki: Waves (C4, L1+, Q1, MaxxBass, RComp, RVox), Timeworks Millenium Pack (Delay, Reverb, CompressorX),SF (Noise gate),Antares Kantos.<br /><br /><br />\r\nProdukuję, bo jest to dla mnie świetna zabawa dająca jednocześnie możliwość wyrażenia siebie poprzez muzykę. Dlatego staram sie produkować nie tylko w czysto hiphopowym klimacie, bo wychowałem się na zgoła innej muzyce niż rap. Eksperymentuję z drum\'n\'bass\'em i ambientem.','www_hhbd_pl_Dj_Ike_1.jpg','image/jpg',NULL,NULL,'tel: 602 589 687<br />\r\ne-mail: ike_slamz@o2.pl			','1981-09-26','0000-00-00',0,'',7,7,666,100,NULL,'Dj Ike web page','http://www.djike.com'),(1018,'Dwa Dwanaście','','','2005-05-15 21:13:51','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,970,100,NULL,'',''),(1019,'Sfond Sqnksa','','','2005-05-15 21:40:58','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,611,100,NULL,'',''),(1020,'Sweet Noise','','','2005-05-15 22:46:05','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,733,100,NULL,'',''),(1021,'Sidney Polak','','','2005-05-17 16:26:00','2005-07-31 13:21:20','',NULL,'',NULL,NULL,'	  ','0000-00-00','0000-00-00',1,'',3,1,983,100,NULL,'',''),(1022,'Finta','','','2005-05-17 16:57:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,480,100,NULL,'',''),(1023,'Rx','Rafał Sielawa','','2005-05-17 18:16:31','2005-09-01 11:56:24','RX (Rafał Sielawa) 20 letni Dj i producent z Mławy, obecnie studiujący w Olsztynie. Z muzyka związany od wielu lat, uczęszczał do szkoły muzycznej. Uczył się w klasie fortepianu, jednak odmienne zainteresowania zadecydowały o zrezygnowaniu ze szkoły na rzecz rozwijania umiejętności w tworzeniu muzyki nowoczesnej, na nowoczesnym sprzęcie. Pierwsze producenckie kroki stawiał na scenie muzyki elektronicznej, oraz angażując się w osiedlowe hip-hopowe projekty. Debiutował na albumie &#8222;Notes&#8221; Tedego utworem &#8222;Zazdrość II&#8221;. Następnie pojawił się na albumie Onara &#8222;Osobiście&#8221; (&#8222;Drugie piętro&#8221;, &#8222;Bez komentarza&#8221;, &#8222;Znowu w klubie&#8221;) Zremkisował również dwa single pochodzący z tej płyty (&#8222;Weź to poczuj (RX remix&#8221;) oraz &#8222;Drugie Piętro&#8221; (RX remix). <br />\r\nWspółpraca z Camey Studio zaowocowała kolejnymi produkcjami, które można znaleźć na płycie Lerka &#8211; &#8222;Bez Ciebie E.P.&#8221;: singiel &#8222;Bez Ciebie&#8221;, &#8222;Zawsze&#8221;, &#8222;Zawsze (RX remix)&#8221; oraz &#8222;Nie mogę wrócić (RX remix)&#8221;.  Muzykę RX&#8217;a znajdziemy również na plycie Nowatora  - <br />\r\n&#8221;Alfabetyczny spis&#8221; (utwór &#8222;Hola&#8221;), oraz nowym Płomieniu 81 (czyli Pezet i Onar). <br />\r\n<br />\r\nRX nie ogranicza się do pojedynczej stylistyki. Świetnie czuje się zarówno w ostrych, amerykańskich brzmieniach, parkietowych hitach i r&#8217;n&#8217;b, jak w klasycznych pianinowych bitach. W tworzeniu kompozycji rzadko wykorzystuje gotowe, samplowane sekwencje. Partie fortepianu i innych instrumentów klawiszowych zawsze nagrywa sam.<br />\r\n<br />\r\nPoza umiejętnościami producenckimi, RX sprawnie włada płytą winylową, potrafi również umiejętnie robić human beatbox.',NULL,'',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',3,7,737,100,NULL,'',''),(1024,'Gutjar David','','','2005-05-17 18:22:32','2005-11-13 19:58:43','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,3,1096,100,NULL,'',''),(1025,'EMER','','','2005-05-17 18:23:24','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,930,100,NULL,'',''),(1026,'Lil Dap','','','2005-05-17 22:53:42','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1023,100,NULL,'',''),(1027,'Dj Seb','','','2005-05-17 22:57:26','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,924,100,NULL,'',''),(1028,'Dezmond','','','2005-05-17 22:59:45','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,592,100,NULL,'',''),(1029,'Szczur','','','2005-05-17 23:01:17','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,568,100,NULL,'',''),(1030,'Seti','','','2005-05-17 23:06:36','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,531,100,NULL,'',''),(1031,'Cisza & Spokój','','','2005-05-20 03:07:44','2005-08-28 15:40:08','Cisza&Spokój to Hip-Hop\'owy zespół założony w 2000 roku przez Dużego Pe i DJ&#8217;a Spox&#8217;a. Twórczość grupy nawiązywać miała do klasycznych duetów &#8222;MC + DJ / Producent&#8221;, takich jak Gangstarr, Pete Rock & CL Smooth czy Eric B & Rakim. Od początku działalności obaj artyści stawiali sobie za cel działania muzyczne bliskie korzeniom kultury Hip-Hop, wybiegające jednocześnie poza wizerunek jakiego gatunek ten dorobił się w Polsce.<br />\r\n<br />\r\nNie mając na koncie oficjalnie wydanej płyty ani pełnowymiarowego nielegala, od maja 2001 do maja 2004 Duże Pe i DJ Spox zagrali jako Cisza&Spokój ponad pięćdziesiąt koncertów na terenie całego kraju. Wśród nich wymienić należy supporty grane przed zagranicznymi gwiazdami takimi jak Lone Catalysts, Gentleman, Defari, K-Otix czy Rahzel, udział w wielkich imprezach takich jak New Yorker Hip-Hop Festiwal czy pożegnalny koncert Paktofoniki, oraz dwa koncerty poza granicami kraju - w Berlinie i w Pradze. Energetyczne, bogate w improwizację występy sprawiły, że nazwa Cisza&Spokój zaczęła być rozpoznawana na terenie całego kraju. Zaowocowało to m.in. wywiadami w środowiskowej prasie oraz obecnością w telewizyjnych i radiowych programach poświęconych kulturze Hip-Hop. <br />\r\n<br />\r\nDuże Pe i DJ Spox zawsze znajdowali się jednak na uboczu \'środowiska\', idąc swoją drogą i nie szukając na siłę protekcji u \'gwiazd\' rodzimego Hip-Hop\'u. Plusem tej sytuacji jest to, że Cisza&Spokój zarówno muzycznie jak i tekstowo wypracowała własny, charakterystyczny styl; minusem zaś fakt, że zarówno przy budowie domowego studia ToSieWytnie jak i przy opanowaniu technik nagrywania Pe i Spox mogli liczyć wyłącznie na siebie. Skutkiem tego w parze z ilością zagranych koncertów i napisanych tekstów nie szła ilość zarejestrowanych numerów, reprezentujących satysfakcjonujący artystów poziom. <br />\r\n<br />\r\nW 2001 roku zespół Cisza & Spokój wydał własnym sumptem (nakładem ToSieWytnie Records) w nakładzie 350 egzemplarzy singiel \'Para z z Zielonej Herbaty\'. Pozycja ta, mimo że dostępna była wyłącznie w &#8222;drugim obiegu&#8221;, wydana była w dość oryginalny sposób (do oryginalnego nośnika dodawana była torebka zielonej herbaty!) i do dziś poszukiwana jest przez wielu kolekcjonerów. Zespół zaprezentował się też na dwóch pierwszych częściach składanki \'JuNouMi\', która te ukazała się w limitowanej edycji, tylko na płytach winylowych. <br />\r\n<br />\r\nW połowie 2003 roku Duże Pe zrezygnowany brakim postępów w rejestracji materiału na płytę Cisza&Spokój postanowił poszukać innych rozwiązań. Szczęsliwy traf sprawił, że los zetknął go z utytułowanym katowickim producentem o pseudonimie IGS, który poszukiwał właśnie tego typu MC, z którym mógłby rozpocząć współpracę. Efektem tego, w maju 2004 nakładem UMC Records światło dzienne ujrzała płyta \'Sinus\' czyli solowa płyta Dużego Pe, na której stroną muzyczną zajął się IGS. O wzbogacenie płyty o skrecze został oczywiście poproszony DJ Spox, a koncerty z \"Sinusa\" grane były pod szyldem Cisza&Spokój: Duże Pe na mikrofonie i DJ Spox za adapterami. Niedługo później przy silnym udziale Dużego Pe (a raczej jego karaibskiego alter ego: Grande Pe) ukazała się płyta zespołu Cinq G &#8222;Panama&#8221;, będąca pierwszym polskim albumem z muzyką dancehall. W początku 2005 roku nakładem netlabelu afterbeat.org ukazał się natomiast suplement do płyty &#8222;Panama&#8221; &#8211; &#8222;Banda Tre EP&#8221;, gdzie oprócz znanych z Cinq G Grande Pe i Mista Pita na mikrofonie szaleje wschodząca gwiazda kobiecego toastingu &#8211; Lady Mocca.<br />\r\n<br />\r\nDuże Pe wspólnie ze Spoxem brali też udział w nagraniach i koncertach składów reprezentujących inne gatunki muzyczne, takich jak orientalny soundsystem Masala, freejazzowa Orkiestra TransTechnoLogiczna Wojciecha Konikiewicza i wiele innych. Obaj zostali tez zaproszeni przez Centrum Twórczości Narodowej do udziału w imprezach &#8222;Karuzela Cooltury&#8221;, gdzie \"zderzano\" rymy Dużego Pe z wierszami Adama Zagajewskiego, kawałki zespołu Cisza&Spokój z piosenkami Grzegorza Turnaua a turntablistyczne umiejętności DJ\'a Spox\'a z umiejętnościami wirtuoza fortepianu, Waldemara Malickiego. Należy dodać, że DJ Spox wraz z DJ&#8217;em Twisterem tworzą turntablistyczny projekt o nazwie PCV, który niejednokrotnie już zapraszany był do udziału w jazzowych jamach w Warszawskim klubie Tygmont, na których udzielali się najwyższej klasy jazzowi muzycy. <br />\r\n<br />\r\nPod koniec 2004 wszystkie wymienione projekty zaczęły być jednak stopniowo odsuwane na drugi plan względem macierzystej formacji Pe i Spoxa. Od poczatku 2005 roku w przygotowaniu jest bowiem pierwszy oficjalny pełnowymiarowy album sygnowany nazwą Cisza&Spokój. Podobnie jak na samym początku całokształtem produkcji muzycznej i kwestiami adapterowymi zajmuje się DJ Spox, za teksty i ich wykonanie odpowiada zaś Duże Pe, w nielicznych przypadkach wspierany przez zaproszonych gości. Produkcję wykonawczą płyty wspomaga swą wiedzą, doświadczeniem i umiejętnościami znany muzyk jazzowy, Wojciech Konikiewicz.',NULL,'',NULL,NULL,'	  ','0000-00-00','0000-00-00',1,'',1,3,1318,100,NULL,'',''),(1032,'Mleko','','','2005-05-26 23:06:51','2005-09-01 11:53:08','Mleko o sobie:<br />\r\nZACZYNAŁEM OD BREAK DANCE , JEÄ¹ąDZIŁEM Z ZIOMAMI Z MOJEGO MIASTA PO CAŁYM KRAJU I BRAŁEM UDZIAŁ W TURNIEJACH TAŁCA, KTÓRE WTEDY ŁÃ„â€žCZYŁY CAŁÃ„â€ž BRAĆ HIPHOPOWÃ„â€ž W POLSCE. NIE BYŁO PODZIAŁÓW, NIE BYŁO CHORYCH ZACHOWAŁ. SZANOWALIŚMY