7; ZOSTAŁY NAPISANE W CIÃ„â€žGU OSTATNICH 9 LAT. CHCIAŁEM TYM MATERIAŁEM POKAZAĆ SWOJÃ„â€ž NIEZALEŻNOŚĆ I WŁASNY SPOSÓB POSTRZEGANIA PEWNYCH PROBLEMÓW. <br />\r\nNIE UKRYWAM, ŻE MAM JUŻ PEWIEN DYSTANS DO HIP HOPU. ŚMIESZÃ„â€ž MNIE WAŚNIE NA POKAZ, WYŚCIGI KTO WIĘCEJ SPRZEDA, KTO JEST MÃ„â€žDRY A KTO GŁUPI, KTO ROBI DOBRÃ„â€ž MUZĘ A KTO NIE.','www_hhbd_pl_Mleko_1.jpg','image/jpg',NULL,NULL,'	  ','0000-00-00','0000-00-00',1,'',3,7,1400,100,NULL,'Camey Studio','http://www.camey.pl'),(1033,'Czekon','Piotr Czekoński','','2005-07-01 18:35:25','2005-09-01 11:45:25','Czekon, czyli Piotr Czekoński (25) jest jednym z pierwszych szczecińskich raperów. Już w połowie lat 90-tych rozpoczął swoje jak to sie nazywa \"rymowanie wierszy\". 97-98r to czas kiedy wraz z zespołem już koncertował w różnych miastach Polski (Konin, Stargard szczeciński, Warszawa, Gorzów, Ostrów wielkopolski, Olsztyn czy oczywiście wielokrotnie Szczecin).<br />\r\nWtedy miał okazję po raz pierwszy zetknąć się z nie aż tak jak dzis znanymi: Grammatik, 3H / Warszawski Deszcz, Głębia Głów (GG), Thinkadelic, Stare Miasto, Płomien 81.<br />\r\nPo rozwiązaniu podpisanego kontraktu z ASFALT Records w 2000r doszedł do wniosku że nie ma już zamiaru robić czegoś co nie do konca będzie w jego stylu. Czegoś do czego nie bedzie przekonany.<br />\r\nPrzez ten czas ok 4 lata, był jakby chwilowo uśpiony biorąc udział tylko w kilku składankach do gazet takich jak Klan czy Steez, u Dj\'a 600v na płycie \"Wrukwione bity\" czy w pierwszej  składance winylowej Junołmi.<br />\r\nZaczął dojrzewać w jego głowie pomysł stworzenia autorskiej płyty z dużą dawka żywej muzyki i tekstami mówiącymi o konkretnych sytuacjach i emocjach. Jak mówią do pisania i całego tworzenia podchodzi bardzo \"serio\". Szukając inspiracji muzycznej chętnie sięga po elementy g-funku r\'n\'b i soulu, ktore dodają bitowi mocnego kolorytu.<br />\r\nProjekt ten spodobał sie kilku dużym wytwórniom, jednak dopiero z Cameyem udało się nagrać pierwszą płytę \"Arogancki Kurier\", która wejdzie na rynek w 2005r.<br />\r\n<br />\r\n\"Tworząc muzę skupiam się na dwóch podstawowych dla mnie sprawach: bogatej muzyce i rzeczowch tekstach. Projekt tej płyty musiał czekać kilka lat na swoją realizację. Z perspektywy czasu myślę, że to bardzo dobrze - definitywnie! Wszystko podgrzane do niemal wrzącej temperatury 91 stopni Celsjusza mówi Czekon. - Rapując opisuje rzeczywistość, w której żyję. Tą prawdziwą, pełna białych i czarnych barw, stuprocentowych sytuacji i ludzkich emocji. Wiem, że w tekstach często opowiadam o rzeczach trudnych, że czasem jestem arogancki itd. Ale to dlatego, że i życie takie jest. Rapując nie mówię o zabawie, ale o życiu, śmierci, miłości. Nie chcę być kolejnym mentorem, choć wiem, że młodzi ludzie słuchają tej muzyki i wiele z niej czerpią. Opowiadam raczej dojrzałą prawdę, która dotyczy każdego z nas. Bez zbednych słów i pustego nawijania. -Jestem takim... (muzycznym) kronikarzem rzeczywistości.\"','www_hhbd_pl_Czekon_1.jpg','image/jpg',NULL,NULL,'	  ','0000-00-00','0000-00-00',1,'',3,7,3222,100,NULL,'Strona oficjalna Camey Records','http://www.camey.pl'),(1034,'Ray C','','','2005-07-02 14:13:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,931,100,NULL,'',''),(1035,'Qbańczyk','','','2005-07-02 14:14:24','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,724,100,NULL,'',''),(1036,'Zimiński Jerzy','','','2005-07-02 14:16:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,723,100,NULL,'',''),(1037,'Łukowska Milenka','','','2005-07-02 14:16:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,644,100,NULL,'',''),(1038,'Wieczorek Ola','','','2005-07-02 14:16:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,855,100,NULL,'',''),(1039,'Marciniak Stanisław','','','2005-07-02 14:16:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00