u utworach, a <a href=\"/n/miuosh\">Miuosh</a> zajął się produkcją kilku numerów wspierająć w tym <a href=\"/n/rahim>Rah\'a</a>. Dalsza współpraca polegała na wspólnym graniu koncertów i doprowadziła do tego, że <a href=\"/n/rahim>Rahim</a> i <a href=\"/n/miuosh\">Miuosh</a> założyli swoją własną wytwórnię: <a href=\"/l/maxflostudio\">MaxFloStudio</a>. Pierwszym planem wytwórni była wspólna płyta Projektora i Rahima (płyta <a href=\"/a/miraz\">Miraż</a> ukazała się 3 kwietnia 2006, dokładnie rok, po premierze płyty \"<a href=\"/a/receptura\">Receptura</a>\") na której Rah zajął się produkcją.\r\nProjektor ma na swoim koncie wyprodukowany własnym sumptem teledysk do utworu \"<a href=\"/s/ciezko_lekko_zyc\">Ciężko lekko żyć</a>, który utrzymywał się przez prawie 2 miesiące na szczytach popularnych internetowych list przebojów i dzięki któremu Projektor stał się rozpoznawalny przez szerszą publiczność. Następnym etapem w działalności Projektora była seria koncertów u boku <a href=\"/n/pokahontaz\">Pokahontaz</a>, oraz występy na imprezach dużego kalibru takich jak: <a href=\"/p/2005_11_10_Slaski_Rap_Festiwal\">Śląski Rap Festiwal 2005</a> czy <a href=\"/p/2005_08_26_Bauns_Shake_Festival_2005\">Bauns & Shake Festival 2005</a>.',NULL,'',NULL,NULL,'havran:<BR>\r\ngg: 1513504<BR>\r\nmaciej.urbanczyk@gmail.com<BR>\r\nkom: 504037743','0000-00-00','0000-00-00',0,'',7,1,2698,100,NULL,'',''),(1078,'Lady Mocca','','','2005-08-26 11:19:40','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,1155,100,NULL,'',''),(1079,'KSC','','','2005-08-26 11:25:31','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,556,100,NULL,'',''),(1080,'Mapa Miasta','','','2005-08-26 11:25:50','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,664,100,NULL,'',''),(1081,'Dj Eddie','','','2005-08-26 11:29:49','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,932,100,NULL,'',''),(1082,'Dj Slyther','','','2005-08-26 11:30:01','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,710,100,NULL,'',''),(1083,'Łukasz Borowiecki','','','2005-08-26 11:53:54','0000-00-00 00:00:00','Swoją muzyczną drogę rozpoczął od nauki w Państwowej Szkole Muzycznej<br />\r\nim. O.Kolberga w Radomiu. Tam  udzielał się jako basista i klawiszowiec, grając bardzo różną muzykę. Od 2001 roku uczy się na Wydziale Jazzu Państwowej Szkoły Muzycznej II stopnia im. F.Chopina w Warszawie. Gra w kilku zespołach jazzowych, koncertując w całej Polsce.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,794,100,NULL,'',''),(1084,'Miód','Tomasz Mioduszewski','','2005-08-26 11:54:34','2005-08-26 11:57:54','Miód to człowiek o ciekawej przeszłości muzycznej. Zaczynał od śpiewania i grania na gitarze w hardcorowych zespołach z dość konkretnym przekazem. Spotkanie na swojej drodze Łukasza Borowieckiego i wspólna inspiracja reggae, wywarły duży wpływ na jego dalszą twórczość. W 2001 roku założył LE ILLJAH - kilkunasto osobową formacje reggae/punk/ska. Grupa ta zagrała kilkadziesiąt koncertów w całej Polsce, zdobyła główną nagrodę na festiwalu reggae w Ostródzie, ma za sobą koncerty w Czechach. Oprócz tego, można Mioda zobaczyć jako mc  podczas występów sound systemowych.',NULL,'',NULL,NULL,'			  <br />\r\n			  			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',7,7,1370,100,NULL,'',''),(1085,'Sofa','','','2005-08-31 14:17:39','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,882,100,NULL,'',''),(1086,'Dinal','','http://www.dinal1982.com','2005-08-31 23:18:35','2005-09-01 13:04:01','Dinal to młody opolski zespół. Jego historia sięga fali popularności hip-hopu, która przeszła Polskę w 2 połowie lat 90\'. Jednak Dinal oficjalnie zadebiutował w 2003 roku wydana tylko na winylu EPka Kaseta Demonstracyjna. To pierwszy przypadek w historii polskiego hip-hopu, żeby zespół własnym sumptem nagrał i wytłoczył na 12 calach swój debiutancki materiał. Wyjątkowość opolan nie kończy się jedynie na nośniku, za tą najbardziej hip-hopowa z hip-hopowych formą wydania idzie jak najbardziej hip-hopowa forma hip-hopu. Dinal zbierał same pochlebne recenzje w branżowych pismach (Dosdedos, Ślizg, Hip-Hop Magazyn, etc.) za korzenne brzmienie i teksty nawiązujące techniką, sposobem rapowania, dobieraniem słów i tematyka do tzw. prawdziwej szkoły amerykańskiego hip-hopu w jego oryginalnym wydaniu. Za stronę muzyczną Dinala odpowiada dwóch świeżych, młodych producentów, Mejdej i Urb. Ten drugi znany jest zwłaszcza z udanego remixu singla Friko Grammatika czy produkcji numeru Wosk, który wspólnie z Dizkretem i Djem Panda przygotowali na pierwsza składankę Junoumi. Muzycznie opolanie kojarzą się z dokonaniami Dj Premiera czy Madliba. Dopełnieniem producenckiego tandemu jest raper Pan Wankz, jeden z najlepszych technicznie raperow w Polsce. Jego wielokrotnie złożone rymy nawiązują do często nieznanych, lub zapominanych w Polsce najlepszych tradycji korzennego hip-hopu, gdzie rola rapera była zabawa słowem, a nie tylko przekazywanie określonych treści. Na niespotykana w Polsce skale Pan Wankz bawi się tzw. followup\'ami, czyli nawiązaniami do tekstów zarówno rodzimych, jak i amerykańskich raperow. Pan Wankz pojawił się gościnnie na składance drugiej Junoumi, a także na albumie IQ duetu Dizkret/Praktik. W najbliższym czasie będzie go można usłyszeć także np. na producenckim albumie katowickiego bitmejkera IGS. Kaseta Demonstracyjna rozeszła się szybko ze sklepów od Pragi po Szczecin i Amsterdam, co dowodzi uniwersalności twórczości zespołu. Dla chłopaków priorytetem jest robienie dobrego rapu, według własnej wizji, z respektem dla dokonań amerykańskich prekursorów gatunku i z dużym dystansem do twórczości lokalnej sceny, na której łatwo popaść w zaściankową bylejakość. Grupa jest w trakcie rejestrowania kolejnej EPki, która pod tytułem Moda Na Sos ukaże się nakładem własnym jesienią 2004. Dinal w oryginalny sposób łączy inspiracje nowojorskim, szorstkim, ulicznym stylem spod znaku Lost Boyz z kalifornijskim rapem dla rapu firmowanym choćby przez Jurassic 5 z mainstream\'owymi wpływami jednego z najlepszych - zdaniem chłopaków - pod względem pomysłów, techniki i charyzmy - raperow - Eminema. Urb ponad polowe roku spędza na studiach w Stanach Zjednoczonych, co pomaga mu w szukaniu niespotykanych na polskiej scenie sampli i rozwiązań. Dinal to świeże brzmienie, właściwie nieporównywalne w większością polskiej sceny hip-hopowej. Chłopaków cechuje podejście z dużym dystansem zarówno do rodzimych trendów jak i swojej twórczości. Koncerty, które grają są żywiołowe, nieraz wręcz zabawne, kiedy przeradzają się w pastisz polskiej rzeczywistości hip-hopowej. Dinal to wyszukany, bardzo oryginalny jak na Polskę rap - a przecież to tylko tak, jakby to zrobili raperzy w stanach - mówią zdziwieni opolanie. Dinal to świeży powiew i nowa jakość na polskiej scenie.',NULL,'',NULL,NULL,'			  <br />\r\n			  tel. 609 551 287<br /><br />\r\nemail: koncert@dinal1982.com			  <br />\r\n			  ','0000-00-00','0000-00-00',0,'',1,7,705,100,NULL,'',''),(1087,'Pnoumatik','','','2005-09-01 11:55:45','0000-00-00 00:00:00','&#8222;Ilość twojego potencjału twórczego jest zawsze zależna od twoich umiejętności oraz tego co nosisz w sobie&#8221; Tak kilkoma słowami można określić podejście artstyczne Bezika do tego co robi , czym się zajmuje , co kocha i w co wkłada serce&#8230;Bezik ( Mariusz Bereziak ) to koleżka który mieszka w Piasecznie a z muzyką związany jest już od jakiegoś 1993 roku.Na początku ( był chaos ) pogrywał na gitarce w róznego rodzaju kapelkach HC sceny piaseczyńskiej i warszawskiej.W 1997 roku we wrześniu razem z ZETTIM , JARANEM , DJ BLC i SIS A założył skład PNOUMATIK.Po jakims czasie i przebijaniu się przez wtedy rozwijającą się scene hip-hopu w kraju , audycjach w radiostacji i udziale na kilku składankach między innymi &#8222;HIP HOP RAPORT&#8221; i &#8222;SZKOŁA ŻYCIA&#8221; Pnoumatik przeszedł radykalną metamorfoze.Ze składu wybił się DJ BLC oraz SIS A a w szeregi zespołu wstąpiła WIOLA , która to wzbogaciła muzyke o aksamitny głos.Na początku roku 2000 PNOUMATIK zapoznał i rozpoczął współprace z CAMEYEM.To był strzał w dziesiątke.Po miesiącu znajomości powstał pierwszy kawałek na producencką składanke CAMEYA &#8222;Robię swoje 2&#8221;.W niecałe pół roku później na rynku była już cała płyta PNOUMATIK - PNOUMATIK.Powstały trzy teledyski z czego klip &#8222;Jesienne liście&#8221; oraz &#8222;Namieszałem&#8221; zrobił Sylwester Latkowski.W roku 2003 skład przeszedł kolejna metamorfoze.Ze składu został tylko BEZIK który cały czas pracował nad swoją debiutancką solową płytą pod szyldem Pnoumatik oraz produkował muzyke dla takich koleżków jak BORIXON oraz zrobił remix MOLESTY EWENEMENT na składanke &#8222;Baza label&#8221; a także nagrał w międzyczasie kawałek &#8222;Różnice&#8221; na składanke &#8222;RADIO 5G FM&#8221;Przez cały czas związany ze stajnią CAMEY STUDIO współpracował i zajmował się swoją solową płyta , która niebawem ukaże się nakładem wytwórni Cameya.Jego (terażniejsza) muzyka oscyluje nadal w kręgu hip-hop , r&#8217;n&#8217;b oraz lekkich zabarwień reggae oraz funky.Współpracuje z wieloma raperami i muzykami starając się aby to co tworzy było pozytywnie odbierane przez wytrawne ucho słuchaczy oraz wizerunek jego twórczości był zgodny z tym co czuje i mysli.Pozdro i wielki szacunek dla wszystkich , którzy maja to w sobie i dla tych którzy cenią wysiłek i prace innych&#8230;peace!!!',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,305,100,NULL,'',''),(1088,'WS.Pro','','','2005-09-01 11:57:08','0000-00-00 00:00:00','WS.PRO jako zespół istnieje od dosyć niedawna, bo od grudnia 2003 roku. Wcześniej nagrywaliśmy osobno tworząc takie projekty jak (z tych bardziej \"znaczących\") to: Siara - \"eNiBe\", a ja (PR.WRS) - \"Wersja Standard\", \"GCS\". Niestety grupy te rozpadły się z powodu różnic w wizji \"artystycznej\" ich członków i raczej nie było możliwości, aby z powrotem się reaktywować. <br />\r\nPo paromiesięcznym czasie \"zastoju\", pewnego listopadowego wieczoru Siara zadzwonił do mnie z pytaniem czy może nie chciałbym zająć się znowu rapowaniem i bitami. Po wstępnej rozmowie i ustaleniu paru rzeczy, postanowiliśmy nagrać na próbę jakiś kawałek, żeby zobaczyć czy pasujemy do siebie tematycznie i czy nasza \"wizja\" rapu jest do siebie podobna. Na szczęście na jednym kawałku się nie skończyło, a różnice, jakie nas dzieliły udało się w czasie pracy nad kolejnymi numerami zniwelować praktycznie do zera. <br />\r\nPóźniej wszystko potoczyło się już bardzo szybko (aż sam w to wszystko nie wierzę..). W kwietniu 2004 wystąpiliśmy na kieleckich hip-hop\'owych eliminacjach do festiwalu FAMA i zdobyliśmy wyróżnienie oraz (co chyba najważniejsze) kielecka scena dowiedziała się w końcu, co to jest WS.PRO. Po tych wydarzeniach zagraliśmy trochę koncertów w Kielcach oraz udało nam się skończyć nielegal, który nosił tytuł: \"WielkieSumy.PROmocja\". W związku z wieloma pozytywnymi opiniami na nasz temat zaczęliśmy poważnie myśleć nad naszą (rapową) przyszłością. <br />\r\nW czerwcu 2004 roku wysłaliśmy płyty demo do dwóch wytwórni (m.in. do Camey Studio). Po dwóch miesiącach oczekiwania, kiedy właśnie myśleliśmy nad wysłaniem kolejnej partii płyt, skontaktował się z nami Camey i tak znaleźliśmy się tutaj.','www_hhbd_pl_WS_Pro_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,407,100,NULL,'Camey Studio','http://www.camey.pl'),(1089,'Basti','','','2005-09-01 11:58:18','0000-00-00 00:00:00','Wszystko zaczęło się, kiedy w 1994 roku założyli mi w domu moją pierwszą \"telewizję kablową\", która w swojej ofercie miała pięć, albo sześć kanałów. Wśród nich znalazło się MTV i dzięki tej stacji muzycznej pierwszy raz mogłem posłuchać rapu i zobaczyć takie składy jak RUN DMC albo NAUGHTY BY NATURE. Miałem wtedy 14 lat i chociaż nie rozumiałem o czym oni nawijają to spodobało mi się \"coś\" w tej muzyce. Co? Po latach już wiem, co mi się tak bardzo spodobało. Było to coś świeżego, coś zupełnie odbiegającego od muzyki jaką prezentowały polskie stacje telewizyjne i radiowe. <br />\r\nDość szybko jednak zacząłem słuchać innej muzyki. Słuchałem wszystkiego czego słuchali moi rówieśnicy, ale nie zapominałem o rapie, który też przewijał się przez moje składanki nagrane na kasety:)<br />\r\nWszystko uległo diametralnej zmianie, kiedy na rynek weszła płyta (ja miałem kasetę) Liroya z kawałkiem znanym chyba wszystkim. Był to numer zatytułowany \"Scyzoryk\". To było to! Wtedy był komplet! Muzyka, która miała to \"coś\" i w dodatku po polsku. Podjarałem się tym faktem bardzo mocno. Biegałem po osiedlu i z kolegami rzucaliśmy tekstami z tej płyty do końca nie rozumiejąc niektórych zwrotów, ale nikt przecież się do tego nie przyzna, tym bardziej mając 15 albo 16 lat. Boli mnie tylko fakt, że teraz większość z moich rówieśników, którzy wtedy krzyczeli \"Scyzoryk, Scyzoryk\" jadą po Liroyu nie zostawiając na nim suchej nitki. Ale to nie miejsce na ten temat.<br />\r\nPo płycie Liroya przyszedł czas na WYP3 w starym składzie itd. W tym okresie zacząłem pisać swoje pierwsze rymy, ale nie szło mi dobrze, a szczerze mówiąc fatalnie i szybko zniechęciłem się pisaniem.<br />\r\nDostałem pierwszy komputer (386) i zacząłem się bawić w robienie muzyki. Załatwiłem sobie program \"FAST TRACKER\" i układałem w nim swoje pierwsze kompozycje. Później zmieniłem komputer na lepszy i zacząłem robić bity w Music Makerze. Moja praca polegała na wycinaniu z płyt CD krótkich wątków muzycznych i dodawaniu do nich kicków i snarów, które były na wyposażeniu mojego programu.<br />\r\nW roku 1999, albo 2000 poznałem chłopaków, którzy później stworzyli skład o nazwie \"RYM NA MILE\". Wspólnie z Kobasem i Koterem próbowaliśmy swoich sił przy mikrofonie u mnie w pokoju. Nie były to jakieś super kawałki, ale wszystko zaczynało trzymać się kupy. Później oni zaczęli nagrywać sami, a ja dalej tworzyłem solo, ale już zdecydowanie aktywniej niż do tej pory. Rap wciągnął mnie na dobre.<br />\r\nNa początku 2002 roku, kiedy grałem swój materiał publicznie po raz pierwszy (WOŚP przy jednej ze szkół na Widzewie) poznałem Lilu i Centa. Polubiliśmy się i zaczęli mnie zabierać na swoje imprezy, które grali na terenie całego kraju. Czasami podbijałem im podczas koncertów, a czasami miałem okazję zagrać jakieś swoje kawałki, których już troszkę leżało na twardym dysku. W tym czasie poznałem THA ADMIRALS z Radomska, których gorąco pozdrawiam i szukam do nich kontaktu.<br />\r\nTrwało to około roku i wtedy poznałem chłopaków z łódzkiego składu o nazwie \"ZJEDNOCZENI\". Bardzo chciałem zagrać imprezę w Łodzi, gdyż oprócz WOŚP przy jednej ze szkół, nie grałem żadnej prawdziwej imprezki hip hopowej w moim mieście. Ptaku powiedział mi, że jeżeli chcę to bez problemu (za browarka) mogę zagrać razem z nimi na łódzko - warszawskiej imprezie w klubie DESPERADO. Oczywiście przystałem na ten pomysł i zagrałem swoją pierwszą, prawdziwą, wymarzoną imprezę hh, której scena była zbudowana na ciężarówce marki STAR. Trochę wszystko się bujało, ale to nie było ważne. Dla mnie najważniejsze było to, że wreszcie gram przed garstką ludzi z mojego miasta.<br />\r\nW tym okresie nagrałem swoją płytkę demo zatytułowaną \"BASTIon\". Dlaczego tak późno? Ponieważ wcześniej uważałem, że moje rymowanie nie nadaje się, żeby je puszczać w obieg. Wtedy właśnie przyszedł ten moment, kiedy stwierdziłem, że rap jest tym, czym chciałbym się zajmować bardziej na poważnie.<br />\r\nPrzyszedł rok 2003 i już pod koniec Stycznia wszystko zaczęło iść po mojej myśli. Zacząłem grać saporty. Pierwszego saportu nigdy nie zapomnę. Był to klub CUBE i grałem przed Abradabem. Ludzie przyjęli mnie dobrze i nawet zarobiłem swoje pierwsze pieniądze grając imprezę:)<br />\r\nRozruszało się. Byliśmy w dobrej komitywie ze \"Zjednoczonymi\" i obstawialiśmy wspólnie większość imprez, jakie były grane w tym roku w Łodzi. Kiedy ktoś zapraszał mnie na imprezę to chłopaki grali ze mną i działało to też w drugą stronę. Tym sposobem ludzie przypomnieli sobie o \"Zjednoczonych\" i poznali mnie. Nagrałem z chłopakami jako gość kawałek \"Z kim tak naprawdę\", do którego powstał klip. Nakręcony został też klip do kawałka \"STAJĘ DO OBRONY\" z mojej demówki. Daliśmy wywiad łódzkiej TV kablowej TOYA, która emitowała nasze klipy. Klip \"Z kim tak naprawdę\" poleciał kilka razy na Vivie. Do swojego programu \"WuWuA\" zaprosił mnie Cezary Ciszewski, gdzie mogłem pokazać się przez chwilę szerszej grupie odbiorców.<br />\r\nPod koniec 2003 roku wyszedłem z luźną propozycją do Trautiego wtedy jeszcze członka \"Zjednoczonych\" - Nagramy razem jakiś kawałek? Jak się każdy może domyślić odpowiedź brzmiała - Tak. Mój dobry ziom Jarek Skąpski wtedy czynnie działający w studenckim radiu ŻAK, udostępnił nam na kilka godzin studio nagrań. Nawinęliśmy z Trautim bardzo lightowy kawałek zatytułowany \"Nostradamus\" i wtedy zorientowaliśmy się, że to jest coś innego niż nagrywaliśmy do tej pory. Wtedy nie wiem już z czyjej inicjatywy wyszedł pomysł - A może nagramy coś jeszcze? Wtedy powstał kawałek \"Płonę\", który ukazał się na składance pt.\"NIEZALEŻNA INICJATYWA\". Na tej samej składance pojawił się numer Zjednoczonych z gościnnym udziałem Zajki, w którym również wystąpiłem jako gość w refrenie. Do tego kawałka powstał klip, który można oglądać m.in. w internetowej telewizji TV FLY.<br />\r\nW 2004 roku okazało się, że Trauti nie jest już \"Zjednoczony\", a chłopakom z \"ZdoI\" nie podobało się jaką muzykę tworzymy. Razem z Trautusem dalej robiliśmy swoje szukając wydawcy. Trwało to prawie rok, ale nasz upór i cierpliwość zostały wynagrodzone. 14 Grudnia 2004 roku podpisaliśmy kontrakt z CAMEY STUDIO, gdzie teraz nagrywamy nasz materiał...<br />\r\n<br />\r\nPozdrawiam! Basti.','www_hhbd_pl_Basti_1.jpg','image/jpg',NULL,NULL,'INFO KONCERTOWE:<br />\r\n(0)880559404 ','0000-00-00','0000-00-00',0,'',7,0,954,100,NULL,'Camey Studio','http://www.camey.pl'),(1090,'Trauti','','','2005-09-01 11:58:57','0000-00-00 00:00:00','Miłość do rapu zaszczepił we mnie kumpel. Ciężko jest mi powiedzieć, kiedy to było, zdaje się jakby wieki temu. Razem z kumplem dorastaliśmy przy dźwiękach tej muzyki i jak wielu innych mieliśmy swój skład. Po pewnym czasie zaistnieliśmy na Łódzkiej scenie pod nazwą &#8222;Zjednoczeni&#8221;, grupa ta powstała w roku 1999 z połączenia trzech składów. Był to dobry okres dla rapu w Łodzi, wiele się działo. Dużo koncertów, duża publiczność i dużo suportów przed gwiazdami dla nas. Przez Zjednoczonych przewinęło się kilka ciekawych postaci, m.in. Lilu, która po pierwszym demo odeszła i teraz na własną rękę przebija się do pierwszej ligi.<br />\r\nLata mijały, ludzie się zmieniali, jedni przychodzili, drudzy odchodzili a &#8222;Zjednoczeni&#8221; nagrywali kolejne płyty i grali kolejne koncerty. Wszystko nielegalnie i dla zabawy. <br />\r\nBastiego poznałem w 2002 roku. Na początku &#8222;Zjednoczeni&#8221; i Basti grali razem koncerty, później pojawił się pomysł nagrania wspólnego kawałka, \"Z kim tak naprawdę\", do którego zrobiliśmy sobie klip.<br />\r\nPo pewnym czasie Basti zaproponował mi nagranie wspólnego kawałka. Okazało się, że współpraca nieźle nam wychodzi i mamy podobne spojrzenie na to, co robimy. Zachęcani przez znajomych zaczęliśmy pracę nad płytą. I tu zaczęły się problemy. Naszym materiałem zainteresowała się jedna z wytwórni. Znajomi stwierdzili, że za dużo czasu poświęcam projektowi z Bastim i przestałem być członkiem &#8222;Zjednoczonych&#8221;, pojawiły się także poważne problemy na studiach. Wytwórnia po pewnym czasie zrezygnowała z planów związanych z wydaniem naszej płyty i znaleźliśmy się w punkcie wyjścia.<br />\r\nDzięki pomocy jednego ze znajomych udało nam się nawiązać kontakt z Camey Studio, gdzie wyrażono zainteresowanie naszym materiałem. W tej chwili pracujemy nad naszą debiutancką płytą.<br />\r\n<br />\r\nNielegalne, na których można mnie usłyszeć:<br />\r\nZjednoczeni &#8211; W jedności siła. 2000<br />\r\nZjednoczeni &#8211; Etap Pracy &#8211; EP. 2002<br />\r\nSkładanka Kawa - Na Ławe 2002 <br />\r\nSkładanka Niezależna Inicjatywa 2003<br />\r\nKawałek Zjednoczeni feat. Ascetoholix &#8211; &#8222;Nie ma z kim pogadać&#8221; 2003<br />\r\nKawałek Zjednoczeni feat. Basti, Zajka \"Nie Pozwól O Sobie Zapomnieć\" 2004<br />\r\n<br />\r\nPozdrawiam. Trauti','www_hhbd_pl_Trauti_1.jpg','image/jpg',NULL,NULL,'INFO KONCERTOWE:<br />\r\n(0)503793928<br />\r\n','0000-00-00','0000-00-00',0,'',7,0,685,100,NULL,'Camey Studio','http://www.camey.pl'),(1091,'Me?How?','','','2005-09-01 13:00:26','0000-00-00 00:00:00','Me?How? - młody, utalentowany bitmejker, realizator, właściciel domowego Studia Mefli oraz przede wszystkim producent nagrań z tej stajni, nie dał się jeszcze właściwie dobrze poznać słuchaczom. Obecnie notuje coraz większy postęp zarówno jeśli chodzi o wiedzę techniczną przy tworzeniu muzyki jak też i własne oryginalne brzmienie będące niejako fuzją soundu uzyskiwanego przez Embeego jak i Alchemista pod koniec lat 90tych. Pierwsze efekty można było usłyszeć ostatnio w kawałku \"Nie ma boga\" który okazał się być internetowym szlagierem.',NULL,'',NULL,NULL,'Jeśli interesuje Cię organizacja koncertu, któregoś z artystów, prezentowanych na www.eternia.pl, pisz na booking@eternia.pl','0000-00-00','0000-00-00',0,'',7,0,291,100,NULL,'',''),(1092,'Deep','','','2005-09-01 22:25:55','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,610,100,NULL,'',''),(1093,'Dima','','','2005-09-01 22:30:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,967,100,NULL,'',''),(1094,'WBU','','','2005-09-01 22:55:32','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,639,100,NULL,'',''),(1095,'Harry','','','2005-09-01 22:55:32','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,893,100,NULL,'',''),(1096,'QQA','','','2005-09-01 22:5