0-00-00',0,'',7,0,834,100,NULL,'',''),(1111,'Dj Falcon','','','2005-09-18 01:18:07','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,753,100,NULL,'',''),(1112,'Dj Qmak','','','2005-09-18 01:20:11','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,1155,100,NULL,'',''),(1113,'Dj Halibut','','','2005-09-18 01:21:18','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,714,100,NULL,'',''),(1114,'Młody & Flow','','','2005-09-18 01:38:51','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,809,100,NULL,'',''),(1115,'Korporacja','','','2005-09-18 01:39:15','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,265,100,NULL,'',''),(1116,'Dj Pivko','','','2005-09-18 01:58:01','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,501,100,NULL,'',''),(1117,'Bla Bla','','http://bla-bla.pl','2005-09-20 23:44:12','2005-11-30 17:00:25','W skład zespołu wchodzą: <a href=\"/n/mroku\">Mroku</a>, <a href=\"/n/wonz\">Wonz</a>, <a href=\"/n/burza\">Burza</a>, <a href=\"/n/em\">Em</a>, <a href=\"/n/jajco\">Jajco</a>, <a href=\"/n/mahyn\">Mahyn</a>.\r\nZa stronę muzyczną odpowiedzialny jest <a href=\"/n/mahyn\">Mahyn</a>, którego czasami wspiera <a href=\"/n/mroku\">Mroku</a>. BlaBla ma na koncie 3 nielegale: \"Niby nic, a jednak tak wiele\", \"Krzyczy kraj cały\" i \"Dobra bla noc\". W 2001 roku <a href=\"/n/mroku\">Mroku</a> i <a href=\"/n/burza\">Burza</a> pojawili się z dwoma utworami \"Strefą Wojny\" i \"Siłą sztuki\" na składance \"Robię Swoje2\" wydanej przez <a href=\"/l/camey_studio\">Camey Studio</a>.\r\nBla-Bla to sześć różnych osobowości, które jednak potrafią stworzyć coś wspólnego i oryginalnego. Bla-Bla to przede wszystkim spontaniczność, nawet jeśli członkowie zespołu bawią się słowem i dźwiękiem, to z należytym szacunkiem.\r\nPochodzą z Koszalina, od wielu lat udzielając się na tutejszej scenie hip-hopowej, nagrywając, wspierając i promując ją. Dali się poznać szerszej publice w 2001 roku, pojawiając się z dwoma utworami na składance \"Robię Swoje 2\" wydanej przez Camey Studio, a także poprzez wywiad i trzykrotne umieszczenie swoich utworów na płycie CD, dołączanej do magazynu \"Ślizg\".\r\nW marcu 2005 podpisali kontrakt płytowy z EMI Music Poland, czego owocem jest pierwsza oficjalna płyta pt. \"W pracowni słowa i dźwięku\". Na płycie oprócz całego składu Bla-Bla pojawiają się Duże Pe z Warszawy, Gres z Łodzi i Piecol z Koszalina, za skrecz odpowiada Dj Zaju, także reprezentujący Koszalin. Producent Mahyn zaistniał także na niedawno wydanej płycie duetu Juras i Wigor \"Wysokie Loty\" produkując dwa numery.\r\nJaka to płyta? Można powiedzieć, że świeża, że oryginalna, że zaskakująca, a można też, do czego się przychylamy, że o muzyce owszem się rozmawia, ale muzyki przede wszystkim się słucha i to słuchacz powie nam jaka jest to płyta.',NULL,'',NULL,NULL,'mail: info@bla-bla.pl<BR>\r\ntel.: 602 461 818','0000-00-00','0000-00-00',1,'',3,1,1217,100,NULL,'',''),(1118,'Mroku','','','2005-09-20 23:45:47','0000-00-00 00:00:00','Mrok zapadł w roku bezpańskim 97\', w czasach FT2, jeans\'ów po ojcu, znikomej wiedzy o czymkolwiek. Mało kto myślał o tym by robić coś poza chodzeniem do szkoły, lub nie chodzeniem, grą w coś tam i piciem czegoś tam. Ja myślałem i nadal myślę. W tym oto czasie powstał projekt 2 Osoby w składzie Mroku i Skwaro, nie będę tu opisywał wszystkiego, bo to nie mają byś wspomnienia z dawnych dni, więc dodam tylko, że jako 2 Osoby wypuściliśmy lokalnie cztery nielegale (2 Osoby już nie istnieją) i ja jako Mroku jeden. Co ja właściwie robię? No piszę, traktując to jako relaks, choć zdarzają się chwile, że i relaks męczy. Siedzę i piszę, czasami składając dźwięki w coś na kształt muzyki. Czym jest dla mnie słowo? Nie wiem, wiem czym próbuje być, próbuje być myślą. Jak uda mi się przełożyć myśl na słowo, to dam znać. Nagle czuję jak ktoś mnie szturcha prosząc bym wyszedł z psem na spacer i nagle mam 24 lata i jest Bla-Bla. Co mogę napisać o Bla-Bla, chyba tylko - My się dopiero rozkręcamy.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',3,0,686,100,NULL,'',''),(1119,'Wonz','','','2005-09-20 23:46:19','0000-00-00 00:00:00','Urodził się w piękną gorącą noc a dokładnie koniec maja 1983, dzięki czemu stał się najmłodszym członkiem zespołu. W dzieciństwie łasuch i leń i tak pozostałoby do dziś dnia gdyby nie zamiłowanie do hip hopu, dzięki któremu nie odnajduje już tak wiele czasu na pochłanianie dużej ilości pokarmu Bla Bla Bla Bla Bla Bla... KONIEC. \r\n\r\nWraz z Em\'em założył skład 2:1, który niestety może i dobrze nie narobił szumu w lokalnym podziemiu. Nastał rok 2000 a wraz z nim, Wonz z nieopuszczającym go przyjacielem Em\'em pojawili się gościnnie na płycie 2 Osób \"PÓŁ ŻARTEM PÓŁ SERIO\", co dokładnie po 3 latach zaowocowało połączeniem i stworzeniem nowego składu BLA BLA. Obecny dzień przynosi nowe numery, które już niebawem miejmy nadzieje ujrzą światło dzienne... DOBRA BLA NOC.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,733,100,NULL,'',''),(1120,'Burza','','','2005-09-20 23:47:05','0000-00-00 00:00:00','To ja Jakub \"BURZA\" Głowacki urodziłem się w Koszalinie 19 czerwca 1979 roku. W 1996 r. założyłem razem z Onilem i Komem już nieistniejącą formacje 3XL. Tworzyliśmy i graliśmy około 2 lat poczym nasze drogi się rozeszły. W miedzy czasie poznałem chłopaków z zespołu 2 Osoby, Skwara i Mroka. To z nimi i Komem stworzyliśmy projekt KLIN, ale stanęło na 4 kawałkach. Nie zaprzestaliśmy współpracować i pomimo różnych perypetii wspólnie zainwestowaliśmy w rapową kanciapę, w której powstawały numery tj. \"Strefa Wojny, Siła Sztuki\" później wydane na składance producenckiej Camey\'a ROBIE SWOJE 2.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,635,100,NULL,'',''),(1121,'Em','','','2005-09-20 23:47:38','0000-00-00 00:00:00','Urodził się w Koszalinie w drugiej połowie listopada dokładnie 25 listopada. Uważa, iż zajmuje się rozrywką, kulturą i sztuką, od kiedy to w 1999 roku wraz z Wonzem założył skład 2:1. Po jakimś czasie 2:1 gdzieś odleciało, przepadło pozostawiając po sobie kilka utworów, schowanych po dziś dzień w czeluściach dysku twardego Em\'a. W 2000 roku pojawił się jako gość na nielegalu 2osób - \"Pół żartem, pół serio\", można było też go usłyszeć na solowym materiale Mroka - \"Od sceny do sceny\". W 2003 roku dołączył do składu BlaBla, tym samym znalazł się na dwóch epkach; \"Krzyczy kraj cały\" i \"Dobra bla noc\".',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,530,100,NULL,'',''),(1122,'Jajco','','','2005-09-20 23:48:04','0000-00-00 00:00:00','Przygodę z tworzeniem rapu rozpoczął w 1998r samemu robiąc pierwsze bity. W 1999r kilkakrotnie próbował stworzyć zespół z różnymi osobami (m.in. z Wonzem i Emem), ale nie przyniosło to oczekiwanych przez niego rezultatów, a nagrania z tamtego okresu nie przetrwały do dziś. Później nawiązał współpracę z 2osobami (Mroku i Skwaro), którzy zainicjowali wraz z przyjaciółmi powstanie \"Kanciapy\", przez którą przewinęło się wiele osób związanych z koszalińskim hip-hopem. To tam poznał Burzę, a rozwijająca się współpraca zaowocowała pierwszym nielegalem BlaBla - \"Niby Nic A Jednak Tak Wiele\" (Burza, Mroku, Jajco, Skwaro). Później wziął udział w nagrywaniu nielegala 2osób \"Pół Żartem, Pół Serio\" oraz solowego nielegala Mroka (2osoby/BlaBla) \"Od Sceny Do Sceny\". Nie mógł pojawić się na reaktywacyjnej epce BlaBla - \"Krzyczy Kraj Cały\". Pojawił się jednak na mini epce BlaBla - \"Dobra Bla Noc\" i na pewno będzie można go usłyszeć w kolejnych utworach grupy.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,692,100,NULL,'',''),(1123,'Mahyn','','','2005-09-20 23:48:27','0000-00-00 00:00:00','Przyjaźń z muzyka rozpoczął w 2 klasie szkoły podstawowej ucząc się w domu na klawisecie, później szkoła muzyczna (waltornia i fortepian), w międzyczasie penetrował wszelakie gatunki muzyczne, od hip hopu zza oceanu, poprzez klasykę, aż po stricte muzykę punkowa, (lata 93-94) był perkusista w zespole Cela 81. Pod koniec lat 90, żywo zainteresował się mieszanka jazz hip hop funky, wtedy tez zaczął zgłębiać tajniki produkcji i realizacji. Z biegiem czasu, zaczął wspierać koszalińskie składy hip hopowe swoimi produkcjami (Onil, SP, Sedno 4xP i oczywiście Bla Bla), najpierw jako tandem w formacji SFX (Mahyn&Stefan), później jako indywidualny producent. W marcu 2004 ukończył kurs realizacji dźwięku w Warszawie i nadal zgłębia tajniki produkcji i rejestracji dźwięku, jak również ciągle poszukuje nowych nurtów i swojego miejsca w hip hopowych produkcjach.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,718,100,NULL,'',''),(1124,'Piecol','','','2005-09-21 00:02:09','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,1089,100,NULL,'',''),(1125,'Maciora','','http://www.maciora.pl/','2005-09-22 12:02:42','2005-10-09 00:21:58','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',1,'',1,3,701,100,NULL,'',''),(1126,'eRAFi','','','2005-09-22 12:02:42','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,603,100,NULL,'',''),(1127,'Brek','','','2005-09-22 12:02:42','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,453,100,NULL,'',''),(1128,'Punkt Widzenia','','','2005-09-22 12:02:42','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,968,100,NULL,'',''),(1129,'Druh Sławek','Sławomir Jabrzemski','http://druhslawek.com/','2005-09-25 17:57:41','2005-12-09 16:07:30','','www_hhbd_pl_Druh_Slawek_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,3,306,100,NULL,'M.Grochowina','http://www.sfotografuj.to.pl'),(1130,'Dj Krime','','www.djkrime.com','2005-09-25 18:03:59','2005-11-24 02:11:24','Dj Krime swoją przygode z gramofonami rozpoczął ok. 1994 roku w rodzinnym Krakowie, kiedy jego brat Mk Fever, który w tym czasie grywał już na pierwszych undergroundowych imprezach w mieśćie, złożył w domu pierwszy dj\'ski set up składający się z 2óch polskich gramofonów paskowych i pożyczonego miksera bez crossfadera. Taki stan rzeczy utrzymywał się dość długo, aż wreszcie z biegiem czasu braciom udało się skompletować profesjonalny sprzęt.\r\nZainteresowanie tematem pojawiło się jednak już duzo wcześniej, pod koniec lat 80tych, pod wpływem fascynacji takimi zespołami jak Run-DMC, czy Public Enemy, w których dj odgrywal istotną rolę, zwłaszcza Jam Master Jay(R.I.P) był dla Krime\'a wielką inspiracją.\r\nPoczątek lat 90tych to fascynacja hip hopem. Krime zawsze ze szczegolną uwagą obserwował na teledyskach m.in w kultowym programie &#8222;Yo MTV Raps\" dj&#8217;ów i dążył do tego by samemu sprobować swoich sił. Fakt posiadania rodziny za granicą był również pomocny w rozwoju, ponieważ w tamtym czasie w Polsce ciężko było być &#8222;na bierząco\" z tym co się dzialo na świecie, a kupowanie płyt było praktycznie nie możliwe, chyba że ktoś własnie przywiózł coś z zagranicy.\r\nWraz ze znajomymi zaczęto organizować pierwsze imprezy hip hopowe w Krakowie (MSC, pozniej Zooteka) i sprawy zaczęły nabierać szybszego obrotu . Krime zagrał niezliczoną ilość imprez nie tylko w Krakowie i na terenie całego kraju, na koncie ma również występy zagraniczne m.in. w Pradze, Bratyslawie, Dublinie,Sztokholmie,Londynie, jak i również w Niemczech gdzie przeprowadził się w 2001 w związku ze studiami i chęcią &#8222;zaczerpnięcia świerzego oddechu\". W 2000 Krime został stypendystą Red Bull Music Academy jako jedyny dj hip hopowy z Polski.\r\nKrime jest również a może nawet przede wszystkim pionierem turntablismu w Polsce, a Kraków stał się jego polską stolicą. Godziny spędzone przy gramofonach zaowocowały w 2001 zwycięstwem w zawodach Vestax Eastern European Turntablist Extravaganza. Sukces ten udało się powtórzyć w roku 2002 po zaciętej walce w finale z czechem djem Five\'em.','www_hhbd_pl_Dj_Krime_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','