1158,'Mr. Hide','','','2005-10-05 22:10:50','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,777,100,NULL,'',''),(1159,'Zielas','','','2005-10-05 22:12:29','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,277,100,NULL,'',''),(1160,'Baner','','','2005-10-05 22:14:15','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,635,100,NULL,'',''),(1161,'Mały El','Kamil','http://www.malyel.ccm.pl','2005-10-08 10:37:39','2005-12-04 23:23:54','Ja (Maly EL) jestem młodym kolesiem, który już albo dopiero w wieku 14 lat poznał Chrystusa i zaczął chodzić jego śladami. Jezus stał się dla mnie jedyną drogą - drogą prawdy... Tak naprawdę  do tej pory  nie znam nut, a robię hiphop. Od początku ulubioną i prawdziwą  muzyką jak dla mnie był, jest i będzie hiphop. Pierwszy rap usłyszałem na kasetach, które pożyczałem od kumpli, jarałem się tym od małego, tylko wtedy to było po prostu fajne. Moje pierwsze CD hiphopowe to kupione na Jarmarku Europa w Warszawie płyty Kalibra 44 i jakaś składanka + pierwsza płyta Liroya, którą dostałem od kumpla. Po jakimś czasie zacząłem sobie na magnetofonie robić mixy, no można nazwać mixtape. Mixowałem sobie różne zwrotki, refreny czy oddzielne zdania, sadzę że te \"bajery\" teraz bym gdzieś w piwnicy albo w szafce znalazł. Chrześcijański rap postanowiłem robić, bo poczułem, że w jakiś sposób jest to moim \"powołaniem\". Mój debiutancki występ był w czasie Pierwszych Dni Kultury Chrześcijańskiej w Grajewie. Od tamtej pory co raz bardziej mnie to pociągało i dawało nadzieję na to, że mogę coś z siebie wywalić i zarazem powiedzieć innym. Początkowo próbowałem założyć squad \"Święta Załoga\", lecz nic nie wychodziło, więc postanowiłem zamknąć ten rozdział i zacząć po prostu rymować jako Maly EL. Chcę robić hiphop dla Jezusa, bliskich i innych - dla całego świata. I pragnę by tak zostało. AMEN!',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,1,729,100,NULL,'',''),(1162,'Łąki Łan','','www.lakilan.stond.pl','2005-10-09 23:53:22','0000-00-00 00:00:00','Nie tak dawno temu, pod liściem truskawki spotkało się pięciu niezwykłych smakoszy nektaru i pyłku kwiatowego. Poń Kolny - znany z celnej riposty, Niesforny Bonk - wybitny znawca smaków i zapachów, Poważka - malkontent elokwent, szybki i wściekły MegaMotyl i mały skrzat imieniem Księżul Sporysz, ważący całymi dniami mikstury mające na celu udoskonalenie owadziego rodu. Nie wiedzieli, jaką tym razem niespodziankę przyszykował dla nich ten ostatni. Pokrzepiwszy się suto specjałami, Sporysz wyjął z zawiniątka małą butelkę i poczęstował całą gawiedź Łąki Łanu, gdyż tak właśnie nazywała się ta drużyna. Nagle zrobiło się jakby ciemniej i wicher okrotny wzbił kuż w powietrze a ptaki umilkły, kwiaty pozamykały pąki i straszliwy piorun przeszył nieboskłon. Wiedzieli, że takie mogą być następstwa spożycia tajemnego wywaru, ale nic więcej nie nastąpiło oprócz deszczu, który zmoczył im skrzydła. Wrócili więc do swego grzyba prawdziwego, wyjęli instrumenty i zagrali ŁąkiFunka.','www_hhbd_pl_laki_lan_1.jpg','image/jpg',NULL,NULL,'Piotr Kozbielski\r\nmobile: +48 508 951 891\r\ne-mail: lakilan@o2.pl','0000-00-00','0000-00-00',0,'',7,0,1154,100,NULL,'www.lakilan.stond.pl',''),(1163,'Dj Peres','','','2005-10-10 00:30:26','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,875,100,NULL,'',''),(1164,'Dj MalFunkTion','','','2005-10-10 00:31:02','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,912,100,NULL,'',''),(1165,'Caroolek & Gacek','','','2005-10-10 00:41:21','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,387,100,NULL,'',''),(1166,'Grupa Operacyjna','','','2005-10-10 00:42:20','0000-00-00 00:00:00','Początki historii Grupy Operacyjnej sięgają roku 1996, a w aktualnym składzie działa ona od roku 2001. Zespół w tym roku debiutował albumem &#8222;Terapia Szokowa&#8221;. Trzon zespołu tworzą Mieszko Sibi