,'','','2006-03-25 21:03:33','0000-00-00 00:00:00','ZGAS jeden z najbardziej rozpoznawanych i szanowanych beatboxerów w naszym kraju. Beatboxem zajmuje się od roku 2000 i od tego czasu, mimo, że mieszka w małym Głogowie koło Zielonej Góry, zagrał niezliczoną ilość koncertów i startował w niemal wszystkich bitwach beatboxowych organizowanych na terenie Polski. Nie bez powodzenia. Beatbox Battle w Gdańskim klubie Parlament zakończył wygraną, na WBW 2004 zajął 3 miejsce a od tamtej pory pnie się coraz wyżej. W 2005 roku wygrał Koszalin Beatbox Battle, Bruk Beatbox Battle oraz warszawski turniej eliminacyjny WBW 2005. Supportował czołowych polskich raperów, oraz brał udział w trasie koncertowej (2005) <a href=\"\\n\\pokahontaz\">Pokahontaz</a> i <a href=\"\\n\\kanal_audytywny\">Kanału Audytywnego</a> (którego był członkiem, z którym również nagrał \"Płytę Skirtotymiczną\"). Jest jednym z członków składu Wpat Wypat (biko, bobek, zgas) oraz członkiem ekipy Pokój 121.',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',0,0,324,100,NULL,'',''),(1310,'Eskubei','','','2006-03-26 12:34:10','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',0,0,252,100,NULL,'',''),(1311,'Miśka','','','2006-03-26 13:18:33','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,169,100,NULL,'',''),(1312,'Pełny','','','2006-03-26 13:20:57','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,203,100,NULL,'',''),(1313,'Knapik Tomasz','','','2006-03-26 13:34:38','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,183,100,NULL,'',''),(1314,'Puq','','','2006-03-27 19:32:54','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,1100,100,NULL,'',''),(1315,'Dj Gusto','','','2006-03-28 13:12:27','0000-00-00 00:00:00','','www_hhbd_pl_Dj_Gusto_1.jpg','image/jpg',NULL,NULL,'','0000-00-00','0000-00-00',0,'',1,0,331,100,NULL,'m. grochowina','http://www.sfotografuj.to.pl'),(13