yjny i miał być tylko sposobem na miłe spędzenie czasu w oparach dymów różnego pochodzenia i alkoholi różnych gatunków i odmian.\r\nZ czasem okazało się, że projekt zaczyna przybierać bardzo interesującą formę, co zainspirowało nas do całkowitego jego przebudowania - i tak Bakflip powstał po raz drugi już nieco bardziej świadomie (opary pozostały).\r\n\r\nBakflip to żywi całkiem muzycy i żywi całkiem MC\'s (z wyłączeniem sesji weekendowych kiedy zdarza się im być mniej żywymi acz oddychającymi)\r\n\r\nBakflip jest zupełnie pozbawiony ideologicznych przesłań i jest z dala od klasyfikacyjnych nieporozumień polskiej sceny muzycznej. Robimy to co lubimy i nie zamierzamy z nikim ani z niczym walczyć (może poza głupotą i kołtuństwem).\r\n\r\nSłuchajcie zatem Bakflipa i bawcie się dobrze ;) ',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',0,0,784,100,NULL,'',''),(1370,'Dj Bam','','','2006-07-03 17:56:25','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,204,100,NULL,'',''),(1371,'Dj Flipside','','','2006-07-03 17:56:31','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',7,0,165,100,NULL,'',''),(1372,'Dj Snoopi','','','2006-07-03 18:10:52','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',0,0,161,100,NULL,'',''),(1373,'THS Kliki','','','2006-11-11 15:00:47','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,391,100,NULL,'',''),(1374,'S2O','','','2006-11-20 16:53:57','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,589,100,NULL,'',''),(1375,'Bebe','','','2006-11-20 16:54:28','2006-11-20 16:55:44','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,3,318,100,NULL,'',''),(1376,'S2O/Bebe','','','2006-11-20 16:55:25','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00',0,'',3,0,0,100,NULL,'',''),(1377,'Limit','','','2006-11-20 17:00:58','0000-00-00 00:00:00','',NULL,'',NULL,NULL,'','0000-00-00','0000-00-00'