INSERT INTO `labels` VALUES (1,'Gigant Records','http://www.gigantrecords.com','gigant@gigantrecords.com','',998,'',1,0,'2004-05-30 16:40:32','0000-00-00 00:00:00','www_hhbd_pl_gigant_records-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(2,'Prosto','http://www.prosto.pl','','',5989,'',1,0,'2004-05-30 16:43:05','0000-00-00 00:00:00','www_hhbd_pl_prosto-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(3,'Wielkie Joł','http://www.wielkiejol.com','ostasz@nokautsklad.pl','',3288,'',1,0,'2004-05-30 16:45:41','0000-00-00 00:00:00','www_hhbd_pl_wielkie_jol-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(4,'S. P. Records','http://www.sprecords.com.pl','sprecords@sprecords.com.pl','ul. Zielona 35a 02-913 Warszawa ',1490,'Wydawnictwo fonograficzne S.P. Records zostało założone w 1993 roku przez byłego gitarzystę Kultu - Sławomira Pietrzaka i od początku istnienia jest legalnym producentem i dystrybutorem płyt i kaset a także członkiem ZPAV.\r\nS.P. Records to największa polska firma fonograficzna, wydająca wyłącznie płyty z muzyką polskich wykonawców, zaliczanych do ścisłej czołówki polskiego rynku muzycznego.\r\nOd początku istnienia S.P. wydaje płyty Kultu, Kazika i Kazika Na Żywo. Oprócz nowych płyt Kultu, sukcesywnie wydawane były reedycje starszych wydawnictw i dzięki temu od listopada 1998 S.P. Records posiada w swym katalogu wszystkie wydawnictwa Kultu.\r\nPierwszym komercyjnym sukcesem firmy była płyta Kultu \"Tata Kazika\", która kilka dni po premierze uzyskała status \"Złotej Płyty\" (100.000 egzemplarzy). Kolejnym sukcesem artystycznym i komercyjnym jednocześnie był solowy album Kazika zatytułowany \"12 Groszy\", który po dwóch miesiącach uzyskał status \"Platynowej Płyty\", a utwór tytułowy został przebojem wakacji 1997 roku. Natomiast piosenka \"Sztos\" promowała debiut reżyserski Olafa Lubaszenko o tym samym tytule.\r\n\"Platynową płytą\" stał się również ostatni album Kultu, zatytułowany \"Ostateczny Krach Systemu Korporacji\", a pochodząca z niego piosenka \"Gdy nie ma dzieci\" była przebojem wakacji 1998.\r\nPoza w/w albumami, nakładem S.P. Records ukazały się płyty m.in.: T.Love, Apteki, Trawnik i Kuba Sienkieiwcz a także Pidżamy Porno (Złodzieje Zapalniczek oraz Styropian).\r\nS.P. Records to również pierwsza firma fonograficzna, nakładem której ukazała się płyta polskiego zespołu hip hopowego (<a href=\"/n/wzgorze_ya_pa_3\">Wzgórze Yapa 3</a>).\r\nPoza tym S.P. Records wydało dwa albumy kompilacyjne, zawierające nieprezentowane wcześniej hip hopowe utwory zarówno debiutantów jak i uznanych artystów.\r\nW 1996 roku pojawiła się debiutancka płyta <a href=\"/n/kaliber_44\">Kalibra 44</a>, której popularność nie maleje do dziś.\r\nSilną pozycję na rynku i duże zainteresowanie twórczością grupy potwierdziła \"Złota Płyta\" za drugi album \"<a href=\"/a/w_63_minuty_dookola_swiata\">W 63 minuty dookoła świata</a>\".\r\nWarto dodać, ze płytę promował tylko jeden singiel i teledysk (\"<a href=\"/s/film\">Film</a>\").',1,1,'2004-05-30 16:57:03','2006-03-28 14:13:29','www_hhbd_pl_s__p__records-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(5,'Asfalt Records','http://www.asfalt.pl','tytus@asfalt.pl','',3835,'Warszawska niezależna wytwórnia hiphopowa Asfalt Records powstała w październiku 1998 r. z inicjatywy Tytusa, prowadzącego stronę enigma.art.pl. Pierwotnie cała działalność była skupiona na bliskiej współpracy pomiędzy Tytusem, a młodym producentem Ośką, który współtworzył warszawską grupę OMP. Debiut OMP \"Wilanów... zobacz różnicę\" ukazał się na rynku 16 grudnia 1998 i stał się pierwszym tytułem z katalogu Asfalt Records. W międzyczasie do Asfalt dołączyli kolejni reprezentanci młodej warszawskiej sceny - grupy RHX i Płomień 81 (ta druga - produkowana przez Ośkę). W kwietniu 1999 ukazała się składankowo-promocyjna Epka \"Asfalt Wiosna 99 EP\" (na kasecie oraz na CD w cenie kasety - precedens na polskim rynku), zawierająca utwory OMP, RHX i Płomień 81. W czerwcu ukazał się debiut RHX \"Opowieści z podwórkowej ławki\" (także na tanim CD). Album ten spotkał się z życzliwym przyjęciem, szczególnie ze względu na obiecujące produkcje DJ M.A.D i oryginalne teksty jego brata Fisza, który wchodził wtedy jeszcze w skład grupy. \r\n\r\nW tym samym miesiącu Tytus zrealizował projekt, który był od ponad roku na ustach wszystkich zainteresowanych polskim hiphopem - wypuścił na rynek pierwszą płytę winylową z polskim hiphopem: 12\" singiel OMP \"Otzafszetu/Oempe\" wytłoczony w Czechach. W sierpniu 1999 r. ukazała się kaseta Płomienia 81 \"Na zawsze będzie płonął...\" i jednocześnie rozpoczęto przygotowania do wydania tego tytułu na podwójnym albumie winylowym tłoczonym tym razem za zachodnią granicą. Czarna, podwójna płyta Płomienia, wycięta w Niemczech i tłoczona we Francji, ujrzała światło dzienne pod koniec roku. W międzyczasie, na zwykłych nośnikach, wyszła producencka płyta O$Ki \"Kompilacja\". Album ten spotkał się z wysokimi ocenami krytyków, a autor stał się wówczas jednym z czołowych polskich producentów, których grono było wtedy dosyć skromne.\r\nPierwszym wydawnictwem, jakie ukazało się nakładem Sony (już we wrześniu 2001) był drugi album Fisza - \"Na wylot\", tak samo jak poprzedni - wyprodukowany przez DJ M.A.D. Płyta ta nagrana została w profesjonalnym studio, przy udziale żywych instrumentalistów. Pierwszy singiel \"Tajemnica\" ukazał się już pod koniec sierpnia. Do końca roku wyjdą kolejne wydawnictwa - solowe albumy OSTR, Komy i Łony.',1,0,'2004-05-30 17:02:45','0000-00-00 00:00:00','www_hhbd_pl_asfalt_records-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(6,'Blend Records','http://blend.terra.pl','blend@terra.pl','ul. powstancow sl. 20-22, 53-333 Wrocław',1502,'',1,1,'2004-05-30 17:12:15','2004-06-18 00:39:03','www_hhbd_pl_blend_records-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(7,'EMI Music Poland','http://www.emimusic.pl','demo@pomatonemi.com.pl','ul. Osmańska 11 02-823 Warszawa',1842,'',1,1,'2004-05-30 17:17:37','2005-09-06 22:54:54','www_hhbd_pl_emi_music_poland-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(8,'BMG/ZIC ZAC Music','http://www.click2music.pl','lukasz.lubiatowski@bmg.com','35 Okrzei 03-715 Warszawa',2248,'',4,1,'2004-06-13 11:55:43','2004-06-13 12:03:58','','image/jpeg',NULL,'2009-06-12 11:40:32'),(9,'Teeto Records','http://teeto.terra.pl','','',734,'',1,0,'2004-05-30 17:31:04','0000-00-00 00:00:00','','image/jpeg',NULL,'2009-06-12 11:40:32'),(10,'Zooteka Records','http://www.zooteka.com.pl','agencja@zooteka.com.pl','',1110,'',1,0,'2004-05-30 17:34:25','0000-00-00 00:00:00','','image/jpeg',NULL,'2009-06-12 11:40:32'),(11,'Sony Music Polska','http://www.sonymusic.pl','Maciek_Rychlicki@pl.sonymusic.com','ul.Chóralna 14 02-879 Warszawa ',977,'',1,0,'2004-05-30 17:39:43','0000-00-00 00:00:00','www_hhbd_pl_sony_music_polska-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(12,'UMC Records','http://www.umc.pl','remik@umc.pl','',3183,'UMC Records powstało jesienią 2002 roku. Jej zapleczem była agencja koncertowa i sklep muzyczny UNDERGROUND MUSIC CENTER, w którym można było zakupić płyty z polską i zagraniczną muzyką hip-hop-ową. Agencja koncertowa zorganizowała w 2002 roku dwa duże koncerty w hali poznańskiej Areny - NEW YORKER HIP-HOP FESTIWAL (od tego czasu impreza cykliczna organizowana przez UMC) i BLESS DA MIC. Oba koncerty okazały się wielkimi sukcesami i to zachęciło organizatorów do większego zaangażowania się w hip-hop. Twórcami UMC są Remik i Urban, którzy po otrzymaniu materiału muzycznego od Owala, postanowili zacząć wydawać płyty, oczywiście pierwszą produkcją, UMC Records był \'Rapnastyk\' OWAL/EMCEDWA. W następnym roku nakładem wydawnictwa ukazały się 4 tytuły, na wiosnę wydano albumy ASCETOHOLIX  \'Apogeum\' i Mezo/Lajner  \'Mezokracja\', a jesienią PIĘĆ DWA DĘBIEC \'P-ń VI\' i JEDEN OSIEM L \'Wideoteka\'. Wielki sukces tej ostatniej płyty pozwolił wytwórni na większy rozwój i zaangażowanie się w różne nowe projekty muzyczne. UMC nie zapomniało o festiwalu i tak w 2003 odbył się NEW YORKER HIP-HOP FESTIWAL 2, a w 2004 NEW YORKER HIP-HOP FESTIWAL 3 który został zarejestrowany przez Telewizję Polską i został wyemitowany w trzech odcinkach na antenie TVP1, TVP3, TV POLONIA. W roku 2004 (do tej pory) ukazały się płyty LIBER \'Bógmacher\', PAN DUŻE PE \'Sinus\' i OWAL/EMCEDWA \'Epizod III: Wirus\' , Deobe/Dena \' deobedena.com\' . Album Mezo/Lajner \'Mezokracja\' został mianowany do nagrody FRYDERYKA 2003, zdobył również nagrodę \'ESKA MUSIC AWARDS\' w kategorii album roku, JEDEN OSIEM L \'Jak zapomnieć\' otrzymało tytuł - Przeboju Roku \'ESKA MUSIC AWARDS\' i zdobył nagrodę - Zespół Roku  \'ESKA MUSIC AWARDS\'. UMC Records planuje w dalszej swojej działalności wspieranie polskiego hip-hopu i dotarcie do coraz większego kręgu odbiorców.',1,0,'2004-05-30 17:45:17','0000-00-00 00:00:00','www_hhbd_pl_umc_records-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(13,'T1-Teraz','http://www.t1-teraz.pl','t1-teraz@o2.pl','T1-Teraz  skr.poczt. nr 52 02-495 Warszawa 122',5463,'',4,1,'2004-06-04 23:58:25','2005-12-02 18:57:17','','image/jpeg',NULL,'2009-06-12 11:40:32'),(14,'EmbargoNagrania','http://www.embargonagrania.pl/','p.sadowski@embargonagrania.pl','',2319,'<strong>Z czyjej inicjatywy powstała wytwórnia?</strong>\r\n<i>Piotrek Sadowski, EmbargoNagrania:</i> Rozmowy o wytwórni - Labelu, rozpoczęły się przed wakacjami 2003 roku, oficjalny start styczeń 2004 - Epka <a href=\"/wykonawca/Grammatik\">Grammatik</a> \'<a href=\"/album/Reaktywacja\">Reaktywacja</a>\'. Inicjatorem całego Labelu jest wieloletni słuchacz i fan kultury Hip Hop - Piotr Sadowski. Od początku w Embargo pracują dwie osoby, oprócz wyżej wymienionej, także <a href=\"/wykonawca/Wujrock\">Piotr Wójcicki (Wujrock)</a>, znany z aktywnej działalności w warszawskiej grupie \'<a href=\"/wykonawca/Stare_Miasto\">Stare Miasto</a>\'.\r\n<strong>Co było bezpośrednim czynnikiem decydującym o powstaniu?</strong>\r\n<i>Piotrek Sadowski:</i> Pomysł powstał z zauważenia znakomitego potencjału, jaki posiada dystrybutor, firma ITI Cinema, należąca do jednej z Firm Grupy ITI. Każdy chyba pamięta, charakterystyczne logo ITI Home Video, na początku prawie każdego filmu na kasecie z wypożyczalni...\r\nMając konkretny produkt, czyli dobre płyty, dobrą muzykę, dystrybutor w łatwy sposób przystosował się do \'dealowania\' oprócz kasetami video i płytami dvd, także \"Kompaktami\". Myślę, że sam fakt zainteresowania tak dużej firmy szeroko pojętą \'muzyką miejską\', przede wszystkim Hip - Hopem, jest chyba oznaką zmiany czasów. Hip Hop to jeden z najważniejszych odłamów kultury i muzyki XXI wieku !!!.\r\n<strong>Jakie jest największe osiągnięcie wytwórni?</strong>\r\n<i>Piotrek Sadowski:</i> Dobrzy artyści, dobre okładki, dobre logo, dobra strona, ogólnie staramy się być postrzegani w kategoriach \'Styl i jakość\', hehe. Staramy się wydawać dobrą muzykę i w dobry sposób, oczywiście jak w życiu, nie wszystko udaje się zrobić na Tip-Top, ale jeżeli zdarza się błąd, uczymy się, wyciągamy wnioski i za każdym razem staramy się robić coś lepiej.\r\n<strong>Jakie są plany wydawnicze wytwórni?</strong>\r\n<i>Piotrek Sadowski:</i> Plany wydawnicze są jej tajemniczą strategią \':) Jak narazie realizujemy starsze plany, właśnie wyszedł pierwszy z trzech zaplanowanych w Embargo albumów grupy <a href=\"/wykonawca/2cztery7\">2cztery7</a>, album nosi nazwę \'<a href=\"/album/Funk_dla_smaku\">Funk-Dla smaku</a>\', najbliższe tematy (przed wakacjami 2005) to dystrybucja płyty <a href=\"/wykonawca/poe\">POE</a> - \'<a href=\"/album/Szum_rodzi_halas\">Szum Rodzi Hałas</a>\' (<a href=\"/wytwornia/Asfalt_Records\">Asfalt Records</a>), a także dystrybucja płyty promującej już po raz drugi największą hip hopową trasę w Polsce \'<a href=\"/album/U_Ciebie_w_Miescie_2\">U CIEBIE W MIEŚCIE 2</a>\', na której wystąpią także nasi artyści, między innymi <a href=\"/wykonawca/Pezet_Noon\">Pezet Noon</a> i grupa <a href=\"/wykonawca/jwp\">JWP</a> (<a href=\"/wykonawca/PCP\">Północ-CENTRUM-Południe</a>), która także już jest na ukończeniu swojego pierwszego albumu w Embargo (Wrzesień 2005).\r\n<strong>Jakie są główne założenia wytwórni?</strong>\r\n<i>Piotrek Sadowski:</i> Jesteśmy otwarci na różną muzykę, dostajemy dużo płyt demo, w głównej mierze są to \'demówki\' hip-hopowe, więc czekamy także na inne rzeczy! Interesuje nas muzyka z szeroko pojętej kultury miejskiej, chcemy aby muzyka wydawana przez nas oddawała klimat i styl życia w dużych miastach. Tacy są jej twórcy, tacy są też w głównej mierze jej odbiorcy. Muzyka płyt Embargo trafia do osób, którzy zazwyczaj nie mają czasu ani warunków na lekkie, przyjemne i beztroskie życie. Dlatego też przy naszych albumach odpoczywają, bawią się, czy też znajdują chwile refleksji.',4,1,'2004-06-05 00:05:43','2005-09-11 01:41:51','www_hhbd_pl_embargonagrania-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(15,'Vabank Records','http://www.vabankrecords.pl','vabank@vabankrecords.pl','',660,'',1,0,'2004-06-12 00:49:35','0000-00-00 00:00:00','','image/jpeg',NULL,'2009-06-12 11:40:32'),(16,'FCS Records','http://www.fcs.pl/fcs/fcs.html','adamus@pozytywka.com.pl','',899,'Wytwórnia FCS powstała w roku 2001, po to aby promować i wydawać wartościowych nowych, nieznanych lecz nieprzeciętnie zdolnych artystyów spod znaku muzyki HipHop Soul R\'n\'B.',1,1,'2004-06-12 16:23:43','2005-09-27 15:04:57','www_hhbd_pl_fcs_records-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(17,'Camey Studio','http://www.camey.pl','info@camey.pl','ul.Orzeszkowej 12<BR>05-500 Piaseczno',2325,'',3,1,'2004-06-13 13:16:24','2005-10-24 10:54:00','www_hhbd_pl_camey_studio-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(18,'Doperacja Label','http://www.doperacja.pl','','',908,'',3,0,'2004-06-13 13:52:12','0000-00-00 00:00:00','www_hhbd_pl_doperacja_label-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(19,'JuNouMi Records','http://zawszespoko.com/junoumi/','junoumi@zawszespoko.com','',2593,'<p>JuNouMi Records jest wytwórnią ukierunkowaną na wydawanie winyli (inne nośniki nie wchodzą w grę). Nastawieni jesteśmy na wydawanie dobrej, pozytywnej muzyki. Jesteśmy otwarci na wszelkie propozycje, szczególnie dużą przyjemność sprawia nam promowanie nowych talentów.</p><p>JuNouMi Rec. powstało nie dawno, na początku roku akademickiego 2001/2002. Na jednej z wielu imprez, w oparach nie tylko alkoholowych, pojawiła się koncepcja zawojowania światowego szołbiznesu. Tylko jak...? Odpowiedź spadła jak grom z \"zachmurzonego\" nieba - PŁYTA WINYLOWA! Pomysł był, wiec trzeba było przejść do realizacji. Zaczeliśmy od zaproszenia zaprzyjaźnionego zespołu Flexxip, zgodzili się i co z tego wyszło można sprawdzić na EP vol.1 (wielkie dzięki dla Emila, Mes\'a i Vao). Dalej poszło już z górki...</p><p>Kolejni wykonawcy zapraszani przez Groha ochoczo podjeli wyzwanie. I tak drugim numerem po Flexxstylu był Eudezet Allstars (podziękowania dla RaadRadd\'a, Oxego i całej łódzkiej ekipy), wkrótce pojawił się 3ekon (big up dla Webber\'a). Znamiennym faktem było nawiązanie współpracy i nieoceniona pomoc Noon\'a (bez Ciebie nie dalibyśmy rady). Następnie doszedł Diztrikt (nowy, piecioosobowy projekt), w którym debiutuje DJ Panda (podziękowania dla Dizkret\'a, Pandy oraz Urb\'a ). Pojawił się też pierwszy zgrzyt, zainteresowani wiedzą o co chodzi (big up dla Deny i Pjus\'a). W między czasie powstało intro, czyli produkcja Noon\'a z cut\'ami Romka (wielkie dzięki Romek!).</p><p>Równolegle do strony muzycznej, ciężko pracowaliśmy nad sprawami technicznymi, czym zajął się osobiście Link. Warto dodać, że w tym momencie mieliśmy już spory poślizg czasowy, ale warto było zwlekać. Internetowym wizerunkiem naszej wytwórni oraz aspektami graficznymi zajął się Supastik (członek JuNouMi Crew, nieoceniona pomoc, big up!).</p>',1,1,'2004-06-13 16:39:07','2004-06-13 16:39:20','www_hhbd_pl_junoumi_records-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(20,'Konret-Dilpak','http://www.konkret-dilpak.com/','mateusz@konkret.w.pl','',639,'',1,0,'2004-0