dową wytwórni jest Spoko Dzieciak Studio, prowadzące działalność komercyjną (reklamy, castingi, sesje,udźwiękowienie, itd.) oraz charytatywną (poszukiwanie utalentowanych dzieciaków i ich edukacja oraz promocja). ',3,1,'2005-07-01 18:33:53','2006-03-03 14:23:14','','image/jpeg',NULL,'2009-06-12 11:40:32'),(40,'White label','http://www.white-label.pl','mich@ziomy.pl','White Labelul. Grochowska 309/317/4904-396 Warszawa',964,'White label ang., \'biała etykieta\', biała nalepka oznaczająca płytę gramofonową jeszcze nie przeznaczoną do sprzedaży, wypuszczoną np. w celach reklamowych.\r\n\r\nWhite label to projekt portalu <a href=\"http://www.ziomy.pl\" target=\"_blank\">ziomy.pl</a>, powstał ponieważ najmocniej cenimy sobie niezależność.\r\n\r\nChcemy, aby nasza działalność była taką białą etykietą dla wszystkich składów, z którymi podejmiemy współpracę.\r\n\r\nCel ten będziemy realizować poprzez:<ul><li>- przygotowanie i wydawanie nowych albumów płytowych,</li><li>- organizacje oraz wsparcie promocji artystów,</li><li>- opiekę managerską i prawną,</li><li>- oraz w późniejszym czasie impresariat koncertowy.</li></ul>\r\n\r\nSzukamy przede wszystkim ludzi uzdolnionych, myślących nie szablonowo - muzyków zakorzenionych w kulturze hip hop, traktujących to co tworzą z pasją.\r\n\r\nZapraszamy składy do przesyłania swoich demówek oraz udziału w projekcie ziomy na legalu.',3,1,'2005-09-11 00:39:04','2005-09-11 01:23:07','www_hhbd_pl_white_label-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(41,'Afterbeat','http://www.afterbeat.org','mailto:netlabel@afterbeat.org','',654,'Netlabel',1,0,'2005-09-27 14:41:25','0000-00-00 00:00:00','www_hhbd_pl_afterbeat-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(42,'Fabryka','http://www.fabrykamusic.pl','fabryka@fabrykamusic.pl','',670,'Wytwórnia Fabryka została założona 11 lipca 2003 w Warszawie. Głównym celem Fabryki jest promocja młodych artystów prezentujących różne gatunki muzyczne.\r\nW najbliższym czasie planujemy otwarcie własnego studia. Fabrykę tworzą producenci: Bartosz Jabłoński i Michał Jaroszewicz.\r\nDziękujemy wszystkim którzy z nami współpracują oraz tym którzy nas wspierają.',1,0,'2005-09-27 14:59:37','0000-00-00 00:00:00','www_hhbd_pl_fabryka-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(43,'Fifti-Fifti','http://www.5050.pl','dezinte@fifti-fifti.com','',1018,'',1,3,'2005-09-27 15:15:30','2008-05-17 14:08:13','www_hhbd_pl_fifty-fifty-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(44,'Kayax','http://www.kayax.net','tomik@kayax.net','Ul. Szpitalna 1 lok. 49<br>00-020 Warszawa',668,'',1,1,'2005-09-27 16:01:01','2005-09-27 16:02:11','www_hhbd_pl_kayax-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(45,'Laboratorium','http://www.labrec.pl','l.u.c@wp.pl','',468,'',1,0,'2005-09-27 16:13:37','0000-00-00 00:00:00','www_hhbd_pl_laboratorium-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(46,'PH Kopalnia','http://www.phkopalnia.pl','','',757,'',1,0,'2005-09-29 23:16:53','0000-00-00 00:00:00','www_hhbd_pl_ph_kopalnia-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(47,'Anonim Records','http://www.anonimgrupa.pl','','',2897,'',1,1,'2005-09-30 12:13:57','2005-12-13 12:04:46','','image/jpeg',NULL,'2009-06-12 11:40:32'),(48,'Kreska Records','','','',947,'',1,0,'2005-11-08 11:42:26','0000-00-00 00:00:00','','image/jpeg',NULL,'2009-06-12 11:40:32'),(49,'Syndykat Dźwięku','','','',694,'',1,0,'2005-11-29 16:02:14','0000-00-00 00:00:00','','image/jpeg',NULL,'2009-06-12 11:40:32'),(50,'Eternia','http://www.eternia.pl','label@eternia.pl','',1172,'',1,0,'2005-12-04 00:30:50','0000-00-00 00:00:00','www_hhbd_pl_eternia-logo.jpg','image/jpeg',NULL,'2009-06-12 11:40:32'),(51,'Funkkrok Records','http://','','',537,'',1,0,'2006-03-20 20:34:02','0000-00-00 00:00:00','','image/jpeg',NULL,'2009-06-12 11:40:32'),(52,'MaxFloStudio','http://www.maxflorec.pl/','','',3274,'Agencja artystyczno-wydawnicza MaxFloRec powstała na bazie istniejącego od 1998r. MaxFloStudio. Prowadzona jest przez j